INSERT INTO CourseDetails VALUES ('CS3103', 'Computer Networks Practice', 'This module aims to provide an opportunity for the students to learn commonly-used network protocols in greater technical depth with their implementation details than a basic networking course. Students will perform hands-on experiments in configuring and interconnecting LANs using networking devices/technologies (e.g., routers, switches, SDN switches, and hubs), networking protocols (e.g., DHCP, DNS, RIP, OSPF, ICMP, TCP, UDP, wireless LAN, VLAN protocols, SIP, SSL, IPSec-VPN) and networking tools (e.g, tcpdump, netstat, ping, traceroute). Students will learn higher-layer network protocols and develop network applications (client/server, P2P) via socket programming.');
INSERT INTO CourseDetails VALUES ('CS3223', 'Database Systems Implementation', 'This module provides an in-depth study of the concepts and implementation issues related to database management systems. It first covers the physical implementation of relational data model, which includes storage management, access methods, query processing, and optimisation. Then it covers issues and techniques dealing with multi-user application environments, namely, transactions, concurrency control and recovery..');
INSERT INTO CourseDetails VALUES ('OY0003', 'Mining Web Data for Business Insights', 'The objective of this module is to enable students to work on an individual integrated research project spanning over two semesters, with approximately 400 hours of workload. Students learn how to apply skills acquired in the classroom and also think of innovative ways of solving problems, and learn to work in a research environment. The project demonstrates a student’s work ethic, initiative, determination, and ability to think independently. On completion of the project, the student has to submit a dissertation describing the project work, and give an oral presentation before a panel of examiners.');
INSERT INTO CourseDetails VALUES ('QS0004', 'Dental Implantology', 'This module presents an overview of the principles of accounting, with a view to providing executives, who may not possess prior accounting training, with an understanding of accounting concepts. Topics include: the uses and limitations of accounting information for decision making and performance evaluation; the standard techniques of financial control; valuation and capital budgeting; and the management of current assets and liabilities of the firm.');
INSERT INTO CourseDetails VALUES ('EC1301', 'Principles of Economics', 'This course is designed to teach the basic principles of economics to undergraduates from non-economic majors. It introduces students to elementary microeconomic and macroeconomic concepts and provides them with an economic framework to understand the workings of individual markets, the aggregate economy, as well as international trade and finance.');
INSERT INTO CourseDetails VALUES ('CM0006', 'Introduction to Computational Biology', 'The course provides an introduction to financial accounting. It examines accounting from an external user"s perspective: an external user being an investor or a creditor. Such users would need to understand financial accounting in order to make investing or lending decisions. However, to attain a good understanding, it is also necessary to be familiar with how the information are derived. Therefore, students would learn how to prepare the reports or statements resulting from financial accounting and how to use them for decision-making.');
INSERT INTO CourseDetails VALUES ('ST2334', 'Probability and Statistics', 'Basic concepts of probability, conditional probability, independence, random variables, joint and marginal distributions, mean and variance, some common probability distributions, sampling distributions, estimation and hypothesis testing based on a normal population. This module is targeted at students who are interested in Statistics and are able to meet the pre-requisites. Preclude ME students taking or have taken ME4273.');
INSERT INTO CourseDetails VALUES ('VM0008', 'Credit & Security', 'This module presents an overview of the principles of accounting, with a view to providing executives, who may not possess prior accounting training, with an understanding of accounting concepts. Topics include: the uses and limitations of accounting information for decision making and performance evaluation; the standard techniques of financial control; valuation and capital budgeting; and the management of current assets and liabilities of the firm.');
INSERT INTO CourseDetails VALUES ('FO0009', 'Big Data Techniques and Technologies', 'Independent research plays an important role in graduate education. The Independent Study Module is designed to enable the student to explore an approved topic in Southeast Asian Studies in depth. The student should approach a lecturer to work out an agreed topic, readings, and assignments for the module. Head"s and/or Graduate Coordinator"s approval is required. Regular meetings and reports are expected. Evaluation is based on 100% Continuous Assessment and must be worked out between the student and the lecturer prior to seeking departmental approval.');
INSERT INTO CourseDetails VALUES ('MA1101R', 'Linear Algebra I', 'This module is a first course in linear algebra. Fundamental concepts of linear algebra will be introduced and investigated in the context of the Euclidean spaces R^n. Proofs of results will be presented in the concrete setting. Students are expected to acquire computational facilities and geometric intuition with regard to vectors and matrices. Some applications will be presented. Major topics: Systems of linear equations, matrices, determinants, Euclidean spaces, linear combinations and linear span, subspaces, linear independence, bases and dimension, rank of a matrix, inner products, eigenvalues and eigenvectors, diagonalization, linear transformations between Euclidean spaces, applications.');
INSERT INTO CourseDetails VALUES ('CS2102', 'Database Systems', 'The aim of this module is to introduce the fundamental concepts and techniques necessary for the understanding and practice of design and implementation of database applications and of the management of data with relational database management systems. The module covers practical and theoretical aspects of design with entity-relationship model, theory of functional dependencies and normalisation by decomposition in second, third and Boyce-Codd normal forms. The module covers practical and theoretical aspects of programming with SQL data definition and manipulation sublanguages, relational tuple calculus, relational domain calculus and relational algebra.');
