INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000263B', '2018-10-25 15:40:46', 'Impressive and given the people cycling through this practice it was clear that the facility and all the therapists were doing something special.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000263B', '2019-01-26 01:20:39', 'I"d be a regular if living in the area.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000044J', '2018-11-11 14:47:31', 'Not a fan. Overpriced, over cooked bland burgers. Everything is extra (fries, onion rings).');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000004I', '2019-09-02 14:53:43', 'The waitresses are really nice and friendly, which is the kick start of a good morning.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000004I', '2018-06-23 01:55:08', 'Very disappointed in how much came on the sub. They make them with their back to you and you can not see the items they put on and they don"t even ask what you want on it. They just proceed to make it the way they want.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000005O', '2018-04-20 01:45:43', 'Came here after a concert at MGM...service was excellent, food was great and we got to sit near the band members we had just seen and got a couple of autographs..how cool was that.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000005O', '2018-06-23 03:20:10', 'Such a unique place & a great find. Our waitress was funny, knowledgable, and did a fantastic job. The food was amazing. We will definitely return and recommend this restaurant to other couples!');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000044J', '2019-08-15 01:51:41', 'When you go to Ikea, it is simply a MUST to enjoy the top floor showroom area. What I would have given to have had Ikea in NC when I got my first apartment. Not only are the items affordable but seeing Ikea"s recommendations of how to decorate, supply, and organize a living space in 640 sq. feet is a miracle! It totally works and somehow I find myself wanting to go live in a space that small!');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000044J', '2019-04-06 08:09:50', 'This is my second visit; my first was back during CES in Jan. with a young friend visiting Vegas for the first time and who had never had a bloody mary...');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000004I', '2018-11-29 07:05:06', 'Everything we ordered was completely disgusting. We ordered from the late night menu, I got the veggie fajitas beans and rice. They left out my tortillas in my Togo order the beans and rice were disgusting. My best friend ordered the fish tacos which ended up being some sort of strange shredded fish. My boyfriend got the salmon salad, which was ok but would"ve been better but the salmon was dry. They left out my garlic fries and on top of all of this disgusting food it was 91$!!! I will never eat here ever again');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000263B', '2019-05-18 23:22:14', 'Frankly disappointed. Guy is one of my favorite chefs i know, he"s so cool and i love his since of humor. but his menu is lacking to me. its so concentrated which can be good... if the quality can hold up to it. i got the bacon cheese burger and i could have gotten the same thing at half the price 3 blocks down the strip. seasonings were bland and LOTS of grease. the reason your getting 3 starts Guy is because I"m more the sure this restaurant doesn"t represent you very well.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000288E', '2018-03-11 01:41:53', 'Lemon Sorbet:  Frozen sorbet in a scooped out lemon, menu says imported from Italy.  I actually liked it better than the sad face Tiramisu so hubby swapped with me because while he usually loves anything lemon, he found an odd aftertaste.  I joked it was the jet fumes to bring frozen sorbet from Italy but the truth is, it was the perfume worn by the woman at the table next to ours.  Thankfully she arrived as we had dessert, so our entire meal was not ruined, but the smell was so overpowering that it gave us both a headache and we wanted to get out of there fast, since with the cramped layout she was almost on top of our table.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000178S', '2018-10-04 02:23:27', 'Alway stop when we"re in town. Amazing fresh food. Really good prices. Friendly  service.  Drink menu has a good variety as well.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000288E', '2019-03-20 14:44:56', 'Everything was pretty good but the beef in the Mongolian beef was very chewy and had a weird texture. I know this is always a 50/50 chance when trying a new Chinese restaurant. The rest of the food was very good! Their noodles are really good and the fried rice.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000048W', '2019-07-10 00:13:08', '- If you get in during breakfast time, do try the Portuguese sausage.  It"s the only breakfast food really worth it.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000166F', '2018-02-18 00:00:58', 'Been going here since summer, i am so glad i have discovered this jem! This joint beats any other sushi spot, even though its an izakaya. The menu is extensive. My faves are obviously tsuki don(a must try!) which no other place has, grilled squid that is cooked to perfection which is also rare nowadays, sashimi salad is to die for, and tamaguro roll with red tuna, tomatoes and garlic sauce. I mean everything else that Iv tried here is also delicious. Their lunch boxes are of a great value.The place has great ambience and music, service is always very consistent. This place is good for a quick lunch, big party or nice dinner. Its simply a spot to-go-to! Can"t wait to go back!');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000166F', '2019-09-28 07:25:29', 'We would highly recommend Fred to anyone purchasing or selling a home. It was a privilege to work with him, Shannan, and the rest of the North&Co team!');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000226U', '2019-09-01 20:10:16', 'Food - 3.75 stars (except for the mushroom pot on crack... 4.5 stars for that)');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000287V', '2018-01-08 07:03:07', 'They brought us a chocolate cheesecake as the complimentary birthday dessert and wrote "Happy Birthday" in raspberry sauce. The cheesecake had chocolate drizzled on top and edible pearls garnishing the plate. The waiter said it was always a surprise as to what the chef prepared for the complimentary birthday dessert.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000166F', '2018-07-24 17:03:06', 'Fast forward a few week, and we spotted Estate banquet, we emailed and arranged to meet up. We showed up and the one we had the appointment with was no where to be seen, having passed our meeting off to someone else without informing us. The venue is beautiful an price was in our budget and we wanted to proceed once we could work out the food details. My girlfriend did not like the unprofessional manner of George, whom I later found out when I asked is indeed the same George from Crystal Fountain.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000166F', '2019-04-16 15:23:39', '* Lunch Box Special Deal:  M-F |  11am - 4pm  | 3 whole wings, fries, and a drink = 8 bucks');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000166F', '2018-04-22 22:59:55', 'Good place always willing to stop by n shop. Hate that they dnt have what they are kniwn for but some of the buttenders help out !');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000166F', '2019-07-18 10:20:34', 'I considered giving this place 4 stars, because we went back a couple days later and the food was cold and missing that extra special love like we had the first time.  But it was a Friday evening and there was an Indian soap opera on the TV I think we interrupted....So, obviously, I can"t blame them.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000048W', '2019-03-23 10:19:21', 'The meal - Veal with shrimp and gnocchi..Quite pleasing to the palette.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000288E', '2019-06-30 01:56:09', 'The meal - Veal with shrimp and gnocchi..Quite pleasing to the palette.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000083Q', '2018-08-05 22:29:04', 'Value wise, this has got to be one of the best lunches you can get for $5.99.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000182E', '2018-12-30 14:19:29', 'I"ve had 3 other laser tattoo removals before I came here so I know what I should be getting. Honestly she didn"t even go over it all the way with the laser. There"s quite a bit of the tattoo that"s untouched. I"ll be going somewhere else for the remainder. It"s not worth the pain if it"s not even going to make a difference.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000179Y', '2019-06-09 21:58:49', 'We came here on Super Bowl Sunday because we were visiting a friend who lived not far from this place.  When deciding on a place to watch the game, a couple of friends suggested this casino because they had a big sports booking place, and also because it wouldn"t be as packed and crazy as the casinos on the strip.  This casino is about a 15-20 minute drive from the strip.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000113D', '2019-06-06 10:20:59', 'Let"s just say I"m shocked. People are super friendly. have other food then donuts! It close to my work. Price isn"t too bad it is reasonable. It"s a great place to relax and get some work done');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000179Y', '2018-07-27 15:15:00', 'I"ve heard great things about Toast for breakfast and lunch so thought we might get it a try for dinner...  We walked in around 6:30pm on a Friday night,  the restaurant was about half filled. There were plenty of seats in the the front of the restaurant but our party of four was seated in the very back beside the bathrooms and back door.  We sat there for a few minutes (not wanting to be difficult or affecting the order in which the servers were sat)  but  we really couldn"t take the cold draft from the back patio door and constant bathroom visits.  We politely ask if we could move to the front.  The hostess obliged but didn"t seem too happy about it.  The same server continued to wait on us once we sat in the front (we were glad because we did not want to make him lose a table) .');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000139U', '2019-07-01 02:51:57', 'I had a Engine in warranty from LKQ, these guys were to install its replacement.. They told me done in a few days, ok...   I went there and noticed when the engine was taken out they carelessly left my AC dangling and did not remove it to install new engine. No big deal till you understand the rest.. this is a cheap way to not refill system and do it right...  After going to get my car when they said it was done I Notice AC didn"t work and wrong Coolant added to Radiator. ( cannot use regular Green... Yellow Ford required ) Then I say I will come get it when they fix the AC, they tell me hours later its the PCM..( Computer ) well OK you guys shorted it out, the only thing wrong was a Valve Rattle, now this?? After 2 days with LKQ saying they are going to send a inspector I drove past and noticed my Mirrors Loose (broken ) on BOTH SIDES!! I am ANAL when it comes to my car I bought New in 2007..  this was enough, I took it home.. I had enough...  They forgot 4 bolts, 2 in wrong spot, One Digging into Power Steering Rack, Power steering Bottle Cracked on Bottom from a Poor removal and hid the fact it was cracked on the lower nipple and the AC system they claimed did not hold R-134a because they DID remove the AC later and LOST the O-Rings when they filled it, it leaked.. and they SHORTED the AC Protective Diode.. IT WAS NOT THE PCM.. this place MIGHT be good for a Oil Change if you tell them how to do it, but that"s all..  Telling me How Do we know you didn"t bring it in here like this... BAHAHAHA, a back yard weekend mechanic was able to figure out they were unskilled for the task.. I will make sure with a HUGE online review on EVERY Review site that this place is NOT the place to take a Car... or a peddle bike for that matter..');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000015A', '2019-02-21 20:53:13', 'Went for Saturday Brunch. Wait was doable compare to other buffets. We paid about $38/person which was standard for Vegas buffet. However, everything was underwhelming, nothing really stood out from their selection. For the price and to pay just a little extra, I"d recommend Wicked Spoon or Bachannal');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000206Z', '2018-09-28 14:09:04', 'This place gets five stars and I can"t wait to go back. Please, please try this place. It was empty when I walked in and that"s a shame. They should have a lot more business if it was all based on the quality of their food and service. It"s also very affordable. Chicken enchiladas were $9 and the carnitas were somewhere around there (maybe $12).');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000015A', '2019-09-28 08:41:15', 'I love chinese food and I love mexican food. What can go wrong? A couple of things. First things first, this place is more of a "rice bowl" kind of place. I thought it was going to be more diverse as far as the menu goes, but its mainly rice bowls you get with different kinds of meats. The ordering was a little confusing at first, but one of the employees helped us out and I got the 2-item bowl and got the jade chicken and hengrenade chicken with all rice(jerk). I also ordered a jade chicken quesadilla on the side.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000036E', '2018-07-07 14:05:07', 'A tale of two locations (AKA: AVOID 7700 S Autoplex, GO TO 616 W Baseline)');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 1, 'P0000002X', '2018-01-04 05:56:49', 'A0000206Z', '2018-04-30 03:01:29', 'This place is a bit of a drive for me and I wanted to be sure they had what I needed in stock before I drove down on a hot day. I called to ask about a specific kind of planter pot in stock, waited about 5 minutes only to have my call picked up and ended. I called back again and waited another 5 minutes for someone to tell me they had that type of pot in stock but couldn"t give me any specifics on a general price point. Star Nursery IS pricier than other places, such as amazon and Home Depot/Lowe"s. So when he told me they were "pretty cheap", I had to take it with a grain of salt.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000122F', '2018-11-12 20:28:26', 'Kind regards,');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000103Z', '2018-11-27 22:01:57', 'Main Course:  I had the delmonico ribeye, oscar style.  The steak was done perfectly and the crab meat and bernaise were amazing.  I could barely eat 1/2 of my meat!  My guest had the lobster mac n" cheese, which is very different, but very delicious.  There was plenty of lobster meat and it was a large portion.  There was spinach, mushrooms and other things mixed in, which is different.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000168B', '2019-07-25 23:13:46', 'I went here today to upgrade to an iPhone X. They were awesome to work with. They mirrored everything from my current phone to the new one. That saved me so much time and aggravation if I had to do it. They were very knowledgeable and friendly! Highly recommend!');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000168B', '2019-05-14 01:13:14', 'I was torn on whether to give this 3 or 4 stars. The reasons I chose 3 is because when I want a plethora of seafood, I know I can come here and have good eats but it is on the expensive side.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000065M', '2018-01-25 14:00:02', 'The Motley Cue sandwich was rally good. Lots of mean.. Could probably split between 2 people');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000102W', '2019-05-08 07:32:33', 'I was really disappointed with my most recent visit to Vintage 95. I make it out there every six months or so and always talk it up to friends. Tonight I went with my husband and in-laws. We ordered a carafe of sangria, which as always was top notch. My in-laws ordered bruschetta - they ended up with a ton of untoasted bread with a very thin coat of ricotta and a light topping of good quality tomatoes. Tasty but not bruschetta and definitely not worth $14. My husband and I got the "artisan board" with one meat and one cheese. For $13, we got a teeny tiny piece of cheese, four thin slices of not-so-good sopressata, stale bread, 2 crackers, raw unsalted almonds, six grapes, and about half a jar of very oniony cornichons! The food was a huge rip-off, and not at all the quality or quantity we have gotten in the past. The saving grace of the night was the sangria, which I still think is one of the best in the area. But overall, I don"t think this place is worth a trip out anymore.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000225N', '2019-02-28 06:49:42', 'Nice ambiance---exposed brick walls, soft light, great music---DH would have liked their playlist!');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000105U', '2019-06-02 08:27:22', 'Good prices here, huge pancakes available.  The place is a bit "breakfast diner"ish, which is fine since it is a breakfast diner.  My only probelm is that our server seemed a little impatient.  The service was fine, but could use a little more friendliness.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000114I', '2018-12-05 17:56:30', 'Maybe because it was rainy outside, or the bartendress was on the rag, but the service I experienced was ATROCIOUS. This is after only my second experience here. My first experience was in the summer where I hung around the bar (on the most uncomfortable chairs I"ve ever sat on) and things were pretty cheery.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000289B', '2018-09-25 17:31:47', 'I ordered 2 chicken enchiladas. I"ll be back to try the tacos!');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000011K', '2018-10-06 16:17:20', 'Wish I could give this place 0 stars. We have had issues here before with being seated (it took them 15 minutes when the place was empty one time), but tonight takes the cake.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000161B', '2018-05-22 08:16:49', 'This place is quite possibly my favorite restaurant in Phoenix.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000296W', '2019-04-29 17:17:15', 'We arrived here at 10:00am and weren"t able to get a full tour until 1:00pm, so we opted for the mini tour.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000099I', '2019-04-15 13:27:53', 'I used to work food service and my manager at the time recommended I try Defalco"s. He knows food well so I was excited to try one of his favorites spots.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000161B', '2018-02-15 10:59:37', 'Beer, beer, and more beer.  It"s definitely a low-key nieghborhood bar.  As an out of towner, I enjoyed it.  It felt like Pittsburgh"s version of Cheers except grimier.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000105U', '2019-03-26 02:33:43', 'They were very friendly and humorous there! They all used English talking to patrons and with each other, which was great!');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000296W', '2018-08-02 13:19:41', 'The O"Donnells');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000185A', '2018-12-02 20:14:01', 'A wonderful dinner experience! Hubby and I came couple months ago, it was our first time at Sushi Samba. We didn"t have reservations, but they were able to seat us at the sushi bar.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000161B', '2019-04-29 11:33:08', 'They don"t deserve any stars!');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000161B', '2018-05-02 19:27:50', 'Don"t expect a hot tub or something fancy. Like I said, just a place to crash.');
INSERT INTO ForumEntries VALUES('CS3103', 2018, 2, 'P0000006E', '2018-03-15 08:27:34', 'A0000296W', '2019-06-17 19:03:55', 'I admit that I haven"t tried ALL the italian restaurants in Toronto... but of the ones that I have tried, Ciao has been the place that I"ve gone to multiple times.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000194A', '2018-10-23 13:32:42', 'The Asada fries were awesome! The meat was well seasoned and had that perfect grilled crunch that I love. You can choose nacho cheese or cheddar,  I chose the cheddar, and they put a good portion on.  It"s topped with Pico,  sour cream   and a huge scoop of fresh guac. Lovely dish!');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000194A', '2018-02-22 08:49:27', '#2. Way over priced. Dinner for 2 with (2) blue moon beers and (1) $10 glass of wine... $165+tip. We tipped over 25% because our server was great and the experience of eating in the Dark was a pretty interesting experience.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000293L', '2019-09-17 21:39:51', 'Good luck eating here!!!!');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000074I', '2019-02-28 03:36:24', 'I had THE BEST VEGAN Gardein chicken plate with broccolini. I was blown away!!! The decor is cute! Nicely dimly lit, It was romantic and very chic. I recommend coming if you"re a vegan looking for a good dinner!');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000046H', '2018-12-27 20:44:22', 'Lemon Sorbet:  Frozen sorbet in a scooped out lemon, menu says imported from Italy.  I actually liked it better than the sad face Tiramisu so hubby swapped with me because while he usually loves anything lemon, he found an odd aftertaste.  I joked it was the jet fumes to bring frozen sorbet from Italy but the truth is, it was the perfume worn by the woman at the table next to ours.  Thankfully she arrived as we had dessert, so our entire meal was not ruined, but the smell was so overpowering that it gave us both a headache and we wanted to get out of there fast, since with the cramped layout she was almost on top of our table.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000203D', '2019-10-23 01:26:36', 'Very large space, open layout.  Been here a few times years ago. I ate mostly the crab legs. Prime rib.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000021C', '2019-09-08 04:47:35', 'Drink -Jones Strawberry-Lime Soda - Yummy not sour but good balance,');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000170Q', '2019-03-23 05:24:43', 'The second line, is to "check in" - by which they scan your new membership card and ask whether you want a bay on a specific floor.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000252I', '2019-06-27 10:45:08', 'PROS: I love this lee"s location! it"s my favorite to go to since it"s near my home. it has everything you would want, they even have a growing sake collection!! they restock a lot.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000230T', '2019-08-20 21:33:37', 'It is conveniently located very close to the convention center so it gets packed when events are going on.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000230T', '2018-04-05 03:42:09', '(and make sure to read the non-PC T-shirts while you wait - funny!)');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000273F', '2019-03-09 08:42:53', 'Kelly"s beckons to the person who wants to sit and have a beer, the person who may want to catch someone"s eye without filtering through waves of affliction shirts over the rancor of the latest Young ___zy song, perhaps someone who wants to wear argyle and sport a mustache and still think its not ironic that he(she?) is trying to be ironic, the person who simply wants to enjoy a solid bev for a price point for "chincy" Pittsburghers.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000216S', '2019-03-16 10:54:37', 'We finally left with out even PLACING an order after 49 minutes. Will not return and by the other reviews for this place, I should have checked yelp before ever coming here in the first place. Went to the Mentor one after and got served right away.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000001P', '2019-09-21 23:37:23', 'They have lots of topping options, along with organic MOCHI and tons of fruit. They also have nutella and flavored bubbles! I usually go with the mochi and fruit with froyo, and all of it was very fresh.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000120U', '2018-12-05 08:28:56', 'I was sent to Vision Source South Hills for a second opinion. I enjoyed my appointments with Dr. Strain and found her to be knowledgable and attentive. However, I was incredibly displeased with how I was treated by the staff. I went through my vision insurance with a staff member and assumed this information was added to my file. I called a month or so later to order contacts and was told I could not pay for the contacts when I came and picked them up; I needed to pay for them over the phone. I have never paid for contacts before picking them up before but I figured it wasn"t a big deal, just differences between offices. Once I got the statement for my order, I realized that they had charged me the full amount and not run anything through my insurance company. I called back and was met with no answers, saying they would call me back later. They never did, so I called back again and finally learned that my vision insurance had never been added to my file. After going through my information a second time, they then assured me they would file a claim with my insurance company and I would receive a check soon. Never once in this back and forth did anyone from the staff apologize or recognize that they had made a mistake. In fact, everyone I talked to seemed more agitated that they now had to reprocess the claim. A month later, I received my refund along with an updated billing statement. It read: "patient originally did not say to use insurance and paid in full for contacts-decided a few days later she would like us to bill vsp and refund her the remaining balance". This is the first medical establishment I have come in contact with that required me to advise them of my desire to use my medical insurance. Professional medical establishments run benefit checks and inform the customer of their costs prior to performing the service. At this point, I do not see myself returning in the future.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000025Y', '2019-07-27 15:02:01', 'Very  dissaiponting breakfast !!!');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000031G', '2019-04-12 00:56:35', 'Pita jungle is one of our family"s favorite places to go for a quick, fresh, healthy meal. The kids love the chipotle chicken flatbread and I am addicted to the Moroccan gazpacho! We feel great when we leave and usually try make better food choices for the rest of the day!');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000216S', '2018-12-10 15:10:32', 'Cons:');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000118M', '2019-09-15 00:01:01', 'The decor and atmosphere was surprisingly nice, from the outside I expected to be more run down inside. The staff was very nice. We were surprised how empty the dining room was for a Friday evening.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000030A', '2019-05-09 23:59:54', 'If there are two things I like, they are eating and drinking. And gastropubs really let me do both at the same time very well. So they"re already on a good footing with me.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000118M', '2019-01-22 12:31:30', 'Jeff is hilarious and has great stage presence and really connects with his audience.  I even got pulled up on stage and got a crotch full of Jeff!  hahaha...');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000212I', '2018-06-22 17:03:53', 'The location and setup is dope. The vibe is chill and everyone is really attentive and nice. If they work on the food, I can see this place getting packed with the quickness.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000075D', '2019-09-21 07:27:54', 'Overall I was very impressed with this recent visit. Keep up the good work!');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000137S', '2019-03-28 08:00:13', 'All in all, if you"re very hungry and either cheap or on a budget, stop on in.. Then again, Sunset Station is close by, and their $7-8 buffet is way better!');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000274S', '2018-01-10 08:33:03', 'Tuesdays are 30% off seniors 60 and over. That is a huge saving. If I see something a few days before that I like, and is still around Tuesday it"s an extra bonus.  You must tell the cashier you are a senior before cashing out, or they  will not apply the discount. Transaction has to be voided and well... so just tell them right away.  I like this location. Some of the house ware merchandise is pricey. It makes no sense and needs to be addressed. Wouldn"t it be nice if one day they wold throw in a " free book of your choice " with purchase of $5.00 . Too many books on shelves that don"t move.  I see students, seniors, family with children who may be on a budget or getting by,  why not have a  " no tax " day it makes a difference.  Have fun and take some time to sift through the racks .  Some days you win some and other days you don"t.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000054Q', '2019-09-27 22:53:01', 'You take the good, you take the bad, you take them both and there you have the facts of life... at Fieramosca.  (You are old like me if you know that theme song!)');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-22 13:04:14', 'A0000054Q', '2019-04-29 20:43:08', '* Their iced tea is sweetened with honey or unsweetened and refillable');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000028T', '2019-09-17 12:03:28', 'One day after I satisfy my frozen yogurt craving at Kiwispoon... I get invited out to eat frozen yogurt at Piccadilly.  A rare opportunity to truly compare the two yogurt places.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000243L', '2018-07-04 17:21:49', 'The draft beer selection is great the tapas style menu is a perfect match and the upstairs is a great after work gathering place. But the best thing about this place is the bartender named Siti (sp) he is one of the best in Charlotte.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000002S', '2018-08-18 03:41:32', 'The 5 for 6 "til 7 is so awesome and such a great deal! I wasn"t sure the first time we went if we should dress up or if it was okay to wear jeans and a nice top but everyone was either in their business casual work clothes or jeans. I would recommend getting there a little early because it fills up quickly! We got there at 6pm and by 7pm it was pretty full.  I have recommended this to so many of my co-workers and friends to try out and so far anyone that has gone has come back to me saying what a great time they had and how surprised they were with the 5 for 6 "til 7 deal :)');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000277N', '2018-09-08 08:03:48', 'There are definitely pluses to Piccadilly"s yogurt though.  I liked the toppings better - I thought the mochi tasted better, the brownie pieces were bigger, and the chocolate caramel turtles went great on ice cream.  The chocolate caramel turtles should be a standard topping for both frozen yogurt and ice cream places.  Also, with the huge map of Cleveland Heights behind the cash register, this feels more like an authentic "neighborhood" froyo joint.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000277N', '2019-01-31 13:08:05', 'The draft beer selection is great the tapas style menu is a perfect match and the upstairs is a great after work gathering place. But the best thing about this place is the bartender named Siti (sp) he is one of the best in Charlotte.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000028T', '2018-04-04 02:19:02', 'It looks much better on the inside than the outside, as at first we were a little concerned.  However the place has tight security and large balconies.  We stayed there for several days and found the motel to be exceptionally clean, the owners/operators were very friendly.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000273F', '2018-09-15 23:57:37', 'Nice way to spend the morning...relaxing by the pool enjoying breakfast at the Terrace Pointe Café.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000050J', '2018-01-08 11:35:47', 'Awful. Nearly inedible... even for airport food.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000002S', '2019-02-25 04:49:20', 'I have been back a few times so far, and this won"t be the last time. It has room to grow on me, and so does the rating.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000154K', '2019-01-02 01:15:08', 'Everything is great really.  Even their level of spice, is always bang on for me.  You can request that they withhold certain things like hot sauce or jalopenos, but trust me, it"s not that bad.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000003G', '2019-07-15 08:20:15', 'Their web site lured me in, impressive as it is... "Largest service fleet in the area... etc. etc."');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000243L', '2019-10-25 10:11:00', 'We celebrated a birthday in the Tatami room.  Beautiful private room, we sat on cushions  in a very cozy setting.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000239H', '2019-03-27 10:22:44', 'Oh my gosh I fell in love with this place today! Lots of vegan options, delicious food - my fav was the falafel and baba ghanoush - and friendly service. Prices are reasonable too. Can"t wait to go back for the open face eggplant soon!');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000031G', '2019-07-05 13:44:39', 'I have no idea what the owner"s problem is, but he"s incredibly rude. His wife, on the other hand is super nice (an odd mix).');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000030A', '2018-11-04 12:57:32', 'We finished eating and paid for the bill at 7:50p.m. I turned around and noticed FOUR empty 2 person tables. They had never been sat, but we had to sit with an unfamiliar couple!');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000216S', '2018-11-27 18:17:10', 'I"ve eaten at this location twice. The first time I got a falafel to go. I thought the cilantro was a bit much for the falafel, it wasn"t what I"ve been used to in the past. I like a milder basic falafel. Today I had a shawarma pita and it was really good. A little heavy on the red onions so next time I plan to ask for no onions! The price is great for the amount of good you get. My pita"s are always loaded up.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000299D', '2018-10-29 08:37:31', 'For sure, we will be back.  It"s a field trip for us, but worth it.  Just an all-around good experience.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000025Y', '2018-01-24 21:33:04', 'lockers (bring your own lock)');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000115N', '2018-06-27 08:37:27', 'Okay, we kinda freaked out when  we heard the half off starts and pizzas.. we ordered way to much but was so worth it.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000001P', '2019-09-09 07:58:57', 'i did not stay at this hotel but i did visit the hotel and the shops. Beautiful place!!!! not too crowded, very quiet and peaceful... I love this place. This hotel is located on the strip on the north end.. It"s less crowded on the north and there is a mall right across the street. This hotel has many high end stores for shopping such as LV, Cartier, etc, but there is a regular mall across the street with Macy"s, forever 21, etc..  The gondola rides are nice, but short!! it"s 19.95 a person and it"s 10mins long. They can stay in doors and out doors with the gondola. I heard out door is better at night because of the lights. Great overall experience, wonderful restaurants, awesome shops..');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 1, 'P0000003W', '2018-10-25 21:17:46', 'A0000115N', '2018-10-16 09:53:15', 'Do I sound like I"m obsessing about water? In the desert, dehydration is no joke, and it"s indicative of the quality (bad - very very bad) of service that we received.');
INSERT INTO ForumEntries VALUES('CS3103', 2019, 2, 'P0000006E', '2019-03-02 19:00:41', 'A0000019J', '2018-03-12 08:00:38', 'Snow and Kind crab, caviar, steak tartare, all types of meat and cuts, sushi, soups, Asian cuisine, pastas and pizzas. Literally all you can think about.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000204V', '2019-01-05 08:37:58', 'Peach cobbler desert was all topping that I swear was merely microwaved and had one slice of grilled peach - putting a candle on it did nothing to make me think this was the birthday dessert I was for...');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000204V', '2019-06-15 12:15:07', 'Heard about this place and was dying to check it put-and I"m very glad I did! Decent beer selection and kind of a hipster vibe, but $8 for a loaded hot dog and tater tots has got to be one of the best deals in town. Tons of unique toppings to pick from and delicious dipping sauces for tots (secret fry sauce was my fav). We were there early and had no problem getting a seat at the bar, but I can see how during prime time or when live music is on how it could be kind of tight. If you"re going for the food is get there earlyu because that loaded dog would have been super hard to eat while standing.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000199K', '2018-11-16 10:52:14', 'In summary, for being the biggest sportbook in Las Vegas this place is dysfunction and fails to satisfy the most basic request to provide food and comfort to betting patrons. A total mess. This place sucks. Watch the big game and bet your money some where else. We will.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000288E', '2019-07-23 19:47:10', 'Food is pretty good overall.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000061X', '2018-02-13 05:05:07', 'PROS: I love this lee"s location! it"s my favorite to go to since it"s near my home. it has everything you would want, they even have a growing sake collection!! they restock a lot.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000135S', '2019-03-27 09:48:18', 'I"ve only swam here once, I need to get on that.  I"ve never used the basketball courts or anything outside.  I stick to the weight room.  I have never had to wait on a bike or a treadmill.  If I"m looking for a stair climber that can be another story though.  The bikes are no where near as nice as the Dowd.  The only thing I ever have to wait on are the free weights.  There"s plenty of weights, but not much room at all to use them.  If you want a lay down bench, you will probably have to wait, especially at peak hours.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000030A', '2018-09-26 08:03:54', 'For sure, we will be back.  It"s a field trip for us, but worth it.  Just an all-around good experience.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000286J', '2018-01-10 10:57:32', 'For my first stop here on a Saturday morning, I opted to get a quick morning pick me up.  A tea and a sandwich.  I got their Salted Caramel Iced Tea (also available hot) and their Turkey Sausage Egg & Cheese sandwich on an english muffin.  Both made to order.  Total cost including tax: $10.  Now to be fair, they prepared the sandwich in part using a microwave so we"re not talking gourmet here.  Still, the sandwich hit the spot and the sausage in particular was very tasty.  I was also very happy with the tea.  Almost tasted like a southern style sweet tea of sorts with those caramel accents.  A solid breakfast.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000030A', '2019-09-07 03:59:34', 'I had to get my nails done last week when I was out shopping, so I decided to stop in and see if I needed an appointment or if they could take me. When I walked in, all nail techs were sitting around and there were no customers.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000190B', '2019-09-27 11:04:59', 'I ate at New India Bazaar for dinner. I took it to go. I ordered samosa, pani puri chaat, and gobi. The samosas were very good and very big! The main dish, gobi was really great. As a vegetarian it seemed like I was eating chicken, but it was cauliflower dumplings. The gobi had a comfort food appeal. The pani puri chaat was weird. I"ve never had it before, so I don"t have a comparison. The description sounded yummy, but it just wasn"t. The total cost was about $14. I would recommend this restaurant. I noticed that they have a pastry case with desserts. I plan to come back to shop. They  have the best prices that I"ve seen on neem toothpastes.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000286J', '2018-09-23 19:49:34', '- MUSHROOM POT ON CRACK. THIS WAS DEFINITELY THE SHOW STOPPER OF THE NIGHT!!! the flavoring of the sauce, the textures of the 3? 4? different mushrooms. happiness. The sauce was like a cream of mushroom, milky, full flavored, salty, a hint of sweetness... too good. needless to say we all took a bite and just smiled in satisfaction. We all stared at each other and knew rice was needed to soak up all that bomb sauce!!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000060R', '2018-12-16 06:22:36', '* Lunch Box Special Deal:  M-F |  11am - 4pm  | 3 whole wings, fries, and a drink = 8 bucks');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000286J', '2018-08-05 10:23:43', 'Despite the decor, the food was amazing.  My dad and I had the fajtas the first night we were in Scottsdale and boy were we surprised.   Our waitress was amazing as she told us a unique way to get to the Grand Canyon, which we didn"t regret.  Salsa was amazing and my mom probably ate most of it.  If I ever go back, I hopefully will go back there for some Mexican.  Was there on 2/15/2012.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000190B', '2018-03-09 22:08:38', 'Don"t you just hate it when you over-carry stuff & not use it? I"ve learned over the years from all my travels for work to "travel efficiently", and I hate carrying extra stuff.........because all you"re doing is lugging excessive weight!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000009L', '2019-09-08 16:19:06', 'The service is always sweet, nothing too spectacular happening with the food. They do make the place very cheery and comforting which isn"t easy for the space they"re working with.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000223L', '2018-09-24 13:34:22', 'Friends got Chili (homemade by Buldogis) Dog, Bulgogi Bowl, Fries, and again the Euro Fries with kimchee added and they LOVED it too!   My 2 friends who had the Chili Dog said the chili was very good! One of them is not even a hotdog fan and loved it :)');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000060R', '2018-11-18 01:10:46', 'OK, this is the business guy in me coming out now, but the whole reason for getting feedback from your customers is to IMPROVE and figure out where you are failing.  The fact that you have a 40 minute check in process, or that you ran out of beer one night, or that there are no napkins on the table, or that there seems to be tons of staff walking around but not helping the bottlenecks - these are ALL issues that management needs to be aware of - but instead, they try to bribe you so that you will rate them the way they want to be rated.  If I owned this place, I would be PISSED off.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000016W', '2018-03-30 15:24:06', 'I LOVED this buffet. To me it was comparable to The Buffet at The Wynn. They had prime rib, warm snow crab legs, ceviche, sushi, an omelet bar, and a little of everything. Tons of desserts as well!! Define lay coming back next trip to Vegas..');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000190B', '2018-07-21 12:36:21', 'I suspect these were a gift for my complaining about the condition of the car and the fact I was making them late from rushing home to see the next episode of moronic reality TV.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000135S', '2018-09-15 18:01:36', 'I really enjoyed my visit here.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000240X', '2019-05-28 00:34:35', 'I bought a house that had a safe with a dial.type lock which while definitely secure is a bit slow to open and makes me want to use the safe less often. I did have a business card from The Safe Keeper attached to opening instructions that was left by the seller. I went online, found their website and emailed them regarding changing to an electronic lock. They replied in the affirmative the next morning. I called and scheduled the work which was done within two days of my first contact. The service technician, Vid, was on time, knowledgeable, very personable and completed the changeover in the timeframe he had quoted even while explaining everything about the safe, the locking mechanism and answering all my questions.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000080C', '2018-08-14 13:51:56', 'The women at the front was flustered that I didn"t have an appointment t when I asked if I could get a gel manicure and when again their were no customers. Never did I feel so unwelcome. I thought about leaving.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000105U', '2018-07-07 23:16:48', 'How does the Post Office come into play?');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000143K', '2018-11-16 04:43:16', 'OAN: It was a little dusty in there. They may want to look into remodeling, but not if that is going to increase the prices. ;-)');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000147I', '2018-02-07 19:45:01', 'Not sure why some posted negative reviews of this place because it is on point. My girlfriend and I had dinner there last night, with reservations set for 6 p.m., were seated by 6:05. Our server William was awesome, was fast, attentative and really was one of the best servers we"ve encountered and we dine out a lot. We both ordered all you can eat crab legs and they were fresh, hot and delicious. I do feel the sticker price was high but we must have had 5 buckets each so it equates to 10 bucks a pound.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000178S', '2019-07-26 20:45:41', 'The waitstaff is very friendly and took great care of us.  They chatted with everyone who came in and made them feel at home.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000026K', '2019-07-12 16:58:05', 'When I got home and went to unpack the food, I realized the order was completely wrong. Checked the receipt and the order that was rung in was completely different then what I asked for and with totally different quantities. It was as if the order was erased and the guy just tried to make it up out of memory. Certainly was not please to have ordered mainly calzones and end up with almost all subs.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000043D', '2019-07-25 13:10:03', 'Despite the decor, the food was amazing.  My dad and I had the fajtas the first night we were in Scottsdale and boy were we surprised.   Our waitress was amazing as she told us a unique way to get to the Grand Canyon, which we didn"t regret.  Salsa was amazing and my mom probably ate most of it.  If I ever go back, I hopefully will go back there for some Mexican.  Was there on 2/15/2012.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000185A', '2019-09-14 22:48:54', 'I"m not into seafood but it was my husbands birthday and he loves it.. There were other options then seafood that made me happy...and my husband said his was great..');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000150P', '2018-03-09 10:44:06', 'Another solid BBQ place in Calgary. This is definitely a great place to go if you are craving something smokey and delicious.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000043D', '2019-01-16 15:43:36', 'One reminder if you go..... bring cash.  No crest or debit cards taken here!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000252I', '2019-10-16 11:44:24', 'After about 20 minutes of giving up, my phone rang... it was Amy! She took the time to talk with us outside of business hours. She was sympathetic and compassionate towards us and our circumstances. We trusted her expertise and experience to provide us with an beautiful flower/plant combination.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000015A', '2019-09-30 07:13:19', 'Our total with tax was around $18.00. With tip, we paid around $21.00. A great, go-to cheap eat in Mississauga where the food is actually decent! Will be back.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000214M', '2018-11-29 14:47:15', 'After all that, we still went to the bar and had two rounds while we waited.  Good selection of beer, bartenders were fast to see that we wanted booze and wasted no time in getting it.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000103Z', '2019-05-26 20:29:24', 'I used to work food service and my manager at the time recommended I try Defalco"s. He knows food well so I was excited to try one of his favorites spots.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000015A', '2019-10-12 01:36:26', 'I have been a loyal repeat customer of Cobblestone Auto Spa ever since I encountered Jared, one of the managers at the 616 W Baseline.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000015A', '2018-12-06 11:21:21', 'I"m truly disgusted by the service of this restaurant.  I came in with my family (Mom and Dad) and they said 10 minute wait, we said okay, we notice that they were short with their staff so we waited patiently till we were seated at a table, but that 10 minutes turned into a 30min wait. So the hostess sat us at a table saying how there may be awhile wait, after seeing 2 servers walk by us like we didn"t exist, the hostess later seated another table which were 4 Caucasian customers, we were still patiently waited for around another 30min, when those 4 sat down an Asian waiter quickly came to take their order, I got the waiters attention and said excuse me, we came here first. And she made up an excuse saying how "Oh we wait on different tables probably your waiter is busy" I knew this was an excuse, I was so disgusted. So we told the hostess that this waiter is waiting on a table after us, and she said oh well we said there would probably be a long wait, and the hostess had the audacity to say "Oh but they serve the people who come before" and I said, we were before them, we been waiting 30min at this table and you know this because you sat us at our table" she said it depends. So in the end we left the restaurant hungry and went to a much better restaurant which served us very well, called Rice Paper.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000055R', '2019-09-18 13:45:48', 'I took the car directly to the 616 location and saw Jared busily working with his staff. I pulled up and was greeted courteously by one of the staff. After being checked in I called out to Jared and explained the situation to him. He dutifully sought out to resolve this issues and return my car to its former glory.  This was not his problem, his staff did not cause it but he fixed it.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000103Z', '2019-08-30 11:56:57', 'The options are always solid and depending on the visit, the choices can vary just a bit. Expect to wait in line for a bit and come with a very empty belly. You will want to get the most for your money.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000087Y', '2018-02-28 11:53:33', 'I actually noticed this place because I wandered by when I was walking downtown and it"s impossible to miss that lovely smokey/BBQ smell if you"re on the block. However, it looks kind of like a hole in the wall. The entrance doesn"t look like it"s been updated in years, and that"s ok because it just adds character. The entire decor is wood/country (to include buffalo head on the wall) and there is also a downstairs where there is live music on the weekends.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000214M', '2019-02-11 03:52:56', 'Im giving this place four stars more for sentiment than taste, but their food is decent. The falafel and gyro sandwiches are both on the small side but tasty and made in a flash. They have basic middle eastern groceries as well as a few hot dishes and classic desserts such as baklava and cashew fingers. A great place to get feta, dolmas , tabouli, or hummus. The baba ganouj is excellent.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000069F', '2019-03-13 16:01:35', 'Overall, the facility is extremely clean, the staff is more than helpful, and on top of it all, they are about as friendly as you can imagine. These people have hearts of gold.  I would absolutely recommend the AZ humane society to anyone who wants to add to their family.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000187A', '2018-05-20 18:55:40', 'Ugh, I don"t care HOW ugly my toes look next time, I will NEVER go anywhere else besides Bella Nails again, they ROCK!!!!!!!  This place was appalling.  I didn"t want to make a scene, so I just paid the money, but I will NEVER go back!!!!!!!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000071V', '2019-08-22 09:51:33', '( 2 ) bacon egg sandwiches');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000187A', '2019-07-27 06:02:14', 'I love Mexican food.  I live across from the Fajita Grill.  I have only been there twice (in 4 years).');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000103Z', '2019-09-01 04:25:09', 'Don"t push the "prompt service" button on the table. The waitress said that they ignore it.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000069F', '2018-11-30 11:41:47', 'I had a Engine in warranty from LKQ, these guys were to install its replacement.. They told me done in a few days, ok...   I went there and noticed when the engine was taken out they carelessly left my AC dangling and did not remove it to install new engine. No big deal till you understand the rest.. this is a cheap way to not refill system and do it right...  After going to get my car when they said it was done I Notice AC didn"t work and wrong Coolant added to Radiator. ( cannot use regular Green... Yellow Ford required ) Then I say I will come get it when they fix the AC, they tell me hours later its the PCM..( Computer ) well OK you guys shorted it out, the only thing wrong was a Valve Rattle, now this?? After 2 days with LKQ saying they are going to send a inspector I drove past and noticed my Mirrors Loose (broken ) on BOTH SIDES!! I am ANAL when it comes to my car I bought New in 2007..  this was enough, I took it home.. I had enough...  They forgot 4 bolts, 2 in wrong spot, One Digging into Power Steering Rack, Power steering Bottle Cracked on Bottom from a Poor removal and hid the fact it was cracked on the lower nipple and the AC system they claimed did not hold R-134a because they DID remove the AC later and LOST the O-Rings when they filled it, it leaked.. and they SHORTED the AC Protective Diode.. IT WAS NOT THE PCM.. this place MIGHT be good for a Oil Change if you tell them how to do it, but that"s all..  Telling me How Do we know you didn"t bring it in here like this... BAHAHAHA, a back yard weekend mechanic was able to figure out they were unskilled for the task.. I will make sure with a HUGE online review on EVERY Review site that this place is NOT the place to take a Car... or a peddle bike for that matter..');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000087Y', '2019-09-20 22:06:21', 'I"ve had 3 other laser tattoo removals before I came here so I know what I should be getting. Honestly she didn"t even go over it all the way with the laser. There"s quite a bit of the tattoo that"s untouched. I"ll be going somewhere else for the remainder. It"s not worth the pain if it"s not even going to make a difference.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000071V', '2018-12-18 01:20:02', 'To be honest, I was a bit disappointed. Had the original philly, but it was so bland, I even needed to add a bit of salt to bring out the flavor of the red sauce. Note: the sauce is not at all spicy. Ill say, they ensure to keep the food warm even for pick up, so thats nice, the cheese was still hot when I had it at home. Also the people are really polite and nice. But not a place ill be trying anytime soon.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 1, 'P0000003W', '2018-02-20 14:50:25', 'A0000055R', '2019-01-26 07:06:04', 'The staff is attentive, nice and considerate. Bigger groups will most likely be seated on the second floor which is way bigger.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2019-01-20 01:50:48', 'A0000112O', '2019-07-14 23:20:03', 'Yum! I could eat it every day. My favorite is the "special" burro.  My second would have to be the two tacos. Beef or chicken, both delicious. Affordable, quick, and take some tortillas home for later.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2019-01-20 01:50:48', 'A0000284F', '2019-01-15 18:20:33', 'Listen don"t complain that you got in late or the guy at the door was rude if you get there if you get there past 11pm who do you think you are the Kardashians?! I mean seriously I get bottle service every single time and I do not get there later than 10-1030 pm sure the club may still be empty but i would muchhh rather hang out at my sickkk table than wait in a line for 2 hours. AMAZING CLUB if you have game you willl have fun I highly recommend a table it is keyyy because you get tired of dancing for a few hours you go back to your table with some chicks hang out for a quick 20 then your back at it going nuts!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2019-01-20 01:50:48', 'A0000112O', '2019-01-01 12:04:52', 'This is one of the Peppis that takes credit cards as well. Not all do FYI');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2019-01-20 01:50:48', 'A0000170Q', '2018-10-05 00:55:17', 'We called George the next day to discuss food options, and he said yes everything we wanted we could have for the price we discussed. Tasting was included for 6 people. I asked him to send me an email confirming what we spoke about on the phone. When the email arrived it simply had generics such as "assorted veggies, assorted cakes, hors d"oeuvres" as well as a tasting for 2 people. As well he upped the amount of people we had to guarantee for the price.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2019-01-20 01:50:48', 'A0000186D', '2018-07-18 09:07:37', 'I went here today to upgrade to an iPhone X. They were awesome to work with. They mirrored everything from my current phone to the new one. That saved me so much time and aggravation if I had to do it. They were very knowledgeable and friendly! Highly recommend!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2019-01-20 01:50:48', 'A0000170Q', '2018-07-26 11:59:59', 'Let me start by saying that I love Aveda which is why I decided to try this salon... and it was a big mistake. I explained what I wanted to the stylist, and even showed two photos. It"s easy to get this cut wrong since it"s short hair, so I also showed a photo of what exactly I DID NOT want. She asked what I didn"t like about the photo and I explained it (it"s a section in the back and she acted like she understood). The cut finishes, she spins me around and it is literally EXACTLY what I showed her that I didn"t want. I was mortified and now trying to grow this hideous cut out. Nothing is blended and she butchered my hair. And to make matters worse, she wasn"t even friendly! Heading to a different salon today to try and get it fixed.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2019-01-20 01:50:48', 'A0000221B', '2019-09-19 20:51:40', 'Dimple"s was no great shakes. It was conveniently located to where I was running errands, and brown (so I knew eyebrow threading would be inexpensive and ace).');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2019-01-20 01:50:48', 'A0000138V', '2019-02-23 02:44:08', 'Once you are done exploring the inside exhibits and views, you can wander outside and walk the dam. Beware that when you leave the dam touring area, you cannot return, it is a one way only exit.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2019-01-20 01:50:48', 'A0000052Z', '2018-10-09 02:08:57', 'Room: Can I tell you that this room was EVERYTHING in LIFE?! Ok. There I told you. I was in room 402 I believe. This room was in fact a suite. I felt like it was an apartment and I had a lease. Freaking HUGE! It had separate areas for a kitchen (complete with full fridge, stove / oven, microwave, dishwasher and bar), living room, balcony, bedroom with 2 queen beds, a safe, closet and tv and bathroom with closet, garden tub, separate bathroom and double sink vanity. The bathroom was the size of most rooms. Completely clean!!!!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2019-01-20 01:50:48', 'A0000186D', '2018-09-06 12:28:44', 'Always slow service. They don"t always have what you initially wanted and then they mess that order up, too. I come  here because of the proximity but I think I"ll just make the drive out to a different Starbucks from now on. I agree with some of the other reviewers, the coffee is weak and the parking/drive thru  set up is hell. Overall  not worth going to this location.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-01 04:10:04', 'A0000018R', '2018-07-29 06:38:15', 'Do yourself a favor and get one of the steak sandwiches off of the menu. They are amazing. The ultra is my favorite.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-01 04:10:04', 'A0000259X', '2018-11-30 15:09:25', 'I can honestly say you get so much more for your money at Subway for much less and you can make the sub the way you want and you get very full and sometimes even have leftovers!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-01 04:10:04', 'A0000123T', '2018-10-18 02:13:07', 'I had chicken scaloppini, which was delicious- perfectly prepared, and served with just the right amount of sauce and Mediterranean olives. The girls all ordered pasta dishes- raved about, and then subsequently demolished them. There wasn"t one crumb of food left on anyone"s plate!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-01 04:10:04', 'A0000250Y', '2018-10-13 19:42:30', '((( LADIES BEWARE))) Don"t ever take your machine to 35th Ave. sew and vac on Northern they broke my Elna machine while it was being repaired. I"ve spent over $10.000 at their store over the years and have been a long time customer .. Bill the owners son was so rude to me and did nothing to resolve my broken machine. I was disgusted when Bill the owners daughter wouldn"t do Any thing to help me when the repair man broke my machine. It"s terrible to bring a nice sewing machine in to be repaired and these people broke it while in their possession and they don"t want to do a damm thing about it. It was like a big (screw you) to me. I won"t buy another thing from these people for the way I was treated. Even the material is too over priced. I"m in the market for another machine but I won"t go there ever again. My machine STILL NEEDS TO BE TAKEN CARE OF AND THEY STILL HAVE NOT RESOLVED THIS ISSUE. ITS STILL BROKEN AND IT HAPPENED WHILE REPAIRMAN WAS SERVICING MY MACHINE. I WISH I HAD NEVER TAKEN MY MACHINE TO 35TH AVE SEW AND VAC SHOP. WHY CANT PEOPLE OWN UP TO TAKE OWNERSHIP TO THEIR RESPONSIBILITY FOR THEIR OWN MISTAKES!!!! GO TO KINGS SEWING MACHINES MUCH BETTER SERVICE AND THEY DONT BREAK YOUR MACHINE!!!!!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-01 04:10:04', 'A0000250Y', '2018-02-17 11:30:36', 'A pot of tea costs money and they automatically add the gratuity to the bill.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-01 04:10:04', 'A0000259X', '2018-07-18 08:20:09', 'Two kids and an adult on a Friday nught. $86. Unbelievable. No selection of food. Quality of food sucks.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-01 04:10:04', 'A0000176G', '2018-07-05 13:10:00', 'A must see is the  Carrolier Academy of Irish Dance! The children participated in the parade and scheduled events throughout the weekend. Led by Debbie Carroll and Shelley Locklier, the two dancers have Irish dance teaching credentials; both teachers travelled the world with Michael Flatley"s Lord of the Dance.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-01 04:10:04', 'A0000124V', '2018-07-07 00:46:33', 'The food here is the best Greek food I"ve had in Arizona. The prices aren"t too bad and the service was great. They are really fast too!!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-01 04:10:04', 'A0000113D', '2019-08-31 00:57:39', 'i consider it pretty rude to do that when almost all the tables are empty and in the 2 days I visited, the restaurant was never completely full.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-01 04:10:04', 'A0000221B', '2019-09-07 10:01:59', 'Very helpful staff.  Location was a little farther than the Home Depot.  After the Yelp coupon, the prices for the items that I purchased was on par with Lowest and Home Depot.  Those big box stores are OK.  However, I am trying to support the local economy.  With an adequate selection, friendly staff, and close location, I will continue to spend my money there.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-01 04:10:04', 'A0000221B', '2018-06-11 15:41:08', 'Be careful about total fee and I do not recommend ask them to rent a car.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-01 04:10:04', 'A0000170Q', '2019-08-25 03:51:50', 'Well they definitely lost me as a customer! RC Willey here I come!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-01 04:10:04', 'A0000221B', '2018-07-02 08:10:21', 'Tried the fish tacos and churro, definitely a superior Mexican/ taco joint around in the city');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-01 04:10:04', 'A0000276T', '2019-09-09 15:41:15', 'Pork Belly, unreal! Had an AMAZING prime NY Strip with bourbon butter jam, PHENOMENAL!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000131L', '2019-03-03 01:21:35', 'inconsistent membership rates (my friends got quoted several different rates than what I pay)');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000277N', '2018-10-29 02:28:02', 'I took the car directly to the 616 location and saw Jared busily working with his staff. I pulled up and was greeted courteously by one of the staff. After being checked in I called out to Jared and explained the situation to him. He dutifully sought out to resolve this issues and return my car to its former glory.  This was not his problem, his staff did not cause it but he fixed it.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000112O', '2018-12-25 00:30:37', 'They serve steak-burgers, so it may cost more than average, but not by much. You can get 2 different styles of burgers: A Freddy"s burger that comes with pickle, mustard, and onion. (my preference) Or a California burger. Same meat, but this one comes with lettuce, tomato, onion, and a "Freddy"s sauce" which is your typical thousand island, fry sauce, spread, etc.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000138V', '2019-08-08 16:52:08', 'On peu y mangé le midi, prendre une pâtisserie ou un café/thé.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000284F', '2018-10-15 03:15:11', 'These guys literally saved me.  I had a RFP due during the holidays.  With my computer and printer crashing, I was in a serious bind.   I usually go to Staples Printing Centers-- but, they couldn"t get it done in time.   So, I got on the Peoria Chamber website and International Minute Press/Desert Sky Printing came to the rescue.  They finished my printing and the RFP was turned in with 1 hour to spare.  I recommend them highly!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000186D', '2019-09-26 21:06:26', 'I have no idea what the owner"s problem is, but he"s incredibly rude. His wife, on the other hand is super nice (an odd mix).');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000276T', '2019-06-15 05:56:46', 'Looked forward to eating here for so long...too bad it was on my birthday - food was good but the service was deplorable so not going to rehash this too much (apologies to my man and bro as I know they were also hoping for better)');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000276T', '2019-02-14 16:17:13', 'Bruh, I"m a stickler for good wings.  Like to the point I can only eat them from about 4 places and I find those places to usually be inferior to the ones I make with my brother.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000170Q', '2019-05-30 15:39:47', 'We had the A5 Wagyu gyoza, was tender and not overdone, Tuna tataki, Chicken Samba was a good size portion, El topo roll, chef sashimi selections, and Tonkotsu ramen. Everything we order was super yummy!  Definitely coming back again next time we"re in town!!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000186D', '2018-02-19 20:18:29', 'Great place for a smaller breakfast, and pretty great coffee as well.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000277N', '2019-05-19 15:28:45', 'The venue set up is great. There is seriously not a bad seat in the house. You can pick yours online when you buy tickets.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000276T', '2018-12-21 00:07:41', 'The added stone "massage" was barely a massage!  She rubbed the stones up my lower legs a couple times, and that was it.  It lasted about 30 seconds.   And when I asked for a design, I"m used to getting a board with a bunch of designs to choose from.  She didn"t even ask me what I wanted, she just painted a few lines on my two toes and then charge me 5 MORE dollars for that!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000131L', '2018-01-12 08:20:17', 'second A place that proudly serves "Middle eastern" and also "Greek" food usually misses those authentic flavors. For example serving Jewish Latkes, Israeli/middle eastern humus, and Greek moussaka is usually just too much for a fusion.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000276T', '2019-09-06 23:24:16', 'The reason for the 2 stars should not reflect the quality of the brewers, they obviously know their craft well!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000131L', '2018-01-23 03:57:24', 'Look I"m honest so here is the run down on what you we had:');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000277N', '2018-10-21 18:41:59', 'I have dined here Teppan twice, a la carte twice.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000022N', '2018-05-30 18:43:47', 'I can say nothing but positive things about my experience at fitness together Steele creek. The facility is clean and well equipped and the staff is knowledgeable and full of personality. When my wife and I first showed up, we had a deal to try five sessions for 99 dollars. We had talked for a while about joining a gym, but fitness together is so much more. It"s like a community of people working toward a common goal of getting fit and taking control of their health. The owner, Joe, is very knowledgeable in fitness, exercise, and most importantly nutrition. He worked with us to set up individual  nutrition plans and exercise programs to help us attain our goals. Included with your sessions purchase is a fitness assessment which measures body fat percentage, fitness levels, resting heart rate, flexibility, and a few other factors. Additional assessments are given throughout your tenure as a fitness together member so you can watch your total body transformation. It is a very encouraging atmosphere no matter your current level of fitness. At first I dreaded going to exercise, but after seeing the positive changes you just can"t wait to get back. I like the fact that sessions can be purchased in packages without a long term commitment, but I must say I continue to add additional sessions. This is mainly because I continue to see results. My wife and I are both stronger, healthier, and happier thanks to Joe and his knowledgeable and helpful staff. I highly recommend Fitness Together to anyone looking to get into shape, tone up, lose some inches or lbs. it"s been a great experience.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000040P', '2018-01-05 17:54:27', 'After my second, alcohol only, visit, I was excited to taste what vegetarian options they had.  I had the grilled cheese with spicy asparagus and portobello.  Let me tell you...grilled cheese is amazing, add a few interesting touches, it becomes addicting.  I was very happy with my sandwich.  Also, they have a very tasty appetizer of Goat Cheese Fritters with a red wine sauce.  Goat Cheese is one of my favorites and frying anything makes it better. I was in love.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000019J', '2019-09-21 14:32:27', 'Go. Seriously. You will not be disappointed one bit!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000250Y', '2018-08-30 07:07:38', 'I went with the ziti. Just as I remembered, the sauce was awful. The pasta was in a pool of water and the sauce had zero flavor. I just feel like a sauce can make or break the meal, and it was tasteless-- no garlic, onion, wine, basil.. Nothing. The portion was also quite small for the price. It was clearly boxed pasta and not homemade, so why so stingy? I"m surprised there are such high reviews on here actually as my experience and my family"s experience wasn"t great. I guess it"s a decent place for families, but I would definitely go to a different Italian restaurant if you"re looking for good food.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000028T', '2018-09-19 09:57:29', 'Love this place! It"s simple. It"s priced fair and the waffle was very good. Sunday was my day to say I have had enough of the twigs and berries and I want pancakes! Well at least a waffle although they have big banner that states now serving pancakes but really who goes to a Waffle Cafe for pancakes...the name tells you what their specialty is.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000259X', '2018-02-05 07:27:28', '( 2 ) bacon egg sandwiches');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000113D', '2018-03-22 23:34:21', 'My only complaint is the hostess staff. They treat you like crap - you"re just a number to them. They have no personality and make no effort to get you excited about the meal - give me you cell number and we"ll text you. NEXT! When I asked about the wait after 45 minutes, she told me that she texted me 6 minutes earlier. I showed her my phone - no text. Well, that also meant no apology from her either. She gave me a look like, do you still want in or not, I have other people to be rude to.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000259X', '2018-01-08 04:36:32', 'Icing on the badlashes cake: she was over an hour and a half late for my apt and claimed it was never booked. even when I showed her the text she had sent me with the confirmation.  The whole time I was waiting my gut was yelling NO and I should have listened.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000113D', '2019-07-24 23:14:55', 'Go. Seriously. You will not be disappointed one bit!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000123T', '2018-06-09 10:23:31', 'First time here and everything was amazing. What a wonderful little gem we found in this place. Looks like not much out front but it"s very charming and original in back. Beautiful patio and food was fabulous. Lunch today but we will be back to try more.  Breakfast looks incredible. Plus, they are Detroit Tiger fans!  Added bonus!!!');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000250Y', '2018-09-08 23:06:54', '"I would give the location 5 stars and the restaurant 3, so we"re at 4 stars overall.');
INSERT INTO ForumEntries VALUES('CS3223', 2018, 2, 'P0000001C', '2018-01-22 01:32:33', 'A0000124V', '2018-03-18 01:26:00', 'why do these guys suck? how hard is it to ring a bell to see if the receiver is home?  I"ve had multiple issues with them, and wish Amazon would stop using them.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000200S', '2019-09-27 21:45:53', 'I have been to ChuChai 5 times now. Trust me on this, get the sticky rice and the crispy duck! I would have given them 5 stars but the last time I was there, the food arrived cold and we asked them to reheat it. It came back to the table just as cold the second time.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000110N', '2018-06-28 11:36:46', 'The decor is trendy and interesting, it"s Cleveland-centric, and they offer great vegan options. When our group entered the store, we were warmly welcomed and given an explanation of how everything worked. It"s a per-ounce froyo place with lots of possibilities. I chose the artisan organic tart yogurt and the vegan blueberry...mmm. One thing to note is that because it"s vegan (made with coconut milk), it"s not as creamy and melts a bit quicker if you"re not used to vegan things. Yum.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000014L', '2018-08-03 11:38:25', 'Out shopping (gross), I got a hankering for Mexican food, and Border MX was the best rated option that came up.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000216S', '2018-07-22 03:32:27', 'My regular cleanings are smooth and I"ve always appreciated the timeliness of each appointment. Any work performed on my teeth have been pain free and effortless which very much appreciated.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000216S', '2019-03-09 02:51:19', 'First, we changed our reservation, and they said they could accommodate the time. Clearly, they shouldn"t have. We were seated at a folding table in the hallway next to the restaurant, quite literally in the food court next to a kiosk selling trinkets to tourists. Whatever ambiance this restaurant might offer is a mystery to me. They shouldn"t have switched the reservation if it wasn"t possible to accommodate the change (our fault, wouldn"t blame them). I know they threw a table together as our table and chairs looked different from the rest of the ones set up. A few were just in front of the restaurant but not off to the side like ours was.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000115N', '2019-03-20 00:14:04', 'After they got the person in front of us through the drive thru, they then told US to hold on a minutes because they are "backed up inside", but they weren"t at all. The parking lot had 2 cars and 3 people behind us in line, and when I was inside, a server was sitting at a table texting. So don"t tell me you are busy if your staff is getting paid for nothing. I yelled "are you getting paid for this?" Through the speaker and he had time to answer and tell me to CALM DOWN but couldn"t take my damn order.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000125U', '2019-04-09 17:28:12', 'The soup comes in a small container and the sub is very small for being a half.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000110N', '2018-10-29 19:48:26', 'It was a journey to get to this place as it took about 30min from my house but the service and food here made it worth the drive. I also love how they had a poster of Keali"i Reichel. (They had other posters but Keali"i Reichel happens to be my favorite). Place is clean, service is fast and friendly and food is delicious. What more could you ask for?');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000239H', '2018-08-19 00:48:34', 'I really like this bookstore for its DVD and music selections. There"s a nice clearance section with top end DVDs going for only two dollars. The staff here is very pleasant, and it"s clean and well organized. I can"t speak for their book section, as I have yet to shop for books here. They also have gadgets, which is nice. It"s easy to find parking outside. My one complaint, if any, would be that they apparently don"t check for the regions of their DVDs. I"ve purchased several which weren"t made for the US region, so it was a total waste of money. Overall, I really like shopping here, and I"d recommend it to anyone who asked.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000110N', '2018-09-03 23:28:59', 'OPH all over this country is amazing. I"ve enjoyed them in Minneapolis, Chicago, LA and Seattle.  I cannot believe how bad this location is and I hate that this is the only location in the valley of the sun.  Please... someone... open another franchise somewhere else in this valley.. PLEASE!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000200S', '2018-01-29 13:33:53', 'Calamari was good. Worth it, served with a large pool (at least 2 cups) of seasoned mayo.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000200S', '2019-01-07 08:43:35', 'Everything was visually appealing to me.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000239H', '2018-02-23 23:07:29', 'Worst customer service ever had me waiting  a hour and then skips me never coming back do not go there if you want a haircut');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000134L', '2019-09-04 16:05:47', 'highlights:');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000200S', '2019-10-07 07:43:30', 'This was my first time going to Harvey"s. I was so impressed! The service was wonderful. The cook even came out to check to make sure we were enjoying our meal. The burgers were the best burgers I have had since moving to Phoenix. The restaurant it"s self is no thrills but I would recommend it to anyone is craving an incredible burger and great service.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000014L', '2019-09-02 21:51:26', 'Third, I felt very rushed. I know that there is a long line, but they were really pushy about cleaning up our plates immediately after we finished and it made for an uncomfortable eating experience.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000239H', '2019-09-21 16:27:26', 'I"ll be the first to admit that I was not excited about going to La Tavolta. Being a food snob, when a group of friends suggested we go for dinner I looked online at the menu and to me there was nothing special and it seemed overpriced.  Im also not big on ordering pasta when I go out. Alas, I was outnumbered. Thank goodness! I ordered the sea bass special. It was to die for. Cooked perfectly, seasoned perfectly, perfect portion. I can not say enough good things about this dish. When the server asked how it was he seemed very proud of the dish and said, " doesn"t she (the chef) do an incredible job?" She does.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000228K', '2019-10-21 09:13:26', 'I"ll be back. You should give them a try too.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000158F', '2019-10-14 08:09:57', 'The food:');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000175P', '2018-04-13 20:34:19', 'Chocolate croissant- tasty, seemed fresh. Nothing special but compared to my $10 crepe and watered down overly flavored latte it shined.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000241P', '2019-08-01 07:56:37', 'I have a confession to make... I have an obsession with tongue.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000195Z', '2018-01-08 19:45:38', 'The lady who was assisting me on the kiosk phone was pretty friendly, but she was doing a lot of up-sell so it was kind of bothersome.  I didn"t need a bigger car than an economy size since there was only 2 of us.  I understand that they probably work off of commission, but sometimes it"s unnecessary to try and convince you to get something that you don"t need.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000175P', '2019-09-15 00:46:49', 'Lets hope for more consistency and the locals will fill the room.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000114I', '2019-09-08 03:36:51', 'Dinner Was Fantastic! Service was great We started with the corn soup and the tuna tartare. We shared the Filet and Scallops. Both delicious entrees! We didn"t realize the steak came with potatoes and ordered two sides Mac and cheese and shishito peppers. I thought the peppers were really hot but I"m a whimp I guess! We will definitely come back');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000247B', '2018-07-10 06:01:39', 'I always like to chose a signature burger so I opted for the Spicy Cajun Burger and combo"d it up with there Beer Battered Rings and a Jones Strawberry-Lime  Soda.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000175P', '2019-10-11 13:17:10', '(Back to Yard House for real food)');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000005O', '2018-03-16 23:03:50', 'Filled out the security forms  with the EMT .');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000100F', '2018-01-18 03:13:03', 'We only sampled a few small plates but they were good. The staff was helpful but their beer selection is lacking.  We sat on the patio and it was okay but they need to invest in some plants for their planters. Just having the old dead plants really does not help the ambiance of a concrete patio.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000005O', '2019-03-29 04:01:42', 'The arugula salad with goat cheese and lemon vinaigrette is to-die-for. I crave that dressing days later. So light and fresh but flavorful.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000158F', '2019-06-01 18:24:38', 'Gaspar is a very nice place inside. It has a cozy, warm feeling, with its dim (but not too dim) interior, exposed brick and wood. Tip: you can get in either on Rue de la Commune or Rue Saint Paul, or through the hotel to which it is attached.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000027M', '2018-08-09 07:04:40', 'The waitresses are really nice and friendly, which is the kick start of a good morning.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000228K', '2018-11-09 19:09:30', 'Dining here, you best not be dieting because this place is literally the definition of excess, but in a good way. I"m a sucker for benedicts so that was awesome.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000247B', '2018-04-13 16:12:48', 'Our lane broke down repeatedly, it even gave up and powered itself off one time.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000158F', '2019-10-27 06:47:16', 'Each visit is carefully tailored to your current state of being and needs.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000082X', '2019-07-26 07:55:04', 'In conclusion, the food quality is above standard, service and cleanliness is high, and the atmosphere is intimate. The food is more old fashioned, come here for a great steak done right at a slightly higher price range than the keg.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000201O', '2018-03-01 22:47:40', 'Will also be posting my experience on your Facebook in hopes that you get better trained and caring staff.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000079A', '2018-11-25 15:48:30', 'I called them at 10.30 saying ill be there in 15 minutes given they close at 11. When I arrived with a party of 15 ( which I mentioned on the phone) they denied me and were extremely rude. Lack of professionalism and courtesy.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000029M', '2019-07-04 10:09:40', '* Clean and modern decor with plenty of seating/table options and large windows');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000082X', '2018-05-04 09:36:45', 'The reason I did not rate a 5 is because the staff is not the best with designs. I like to have designs on my nails and they were very hesitant to do any of the ones I wanted. They ended up doing a Hawaiian flower on my toes. Its was ok but not the best.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000008J', '2018-01-10 03:04:59', 'I"m not that familiar with Scottsdale so I"m just guessing that this restaurant is fairly new. The atmosphere is great and lively but s but loud. They have a huge wine and drink list.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000082X', '2018-02-18 07:52:30', 'I took the car directly to the 616 location and saw Jared busily working with his staff. I pulled up and was greeted courteously by one of the staff. After being checked in I called out to Jared and explained the situation to him. He dutifully sought out to resolve this issues and return my car to its former glory.  This was not his problem, his staff did not cause it but he fixed it.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000079A', '2018-01-26 21:20:59', 'Not a bad place to camp out for a night in Cleveland. The airport shuttle is easy to catch and the employees are friendly.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000047G', '2018-02-15 20:55:43', 'Don"t go here. Especially not for a full hour table massage. I"ve never tried the chair massages so I can"t speak to those, but the table massage was not a great experience. I"ll spare the details, but I definitely don"t recommend this place.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000082X', '2019-02-27 04:01:35', '3.5. Patio is great and spacious. Selection of beer and menu also great. I came here because of the more sophisticated menu variety. I ordered the steak tartare. It"s okay, but if you"ve had steak tartare done right before skip it here. They use a chicken egg yolk. Tartare itself is not seasoned enough and left more to be desired. Salmon quinoa bloated. Duck fries were quite good and a large portion too. In terms of fruity beers, I didn"t like my friend"s cherry beer (reminded me of medicine taste(, but my peach beer was quite interesting and more bitter than I thought. The seating with half booth half stools are a bit weird, apparently my back doesn"t like backless chairs. Either way, I would come back if I want beer in a less rowdy bar with an interesting menu for food.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000008J', '2018-06-10 18:25:27', 'I would return if I was in the area again :)');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000289B', '2019-09-25 18:58:03', 'Well, they get ZERO stars for not fixing the washer. They get ZERO stars for charging us for a service call when they had no real solution. They were kind enough to remove the new (bad? wrong?) parts, and to refund our money for them.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000201O', '2019-09-05 21:23:16', 'Believe the negative reviews. I came here after a round of golf, in order to have dinner and a few brews. The service wasn"t terrible, it was non-existent. The waiter seemed to take an eternity to take our order.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000079A', '2019-09-10 08:32:31', 'I don"t remember what I ordered but it all came to $75.00');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000029M', '2018-02-05 02:13:11', 'FOOD');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000047G', '2018-11-04 06:44:21', 'I like neon. Theres just something about it that says taboo allure to indulge in all sort of human vices. Moths to the Noble Gas flame, people seem to slither their way to these oasis"s of the night, incubating amongst each other in a haze of sensory saturation.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000079A', '2018-10-06 05:44:24', 'Had the occasion over the last few weeks to experience their sports medicine/physical therapy department.  Outstanding.  Drs. Anthony "Tony" Walker and Jennifer Hannon are a great team.  They really know their stuff.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000106W', '2018-10-08 02:34:27', 'highlights:');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000133D', '2018-09-27 19:07:42', 'Dined here a couple of weeks ago on a Saturday night -- actually sat at the bar with my three fellow diners and had an absolutely amazing evening -- food, wine, service all made for a perfect experience.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000133D', '2018-12-23 01:39:51', 'I remember going to this salon a few years ago and I loved how fast thier service was(under 45 min). I"m glad that that hasn"t changed. I did a refill on my seaweed bio gel nails with an air brushed french manicure because I saw it here on yelp and I didn"t even know that was an option. My nail tech was nice she understood what I wanted and was very fast( without sacrificing quality). Sadly my only complain is that this place is located in markham which is out of my way. It would be cool if they opened up another location in the north York or downtown area.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000133D', '2018-06-11 01:19:17', 'That being said.  I was pretty edgy by the time we arrived.  We"re from Cave Creek and had been out shopping and then had a heck of a time finding the place, so we arrived about 8.15---pretty close to closing.  And I had a Groupon---and there are Yelp reviews that said the staff DOESN"T like Groupon-ers.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000206Z', '2019-04-05 03:38:59', 'My favorites are the Chicken Scarpariello, the pizza and the Sangria. My wife can"t decide between four dishes. Our daughter loves the Penne ala Vodka, Lasagna, or Ravioli.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000116Q', '2019-08-28 20:38:14', 'And yet, the food was tasty! Even tough it wasn"t 100% loyal to the original flavors or shapes of the Middle East the food was yummy! And I do have to give them a round of applause for their hummus. Simply really good!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000173C', '2019-09-13 04:57:30', 'This is a hidden gem , the decor is a bit dated but the pizza is awesome.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000280M', '2018-01-18 20:24:28', 'Despite the decor, the food was amazing.  My dad and I had the fajtas the first night we were in Scottsdale and boy were we surprised.   Our waitress was amazing as she told us a unique way to get to the Grand Canyon, which we didn"t regret.  Salsa was amazing and my mom probably ate most of it.  If I ever go back, I hopefully will go back there for some Mexican.  Was there on 2/15/2012.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000280M', '2018-09-24 10:49:26', 'Service: No complaints here. Our server (Eric, I believe) was extremely pleasant and most helpful. He took the time to explain some of the menu items, checked on us fairly often, and  was generally very friendly. High marks here.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000133D', '2019-08-01 14:49:47', '3. Fabulous Wine Selection');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000280M', '2019-02-17 17:03:03', 'Complimentary bruschetta:  A plain Pizza crust with bruschetta topping which falls off and wasn"t that flavourful. Go to La Bruschetta to find out how it is meant to taste.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000280M', '2019-03-07 18:59:18', 'Early this past January, I needed to find a furnished rental in the uptown Charlotte market. I really had no idea of how or where to look. I was glad when I found the Sold on Charlotte site.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000261Z', '2018-05-23 20:46:30', 'I wouldn"t consider this Aunthentic Mexican food, like my hubby does, but it sure was tasty.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000206Z', '2018-02-09 02:42:21', 'After getting into an arguement at another Az casino with a fellow BJ player, I"ve decided that table poker is the game for me.  3 Card Poker specifically!!!   Love going to the Wild Horse Pass casino.  All the table dealers I"ve dealt with there are very friendly, both when you"re winning and losing.  Trust me, I"ve seen my fair share of "coolers" who have been asshats in other casinos.  The dealer I had this past Friday night was especially helpful to a friend of mine, a newbie to 3 card, and taught her the basics.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-04-26 20:20:14', 'A0000098D', '2018-08-24 01:28:57', 'Time to start shopping around for a new rental car company.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000200S', '2018-06-26 18:14:28', 'It turned out to be a bit pricy, but I"m willing to pay for it - the whole thing, from the froyo to the overall experience.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000014L', '2018-03-06 16:23:10', 'I bet at this point in time you are wondering why I am only giving this place 4 stars then? Well, not everything is as amazing as those garlic fries. The bourbon apples are fairly tasteless, the chili is ok (the meat was very tough), and the service is also just ok. However, the catfish is delightful, the mac and cheese is also delicious, and the brisket is quality.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000110N', '2018-05-16 20:38:35', 'I took the car directly to the 616 location and saw Jared busily working with his staff. I pulled up and was greeted courteously by one of the staff. After being checked in I called out to Jared and explained the situation to him. He dutifully sought out to resolve this issues and return my car to its former glory.  This was not his problem, his staff did not cause it but he fixed it.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000239H', '2018-06-17 17:49:09', 'I"ll be back. You should give them a try too.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000216S', '2018-10-12 10:10:31', 'The only big miss on their beers I"ve had is the Big Chuck Barleywine. It could probably benefit greatly with age, but at this age all there is to taste is the alcohol.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000273F', '2019-09-22 00:04:59', 'I would like to point something out about this place.  No the food isn"t cheap but the quality of the ingredients justifies the cost.  Our meal with tax and tip was $200 (for four).  The food was really good but what sets them apart is the service.  The restuarant was fairly busy and there was only one waiter who had the assitance of the owners Amy and Albert.  Yes there were times when we seemed to be waiting awhile for things but they made sure that we never felt forgotton.  They went out of their way to talk to us and make us feel welcome.  I"ve been to some really nice restaurants and had some incredible food but I"ve never been made to feel as welcome as did at The Combine Eatery.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000239H', '2018-01-25 20:20:15', 'Alexander"s pizza also serves Italian and Greek entree meals. The pizza was disappointing, but their homemade (?) ranch dressing is out of this world! It"s creamy, thick, and very nicely seasoned to go with their surprisingly fresh salads. Their ranch dressing really is superb and the family that runs this place seem very nice. Not the friendliest bunch of people, but you can tell their honest and work hard.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000106W', '2019-04-29 01:39:49', 'I would choose this one 9/10 times over the other.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000280M', '2018-10-12 10:23:05', 'I love this place. Lots of great, healthy options. Excellent variety, friendly staff, no exorbitant prices. Doesn"t beat being held by someone who cares about you, but what does? Enough melancholy from me...go forth and eat healthy');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000116Q', '2019-07-13 21:55:19', 'Amy is amazing and an outstanding example of going above and beyond. I cannot thank her enough for taking the time out of her time off on a Saturday to ensure we were taken care of.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000237J', '2018-03-07 20:12:14', 'Jared to the rescue:');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000206Z', '2018-06-09 14:02:15', 'This is a great alternative to the full service places.  It"s quicker and you don"t have to wait for someone to towel dry your car.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000206Z', '2019-06-01 03:14:44', 'Very fast to go service. The pad thai is made from bigger noodles than i"m used to but had a very good flavor');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000282Q', '2019-01-24 10:17:18', 'My wife and I split the main dish, which was a special "baked brisket enchilada" recommended by the waitress.  It was huge and definitely more than enough for too, but we didn"t care for it. There didn"t seem to be much beef in it; it was mostly sauce and cheese.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000261Z', '2018-06-22 11:38:56', 'Dreadful Service');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000237J', '2018-10-01 22:17:02', 'Caesar salad:  Crispy romaine, hints of fresh garlic and Parmesan but the dressing seemed watery and the croutons were like rocks.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000261Z', '2018-12-17 03:26:12', 'When we said that we weren"t interested in hearing the specials, he read them anyway.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000261Z', '2019-06-09 19:29:23', 'Highly recommend and will return.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000282Q', '2018-08-05 06:58:39', 'It was ok, but I"m not dying to go back right away.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000261Z', '2019-09-07 08:07:47', 'We wanted to try something different so we ordered the half sub and soup special. I thought it was expensive if you ask me. It was like $9. So it was over $20 with 2 specials and a drink. It didn"t even fill you up for that kind of money!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000133D', '2018-06-30 21:39:27', 'The pros:');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000116Q', '2019-02-25 23:11:29', 'A co-worker of mine kept talking about Tottie"s, so last night I finally gave it a try.  I don"t know if it is different dining in, because I ordered take-out, but it was good.  It didn"t blow me away, but it was good.  Very similar to good chinese take-out, or maybe a notch up.  I ordered the Tottie Rolls as a starter.  They are crispy egg rolls that you wrap in a lettuce leaf, with mint and parsley.  They come with a sort-of sweet and sour sauce for dipping that was quite nice.  Or atleast I think that is how you are supposed to eat them?  I had a big take out container full of lettuce, mint and parsley, so I figured that was the drill since I didn"t order a salad?  They were good.  I ordered the Tangerine Chicken and the Beef Pad Lard Na.  The chicken dish was good, tasted like an orange chicken, deep fried until crispy then tossed in a sweet tangerine sauce.  It had a few strips of red bell pepper also.  The beef dish I liked a little more, it was the wide egg noodles and had chunks of beef, onion, pea pods and bok choy in a really good brown sauce.  You can order many of the dishes mild to HOT, so I did a medium hot since I sharing the dishes I didn"t want to blow them out of the water with too spicy of a dish.  Next time I will definitely go hotter!  The dishes came with 2 containers of sticky white rice, which was exactly what it sounds like. I didn"t have any dessert, but the crispy bananas sound great, and I am interested in trying the ice creams I keep hearing about.  I also really want to try the soups, they sound good.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000241P', '2019-04-07 19:45:35', 'Egg-celent! Was so delicious and would definitely recommend it. I gave only 4 stars because I wish they had more options on their menu. I didn"t want bread and opted for the salad at no additional cost. Although the salad was good, I"m not too sure about arugula with scrambled eggs and a slice of cheddar cheese.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000295G', '2019-07-11 03:24:47', 'I was told so many great things about this place but my entire experience was awful. The food wasn"t very good, way too greasy. My fries were luke warm and my tray was literally covered in grease. I needed about 50 napkins and a shower after that. The service was pretty awful too. I can"t believe I paid $14 for a small meal with no extra fixings. On national cheeseburger day of all days too. Such a disappointment and I"ve never gone back since. Best thing about it was the soda, but that"s pretty difficult to mess up.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000175P', '2018-06-17 02:11:35', 'By the way, the carnitas were excellent, as well.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000114I', '2018-03-27 14:03:38', 'Amazingly professional & compassionate staff. We recently lost an animal member of the family, and I was pleasantly surprised today with a follow up hand written sympathy card personalized and singed by the whole group. Thank you!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000158F', '2018-08-04 06:09:41', 'BRFC is a solid place to try some really good chicken. I"ve been very happy on my recent visits to BRFC. Our chicken combos were tender, juicy, crispy, and flavorful. We like to order their chicken tender combos and dip them in all their different sauces. My husband and I really enjoy it and plan on returning.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000195Z', '2019-04-29 11:14:22', 'I could go on and on about all of the products they"ve managed to cram into this place and about how friendly the staff was but I want to leave something for you to find out on your first visit. I know, it"s not the West Side Market and it doesn"t have nearly the sheer volume of items of this venerable food mecca but it"s worth paying them a visit anyway. What it does have is a neighborhood feel, more parking, and a more intimate experience. Support a local business, eat local foods and give something back.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000158F', '2018-03-28 00:28:04', 'So I chose this place because they were open at the time I wanted to go pick up dinner at 4pm.  Ordered a Papaya salad and Pad Thai. They asked how I wanted it Mild Medium or Hot.  I stayed safe and said mild for both.  Well, when I got home and opened up the containers--of which they stupidly put them in one bag-dumb because papaya salad is always cold- I had to remove it in the car before heading home.  The Papaya salad was not evenly cut...their shredder is not working and it is supposed to be picked up like speghetti...this was clumps of papaya shredded half way. ALL I COULD TASTE WAS ONION. ONION...like eating a clumpy mouthful of ONION.  Horrid.  The Pad Thai had dry pieces of chicken and ZERO seasoning.  AWFUL. CRAP.  Waste of $17. NEVER BE BACK. They cannot produce Thai food that is worthy.  Instead of driving back to the place to return this...I"m writing this review. STAY AWAY.  Should have gone to Thai Plates or tried another place..these guys were the only ones open at the time I wanted food.  BAD DECISION. STAY AWAY. Headed to the fridge to eat crackers and cheese. TICKED.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000100F', '2019-06-23 15:40:23', 'Brandi is awesome... love her demeanor and personality. She is an excellent stylist.. I am also a cosmetologist so I know  the real deal when I see one! I will be back again for sure! Her scalp message was perfection.. so relaxing and I had a blast talking "shop" with her. Highly recommend this lady!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000247B', '2018-01-05 05:14:41', 'Love the crust on this pizza. The sauce is decent, cheese is okay, the pepperoni was not the best quality.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000195Z', '2019-09-29 21:25:35', 'Price wasn"t too bad...all you can eat wings for like $13.  I had the garlic parmesan which seemed a little bland.  Then I tried the Hot Wings...and it was kind of spicy....not too bad.  The ranch was a bit watery...');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000117Q', '2018-11-21 22:08:15', 'Brand wise, you"ll find upscale brands like Shoshanna, Amanda Uprichard, Alice & Trixie, Frock by Tracy Reese, James Jeans, Anlo and Citizens for Humanity. As mentioned, they have begun to add more affordable pieces from Greylin and LA Clothing. You"ll also spy a handful of accessories and handbags scattered about in a range of prices.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2018-09-02 11:41:07', 'A0000029M', '2018-11-14 08:14:12', 'My search for the best beautician with great customer service skills,  hairstylist and applying my weaves are over. Rasheen"s skills surpassed my expectations. Rasheen"s expertise in the use of different techniques that would be best for your natural hair when applying your weave, shows that she cares about your natural hair. My hair looks amazing, and I have received so many compliments.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-09-10 16:31:56', 'A0000216S', '2018-07-02 13:05:17', 'I have eaten at Pan Asian about 15+ times, and have taken several friends here.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-09-10 16:31:56', 'A0000110N', '2019-03-18 07:37:13', 'Also note that it is a tiny store that fits no more than a dozen people, so don"t expect to sit inside enjoying your ice cream there.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-09-10 16:31:56', 'A0000200S', '2019-07-31 01:38:35', 'That"s right folks - tongue. I love it. Name the animal - duck, pig, cow - it"s definitely one of the best eating parts of the animal. (what, were thinking about something else? You guys have dirty minds ;P  !) Being Asian, my parents indoctrined this love at a very early age.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 1, 'P0000004E', '2019-09-10 16:31:56', 'A0000200S', '2019-07-20 08:50:24', 'He"s pretty much bang on.  There"s very little to regret when it comes to Burrito Boyz.  Their burritos are big and filled to the point of bursting with delicious flavours.  I usually go for the small, because the large really is very large, but I"ll indulge once in a while.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000126F', '2018-09-05 00:24:44', 'I have purchased two carpets here and went for my third today. The first two worked out just fine. You save a little money by having very limited customer service but it has good variety as long as you are good with looking on your own.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000193L', '2018-10-31 02:45:45', 'Interior is super cool and chill & the place has numerous decorative pieces if you look carefully.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000064S', '2018-12-30 04:25:25', 'Sicilian pizza here is amazing, as is the Alfredo sauce. Food and service are both great. Ordered pizza and cheesy bread for pick up, and everything was ready when I got there, no extra wait. Will definitely be back to try some of the other items on the menu :)');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000167N', '2018-05-11 03:47:45', 'So if you are even a little claustrophobic,  be warned, you won"t be comfortable here.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000107C', '2019-06-14 21:28:12', 'We arrived early to avoid long waits and drunk people.  By the time we left, we might have been the very people we were trying to avoid!  Drinks aside, we enjoyed the flaming fajitas!  We ordered the fajitas for 2 with steak and shrimp.  It is more than enough for 2 people.  My hubs and I made 7 fajitas from the meat.  We can"t speak to any of the other food.  OH WAIT!  Now I remember, we had an AMAZING desert.  A sopapilla topped with ice cream and strawberries.  It was DELISH!!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000107C', '2018-02-14 19:05:04', 'I love coming to pastel ! My favorite items are the black sesame crepe and the green tea crepe. Their waffles are good too, but I personally like crepes more. The ice cream and whipped cream is not too sweet which I like. I recently tried their matcha batter crepe, it wasn"t bad, but I prefer sticking to plain crepes with green tea or black sesame ice cream.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000101O', '2018-07-19 20:36:45', '[me] No.. but lets try it.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000126F', '2018-07-04 19:51:29', 'Not happy.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000064S', '2019-04-20 03:26:30', 'Not going into great detail. But I brought my car in for a problem I knew it had. They inspected the car and gave me an astronomically high quote on repair. The staff was very nice and place was clean and neat. I simply could not afford the price they gave. After continuing to research the repair needed and shopping around for quotes I know for a fact that these guys quoted double the going rate and what I ended up paying.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000107C', '2018-09-27 23:23:08', 'Unfortunately we had no room for dessert but the meal was definitely above out expectations.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000267T', '2019-09-27 00:20:51', 'We finished eating and paid for the bill at 7:50p.m. I turned around and noticed FOUR empty 2 person tables. They had never been sat, but we had to sit with an unfamiliar couple!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000294V', '2019-09-13 02:36:22', '9 months later... And 3 days prior to my wedding I went to the final fitting just to discover that the seamstress" alteration made the dress too tight... Something that was supposed to be a very simple fix ended up messing my dress with only 2 days left, which means not enough time to fix anything. The customer service is only good when the manager is there... The other ladies aren"t really helpful and I definitely had a very low opinion about this store... The selection of dresses they carry is very good and the service is amazing while they are getting your business... The follow ups and fittings/alterations can only be booked Monday to Thursday and the customer service experience is quite bad');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000122F', '2019-04-26 13:06:07', 'Love this hidden gem!  The food is excellent, well-presented and affordable. I have tried the Kiss Taco, Kiss Papa Taco and Kiss Salad...all delicious!!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000122F', '2019-03-16 20:31:17', 'So I once went to see Brent Spiner, the guy who played Data on Star Trek, talk at a convention (i"m cool) and he opened his little talk by telling us all about how the night before, he"d had a truly unique dining experience.  He went to Burrito Boyz.  His only regret?  Not getting a large.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000219A', '2019-02-06 20:05:38', 'Both of those tasks sound SO easy - and they should be - yet we still waited in line for about 40 minutes to accomplish these two tasks.  The entire time, we and everyone else in line are talking about how inefficient this place is and you would think the managers would see this once, and rearrange things to make it easier.  After all, we really wanted a beer - we could have been through two rounds at the bar in the same amount of  time we spent waiting around to check in.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000243L', '2018-02-23 03:57:49', 'When looking up hotels to stay in, I was skeptical about this and many other hotels, as one usually is in a city the"ve never visited. However, I was extremely pleased with my stay at Platinum.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000268B', '2019-09-14 09:15:00', 'Lemon Sorbet:  Frozen sorbet in a scooped out lemon, menu says imported from Italy.  I actually liked it better than the sad face Tiramisu so hubby swapped with me because while he usually loves anything lemon, he found an odd aftertaste.  I joked it was the jet fumes to bring frozen sorbet from Italy but the truth is, it was the perfume worn by the woman at the table next to ours.  Thankfully she arrived as we had dessert, so our entire meal was not ruined, but the smell was so overpowering that it gave us both a headache and we wanted to get out of there fast, since with the cramped layout she was almost on top of our table.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000219A', '2019-03-19 13:33:58', 'The Buffalo  (seems like a standard combo of whirl and franks) someone is mixed in a way that exceeds other standard buffalo combos.   Also enjoyed the dry cajun.  The sirachi were a bit of a miss though.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000219A', '2018-09-14 11:46:12', 'As for freshness, only what I think was the hamachi was maybe off. I am sure it depends on when you go. I tipped the guys working the buffet (as well as my server) because I thought they were good enough to warrant it.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000229S', '2018-04-10 19:41:31', 'Room: Can I tell you that this room was EVERYTHING in LIFE?! Ok. There I told you. I was in room 402 I believe. This room was in fact a suite. I felt like it was an apartment and I had a lease. Freaking HUGE! It had separate areas for a kitchen (complete with full fridge, stove / oven, microwave, dishwasher and bar), living room, balcony, bedroom with 2 queen beds, a safe, closet and tv and bathroom with closet, garden tub, separate bathroom and double sink vanity. The bathroom was the size of most rooms. Completely clean!!!!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000171X', '2018-07-06 19:03:14', 'What a great class.. I feel refreshed! A great studio as well - nice and roomie. Looking forward to my next class!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000229S', '2019-09-22 17:04:59', 'Best Chinese food in LKN area. Never disappointed with the take out we get.  They speak English well too!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000238W', '2019-03-10 19:37:28', 'If you just need glasses and lenses and are fairly routine in your needs, you"ll probably be fine. But I"m going back to Oakland I guess. The office staff just can"t handle anything.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000067A', '2018-07-19 13:14:05', 'Imagine, if you will, a bright, airy open market full of colorful fruit and vegetables from farms around the region, rows of farm fresh eggs, coolers filled with Amish chicken and local ground beef...yeah, right. No, really, it"s true. I"m not saying this place is perfect, but for an area of Cleveland more known for it"s shady strip mall bars and giant cemeteries it"s a breath of fresh air. It does what Cleveland and the rest of the nation needs, it encourages consumption of fresh, local foods. So what do they have to offer?');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000171X', '2019-05-04 15:05:42', 'The food was very good and the drinks were fantastic but more importantly the service was outstanding.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000067A', '2018-05-21 20:47:33', 'My husband and I used to order from here more than I"d like to admit (almost weekly). The pizza is pretty mediocre, but it"s really cheap and convenient. The cheesy bread, subs, chicken fingers, and onion rings are pretty delicious. We always order online (which I love), it"s right around the corner, delivery is always under 45 minutes (yes, we"re that lazy and really hate winter), and the delivery people are always super nice. Sadly, they had to go and screw up the good thing we had going.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000238W', '2019-09-13 08:57:52', 'The show was def entertaining, with finely sculpted men ripping off their shirts and dressing up in firemen/spartan outfits ;) The occasional view of g-strings was not as welcome, something about a man in a g-string is just wrong, you know? but nonetheless, it was very entertaining. The emcee"s accent was hot, and so was his bod. i think i found him the most attractive out of all the guys. They pulled a lot of the bachelorettes and birthday girls onstage to participate, and some of the older women too, which i thought was cool. They also ran around through the audience as well, so no matter where your seats were, I think you"d be able to get up close with one of the guys.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000229S', '2018-07-07 12:07:28', 'Secondly, they really nerfed the size of the Dutch Baby here. I worked up my friends at how awesome and overwhelmingly large the Dutch Baby is (and that you could share it with two people), but it was a disappointment. It was bit dry, almost burnt and stale tasting.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000229S', '2019-02-01 01:52:35', 'I stopped in before Christmas and received a welcoming tour.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000226U', '2019-03-29 20:36:25', 'None of these things happened.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000226U', '2019-02-10 03:55:37', 'I adore Ikea! There is nothing better to me than seeing a piece in it"s functionality and how it will work in a room, hence, the showroom.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000067A', '2019-06-25 02:31:10', 'This Gold"s is a pretty good gym..for the price. I just have the cheapest membership, which is all I need. When you join they do snake a few charges on you that you don"t expect but everybody who gets your credit card does that nowadays don"t they? Basic membership probably comes out to around $170 a year and that"s not bad at all.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000120U', '2018-04-16 13:11:41', 'standing.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000120U', '2018-06-18 14:42:58', 'The food:');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000048W', '2018-07-12 09:43:17', 'I have never had bad service here.  All of the order takers and servers are friendly.  The burgers are nothing spectacular, but are good.  I love that you have the option to have tater tots, more fast food places should offer them as well!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000258P', '2019-04-08 02:08:40', 'This is my new favorite restaurant in Surprise, which isn"t very hard to do because surprise is full of nasty chain restaurants. However, if you want to eat some darn good vietnamese food, this is the place. The pho of any type is amazing, even to go. Also try the spring rolls. Make sure you wrap them in the lettuce with a bit of mint, the texture is bomb fool! It gets a little crowded around 6pm because all of Sun City eats dinner around that time. So show up around 7pm and you"ll be fine.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000090V', '2019-09-07 03:38:46', 'We returned for breakfast the next day.  Breakfast menu was considerably smaller and a lot less options, but the food was really good.  I had the ham & cheese omelette, which was great.  Large portion of toast accompanied my omelette, and the crispy potatoes that came with the omelette were really good.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000281B', '2018-11-07 20:17:44', 'You go to a casino to gamble money ,not your health!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000075D', '2019-09-15 10:35:22', 'Great Columbian street food place.  A lot of options in the place that it"s located, but I think we chose right.  We got the hot dogs, Columbian style, empanada and yucca.  All great!!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000068V', '2018-09-22 03:39:53', 'First time I had the fried chicken. It was delicious, but be warned, extremely salty. I couldn"t even finish the last piece of chicken after experiencing a salt overload.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000197C', '2018-02-27 05:37:45', 'The service is slow & my salad, which was $15, was as bad as it gets.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000017C', '2018-10-11 02:54:16', 'My hubby got the crab tortellini and also loved his. I heard "mmmm this is so good" from all around the table. Our waiter was super nice and even gave us free desserts because we were some of the last people in the restaurant. Service was very slow and the place was PACKED but we had our jugs of wine and a large group with good conversation so it didn"t seem to bother anyone.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000120U', '2019-07-22 17:34:08', '(Back to Yard House for real food)');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000017C', '2018-09-07 20:38:22', 'Sexy, swanky Art Deco/Craftsman interiors with nightly piano.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-01-12 10:20:47', 'A0000213C', '2018-02-04 08:30:14', 'Looked this place up before making appointment, April did a great job. I had to wait a while even with an appointment but they apologized and serviced me and my daughter to our satisfaction. Their hot stone massage was great and you get a full foot and calf massage as part of the $20. Great price, good service.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000090V', '2018-01-06 22:31:27', 'We were craving breakfast food and decided to check this place out. We shared a skillet and a few breakfast sides, each of which were cooked to perfection and super tasty. The atmosphere here is cute, clean, and just what you want for enjoying your breakfast.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000048W', '2018-12-30 04:58:15', 'She uses clumps of lashes that fall off within 12 hours. Your eyes will also be completely bloodshot from whatever glue she uses. I let her know and even sent pictures of my eyes because they were so red and painful I thought they were infected. She blamed it on me and offered to "fix" them for more money. I declined - there was no way I was letting her do any more damage. I have had my lashes done before and since with professionals and have never had that happen. I love the lash service at wishful winking and the spot in Liberty village.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000075D', '2019-09-25 07:10:21', 'Our party was big so we were seated outside on the patio which was enclosed and heated.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000197C', '2019-09-16 15:50:21', 'Man, I love Toronto! Hiding in a strip mall on Overlea, find a dingy looking restaurant that serves up fantastic, cheap kabob...be warned regardless of when you come here you"ll likely be waiting for a table as this place is always overrun with people...If you"re a fan of perfectly grilled spicy meat, you must try this place out...now that I"ve been here I need to limit how many times I go here per month :)');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000213C', '2019-07-06 21:31:32', 'After agonizing over where to have our one upscale meal in Montreal, we decided on Chez L"epicier.  We were glad we did.  We did the tasting menu will wine pairings (note that 2 courses do not come paired) and our "journey" included a savory macaroon amuse bouche, gazpacho, gnocci, cod, goose, foix gras, and more.  The tastes were small but hearty, most with a delicious inventive sauce.  The wines were great and ran the gamut of classic French wines, and were well paired.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000160N', '2018-06-02 15:45:45', 'notes: 1 visit, breakfast/lunch');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000197C', '2018-04-20 22:27:26', 'The fish is always fresh and inventive. My favorite is the sashimi salad. It"s my all time favorite, the vinaigrette is a perfect tartness in contrast with thin strips of salmon, tuna, octopus, and mackerel. I could eat it forever. Other menu items are always cute and beautifully presented. There are even local nods to the Flames, with the "Red Mile Roll," and "Red Hot Flames Rolls."');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000281B', '2019-02-08 21:23:44', 'standing.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000068V', '2018-02-21 17:33:50', 'Also a random note: despite its appearance as an old fashioned diner, I got a very hipster-y vibe from it once I got in.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000213C', '2018-09-28 17:44:15', 'I"m from LA and been looking for an awesome cut here in Vegas. I got that here from Favio. He took his time and gave me EXACTLY what I wanted. I"ll definitely be back!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000075D', '2019-06-25 05:29:32', 'Went here on new years day to grab a burger. Got in before the OSU game started. Tasty $5 cocktails (in pint glasses, mind you) and good burgers. The fries have large grain salt and were well prepared. I had the Oh Cheesus, which is a burger to be reckoned with. Seems a bit like a rip off from Melt but I didn"t care, it"s a burger between two grilled cheese sandwiches (with more cheese on top of the burger)');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000017C', '2018-02-15 19:48:07', 'Very impressed. Jim from Dodge plumbing came out today and presented a very rational and logical argument for why his company should not take my money to convert over to an electric tank-less water heater due to out current logistics and electrical set up and why instead we should forgo this and stick with a gas system to save us money.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000090V', '2018-08-27 16:47:54', 'Excellent service quality.. I bought my car here and this is my car"s first oil change service. They are very professional. I definitely recommend this place.  Since I bought my car here, they did everything free for first time. I checked the receipt and the prices are decent when compared to other auto service centres.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000017C', '2019-10-24 02:45:24', 'One of the crappier Marriotts I"ve ever stayed at. The staff is nice and professional enough. But the fact that it"s right by the frontage road along I-17, you tend to attract a seedier crowd. Also, with three floors worth of rooms here, guess how many washer/dryer they have for everyone? ONE crappy washer and ONE crappy dryer! Don"t even think about washing your clothes on a Friday night. For a two hour period, I went to see if the washer was finally available, each time I was met with yet another load of dirty clothes inside. If they can"t afford to get more machines, consider installing one of those number ticket dispensers! Just a thought. Maybe I would have a better shot of washing my clothes. I also considered sitting on top of the washer until the load was done, but that would be kind of creepy on my part. I will be packing all my dirty clothes with me and never come back here again.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000197C', '2018-06-24 22:40:51', 'I would definitely go again if given the chance.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000068V', '2019-04-14 08:29:16', 'They were very friendly and humorous there! They all used English talking to patrons and with each other, which was great!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000068V', '2018-07-31 22:58:08', 'I stumbled upon this ice cream store and seeing the high reviews on Yelp, went in with high expectations. First off, the prices are fairly high considering the size of the cones and cups they use. It"s almost $4 for a small scoop, which is pretty overpriced in my opinion. Their flavours are a little more creative than most traditional ice cream stores and it is marginally creamier. The Noah I had was pretty neat with some different ingredients mixed into it as well. But, not worth that price and on some hot summer days, that lineup.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000213C', '2018-02-06 22:45:40', 'What a cute place! I was visiting relatives in the area and we went here to grab coffee and breakfast. The egg sandwich I got on a bagel was HUGE and tasty, but it was pretty greasy. The coffee is really good and the service is fast and friendly. I recommend it!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000107C', '2018-06-18 20:30:11', 'Mexican cafe with lively atmosphere and decent pricing.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000064S', '2019-09-12 06:32:26', 'Wonderful experience. We sat outside on the patio and watched the Food Channel and listened to music while going over the menu and having a great conversation with out out-of-country guests. The patio is a good place for kids because the patio can drown out even the loudest child.  If you have a need for food with a great bite to it, this is the spot. We only waited 20 minutes for a table for 8 at the peak dinner hour of 7-8. Our server was quick to greet us and get our drinks to our table. We ordered the sashimi wonton tacos and sausage cheese dip with pretzels wrapped with pepperoni. Tuna was fresh. Wontons not greasy. Wasabi sauce with enough zing but not enough to over power the tuna. Pretzels and cheese dip was nice and hot. Pretzels sprinkled with parmesan cheese and crisp.  Entree"s were big enough to serve two people! Beef brisket, beef short ribs, pork ribs, Caesar salad, bacon cheese burger all packed with flavor. Caesar salad comes with a huge garlic crouton, which my daughter cut up and we used it to finish up the sausage cheese dip! Caesar dressing was fresh. Corn bread and macaroni & cheese sides tasty. Ordered the cheesecake for dessert. It was large enough for our party of 8 and we left some of it there. Asked our server to put the pretzels, fudge sauce and potato chips on the side instead of on top, which they did.   If your stomach is sensitive, you may want to ask for the various sauces on the side because this isn"t a place to miss. It"s not that the food is spicy, it does the dance of the happy on your tongue and in your tummy. For some people, it may be too much but for me, this is a good thing!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000126F', '2018-12-15 22:08:33', 'Value:  Here"s where I thought this place shined.  Meals were in the $18-30 range, including salad and potato.  They have $10 sandwiches, too, but they"re not served on Fri/Sat until after 9pm.  Seems fair.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000211O', '2018-01-03 00:25:28', 'AWFUL AWFUL PEOPLE! I"m only giving them one star because I can"t post otherwise, but they"re not even worth that. I used MovingAPT.com to find them - won"t ever use them again either. I thought having an agent would prevent this kind of crap from happening. I don"t even know where to start with my complaints; this entire move was a mess from the beginning due to lack of communications and professionalism. I paid extra for a specific move date and time, as well as a "special handling fee" because of my piano.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000254G', '2018-10-05 10:27:53', 'If you need tires, this is a must visit.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000254G', '2018-07-23 23:53:33', 'I went to Itech Customs for just a quick quote on my iphone6s screen/ front camera crack. iTech fixed it all for $75 when Sprint was going to charge me over $150. Thank you & I will definitely be back for any issues that I have with phone repair! I"m extremely happy and impressed! I"m recommending iTech Customs to all of my friend!!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000126F', '2018-06-06 08:09:34', 'I"m never disappointed picking up a slice at Desert Ridge slices - the kids love  it, and I"m a fan of the NYC triangle slice too. Plus, I pick up all my weekly magazine reads in their shop as well.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000167N', '2019-06-07 02:21:34', 'I was a little disappointed that 2 groups of women with sundresses came in 30 mins after me and received their food before me.  There has to be a Happy medium.   It"s not right to let the "sex sells" slogan consume your site of all customers being treated fairly and equally.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000107C', '2018-12-11 13:52:12', 'Recommend the fish filet and jelly fish.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000211O', '2019-03-15 05:47:37', 'I always like to chose a signature burger so I opted for the Spicy Cajun Burger and combo"d it up with there Beer Battered Rings and a Jones Strawberry-Lime  Soda.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000193L', '2018-09-13 17:22:04', 'When it was time for dinner we picked a bottle of sparkling sake called "hana awaka"....it was sincerely the best sparkling sake we"ve ever had.  It was a little pricey (then again, what"s not pricey in Vegas?) but it was definitely an amazing experience to try something new!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000064S', '2018-11-13 19:35:00', 'Wait...what? Oh...it"s Vegas!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000211O', '2018-02-05 02:52:42', 'Love coming back to this location, one of the best ones I"ve been to. Have tried other buffalo"s and they don"t top the service from the metro center store. We always get helped out by Chelsea and she is awesome always has a smile and makes us feel at home, also the team captains are always checking to see if we are good with our orders and drinks');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000211O', '2019-09-13 03:57:29', 'I just can"t get over the interior though - I think the lighting is just SO BRIGHT, they would do themselves a favor to get a lighting scheme designer to come in and adjust things a bit - make it less of a cafeteria. It reminds me of a place in California - Chevy"s... same sort of set up and theme.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-07-13 12:38:14', 'A0000126F', '2019-08-18 02:35:59', 'Watch the game somewhere else.....');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000068V', '2019-03-24 06:01:30', 'I will say that the fruit was fresh and yummy (melon, berries, etc.) and the desserts were good, but it wasn"t enough to make me want to come back here ever again.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000272I', '2019-08-17 19:26:46', 'Palermo"s was a pretty decent pizza for the price. I got the chicken fingers and pizza special for $12, which was a great deal. The delivery was a bit slow but free, so no complaints there. I"d order again.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000090V', '2019-10-21 10:38:38', 'My wife and I participated in the MS Walk and decided it was the perfect opportunity to give the famous River Cafe a try.  What a beautiful spot and a great ambience.  We were greeted by a couple friendly hostesses and shown to an indoor table as the patio was full.  We got a great spot by the window that opened, so a great compromise.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000197C', '2018-11-21 03:33:29', 'The Buffalo  (seems like a standard combo of whirl and franks) someone is mixed in a way that exceeds other standard buffalo combos.   Also enjoyed the dry cajun.  The sirachi were a bit of a miss though.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000281B', '2018-10-20 18:19:53', 'Imagine, if you will, a bright, airy open market full of colorful fruit and vegetables from farms around the region, rows of farm fresh eggs, coolers filled with Amish chicken and local ground beef...yeah, right. No, really, it"s true. I"m not saying this place is perfect, but for an area of Cleveland more known for it"s shady strip mall bars and giant cemeteries it"s a breath of fresh air. It does what Cleveland and the rest of the nation needs, it encourages consumption of fresh, local foods. So what do they have to offer?');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000160N', '2019-09-04 06:21:32', 'Great customer service! Lisa and Marie were a big help with deciding what I needed. With so many places to choose from it"s great to find a national level business treat you like new neighbors.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000090V', '2018-05-09 09:38:33', 'Just a great place. Perhaps my expectations were set by all the bad service reviews, but I was not disappointed.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000075D', '2018-06-07 05:18:32', 'I am short. Pants are always waaaay too long. I have been taking my pants and jeans to Maria since we moved to this area 4 years ago. She always does a wonderful job and is very upfront about her pricing. I would be heartbroken if she ever closed up shop.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000068V', '2019-07-06 16:45:11', 'BE AWARE OF THIS LOCATION!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000160N', '2018-06-07 01:21:26', 'We have had a wonderful experience with Dr. Beals treating our son. He"s been seeing him for about 8 months now and are very satisfied with the care he receives here. Dr. Beals is very helpful, we never feel rushed to get out of his office and he"s patient in answering our questions. One of the things I most appreciate is that I"ve never felt like his solution is to throw a bunch of meds at my son. He"s conservative and has started on low doses, moving up only when we were comfortable. My son loves coming to the appointments and playing with all the Minecraft toys in his office!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000120U', '2018-12-14 17:12:33', 'Best chinese resto. Highly recommended. 5 stars. Let us support this business. Best in the west valley. Trust me you wont gi wrong coming to this place');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000160N', '2018-10-29 17:22:25', 'The food came and it was hot. It was delicious, mostly cause i was starving.. but it wasn"t something that was spectacular. My mother in law makes better beans and rice. The taco cracked as soon as i took a bite. Thats another pet peeve. Inside I cried a little.. Now all the meat cheese and lettuce was going to fall out. Well, that ruined my taco experience. Boo. The chile relleno was delish. Cooked to perfections and de-seeded, just the way I like it. Adding 1 more star just for the chile relleno. Overall it was good');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000068V', '2018-12-23 07:54:33', 'Yes, this IS as good as it gets!  Dr. Dameron and his team make going to the dentist actually a really good experience!  The whole staff is very professional, kind and accommodating.  Not to mention HAPPY!  The hygienists are just the best, as are all the staff.  Dr. Dameron"s work is beautifully done and my teeth have never looked or felt better.  I HIGHLY recommend this whole office to anyone needing work done!  You will not be disappointed.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000258P', '2018-12-27 08:00:07', 'Imagine, if you will, a bright, airy open market full of colorful fruit and vegetables from farms around the region, rows of farm fresh eggs, coolers filled with Amish chicken and local ground beef...yeah, right. No, really, it"s true. I"m not saying this place is perfect, but for an area of Cleveland more known for it"s shady strip mall bars and giant cemeteries it"s a breath of fresh air. It does what Cleveland and the rest of the nation needs, it encourages consumption of fresh, local foods. So what do they have to offer?');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000090V', '2019-09-19 05:12:35', 'I went to Itech Customs for just a quick quote on my iphone6s screen/ front camera crack. iTech fixed it all for $75 when Sprint was going to charge me over $150. Thank you & I will definitely be back for any issues that I have with phone repair! I"m extremely happy and impressed! I"m recommending iTech Customs to all of my friend!!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000090V', '2019-03-28 08:59:35', 'Ugh, I don"t care HOW ugly my toes look next time, I will NEVER go anywhere else besides Bella Nails again, they ROCK!!!!!!!  This place was appalling.  I didn"t want to make a scene, so I just paid the money, but I will NEVER go back!!!!!!!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000272I', '2019-09-25 03:27:28', 'As for the food itself, I"d call it "decent". The donuts were delicious, but the chocolate mousse-like dip it came with was rather tasteless. Actually, I actively didn"t like the chocolate dip and I LOVE chocolate. My duck scramble was good but nothing special. I loved the potatoes, but everything else just...normal.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000160N', '2019-06-23 11:39:34', 'Definitely recommend them!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000090V', '2019-04-22 22:02:44', 'Let"s just say I"m shocked. People are super friendly. have other food then donuts! It close to my work. Price isn"t too bad it is reasonable. It"s a great place to relax and get some work done');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000126F', '2018-05-02 09:06:38', 'I"ve been here a couple of times by recommendation from a Korean friend. The Jjamppong and Jjajangmyun are very delicious. It"s even better when they"re cheaper on the special menu days (rotates every other day). The portions are very generous. I usually share 1 dish with my friend. It"s $5.00 (Jjajangmyun - Tues,Thurs, Sat, Sun) and $6.99 (jjamppong - mon, wed, fri).');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000101O', '2018-11-16 15:06:39', 'Amazing service, great vibe, and fair prices.  Their Asian/Hawaiian fusion was perfect.  We"ll be back!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000268B', '2018-12-23 22:44:21', 'Anywho, there are a ton of great shops out there. And I"m sure these guys are good too. But I can"t justify paying double.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000268B', '2018-04-13 05:49:18', 'Fun for the children included the ferris wheel and carousel.  Since the Las Vegas Valley does not have a permanent ferris wheel and carousel to ride, we enjoyed taking a twirl on both.  Ferris wheel tickets were 4 tickets per person. Carousel tickets were 3 per person, but an adult is free if standing next to small children who are on the ride.  Each ticket = $1.25.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000230T', '2019-07-06 04:59:11', 'Even though our hostess did a terrible job, our server was lovely.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000025Y', '2018-02-21 01:32:00', 'Highly recommend this place - I know we"ll be back!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000129F', '2018-02-04 11:45:21', 'Never never never.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000174P', '2018-10-20 06:33:03', 'Hey, look its Viva Mercados!');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000243L', '2019-10-23 17:29:00', 'Bill Burr (He sells out pretty much every time. Buy immediately when announced)');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000243L', '2019-06-20 00:23:55', 'The arugula salad with goat cheese and lemon vinaigrette is to-die-for. I crave that dressing days later. So light and fresh but flavorful.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000243L', '2018-09-26 01:36:55', 'Tried almost all the appetizers and "small plates" and they were exceptional.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000041C', '2018-01-09 19:24:11', 'Wish I could give this place 0 stars. We have had issues here before with being seated (it took them 15 minutes when the place was empty one time), but tonight takes the cake.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000212I', '2019-03-27 13:49:13', 'The second line, is to "check in" - by which they scan your new membership card and ask whether you want a bay on a specific floor.');
INSERT INTO ForumEntries VALUES('CS3223', 2019, 2, 'P0000007K', '2019-10-07 20:32:44', 'A0000010N', '2019-05-26 16:55:57', 'the food is good, very high end .  2 of us ordered the prime rib, 2 others ordered filet, 3 others steak, plus apps of sashimi, tator tots, mashed potatoes,');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000249V', '2018-08-11 00:08:29', 'I have been getting monthly massages here for the past five months. A couple of the therapists are good, and some lack experience. As a stocking stuffer for my husband, I scheduled an appointment for him to meet with Roberta, a very capable therapist. When he arrived for his appointment, his name did not show on the schedule. Yet the gentleman working the front desk clearly remembered scheduling that appointment with me. He blamed it on glitchy new scheduling software. I was extremely disappointed and embarrassed, since it was a gift. But what else could we do but reschedule? An appointment was set, again with Roberta, through the same desk attendant, for this afternoon. When my husband arrived this afternoon, he was placed with a different therapist, who confessed that she did not know how to work with his specific shoulder issue. So he again rescheduled. This is getting ridiculous, and I"m considering canceling my membership over it.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000264R', '2019-05-12 05:18:41', 'For my hard lens it took time to get that correct as well, but that is expected. It also took me several times asking my Oakland optometrist to get my records faxed to them. McCauley-Celin at first said they never received them, but they then found them in another computer system. When the first lens didn"t fit quite right I went to the Wexford office to get it checked and left my lens there as it needed to be returned. When my new lens came they asked for my old one and apparently it was lost out there or somewhere. I paid for my lens with my FSA account but then was told that it should be covered under my insurance and that they would take care of it. That didn"t happen so I called to ask about it. They never got back to me so I went to their Gibsonia office and they said that they owed me money and it was fixed. This all again took several months.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000078A', '2018-06-16 07:53:31', 'The biggest seller is potato and cheese but they sell many flavors. They are like plump pillows of softness. You can buy them buy the dozen. You can get them cold to take home and freeze or warm and ready to eat. The warm ones are served with butter and onions.  It"s definitely a comfort food. The best part is that they ship internationally. Yes, they are that good.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000233C', '2018-02-15 04:15:55', 'Serene patio seating for fireside canoodling, sunset viewing or enjoying the early desert spring weather.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000131L', '2018-08-26 16:24:19', 'I had the turkey chipotle club wrap. It was ok. Nothing special but not bad. The fries are so good! My husband had the open face meatloaf and was really disappointed. He didn"t even eat half!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000131L', '2018-06-11 02:37:21', '1. Reserved table is always ready');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000233C', '2018-08-02 02:07:17', 'Well, we got off to a bad start.  My son fell asleep in the car on the way over (he"s five and had been in the pool all day) and I carried him into the restaurant.  At the register, I discovered that there was no children"s price and that I would be paying more than $30 to enter with my sleeping child.  Because it was mom"s birthday, I went with it, but I was annoyed.  No child is going to eat $30 worth of buffet food. They want the pizza and dessert and not much else.  Of course he didn"t want to wake up at all and refused to eat much of anything, so I paid for him to sit there and be cranky.  My bad.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000062J', '2019-04-30 07:35:51', 'Do yourself a favor and skip Wendy"s, McDonald"s, and for sure pass by the Taco Bell next to this place, you won"t regret it.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000010N', '2019-03-16 01:01:50', 'I will never rented from them.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000017C', '2018-11-05 13:08:17', 'Better than hot & juicy and boiling crab.. They would have gotten 5 starts from me, but they forgot my crab legs! The main reason I wanted to come here.. It was disappointing, but the flavors are really good and the seafood was very fresh.. I love that they use real butter in the sauce and not margarine like all the other crawfish spots!! So this will be my new seafood spot..');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000172O', '2018-09-08 03:42:56', 'Catch my drift???');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000295G', '2019-03-09 00:12:15', 'Our server was friendly and insightful, and always catered to our needs at the table, other servers were also helpful but tended to their own tables. Although there were several mistakes on our bill initially, such as wrong food and drinks and extra items being billed, our server fixed everything easily.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000167N', '2018-12-04 18:32:33', 'It"s a good casual spot for drinks and munchies in a cute neighborhood but nothing to write home about on a normal day.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000264R', '2019-06-03 16:31:19', 'I had this same waitress the Tuesday before accompanied by the same crummy service. That"s when I realized that it wasn"t just a bad or busy night (it was a Tuesday for crying out loud), but that this woman is just REALLY bad at customer service. Definitely do NOT recommend going there!!! Don"t know exactly which was our original waitress but our checks said Joanne G.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000233C', '2019-08-08 04:07:58', 'My regular cleanings are smooth and I"ve always appreciated the timeliness of each appointment. Any work performed on my teeth have been pain free and effortless which very much appreciated.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000172O', '2018-05-14 23:33:38', 'Wild every night! My favorite place hands-down in AZ! The night life here is contagious and Iv never been disappointed with there Sunday fun day! Every Sunday they have a corn hole competition and crazy drink specials like penny refills!! You also have to try there duck and pork tacos or there Hefe Hamburger! My favorite margarita on the menu is the la chica flaca. If you want a fun place to get lunch and a few drinks or looking to go crazy night this is the spot.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000249V', '2019-02-01 20:47:35', 'If youre coming here just for drinks I wouldnt say don"t go but if youre looking for drinks and asian food I would 100% brasserie Pamika, it is much better in terms of flavour and authenticity and also has a cool trendy vibe');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000131L', '2018-10-17 07:42:32', 'I ordered a simple naked potato and a side salad to accompany my steak. Both were fine. But there is not much room to mess up a potato and iceberg, is there? People rave about the garlic bread and I think it"s because the rest of the meal is so mediocre, that the cheesy bread becomes the highlight if the meal. It was just OK. The most inexperienced cook could make it at home with sourdough, butter, and three types of cheese.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000010N', '2019-10-10 08:23:57', '~G');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000135S', '2019-04-01 04:21:35', 'Definitely would like to try take-out next time.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000196F', '2018-07-01 10:50:51', 'Picture Homer Simpson when he sees something really delicious that he wants to eat.  His eyes close a bit, his mouth waters profusely, and he makes that mouthwatering gargling sound.  Do you have the image in your head?  Well, that"s probably me exactly when I think about eating at Jimmy"s!  It"s so delicious that whenever I think about it, I have an instant craving!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000028T', '2018-12-18 19:21:33', 'Overall the food is really good. We had bruschetta and it seemed to have just a tad bit too much olive oil on it. Had it had anymore on it we would not have eaten it. My husband had chicken Parmesan and I ordered a salad with grilled salmon. He said his tasted good and my salon was cooked perfect. I also enjoyed whatever the dressing was, I just wish it would have been on the side. For whatever reason it was poured on and also came with a cup of it on the side. We agreed that the prices seemed a bit high for the experience. It has a similar feel to Bravo but service just isn"t at that level yet (from our experience). Our sever did not know anything about the menu or what is fried in their fryers which should be expected at $18+ a plate. (We asked because of food allergies) She did however make sure to note allergies on our order which we appreciated! The music also did not match the setting. I really wanted to relax but the music was super up beat and almost had me rushing to leave. We will try again in a few months and I"ll update my review then.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000226U', '2018-09-26 21:20:00', 'I"m from Chicago were pizza is King and Pizzafarros is my favorite in Scottsdale!!!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000180L', '2019-09-14 10:33:57', 'In conclusion, the food quality is above standard, service and cleanliness is high, and the atmosphere is intimate. The food is more old fashioned, come here for a great steak done right at a slightly higher price range than the keg.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000171X', '2019-03-04 02:39:19', 'I was involved in the therapy.  And we continued in this joint planning over a month of treatments.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000199K', '2018-08-07 02:54:51', 'Everyone knows the hummus rocks. I love how they let you split up a small order between the roasted bell pepper and jalapeno cilantro. It"s like a little hummus sampler for less than $5.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000104O', '2018-10-03 22:50:08', '2. Amazing service');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000155H', '2018-12-30 12:39:33', 'Meat - Grilled perfectly, tasted average, but I found it too small compared to the bun.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000169M', '2019-09-25 03:55:02', 'The brisket nacho were really good!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000296W', '2018-07-23 09:04:59', 'Drink - 4 stars for the cucumber cocktail & bottle of Santa Margaritta Pino Grigio');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000287V', '2019-06-03 13:02:18', 'I will definitely go back once they revise their price!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000138V', '2018-05-25 21:26:43', 'I had the country fried steak and would recommend it.  It"s pretty small in the dining area, so I would not recommend a group larger than 4, even so 4 is pushing it.  Knocked off 1 star for cash only.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000013R', '2019-06-21 10:50:07', 'I always like to chose a signature burger so I opted for the Spicy Cajun Burger and combo"d it up with there Beer Battered Rings and a Jones Strawberry-Lime  Soda.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000137S', '2019-05-05 09:42:25', 'Do order the calamari and fried zucchini appetizers. Leave out the mussels.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000075D', '2019-05-21 02:01:13', 'Picture Homer Simpson when he sees something really delicious that he wants to eat.  His eyes close a bit, his mouth waters profusely, and he makes that mouthwatering gargling sound.  Do you have the image in your head?  Well, that"s probably me exactly when I think about eating at Jimmy"s!  It"s so delicious that whenever I think about it, I have an instant craving!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000013R', '2018-01-21 09:55:18', 'I recommend everyone stop in and give this place a try.  It is now on my list of regular lunch spots when I am on the N. Side.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000013R', '2019-05-22 07:24:17', 'Shared a fish tagine for 4 and it was also excellent!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000047G', '2019-04-19 21:33:01', 'I"ve stayed at ALL hotels on the strip. Even when Stardust and Frontier was around. I"ve encountered the atmosphere, the check-in lines, the restaurants, the pools, and the nightclubs of these hotels. HANDS DOWN, Venetian & Palazzo has the best to offer in luxury. Yes, there are clubs better than TAO, and better restaurants than the Grand Lux, but those hotels with don"t have great service or great decor or rooms as the Venetian. It"s like some hotels focus on one great trait (day club, night club, room accommodations), but the Venetian has it all across the board. Tables are loose, Rooms are suite, family side of pool and adult side. Cosmo is catching up though...but yeah The Venetian is definitely tight butthole');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000137S', '2019-09-02 09:14:27', 'Five stars! I highly recommend this place if you"re in the mood for authentic Latin American cuisine. Coming from someone raised in Latin America, I"m usually skeptical of restaurants that claim to have Latin American food because although the dishes try to imitate Latin American styles, they usually come up short and completely miss the subtle flavors that make these dishes what they"re supposed to be. However, Chica completely nailed it. The whole chicken with chimichurri is a must-have (we shared it among four people) and the small dishes were delicious as well. The mini arepas that came with the guacamole were a really nice surprise and the empanadas were simply amazing and tasted just like the ones back home. Besides that, the latin music was on point and the cocktails were great too!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000137S', '2019-06-08 22:16:14', 'Dear management, read your reviews. Common theme, crepes are undercooked. If you are going to be so bold to name your establishment after a certain food, you best knock it out of the park. IHOP makes a better chicken Florentine crepe. That"s shameful. I gave it two shots both were overpriced let downs. Their space can"t seem to keep a business longer than 2 years. I"ll be shocked if they stick around.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000086V', '2019-09-18 17:23:02', 'I booked a session and decided to also use my coupon for free Easter collage. The girl told me it would take 45 min to print. Showed up 45min later and I guess they were having issues formatting it to print out correctly. Hour and a half total spent waiting and the guy kept saying if you wait I"ll give a free print. I had already waited hour and a half along with session time and a five month old wasn"t going to deal with it much longer. I don"t travel to chandler often and live 30min from this location. I told them they needed to mail it to me and I left furious. Never again!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000047G', '2019-10-17 23:58:19', 'The patio is a great people-watching spot in the summer plus it"s bring your own wine which helps keep the cost down seeing as it is a tad overpriced.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000047G', '2018-06-09 18:22:47', 'There just isn"t any better way to watch a movie. Sound is incredible. Picture is awesome. I actually travel 1hr to see movies at this theater.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000075D', '2019-09-02 10:00:40', 'Dr.K. & Dr.B. will holistically bring your health & well being back into balance, not just treat individual injuries.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000088F', '2019-09-07 14:36:08', 'Had an awesome breakfast cum brunch.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000137S', '2018-08-29 07:00:08', 'This place rocks my world!!!! The servers are super friendly and the food is fantastic. I come here about 2 times a week and am extremely satisfied every time. They have a great happy hour too! Denise and Maggie are the best!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000075D', '2018-10-31 05:21:15', 'We arrived and Boy was this place busy, people standing outside waiting for tables and all. I went in to see how the list worked and there was a sheet of paper on the landing with no one manning it and several sets of people in the extremely small (6ppl capacity) entry way. I flagged down a server who then came to take my name and others waiting name down and explained to us all at once how the long table in the middle worked. Basically the table is 1st come 1st served and adding your name to the list put you on wait for the tables around the room on the outer perimeter. We were told 30min so we sat in the car and my husband went inside every 10mins to see if we were coming up since they don"t take numbers nor do they have buzzers. I totally don"t mind this process at all it seems more down to earth and not commercial.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000075D', '2019-05-31 16:09:48', 'Also we get the complimentary bread and butter AFTER we get our food. The homie has to ask for the bread and butter. Strange and not needed at that point.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-08-14 10:24:33', 'A0000154K', '2018-06-28 14:58:01', 'Amazing pizza!!! Although they did forget my cheese sticks I forgive them, but don"t let it happen again :)');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000047G', '2019-03-27 20:01:05', 'this hawaiian/korean restaurant brought me back to the local cuisine of  hawaii. I ordered the meat jun combo plate and it was good. the soy dipping sauce for the meat jun should be bottled and sold in markets. deifinitely stopping by to try the other items on the menu. The ALOHA spirit is deifinitely alive and well in las vegas..thanks to RUSSEL.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000072U', '2019-05-06 08:43:06', 'Denny"s food at Beverly Hills prices.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000140O', '2018-08-30 06:34:08', 'Just kidding. Desyree makes everything that goes into the gelato herself. Same difference right?');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000128N', '2018-05-26 23:46:30', 'I ordered the Akropolis Pizza and Pork Gyro. The first thing I noticed when the pizza came out was how vibrant the toppings were! You can tell the veggies are fresh just by looking at them. The gyro was one of the best I"ve had and the fries were awesome. Great service! They really care about giving you a good experience. I will definitely be back!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000138V', '2018-01-01 02:01:35', '- Cookies!  You must try their cookies.  I got so lucky and grabbed some white chocolate macadamia cookies when they were still warm.  Crispy on the sides and chewy and mouth-wateringly good.  I mean, I was stuffed beyond belief, but I couldn"t stop eating it!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000057U', '2019-09-09 11:20:30', 'I used Red Carpet VIP to set up my friend"s bachelor party. The customer service was awesome and all of my phone calls were either answered immediately or I got a call back within the hour. Everything went exactly how they said it would. We scheduled for 3 separate limo pick ups and all 3 were on time and the drivers were awesome and courteous. We also got a hosted entry to XS for that night, with Calvin Harris DJ-ing so it was a crazy line. Getting in was really easy, the host texted me earlier in the evening so I could tell him when we would be getting to XS and then arranged to meet us outside the club and walked us right in past the giant line (even past the endless line for all girl groups) of people waiting hours to see Calvin Harris. Honestly I can not say enough about how painless the whole process was and how awesome all of the staff were throughout the whole process. These guys are now my go to if I need to get in to a crowded event or club in Vegas.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000137S', '2018-10-14 00:45:36', 'Yet another example of a business cashing in on location at the expense of quality. Cocktails are chain-restaurant worthy, wine list is weak, and seafood is only barely competently prepared.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000057U', '2019-07-31 21:52:22', '-- I highly recommend the banana nutella crepes.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000057U', '2019-05-06 05:34:07', 'Great cocktails and very good food.  Overall first class restaurant.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000088F', '2018-09-05 23:59:46', 'We look forward to checking out other items and won"t come hungry');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000057U', '2019-01-28 04:24:18', 'I normally only write positive reviews online, but this time i want to let people know about what"s really going on there. I would NOT go there any more and I do NOT recommend LifeScape to anybody.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000088F', '2018-12-14 23:22:34', 'ended up here because Raku was closed and it received great ratings on Yelp.  I"m so glad I came here.  One of the better meals I"ve had.  Started off with the mushroom dish and the lettuce wrap.  both were amazing. the lettuce wrap is like having a flavor party in your mouth.  also had the panang duck which was terrific. highly recommend all three dishes. one dish that wasn"t so good was the seabass with drunken noodles. overall it was an excellent meal, intimate setting, and great service. definitely will be back.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000287V', '2018-08-12 12:48:25', 'Awesome breakfast!!! Had the Rubin Benedict and wow was it good! Loved it!! Kid friendly & mom approved,  in fact she had the Florentine Benedict... Good service and prices.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000138V', '2019-10-06 19:31:41', 'None of these things happened.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000106W', '2018-07-26 08:01:25', 'As for the tenants who are complaining, I am hard-pressed to believe that Rich and the entire Active Renter crew have treated anyone poorly or have not serviced rentals in a timely manner. There are also people who tear up property (not their property!!) and then complain when they get billed for all the damages.  These are probably the same tenants who punch holes in dry wall, steal furnaces (who DOES that!?!?!?!), damage landscaping, tear up concrete driveways, etc.  - and then later complain when they are held accountable for the damages they created.  It"s said that people who have negative comments are much more likely to post a review than people with positive comments - on a 9 to 1 basis!  So for every complaint, remember there are dozens, hundreds, perhaps even thousands of individuals who have wonderfully positive things to say about Active Renter, but just don"t take the time to post a review.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000295G', '2018-05-20 04:25:31', 'I"ve had the opportuniti to dine in, get carri out, and order deliveri (I"ll stop this now) from Lucki on many occasions in the last few months, so I can tell you that no matter which method you decide to go with for your thai food fix there you won"t be disappointed.  The first time I had Lucki I dined in and had the Tom Yum soup with Shrimp and their Crab Fried rice.  The Tom Yum Soup is consistently good, and I"d know since it"s been a staple of every single order I"ve made with Lucki since.  It"s always hot, with the perfect combination of sour and spicy, and loaded with mushrooms and an ample amount of shrimp.  The large order feeds 2 perfectly.  The crab fried rice is not something I tend to order, but Lucki"s version definitely packed a lot of crab flavor.   They also weren"t shy with the egg on the rice, and being an egg slut like Anthony Bourdain, that pleased me.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000125U', '2019-02-02 14:00:08', 'I think the prices were great for the Waxhaw area. I paid $57 (without tip) for a full set French manicure with sparkles, and pedicure with design. I used to pay $75 for the same service at my last salon.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000017C', '2018-08-24 16:04:11', 'I used to work food service and my manager at the time recommended I try Defalco"s. He knows food well so I was excited to try one of his favorites spots.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000152P', '2019-06-15 23:45:23', 'So I chose this place because they were open at the time I wanted to go pick up dinner at 4pm.  Ordered a Papaya salad and Pad Thai. They asked how I wanted it Mild Medium or Hot.  I stayed safe and said mild for both.  Well, when I got home and opened up the containers--of which they stupidly put them in one bag-dumb because papaya salad is always cold- I had to remove it in the car before heading home.  The Papaya salad was not evenly cut...their shredder is not working and it is supposed to be picked up like speghetti...this was clumps of papaya shredded half way. ALL I COULD TASTE WAS ONION. ONION...like eating a clumpy mouthful of ONION.  Horrid.  The Pad Thai had dry pieces of chicken and ZERO seasoning.  AWFUL. CRAP.  Waste of $17. NEVER BE BACK. They cannot produce Thai food that is worthy.  Instead of driving back to the place to return this...I"m writing this review. STAY AWAY.  Should have gone to Thai Plates or tried another place..these guys were the only ones open at the time I wanted food.  BAD DECISION. STAY AWAY. Headed to the fridge to eat crackers and cheese. TICKED.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000233C', '2019-01-01 18:00:55', 'Honestly, the best part about this place, in my opinion, is that it takes brunch reservations. I like the decor inside and it"s apparently a very popular drink spot, but I probably won"t be back for brunch unless all I want is an order of potatoes and a bellini.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000172O', '2019-09-08 07:06:53', 'This place will not be recommended to anybody I know');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000253B', '2018-05-17 14:57:50', 'Glad they"re open again!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000010N', '2018-02-25 16:52:29', 'I was very skeptical about this spot.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000249V', '2018-04-28 15:21:40', 'Not the best part of town.  Not particularly good (or particularly bad) service.  Even the food isn"t the best.  But the variety is awesome, and unlike many places, everything is pretty good.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000253B', '2019-04-19 03:16:52', 'But this particular Giant Eagle had one huge bonus: their bakery makes really good everything bagels... Better than the ones from the other Giant Eagle market district, even though that bakery is huge and fancy. Even before their renovation, I would go there just for bagels. Their donuts are just like other Giant Eagle bakery donuts...really good. Personally, I prefer them over Dunkin.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000078A', '2019-03-28 20:06:24', 'Last time I was in this area at lunch time, Chao was still being built. Now it"s open and today was my first official visit to check things out. I"ve only tried one entree from the menu, but if the other choices are anything like what I ate today I will definitely be a regular here.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000135S', '2018-08-18 07:29:53', 'Back to the Eggs Benedict. Everything on the Benny was cheap. The English muffin WASN"T TOASTED! Never seen that before. The hash browns were WAY too crispy.. Like eating unflavored Pop Rocks.. The Hollandaise sauce was just ok..');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000010N', '2018-07-16 07:16:44', 'I signed my papers and wrote my check but it was gym time so, we told David we"d come back for the car after the gym since they still had to detail it anyway. It was the most entertaining car-buying experience ever. We were all laughing and chatting about cars, the gym, nutrition, Hello Kitty, Yoda, etc. David explained and showed me what my car can do and at the end he said, "I wish all my clients are as fun as you."');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000135S', '2019-07-26 15:34:10', 'I"ve been coming to Loco on mill since they opened. I love coming here especially on Sundays for football. They have all the games on, great bloodys, and awesome breakfast!  Loco is my local watering hole and I always have a great time with the staff.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000135S', '2019-06-15 05:07:41', 'Brand wise, you"ll find upscale brands like Shoshanna, Amanda Uprichard, Alice & Trixie, Frock by Tracy Reese, James Jeans, Anlo and Citizens for Humanity. As mentioned, they have begun to add more affordable pieces from Greylin and LA Clothing. You"ll also spy a handful of accessories and handbags scattered about in a range of prices.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000264R', '2019-01-21 03:18:54', 'Warning: When the dish indicates it"s spicy, it"s spicy. Those were the spiciest enchiladas I"ve ever had, but I appreciate the spice. My gf, however, was fortunate in her decision to get the carnitas because she would have not been able to handle the enchiladas.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000233C', '2018-08-09 13:14:50', 'Red Carpet handles business.  No WAIT No LINES No HASSLE,  seriously though.  Why worry about lines in Vegas when you can pregame in the room and immediately step into the club?!?!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000135S', '2019-04-06 16:02:48', 'I tried a bite of the steak which was very tasty and the side of smashed/fried red potatoes were oh so good. I enjoyed my french onion soup and arugula salad as well.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000017C', '2019-05-21 05:09:53', 'Early this past January, I needed to find a furnished rental in the uptown Charlotte market. I really had no idea of how or where to look. I was glad when I found the Sold on Charlotte site.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000249V', '2018-08-21 06:14:05', 'This Post Office also has a automated kiosk, which is nice, because to can still ship items out when the post office is closed, or say you come here on a Sunday to ship something out (when the post office is closed).');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000163Z', '2019-07-17 19:15:37', 'My first time visiting Sabor today and all I can say is what an absolute spectacular culinary experience! Their Latin Street food was fresh and very, very tasty. The Empanadas were perfectly cooked and juicy, not dry at all. The street corn, which is a favorite of mine, was the best I have had so far. I can highly recommend their shrimp and steak tacos which were soft and had great flavor. We ordered sliced avocado, creamy cold quacamole and together with the rosa sauce and fresh lime on the side made for a meal levels above what we paid for or expected. I love that you have so many choices to choose from to make up a meal that will satisfy any food cravings or preferences you might have and it is fresh and clean. On top of this the staff is friendly and very helpful. Such a joy! My kids loved this perfect little addition to Davidson as well and I can definitely see us becoming regulars.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000222B', '2019-02-05 01:56:56', 'Our party was big so we were seated outside on the patio which was enclosed and heated.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000095I', '2019-01-04 10:02:42', 'I specifically go to this location even though it"s a bit far from me because of the friendly staff and great recommendations!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000163Z', '2019-06-12 04:46:48', 'Hy Steakhouse is a contemporary and elegant  traditional steak house, with lots of open space and an intimate dinning experience.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000255J', '2019-05-22 06:04:22', 'We celebrated a birthday in the Tatami room.  Beautiful private room, we sat on cushions  in a very cozy setting.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000222B', '2018-10-20 07:34:34', 'In need of a burger, this was the closest location from work that wasn"t your typical fast food joint.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000096O', '2019-01-26 05:37:01', 'Amazing Burgers. The combinations of ingredients is Fantabulous');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000129F', '2019-09-13 18:27:29', 'Lots of families and kids. No sense of intimacy - so not a date spot for sure - a good casual place to chill after shopping at the Pottery Barn though..');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000122F', '2018-09-11 03:49:42', 'The layout of the store recently changed. The women"s clearance section is on the far right of the store near the dressing rooms. The rest of the markdowns really weren"t too impressive. Some jeans were marked down to $49.99.Generally, I don"t buy jeans at that price. See, I"m searching for the best deal and that"s still pretty high for me.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000096O', '2019-03-02 14:19:46', 'For my hard lens it took time to get that correct as well, but that is expected. It also took me several times asking my Oakland optometrist to get my records faxed to them. McCauley-Celin at first said they never received them, but they then found them in another computer system. When the first lens didn"t fit quite right I went to the Wexford office to get it checked and left my lens there as it needed to be returned. When my new lens came they asked for my old one and apparently it was lost out there or somewhere. I paid for my lens with my FSA account but then was told that it should be covered under my insurance and that they would take care of it. That didn"t happen so I called to ask about it. They never got back to me so I went to their Gibsonia office and they said that they owed me money and it was fixed. This all again took several months.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000127E', '2018-08-04 02:49:36', 'We had a great stay at the Platinum.  I had no qualms at staying at a non-gaming (read: not a casino) hotel off the Strip.  It"s a quick walk to all the action (about 5 to 10 minutes to the Flamingo depending on how quick you pound the pavement).');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 1, 'P0000007K', '2019-02-17 17:27:31', 'A0000052Z', '2019-07-06 17:28:54', 'The nicest hotel I"ve ever stayed in in Vegas! Found a great deal during the week and couldn"t pass it up. Clean, staff is friendly and there"s so much food to choose from downstairs! Pretty convenient location on the strip as well. Definitely will stay here again.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000041C', '2018-09-23 18:26:16', 'Review #189 - 2016');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000032P', '2018-09-12 03:26:29', 'A pot of tea costs money and they automatically add the gratuity to the bill.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000176G', '2018-03-11 10:05:11', 'The food is great we did a rib eye & a sirloin pretty basic cuts, both were done correctly. The mushroom ravioli appetizer is special, the tuna as well...The decor is nice and makes this place a nice one for "special" dinners. As others have mentioned it is pricey with a good tip for good service we were at $185 for two appetizers, two sides, two steaks and one glass of wine... hummm....');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000188F', '2019-04-15 04:49:35', 'This place sucks.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000288E', '2018-10-16 08:42:47', 'Definitely a spot to check out when looking for a quality sandwich at a reasonable price.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000024S', '2018-12-30 04:09:52', 'Eyebrow threading is $4. That"s usually what it goes for at these places. No taxes on cash payments! I am not being racist but white places charge more and they don"t do a great job. So, always find an Indian or Arab place to go to for threading.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000288E', '2018-10-25 20:31:43', 'We love Kneader"s! Their French toast is literally the best French toast ever. And their breakfast sandwich on a croissant is sooooo yummy. We always have the best service there. Workers are nice and friendly and we get our food quickly. Highly recommend Kneaders! A great place to go to brunch with friends.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000032P', '2019-10-10 13:31:52', 'Service was amazing, Christina was extremely tentative and took care of our whole group. Asked about splitting checks from the beginning which for a large group is very convenient!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000189E', '2019-05-20 21:12:24', 'Definitely not the best looking places and the food was just OK. Crab rangoons were disgusting, I couldn"t even eat them and the chicken and broccoli was weird tasting, the gravy was really thick and the rice wasn"t the best i"ve ever had. It took five minutes to be greeted and to order my food. Will I go back, NO!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000288E', '2018-06-08 18:38:30', 'Jared to the rescue:');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000032P', '2019-06-20 01:42:48', 'Downside though, at the end of the show, you are welcome to go to the front of the stage and pay $20 PER PERSON to take a pic with the guys, only to receive one picture. no offense, but that is a total rip off. i"ve been to Fantasy, which is a female stripshow,  and you can take pics with them for free, and they had much better attitudes and were a lot friendlier to talk to after the show. They were annoyed that we had stood in like and decided against taking the picture after the show, and even more annoyed when a girl behind us asked if they took credit card. wtf? These men seemed way too jaded and full of themselves. They may be good to look at, but off-stage they"re total jerks.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000176G', '2019-08-01 18:11:27', 'My father in law passed away late Friday, June 2nd. We went to the funeral home at 12 noon Saturday June 3rd to make arrangements for his visitation, funeral and graveside service. We left after 2pm and went to another florist in the area that was a friend of the family. No offense to that florist, her selections were slim pickings and she didn"t seem too accommodating since she was low on fresh cut flowers because of "prom weekend". My wife was so upset because she wanted the perfect flower arrangement for her "daddy".');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000032P', '2018-10-03 04:16:05', 'Love this place downtown but the Scottsdale location has no manners. Sat at bar for 10 min while bartender ignored us. No menu, no water. We walked out and they could have cared less.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000189E', '2018-07-17 08:50:38', 'The only reason I"m even giving this place 2 stars is because of their food and drinks. Their service however, is probably the WORST I"ve ever had. I used to (emphasis on the tense) go there every Tuesday for trivia night (the guy hosting is awesome). My service has been absolutely horrible every time except for once when a girl named Jess waited on us. The rest of the waitresses are completely incompetent and utterly rude off the bat.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000227F', '2019-05-27 10:13:14', 'We love Kneader"s! Their French toast is literally the best French toast ever. And their breakfast sandwich on a croissant is sooooo yummy. We always have the best service there. Workers are nice and friendly and we get our food quickly. Highly recommend Kneaders! A great place to go to brunch with friends.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000201O', '2018-01-15 00:26:45', 'In the end it was just terrible.  My family and I went home unhappy.  And the thing is I love food, I work in the industry so I timing is very important.  Having only two servers is rough but it can not be the only excuse.  If there was something wrong or if it was going to take a little longer, they should inform the customers.  The worst part was watching tables come in before us and eat before we got anything.  I am never going back.  I really hope they clean up their act, there are a lot of pho places out here and if they don"t fix things it will be buried beneath the rest.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000279Y', '2019-05-23 10:46:53', 'Crowd:  Seemed happening, although it was Opening Night.  A wide mix of young and old.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000242A', '2018-12-21 01:24:30', 'Love the crust on this pizza. The sauce is decent, cheese is okay, the pepperoni was not the best quality.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000262K', '2019-06-03 10:50:42', 'I started going here more than 15 years ago (I think, more than 10 for sure).  I was referred here by my relative that knows the now famous Clarance, the owner of the place.  I told him I am the niece of such and such and he said he remembers them.  I didn"t have insurance for glasses then he gave me a very reasonable price.  He is very friendly and chatty, and despite our age difference (I am probably not much older than his children) we became quick and great friends.  I even go over just to chat after I got my glasses.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000123T', '2019-05-18 17:00:21', 'If you are looking for the best pierogies in Pittsburgh, this is your place. There are a few small tables outside but most of the business is carry out. Pierogies Plus wins Best Pierogies every year. Why? Because the owner is from Poland and she is making the real deal pierogies. The best part is that they are hand pinched by a group of older Polish and Hungarian women.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000158F', '2018-01-29 02:42:52', 'Brandy was amazing! Loved her personality and that she made all of us feel welcome at the studio! She is a great technician to boot! Highly recommend seeing this place if you"re interested in great photos of your baby!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000279Y', '2018-08-07 15:26:38', 'Complimentary bruschetta:  A plain Pizza crust with bruschetta topping which falls off and wasn"t that flavourful. Go to La Bruschetta to find out how it is meant to taste.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000230T', '2018-11-20 13:32:30', 'Service was amazing, Christina was extremely tentative and took care of our whole group. Asked about splitting checks from the beginning which for a large group is very convenient!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000048W', '2018-05-05 01:20:36', 'This place gets five stars and I can"t wait to go back. Please, please try this place. It was empty when I walked in and that"s a shame. They should have a lot more business if it was all based on the quality of their food and service. It"s also very affordable. Chicken enchiladas were $9 and the carnitas were somewhere around there (maybe $12).');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000230T', '2019-07-11 13:28:55', 'Paid for the works. They didn"t even wipe the dash or any of the interior. Outside still has crap all over it. Should have gone back inside and asked for a refund.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000097E', '2019-01-02 01:46:18', 'They administer a tablet form of survey asking about your condition and how it is affecting your life.  After the therapy has run its course you complete the same survey, so they have a before and after record of your condition.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000244V', '2019-10-17 23:05:35', 'I both attended and hosted multiple events at Sigmas - training, executive offsite meeting and a retirement party.  The staff are professional and very organized.  Every detail  has been considered - from extra insulated windows to keep out street noise to decaffeinated ice tea.  All the touches a trainer or meeting facilitator could wish for in the technology and variety of spaces (whether board room, lunch cafe, formal reception area, or training room).');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000097E', '2018-09-24 21:05:54', 'Had the occasion over the last few weeks to experience their sports medicine/physical therapy department.  Outstanding.  Drs. Anthony "Tony" Walker and Jennifer Hannon are a great team.  They really know their stuff.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000244V', '2019-09-20 20:14:28', 'First time ever coming here even though I live less than a mile away. I have to admit it was fantastic! I ordered the Surf & Turf taco plate. Both of the tacos were full of flavor and tasted very fresh.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000090V', '2019-06-19 23:06:09', '-A wall of bulk candy packaged in little containers perfect for hiding in your cupboard behind the quinoa and flax seeds.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000113D', '2019-05-30 15:25:06', 'I had to get my nails done last week when I was out shopping, so I decided to stop in and see if I needed an appointment or if they could take me. When I walked in, all nail techs were sitting around and there were no customers.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000279Y', '2018-07-21 17:10:30', 'The service was very good and the food came out hot and quick.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000242A', '2018-09-10 03:16:21', 'The perfect ending however, are the deserts.  They are all hommade, and terrific.  I can"t get past the pecan pie, perhaps the best in Phoenix.  The crust is just right flaky, and it"s loaded with pecans.  I"m hungry again just writing this review');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000133D', '2018-07-05 17:23:23', 'It"s a very high energy show that he never lets up... he just goes and performs his little heart out much to the enjoyment of the audience.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000161B', '2019-05-15 17:38:18', 'Also the Cancun fries are awesome. 1 order is for sue big enough to serve 2 people maybe even 3!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000136L', '2018-08-08 06:25:50', 'The biggest seller is potato and cheese but they sell many flavors. They are like plump pillows of softness. You can buy them buy the dozen. You can get them cold to take home and freeze or warm and ready to eat. The warm ones are served with butter and onions.  It"s definitely a comfort food. The best part is that they ship internationally. Yes, they are that good.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000239H', '2018-01-17 02:50:51', 'Five stars! I highly recommend this place if you"re in the mood for authentic Latin American cuisine. Coming from someone raised in Latin America, I"m usually skeptical of restaurants that claim to have Latin American food because although the dishes try to imitate Latin American styles, they usually come up short and completely miss the subtle flavors that make these dishes what they"re supposed to be. However, Chica completely nailed it. The whole chicken with chimichurri is a must-have (we shared it among four people) and the small dishes were delicious as well. The mini arepas that came with the guacamole were a really nice surprise and the empanadas were simply amazing and tasted just like the ones back home. Besides that, the latin music was on point and the cocktails were great too!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000120U', '2018-01-20 19:37:29', 'As for the food itself, I"d call it "decent". The donuts were delicious, but the chocolate mousse-like dip it came with was rather tasteless. Actually, I actively didn"t like the chocolate dip and I LOVE chocolate. My duck scramble was good but nothing special. I loved the potatoes, but everything else just...normal.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000231F', '2018-10-18 23:28:56', 'Ok so I have purchased items from RC Wiley and have spent a lot of money but will never again. I had a $500 credit limit after I purchased my fridge and when  iwent to use it towards ny bed room purchase it was no longer available due to me paying it off too soon????? (Apparently since I paid $500 in 2months instead of $25 in 10 months) When we attempted to question what they meant and if there was anything that couldbe done the supervisor emele pretty much told us to take a flying leap -are you serious!!  So I spent my $2300 at Ashley furniture. RC Wiley apparently is balling and they don"t need me to buy anything. Good luck! when u have poor customer service reps representing you like that their making your company look bad.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000147I', '2018-06-03 03:11:58', 'I seriously love Jimmy"s so much.  I miss the days when a friend used to live behind the store and we ate there almost everyday.  Now I have to go a little out of my way to get there, but it"s totally worth it every time.  I love Jimmy"s so much and I"m positive that everyone who goes there loves it too.  It"s just one of those awesome finds that everyone in the world should know about.  *insert Homer Simpson drooling here*');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000247B', '2019-10-09 08:04:31', 'Loco Patrõn is my favorite Mexican restaurant in the valley. When I first tried Loco Patrõn I wasn"t expecting it to be great, I figured it would be typical bar food. But I was blown away by how delicious the food was! The presentation is fabulous and the service is always prompt. It is a great place to take your friends or family. I highly recommend it!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000194A', '2018-02-06 03:59:38', 'way overrated, owner and manager have a seriously lousy attitude. Overpriced for sure. Bumpers is the place to go for the crab legs, not mushy like Pickle Bills. They have the river right outside the place so they feel they can justify the increased pricing.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000289B', '2019-09-01 03:14:51', 'On our last visit ( less than a week ago) ,their baked beans were different...hopefully it was just a hiccup because they are usually incredible.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000043D', '2018-03-02 06:47:28', 'I contacted Sammy a couple more times throughout the weekend for various things, and he was more than helpful even though we weren"t using them for additional reservations or nights out.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000297I', '2019-05-22 07:54:03', 'The place is usually pretty packed but on a week night you can usually get a seat without having to wait.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000194A', '2019-06-29 22:29:51', 'I"ve had Jimmy John"s before several years ago in Minneapolis.. But apparently here in Phoenix, the store personnel must be trained differently. I had to take my sandwich back up to the counter twice to get the thick headed folks working at the one on Camelback at about 16th to get my sandwich the way I wanted it.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000175P', '2019-09-07 21:23:06', 'Best barbecue this side of the Mississippi!!!! Come here your car washed and detailed pick up some Petroleum, and slap your lips around the best barbecue you"ve had in Arizona!!! Hot diggity !!!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000289B', '2019-06-09 10:44:54', 'I"ve been coming to Loco on mill since they opened. I love coming here especially on Sundays for football. They have all the games on, great bloodys, and awesome breakfast!  Loco is my local watering hole and I always have a great time with the staff.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-04-16 17:43:23', 'A0000239H', '2018-01-31 09:32:15', 'Our regular plumber is great, but a little pricey, so we decided to try someone new.  Belsito"s rating on Yelp made us give them a try.  We called on a Saturday afternoon for a non-emergency.  They told us someone would call us back and let us know when they could come out.  About an hour later the doorbell rang and it was the plumber.  Luckily we were home as we never got a call.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-05-28 12:42:01', 'A0000243L', '2019-09-17 18:56:57', 'The draft beer selection is great the tapas style menu is a perfect match and the upstairs is a great after work gathering place. But the best thing about this place is the bartender named Siti (sp) he is one of the best in Charlotte.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-05-28 12:42:01', 'A0000232Z', '2019-07-12 06:11:54', 'The servers are great and friendly.... but relying on two servers to wait on 100+ customers says a lot about how inexperienced management must be. In fact, after waiting 15 mins at a dirty table I was finally able to track down someone I guessed was an employee to let them know we were even there!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-05-28 12:42:01', 'A0000206Z', '2019-09-15 16:41:59', 'It"s so popular that I didn"t try it until recently. The bubble tea here is really good. It"s pricier than the one in Rose tea, but you also get more.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-05-28 12:42:01', 'A0000265D', '2019-06-11 04:18:51', 'Two stars or even one if not for the Bloody Mary meal or Jack Daniels chocolate cake.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-05-28 12:42:01', 'A0000232Z', '2018-04-10 04:40:25', 'The service was exceptional and we rarely waited for anything we needed. Our server asked my boyfriend if he wanted another diet coke, she cleared our cutlery from the greek salad and replaced it when our platter came.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-05-28 12:42:01', 'A0000059N', '2019-09-04 08:30:46', 'Good place always willing to stop by n shop. Hate that they dnt have what they are kniwn for but some of the buttenders help out !');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-05-28 12:42:01', 'A0000019J', '2018-11-07 20:35:09', 'Our food was amazing, we had a second bottle of wine, which was also amazing and although my friend finished all of his food, I"ve never been able to finish a full plate of pasta in one sitting, so I brought some home. I actually ate the left overs, which is unlike me.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-05-28 12:42:01', 'A0000085R', '2019-09-06 05:43:07', 'I was involved in the therapy.  And we continued in this joint planning over a month of treatments.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-05-28 12:42:01', 'A0000116Q', '2019-09-01 00:44:28', 'As a professional traveler, I like to travel light, and if I take something with me on a trip..........I"ll be sure to use it!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-05-28 12:42:01', 'A0000117Q', '2019-07-26 13:20:35', 'This is a grand place in many ways; the lobby is pretty, the décor is over-the-top Disneyland, the shops are great, the choice of restaurants (which skew towards heavy foods) is good, and the rooms are big and comfortable. The room is probably the best reason to book here if you can get a room during the week for $175 or less. The room always smelled a bit funky when we first walked in though.. not sure. Maybe time to rip up the carpet.  But this property is crowded. And the crowds aren"t exactly the fun type of Las Vegas people. Its like the show "Jersey Shore" invaded the place. And while I am sure the average person from the Garden State is enjoyable, this crowd is just too .. too. cheap and plastic. Gaming there is average strip gaming with a lot of slots and fun machines.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-05-28 12:42:01', 'A0000116Q', '2018-02-07 05:49:39', 'FIrst let me explain the 2 stars - we decided to try out the sushi after friends said it was good.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-05-28 12:42:01', 'A0000019J', '2019-05-10 07:36:30', 'If I could give them 10 stars, I would!  They are that awesome!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-05-28 12:42:01', 'A0000243L', '2018-01-03 00:58:49', 'The shakes were the normal quality-great shakes. Servers were very kind-would have been a one star but not for these two positives.');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-05-28 12:42:01', 'A0000206Z', '2018-10-23 08:47:07', 'First off food is DELICIOUS! By far my favorite restaurant in downtown Phoenix. I have tried so many different things from the menu and it never disappoints, but the Saturday night special Prime Rib and Horseradish Dauphinoise Potato is my favorite. Second, the service is amazing. Ian is my favorite waiter, will request him every time! He is so personable with a good sense of humor! He constantly is checking up to make sure everything is good (but not too much). He made the experience at the Arrogant Butcher memorable!');
INSERT INTO ForumEntries VALUES('OY0003', 2018, 2, 'P0000007K', '2018-05-28 12:42:01', 'A0000085R', '2018-09-16 11:46:25', 'Even though our hostess did a terrible job, our server was lovely.');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2019-04-17 13:19:12', 'A0000205A', '2018-10-19 23:48:25', 'Oh my goodness.... where to start?!! I had the pleasure of enjoying some BBQ chicken, beans and potato salad about a week ago. Not only was the meat perfectly tender and juicy, but the beans, oh my god the beans. Talk about perfection. On top of the delicious food, the service I received was beyond 5 stars. I was offered a sample while working and was told he could bring the food into me at my convenience but I didn"t take advantage assuming that I would be able to catch him outside and take a look at my options. Unfortunately for me as I was walking out of the building Steven was pulling away. He saw me though, and as I expressed my sadness in missing my opportunity. He so kindly and without hesitation pulled over and prepared me the dish of my choosing. He was so gracious and even gave me a small story of how he got started. I would recommend Holy Smoke BBQ to ANYONE and EVERYONE! My heart and my belly were so full! Thank you again for your extremely generous service!');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2019-04-17 13:19:12', 'A0000060R', '2018-06-21 19:42:54', 'Fact that this location is in tempe marketplace, makes a high difference so we can enjoy outdoor seating in evenings.');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2019-04-17 13:19:12', 'A0000291F', '2019-09-17 02:53:21', 'Food (for the first time I came) - 4.25 stars!');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2019-04-17 13:19:12', 'A0000008J', '2019-03-11 22:51:44', 'I can see why The Packhouse is not a packed house. (See what I did there?)');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2019-04-17 13:19:12', 'A0000257O', '2019-05-15 04:23:28', 'Food (quality): Again, very few complaints. Food was fresh and flavorful; portions, while not huge, were pretty satisfying. My wife had the roasted beet salad (actually part of the 4-course special but our server told us we could order it a la carte) and enjoyed it very much. I started with the Caesar...the black garlic dressing was delicious! Highly recommended!  My wife"s filet mignon was well prepared and presented; I had the brick oven chicken and was very pleased. Moist, tasty, and the mac & cheese was excellent. Topped off with the Brookie for dessert, a very nice meal.');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2019-04-17 13:19:12', 'A0000056Z', '2018-03-06 08:04:04', 'My friend lost the key in the car and we were locked out of the car.');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2019-04-17 13:19:12', 'A0000020H', '2018-01-30 06:29:38', 'Dustin was the technical rep who handled my case and was very helpful as well. He really understood my budget limits and had very affordable solutions to my problems.');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2019-04-17 13:19:12', 'A0000271T', '2019-08-22 02:21:12', 'Listen people this is the spot. Stop paying too much at over priced place where the portions are small and mash potatoes are green. This place portion size it meant to feed a horse not a mouse like the other places. Like I"m coming back here over and over again. Plus my gf lives not far is its convenient.');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2019-04-17 13:19:12', 'A0000271T', '2019-09-03 00:51:18', 'This place.  We are staying at the Legacy Golf Resort and that we would grab a quick bite there since we were driving by.  Such a fun atmosphere !  And, fantastic food that has a unique flare and is healthy.  I also like the casual environment where you can play outdoor games with the family. Highly recommend this spot!!!');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2019-04-17 13:19:12', 'A0000271T', '2018-02-13 12:26:48', 'The coffee I had was pretty gross. The cappuccino was barely foamy, and the coffee was kind of rancidly bitter.');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2019-04-17 13:19:12', 'A0000056Z', '2018-12-01 04:27:02', 'If Union Social was located closer to where we live it might merit another chance but we live in the south end of Mississauga and thus will be sticking closer to home.');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2018-10-18 09:53:12', 'A0000008J', '2019-02-27 07:10:24', 'Clean, fast, friendly everytime. But not weird and sterile like Baja Fresh.');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2018-10-18 09:53:12', 'A0000020H', '2018-06-10 05:36:03', 'On peu y mangé le midi, prendre une pâtisserie ou un café/thé.');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2018-10-18 09:53:12', 'A0000102W', '2018-07-30 15:33:23', 'My wife and I flew out to Vegas for the 3-Day President"s Day weekend and my 50th birthday.');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2018-10-18 09:53:12', 'A0000063D', '2018-03-12 07:07:02', 'I have visited this place several times. They have great happy hour prices and their regular menu prices are very reasonable too. Their entrees are big enough to share, my favorite is their fish tacos. They tend to get pretty busy on Friday nights, so there is sometimes a bit of a wait. Overall, thumbs up!');
INSERT INTO ForumEntries VALUES('OY0003', 2019, 2, 'P0000004E', '2018-10-18 09:53:12', 'A0000022N', '2019-09-30 08:53:13', 'It is delicious! The chips are mini tortillas that you break off and have with salsa. Very yum. The food is delicious! I don"t remember what I had the last time we went here, but I managed to finish more than half of it and had some to take home (tastes better later, IMO). The portions are generous and filling.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000007E', '2018-02-13 08:22:16', 'I should have listened at the other reviews for this place. I got the Hopeful Signature Poke Bowl and it was very bland, and didn"t quite sit right in my stomach. Maybe too much sauce? It is comparable to  having salmon sushi ingredients in a bowl with way too much rice. It"s too bad, because I love poke bowls and had high hopes for this place. 2 stars for the nice interior.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000124V', '2019-10-12 06:17:05', 'A wonderful dinner experience! Hubby and I came couple months ago, it was our first time at Sushi Samba. We didn"t have reservations, but they were able to seat us at the sushi bar.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000155H', '2018-10-18 02:29:30', 'The staff are courteous and gets your order right!!!');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000050J', '2019-09-16 16:36:01', 'As an ex-NYer, I have a pretty high standard of bagel. These did not disappoint, but I wouldn"t say they are truly singular in their yumminess. My review is based solely on these, as we did not try the desserts or anything else. Some of the bagels seemed "fresher" than others, and if you"ve ever had a NYC bagel before 8am, you know the expectations I have. I also feel like the bagels were kinda skinny, and the holes were big. I"m used to really fat, chewy but pillowy ones. Sigh.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000285W', '2018-09-18 01:24:36', 'The atmosphere...beautiful, romantic (if you like sharing intimate moments with strangers) but it was pleasantly dark with candles and Christmas lights through out. They had an electric fireplace when we first sat down we observed and enjoyed the heat coming from it, since as you know we dress up, not dress warm when going out to dinner. The place lost half of its power 5 minutes after sitting down. The manager  chose to turn the fireplace off, even though it stayed lit and running during the power outage.  By the time I left, my toes were frozen.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000134L', '2018-12-30 01:02:24', 'YELP 100 CHALLENGE 2013-(3/100) "  Our Retro Return"');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000188F', '2018-02-08 03:57:37', 'I"d be a regular if living in the area.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000270U', '2018-05-25 21:30:50', 'Went here as a last resort because a hose on my son"s truck busted and we were stuck.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000138V', '2018-12-06 01:30:01', 'In most cases, I find kabob houses to be boring and that isn"t because I don"t love the almighty Kabob, it"s because I have come to expect that Kabob places outside of the Middle East, Detroit, and even Western Europe just can never get it right - every time there is hope, it normally ends in disappointment for me - I should have never made that trip to Iran in 2007 where I was in kabob paradise.  However, Chateau Kabob located in the Frankophilic metropolis of Montreal did me rare pleasure of maintaining that hope.  Here in Washington, DC we need to cling to places like Shamshiri and Alboorz to get our kabob fix but even that gets repetitive after a while - especially when there isn"t a single Kabob house in the region that can even hold a candle to those two places and therefor isn"t particularly incumbent of them to reach for the stars.  Chateau Kabob does it right and is about as close as you can get to some of the legendary places you can find in Iraq and Iran - the latter of which reigns supreme in the world of Kabobs.  At Chateau the spices are right, the juiciness is on par, and the meat is superb - all in all a very excellent Kabob.  And perhaps one of the most underappreciate techniques that Chateau also got right is the rice!  It is superb here - fluffy, velvety, and aromatic.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000273F', '2019-08-19 03:34:41', 'By the way, the carnitas were excellent, as well.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000258P', '2019-05-19 18:59:16', 'I stayed in it by myself. What a wondrous time!!!!!!! I had everything I needed and then some. And the view! Perfect view of the strip. It"s the perfect way to be a part of Vegas without all the noise and smoke you get in a hotel with a casino. At half the price. Or less, depending on when you go. My first night in Vegas was spent relaxing in my beautiful room.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000188F', '2019-09-10 16:29:10', 'I went to Dr. Goth for a couple procedures, including wisdom teeth and to have a suspicious oral growth removed. Only one word - fantastic! His staff is excellent, and his art in dentistry and patient care unsurpassed. Cut and dried - Dr. Goth was outstanding. He is the man to see in the Pittsburgh area.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000230T', '2019-07-03 06:53:29', 'Second time I have been here,  and the only reason I took a star away,  was because I had to toss my entire takeout dish except the cookie!! I very specifically made sure to say NO BEANS.... Unfortunately,  my food was covered in them!  The service here is very very good... They know their menu and will walk you through finding the order right for you.   The food is very good,  was looking forward to it...  Looks like totinos is lunch today!!');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000260L', '2018-07-29 18:42:16', 'Beyond knowing their stuff is their continual dialogue with patients.  On each appointment we began discussing how the exercises were working, how I was feeling, what is working or not.  Then we would get into planning for that day and going forward.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000028T', '2019-03-30 03:04:16', 'second A place that proudly serves "Middle eastern" and also "Greek" food usually misses those authentic flavors. For example serving Jewish Latkes, Israeli/middle eastern humus, and Greek moussaka is usually just too much for a fusion.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000145F', '2018-10-13 10:18:34', 'They reluctantly looked at fixing the area of the dash they had messed up, and made a halfhearted attempt to fix it. At this point the dash looked a little better but not the same as it did when I brought the car in. I was tired of dealing with these lazy incompetent fools who had no pride in their work and decided to take the car back to the 616 location.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000186D', '2018-07-02 03:27:24', 'WHOA!');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000071V', '2019-06-02 03:21:08', 'Great space, rude owner and the coffee is average.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000119R', '2018-03-22 03:11:26', 'The staff are courteous and gets your order right!!!');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000177E', '2018-03-19 13:58:08', 'Good tex.mex food. Live close so easy for me. Good margaritas. Decent service. Prefer the local mexican places, but this place is good and closeby. Upset that I don"t get my work discount anymore.:-(  But will return.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000215E', '2019-09-17 23:39:41', 'We ordered the beef brisket curry, a fried rice and 2 extra orders of roti.  I wish there was just a bit more beef in the curry.  Other than that, things were pretty good.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000215E', '2018-11-12 20:45:48', 'Worst eggs Benedict I have had in my entire life. Bacon is dry. Hollandaise sauce is tasteless and bland. Same for my other half.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000264R', '2019-03-08 02:18:30', 'Hubby and I also went back on a Friday at 2:15 for a liquor lunch, and I must say it was one of the best dining experiences we have had in Las Vegas.  The food was excellent as it has always been.  However, for the first time, the service (by Mark), was impeccable.  Was it because there were only a few tables?  Possibly, but something tells me that I have found my go-to server from now on.  He made great recommendations, and the timing of everything was amazing.  Sitting outside and enjoying champagne was heavenly.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000174P', '2019-09-11 07:50:40', 'Jodi the salesperson design of the layout of the cabinets was excellent.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000226U', '2018-02-27 16:31:02', 'These guys literally saved me.  I had a RFP due during the holidays.  With my computer and printer crashing, I was in a serious bind.   I usually go to Staples Printing Centers-- but, they couldn"t get it done in time.   So, I got on the Peoria Chamber website and International Minute Press/Desert Sky Printing came to the rescue.  They finished my printing and the RFP was turned in with 1 hour to spare.  I recommend them highly!');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000219A', '2019-01-25 00:34:20', 'New management sucks. I used to get my nails done here all the time but now they do a horrible job.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000005O', '2019-02-11 22:08:08', '- MUSHROOM POT ON CRACK. THIS WAS DEFINITELY THE SHOW STOPPER OF THE NIGHT!!! the flavoring of the sauce, the textures of the 3? 4? different mushrooms. happiness. The sauce was like a cream of mushroom, milky, full flavored, salty, a hint of sweetness... too good. needless to say we all took a bite and just smiled in satisfaction. We all stared at each other and knew rice was needed to soak up all that bomb sauce!!');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000061X', '2018-02-16 14:15:04', 'The appetizer - Artichokes with Prosciutto.. YUMMO!');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000157L', '2019-07-29 03:44:21', 'I went with the ziti. Just as I remembered, the sauce was awful. The pasta was in a pool of water and the sauce had zero flavor. I just feel like a sauce can make or break the meal, and it was tasteless-- no garlic, onion, wine, basil.. Nothing. The portion was also quite small for the price. It was clearly boxed pasta and not homemade, so why so stingy? I"m surprised there are such high reviews on here actually as my experience and my family"s experience wasn"t great. I guess it"s a decent place for families, but I would definitely go to a different Italian restaurant if you"re looking for good food.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000226U', '2018-06-10 13:29:33', 'I had a Engine in warranty from LKQ, these guys were to install its replacement.. They told me done in a few days, ok...   I went there and noticed when the engine was taken out they carelessly left my AC dangling and did not remove it to install new engine. No big deal till you understand the rest.. this is a cheap way to not refill system and do it right...  After going to get my car when they said it was done I Notice AC didn"t work and wrong Coolant added to Radiator. ( cannot use regular Green... Yellow Ford required ) Then I say I will come get it when they fix the AC, they tell me hours later its the PCM..( Computer ) well OK you guys shorted it out, the only thing wrong was a Valve Rattle, now this?? After 2 days with LKQ saying they are going to send a inspector I drove past and noticed my Mirrors Loose (broken ) on BOTH SIDES!! I am ANAL when it comes to my car I bought New in 2007..  this was enough, I took it home.. I had enough...  They forgot 4 bolts, 2 in wrong spot, One Digging into Power Steering Rack, Power steering Bottle Cracked on Bottom from a Poor removal and hid the fact it was cracked on the lower nipple and the AC system they claimed did not hold R-134a because they DID remove the AC later and LOST the O-Rings when they filled it, it leaked.. and they SHORTED the AC Protective Diode.. IT WAS NOT THE PCM.. this place MIGHT be good for a Oil Change if you tell them how to do it, but that"s all..  Telling me How Do we know you didn"t bring it in here like this... BAHAHAHA, a back yard weekend mechanic was able to figure out they were unskilled for the task.. I will make sure with a HUGE online review on EVERY Review site that this place is NOT the place to take a Car... or a peddle bike for that matter..');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000005O', '2018-04-28 00:18:17', 'While Savers deserves five stars, the adhesive on the back of the price tags is very hard to remove and the frustration level is palpable. When they put it on the inside of the shoe bottom, and you try to remove it, it leaves a gooey residue that is all but fun when you slip on a pair of shoes in warm weather and your foot is sweaty. Ignoring the schmuck sound when you lift up your foot to walk due to it sticking to the shoe, it doesn"t feel very good.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-09-25 10:50:38', 'A0000293L', '2019-10-18 04:44:14', 'Overall a great experience: Food was great and the staff was very friendly.  The owner came to the table to  ask how the food was and we talked for a few minutes. He was genuinely interested in feedback and his passion for cooking and providing a great experience for his customers was very evident.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-01-02 11:58:55', 'A0000272I', '2019-08-31 11:06:19', 'This place is definitely a local spot. We stumbled in on Friday around 7pm to a karaoke night! Everyone seemed to know one another and felt like family (some may have actually been family. It was so intimate they even celebrated the monthly birthdays and sang to a woman with a birthday crown on. Definitely felt like a regular karaoke group that returns each week. Everyone welcomed us, even new people that came in said hello and told us about the karaoke nights and to come back again soon. Despite the closeness of the patrons we didn"t feel like an outsider.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-01-02 11:58:55', 'A0000138V', '2018-11-17 09:35:23', 'Came here with a group of 20+ to see Morgan Page on 11/30/12.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-01-02 11:58:55', 'A0000040P', '2018-10-08 15:26:59', 'Last time I was in this area at lunch time, Chao was still being built. Now it"s open and today was my first official visit to check things out. I"ve only tried one entree from the menu, but if the other choices are anything like what I ate today I will definitely be a regular here.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-01-02 11:58:55', 'A0000040P', '2019-10-19 17:51:11', 'I"ve had everything from their Eggs Benedict to their salad bar. Their salad bar is very basic. Cheap square croutons, fake Baco Bits, half-wilted(so take your time picking out the good lettuce, and leave the crap to another patron, haha) lettuce, and OK dressings. I get it. They can"t have fresh stuff at this price.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-01-02 11:58:55', 'A0000112O', '2018-04-19 17:20:31', 'I ordered the Penne with Italian sausage, only to find out, they were out of sausage. The waiter suggested an alternative. I went ahead and ordered it. What I ended up with was penne with canned tomato sauce and what I swear was frozen meatballs. At $12...what a shame.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-01-02 11:58:55', 'A0000172O', '2019-09-18 14:38:57', 'Today we went to rent a unit and the staff there are very friendly and helpful. The place it self is very nice kept clean. Thanks a lot Al and Jeff.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-01-02 11:58:55', 'A0000184I', '2019-01-12 01:15:06', 'we enjoyed excellent service and very good food. salads were perfect as was soft shell crab and chicken livers. broad pasta was excellent as was scottish beef. very good and extensive wine list. wonderful experience and good value for the price');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-01-02 11:58:55', 'A0000184I', '2018-03-28 22:24:36', 'It"s awesome here!!The guys are soooo hot and nice!!The host London is amazing at the mic and getting the crowd excited!!highly recommend this place!!');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-01-02 11:58:55', 'A0000172O', '2018-12-25 07:55:38', 'I booked a session and decided to also use my coupon for free Easter collage. The girl told me it would take 45 min to print. Showed up 45min later and I guess they were having issues formatting it to print out correctly. Hour and a half total spent waiting and the guy kept saying if you wait I"ll give a free print. I had already waited hour and a half along with session time and a five month old wasn"t going to deal with it much longer. I don"t travel to chandler often and live 30min from this location. I told them they needed to mail it to me and I left furious. Never again!');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-01-02 11:58:55', 'A0000112O', '2019-09-21 05:38:25', 'Club Layout: The club itself is very nice. Not quite as grand or spacious as XS next door, but a beautiful venue nonetheless. Main dance floor is average sized. It was spacious enough so that we didn"t feel like canned sardines and had adequate room to dance. There are no stairs or steps to climb, a la Marquee, so ladies will appreciate this. The main room is flanked by a large tent-like area and the outdoor wading pool/patio area. The easiest accessible restrooms are outside as well (the indoor one gets crowded). The outdoor area is ideal for those who want to socialize more, take pictures, take a breather, etc. It"s beautiful.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-01-02 11:58:55', 'A0000172O', '2019-05-31 16:57:33', 'I"m a sucker for a good falafel,  and this place delivers. Ordered the combo with a side of hummus. Tasty,  fresh falafel and good but a little loose hummus. Would definitely come here again.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-01-02 11:58:55', 'A0000184I', '2018-01-16 09:57:57', 'The suites are large, well equipped (full kitchen with a dishwasher in ours--I loved storing all  of our leftovers in our full fridge) with a full walk out balcony furnished with a patio table and four chairs.  The attached bedroom was large and outfitted with a King size bed.  As much as we liked the room, we obviously didn"t spend tons of time in it since we hung out on the Strip during much of the day and night.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-01-02 11:58:55', 'A0000144N', '2019-01-06 09:54:29', 'In town for a convention and looking for something away from the strip. Found this place on Yelp and was not disappointed. Mango margaritas were tasty as were the shrimp tacos. The waiter mistakenly brought me the fish tacos (which were actually quite good as well) and was very apologetic when I pointed this out. He then replaced them as quickly as possible.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-01-02 11:58:55', 'A0000184I', '2018-02-11 14:27:30', 'Always taken care of at this company. This was my first visit to this location since moving from the east side, and Tony really took care of me with a price match. These guys here are great at customer service and once again left extremely happy.');
INSERT INTO ForumEntries VALUES('QS0004', 2018, 2, 'P0000005R', '2019-01-02 11:58:55', 'A0000165H', '2019-01-07 20:04:36', 'Overall I was very impressed with this recent visit. Keep up the good work!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000135S', '2019-09-09 15:54:02', 'We"ve shopped there for several years and always enjoyed the savings but this year I"m shopping for hoodies for the less fortunate.  Thank you Antigua.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000084U', '2019-08-18 13:17:06', 'Well, we got off to a bad start.  My son fell asleep in the car on the way over (he"s five and had been in the pool all day) and I carried him into the restaurant.  At the register, I discovered that there was no children"s price and that I would be paying more than $30 to enter with my sleeping child.  Because it was mom"s birthday, I went with it, but I was annoyed.  No child is going to eat $30 worth of buffet food. They want the pizza and dessert and not much else.  Of course he didn"t want to wake up at all and refused to eat much of anything, so I paid for him to sit there and be cranky.  My bad.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000092M', '2019-08-21 13:22:43', 'Was very excited for happy hour and heard great things. Food was less then average we were charged $10 for BREAD.  Most apps were greasy or fried and still spent $250 on happy hour menu for a group of 4. First review on yelp so cared enough to take the time to write this. Sorry won"t come back.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000208O', '2019-09-19 22:21:30', 'Also the staff in this place was very friendly, helpful and fun. It was good to hear youthful energy enjoying their work instead of the normal this is just my job type of employee"s. This staff gave good service and enjoyed what they do.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000096O', '2018-01-18 14:16:00', '6. The quality and taste of the food is amaze');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000074I', '2019-07-03 09:02:25', 'The nicest hotel I"ve ever stayed in in Vegas! Found a great deal during the week and couldn"t pass it up. Clean, staff is friendly and there"s so much food to choose from downstairs! Pretty convenient location on the strip as well. Definitely will stay here again.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000247B', '2019-10-24 17:05:16', 'When they arrive for the pick-up - 2 days late 6 hours after they were supposed to be there - they didn"t come prepared for a piano. My dad and uncle had to find 2x4"s to use as a ramp and help the movers hold it and roll it off the porch. This is a stage piano, the wheels aren"t really meant for rolling around cement! After loading everything and telling my parents they were headed my way (Virginia), my stuff is taken from Wyoming to Seattle, then back to Vegas where it was put in storage without my knowledge or permission. I only found out because I kept calling to see the whereabouts of the truck so I could plan accordingly. After repeated phone calls, and finally the threat of legal action, my items were put back on a truck and started the journey East.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000102W', '2018-04-24 11:43:20', 'Prices were on par with other Mexican restaurants and you get more than enough to eat.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000102W', '2018-08-10 09:24:32', 'Had a good protein omlete. Flavorful food and staff was friendly. I will go back and try some of the other dishes.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000247B', '2018-11-30 17:38:19', 'The brisket nacho were really good!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000006R', '2018-01-01 12:31:40', '-A bulk section with plenty of flour, rice, pie fillings, nuts, seeds, and other goodies.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000013R', '2019-07-16 14:06:27', 'Azzip Pizza is literally SO good. I have been there so many times and each time I get a "Big Zip" for $8.22. The place is amazing and the pizza cooks in about 2 minutes. It is the build your own concept and I have never had a bad experience there. Also, I go there about 4 times a week.. Don"t worry I hit the gym, sometimes..');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000220U', '2019-09-25 23:52:42', 'Definitely recommend them!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000247B', '2018-12-30 17:13:51', 'The store is recently renovated, clean, and normal in size.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000267T', '2019-09-18 07:28:34', 'Enjoyed Nee House immensely. No service issues, just fantastic chinese food. Food order? Spicy Green Beans = Perfect!, Chow Fun (Chicken) = Perfect!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000263B', '2018-12-18 15:40:06', 'Pozole- which is really filling! Great for when is freezing outside....');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000129F', '2018-07-16 03:14:01', 'I then went a second time for a wash, also below standard. I also let that slide.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000060R', '2019-09-25 20:07:02', 'The Wisco Porker pizza was tasty and full of meat - just as you would want and expect.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000020H', '2019-09-24 02:31:36', 'I would definitely recommend to a friend!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000255J', '2019-08-31 11:50:38', 'I went here yesterday and I got the best service I ever got at a restaurant. The waiter helped me on the grill constantly checked on me to see if everything was ok, the food was great and so was the service and everything was A++++ pricing was great as well it came out to around $18.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000060R', '2018-12-17 11:49:41', 'Overall I am glad we went because we had been wondering about this place but I would be very hesitant to go back.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000060R', '2019-06-04 08:37:49', 'Had the occasion over the last few weeks to experience their sports medicine/physical therapy department.  Outstanding.  Drs. Anthony "Tony" Walker and Jennifer Hannon are a great team.  They really know their stuff.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000154K', '2018-12-11 02:44:05', 'Dan dan noodles are different from what I was expecting. My friend liked it but it"s just okay for me.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000239H', '2018-11-09 13:32:20', 'When they arrive for the pick-up - 2 days late 6 hours after they were supposed to be there - they didn"t come prepared for a piano. My dad and uncle had to find 2x4"s to use as a ramp and help the movers hold it and roll it off the porch. This is a stage piano, the wheels aren"t really meant for rolling around cement! After loading everything and telling my parents they were headed my way (Virginia), my stuff is taken from Wyoming to Seattle, then back to Vegas where it was put in storage without my knowledge or permission. I only found out because I kept calling to see the whereabouts of the truck so I could plan accordingly. After repeated phone calls, and finally the threat of legal action, my items were put back on a truck and started the journey East.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000035K', '2018-10-25 00:39:41', 'A few people in our party ordered the mushroom rice side dish and it was not good. After tasting it, I was grateful to have passed on this wet, mush.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000169M', '2019-06-18 00:45:47', 'My good friend loves the place and found it a few years before. So he recommended a few things, we had a bottle of Riesling with our baked Bree and blackberry (I think it was jam) it was amazing. Truly, and I am very particular about the types of cheese I"m okay with (food allergies)');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000073I', '2018-03-25 07:40:03', 'Arrival: Got to the club around 11pm. Getting to the club was simple, took only around 15 minutes from the car to the lines (and that included a bit of pre-gaming)!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000194A', '2019-09-03 20:01:30', 'Employees were to busy chatting with each other. One employee had his head out the  drive thru window talking to people the entire time I was there. The cook come from outside and made my food. Did he was hands before making my food???');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000216S', '2019-10-09 09:55:38', 'Here"s why I don"t write reviews for Chinese restaurants: I have to look up their English names...');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000194A', '2019-09-24 21:37:55', 'Service: No complaints here. Our server (Eric, I believe) was extremely pleasant and most helpful. He took the time to explain some of the menu items, checked on us fairly often, and  was generally very friendly. High marks here.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000224Y', '2018-08-12 11:40:17', 'My wife and I participated in the MS Walk and decided it was the perfect opportunity to give the famous River Cafe a try.  What a beautiful spot and a great ambience.  We were greeted by a couple friendly hostesses and shown to an indoor table as the patio was full.  We got a great spot by the window that opened, so a great compromise.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000156L', '2018-01-31 08:00:29', 'As a result I was livid. I had tried to be cooperative and reasonable and was rewarded with this insult added to injury.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000056Z', '2019-04-26 20:28:57', 'Cons:');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000075D', '2019-09-10 05:40:56', 'I love NY city pizza pie.  Excellent rendition of sharing a portion of NY here in the desert.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000106W', '2019-01-07 13:07:08', 'We had the A5 Wagyu gyoza, was tender and not overdone, Tuna tataki, Chicken Samba was a good size portion, El topo roll, chef sashimi selections, and Tonkotsu ramen. Everything we order was super yummy!  Definitely coming back again next time we"re in town!!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000054Q', '2018-11-24 07:00:56', 'Service was amazing, Christina was extremely tentative and took care of our whole group. Asked about splitting checks from the beginning which for a large group is very convenient!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000012R', '2018-03-03 03:01:47', 'When I was looking for a new groomer as my old one was moving out of town I was asking my groomer at the time who she would recommend and she mentioned Diane at Razzle Dazzle. I can start with saying I was a little hesitant about taking my "kids" to just anyone 1) Razzle Dazzle is out of my way about 10 miles and 2) she was new. I"m so glad I called Diane and after talking to her on the phone I felt confident that she was the one who would take over caring for my little ones.  I have been taking my "kids" to Razzle Dazzle now for a couple years. All I can is Diane is simply AMAZING!!!! Let"s just say I would travel an additional 30 miles if it meant that Diane would still be caring for my "kids".');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000216S', '2019-09-28 02:38:09', 'Overall, we had an incredible experience dining at social house.  It was such a fantastic meal my girl friend and I were still talking about it half an house after we walked out of the restaurant!  This is definitely one place we have to visit every time we go to Vegas!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000216S', '2019-09-10 10:55:06', 'The soup was hot and had a good flavor but such a small container and they fill just above half. We didn"t get much at all.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000195Z', '2018-02-09 20:58:08', 'I was told so many great things about this place but my entire experience was awful. The food wasn"t very good, way too greasy. My fries were luke warm and my tray was literally covered in grease. I needed about 50 napkins and a shower after that. The service was pretty awful too. I can"t believe I paid $14 for a small meal with no extra fixings. On national cheeseburger day of all days too. Such a disappointment and I"ve never gone back since. Best thing about it was the soda, but that"s pretty difficult to mess up.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000252I', '2019-09-18 14:00:49', 'I have never had a problem with stocking here, which is good. Items are always stocked well, regardless of when in the week you come. I am not the biggest fan of their produce however. About 20% of the time, I bring how green beans or asparagus, and two days later they are covered in mold (and no, it is not my refrigerator). So I no longer purchase produce here except for when I am in a bind. Store is also always clean, I have never once seen a spill or poorly arranged merchandise, which is a testament to the hard working staff.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2018-05-13 20:10:40', 'A0000216S', '2019-02-25 07:06:56', 'The noodle dishes are great, and the Pad Thai is less sweet and more interesting than usual. Portions can be a bit on the small side, but so is the dining room.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000084U', '2018-04-15 18:43:29', 'These fries were actually very delicious - crispy on the outside and soft on the inside. If you visit this restaurant, I would recommend this particular dish, especially given the price ($8) and the portion size (it was quite large - almost the size of a large plate).');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000076T', '2018-01-05 10:44:53', 'Overall I am glad we went because we had been wondering about this place but I would be very hesitant to go back.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000199K', '2018-06-25 06:14:25', 'The amazing food and friendly atmosphere keeps us coming back!! My hubby is vegetarian and we love how we can choose anything off the menu for the both of us and it tastes delicious!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000096O', '2018-09-17 11:41:46', 'I"m going back soon! This place is a Gotta Try!.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000096O', '2018-05-11 06:46:56', 'My companion and I went to Living Kitchen on an impulse and am very happy to say it was delicious and worth it! My companion got the Arugula Harvest salad and I got the Pad Thai. The Arugula Harvest salad was very tasty and all of the components came together well. The Pad Thai was also very flavorful and had an awesome sauce which had a good afterburn to it. I would highly recommend coming here to try the food vegan, vegetarian, or otherwise.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000074I', '2018-01-01 19:42:36', 'What a great service that the US Postal Service provides! MAHALO! :D');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000081B', '2018-07-22 10:01:58', 'I"m pretty sure this was all I ordered.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000295G', '2019-09-20 17:34:58', 'Service was very good, the LARGE Bloody Mary was impressive, and the Jack Daniel"s chocolate cake was to die for.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000032P', '2018-02-23 07:21:48', 'Decent burgers here.  Didn"t live up to the hype, though.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000076T', '2019-08-08 23:13:20', 'A co-worker of mine kept talking about Tottie"s, so last night I finally gave it a try.  I don"t know if it is different dining in, because I ordered take-out, but it was good.  It didn"t blow me away, but it was good.  Very similar to good chinese take-out, or maybe a notch up.  I ordered the Tottie Rolls as a starter.  They are crispy egg rolls that you wrap in a lettuce leaf, with mint and parsley.  They come with a sort-of sweet and sour sauce for dipping that was quite nice.  Or atleast I think that is how you are supposed to eat them?  I had a big take out container full of lettuce, mint and parsley, so I figured that was the drill since I didn"t order a salad?  They were good.  I ordered the Tangerine Chicken and the Beef Pad Lard Na.  The chicken dish was good, tasted like an orange chicken, deep fried until crispy then tossed in a sweet tangerine sauce.  It had a few strips of red bell pepper also.  The beef dish I liked a little more, it was the wide egg noodles and had chunks of beef, onion, pea pods and bok choy in a really good brown sauce.  You can order many of the dishes mild to HOT, so I did a medium hot since I sharing the dishes I didn"t want to blow them out of the water with too spicy of a dish.  Next time I will definitely go hotter!  The dishes came with 2 containers of sticky white rice, which was exactly what it sounds like. I didn"t have any dessert, but the crispy bananas sound great, and I am interested in trying the ice creams I keep hearing about.  I also really want to try the soups, they sound good.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000096O', '2019-08-03 00:35:50', 'Sweet potato waffle - Hubby wasn"t impressed he stated it was to soft and the texture wasn"t what he expected.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000295G', '2019-09-11 11:16:49', 'My family and I visited and decided to take some pictures with the green screen so they can edit in the Avengers in them afterwards. Since this was our first time visiting this place, the staff was very patient and helped guide us. When we went to go check out which ones to print, Agent Collins was a great help. We loved his easy going personality and he has great customer service! 10/10 would visit again. The pics came out very nice too! Thank you, Agent Collins. Continue to show your awesome personality and great customer service! Very much appreciated.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000199K', '2018-01-02 14:32:07', 'I knew these were not my wife"s who is a small woman because these were of a rather robust size. Also these were obviously clean panties, so I gather that one of the employees has a fat girlfriend or wife who is missing something from the laundry.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000092M', '2018-02-21 16:45:21', 'We arrived and Boy was this place busy, people standing outside waiting for tables and all. I went in to see how the list worked and there was a sheet of paper on the landing with no one manning it and several sets of people in the extremely small (6ppl capacity) entry way. I flagged down a server who then came to take my name and others waiting name down and explained to us all at once how the long table in the middle worked. Basically the table is 1st come 1st served and adding your name to the list put you on wait for the tables around the room on the outer perimeter. We were told 30min so we sat in the car and my husband went inside every 10mins to see if we were coming up since they don"t take numbers nor do they have buzzers. I totally don"t mind this process at all it seems more down to earth and not commercial.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000096O', '2019-09-21 17:23:26', 'Go with "The Big Breakfast" for ~$12 if you"re hungry, and I"m telling you, you"d be pretty full by the end of it you wouldn"t want lunch!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000295G', '2018-08-07 10:19:46', 'Do yourself a favor and get one of the steak sandwiches off of the menu. They are amazing. The ultra is my favorite.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000081B', '2019-10-26 01:41:14', 'Good carpet variety but a lack of integrity and honesty. Maybe it is a new guy but the owner didn"t help. Be careful that the price they give is the same when you pay the bill.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000048W', '2019-04-04 10:14:49', 'This place is over the top! The food is great and the portions...when the hell did every restaurant in Vegas begin serving only sumo wrestlers. My family had a great mix of food - the Mayor of Flavortown Burger, Motley Que Sandwich and Vegas Fries. Don"t kid yourself, the fries aren"t a side; not by a long shot. They are a meal and for $13, they"re a very filling meal. We all loved our food, but I"ll have to say the Motley Que was the best meal of the night. Damn it! My wife is always bragging about how she"s better at ordering, and she did it again here.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000120U', '2018-06-13 16:40:43', 'Overall I am glad we went because we had been wondering about this place but I would be very hesitant to go back.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-08-12 08:44:09', 'A0000092M', '2019-04-08 01:43:21', 'The seating arrangements are like any other Friday"s... booths, tables, a bar. Some of their "four person" booths would probably be better suited for 2 people or perhaps small children - you won"t find any arm room or a place to set your purse here.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000195Z', '2019-09-20 21:25:10', 'Everything was fantastic, although I was expecting a little more paneer flavor to my paratha.  This place is very casual, which I really like about it.  Don"t come in expecting the same food that you would get at a sit-down Indian restaurant; instead, expect the kind of food you would get if you were invited to a grandma"s kitchen.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000126F', '2019-03-19 02:39:55', 'Eyebrow threading is $4. That"s usually what it goes for at these places. No taxes on cash payments! I am not being racist but white places charge more and they don"t do a great job. So, always find an Indian or Arab place to go to for threading.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000075D', '2019-09-18 05:03:22', 'Being a repeat customer, I can honestly say that the service and the communication between parties has not changed! Excellent as usual and is never a hassle. People will definitely have a smooth transaction over here.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000191G', '2019-09-09 21:48:52', 'I most definitely would recommend this place to anyone. Thanx to cake world my cake for my son"s baby shower made the entire event that much better! I will be going back in the future!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000224Y', '2019-09-09 15:26:35', 'Got the tech scheduled as best they could as quick they could and we"re professional the whole time.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000017C', '2019-09-29 12:54:46', 'When we began ordering appetizers the waitress stopped us and asked if this was "going to be complicated or not." She then forgot to put in an order for 1 of 3 appetizers ordered. It took about 15 mins after getting 2 of them, to even bring that to her attention, for which she didn"t even apologize. After 35mins and someone else bringing our food out, we finally had to go to the bar and ask someone to come take our drink orders, a task that was also messed up (I ordered their special of Big ass margeritas to which I received a small mason jar of mostly ice). They told me it"d be free, but it honestly wasn"t even worth that. After that, the only time I saw our waitress was when she was visibly talking about us and pointing with another waitress. Completely unprofessional. A different waitress had to bring us our checks and messed that up too.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000199K', '2018-02-26 07:59:54', 'Let"s just say I"m shocked. People are super friendly. have other food then donuts! It close to my work. Price isn"t too bad it is reasonable. It"s a great place to relax and get some work done');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000274S', '2018-03-26 11:28:51', 'Whaaaalaaaah! Not only was it cheaper to ship (even cheaper than paying for airline luggage, which usually runs from $25 to $35 dollars), but you don"t have to carry it home either! What a smart Hawaiian I am "eh!!!!! Lol!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000032P', '2018-04-01 02:42:03', 'I have been back a few times so far, and this won"t be the last time. It has room to grow on me, and so does the rating.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000199K', '2018-04-25 09:22:35', 'All in all, it was good (I keep saying good!)  the prices are reasonable, and the portions are big.  I have enough for lunch leftovers today.  So, it is worth giving them a try, and I will be back.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000208O', '2018-01-14 04:33:46', 'I love this place... it"s great to have a neighborhood center with good food and great coffee!!  The patio is great all year long.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000017C', '2019-09-29 00:58:50', 'Beyond knowing their stuff is their continual dialogue with patients.  On each appointment we began discussing how the exercises were working, how I was feeling, what is working or not.  Then we would get into planning for that day and going forward.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000170Q', '2019-09-16 01:47:22', '* Their Boylan pop is served at a soda fountain and is sweetened with cane sugar and refillable');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000131L', '2019-09-02 05:25:30', '9 months later... And 3 days prior to my wedding I went to the final fitting just to discover that the seamstress" alteration made the dress too tight... Something that was supposed to be a very simple fix ended up messing my dress with only 2 days left, which means not enough time to fix anything. The customer service is only good when the manager is there... The other ladies aren"t really helpful and I definitely had a very low opinion about this store... The selection of dresses they carry is very good and the service is amazing while they are getting your business... The follow ups and fittings/alterations can only be booked Monday to Thursday and the customer service experience is quite bad');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000135S', '2019-09-10 12:25:41', 'If I wasn"t at the Biltmore for work you would"ve found me here or at the pool my entire stay in Phoenix.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000017C', '2019-02-21 20:18:54', 'Ok, this place had us right from the start. My wife just finished  running a marathon and was extremely cold. Seeing her shiver, our waiter brought her a cup of homemade chicken vegetable soup on the house. Who does that these days?');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000199K', '2018-11-16 14:07:37', 'Lets hope for more consistency and the locals will fill the room.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000274S', '2018-10-01 23:44:11', 'The shop staff are very friendly and more than willing to accommodate any request.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000074I', '2019-09-29 22:12:23', '-Giant bags of peanuts, onions, apples, and carrots.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000048W', '2019-05-31 13:37:39', 'I have had foot massages all over the country and these guys are top two or three for sure!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 1, 'P0000003W', '2019-02-12 02:14:40', 'A0000096O', '2018-07-06 06:57:14', 'My wife and I split the main dish, which was a special "baked brisket enchilada" recommended by the waitress.  It was huge and definitely more than enough for too, but we didn"t care for it. There didn"t seem to be much beef in it; it was mostly sauce and cheese.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000282Q', '2018-02-28 14:38:24', 'Everything is what you"d expect from a $10-$15 breakfast, and that"s why I gave it 4-stars.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000149A', '2019-01-08 23:55:32', 'The soup - Lobster Bisque (Delicious) and Minestrone with sausage ( missing the sausage and the vegetable were literally giant sized. It was like eating a salad with broth and rice in it). However it did taste quite nice.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000240X', '2018-04-09 22:55:22', 'Service: No complaints here. Our server (Eric, I believe) was extremely pleasant and most helpful. He took the time to explain some of the menu items, checked on us fairly often, and  was generally very friendly. High marks here.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000296W', '2018-06-10 14:28:21', 'Quick, easy adjustments and I"m back to *almost* 100%.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000207E', '2019-05-15 15:09:40', 'Walked into XS -no problem-       9 dudes');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000049T', '2019-09-30 12:59:15', 'I really wanted to love this place- as it"s in my Neighborhood, beautifully decorated with a clean interior and products.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000207E', '2018-04-07 14:50:26', 'As many of the other reviewers have said, the food is sub-par Mexican food.  I appreciated the complementary chips and salsa, and the incredibly unhealthy Boat Dip was pretty decent.  I had the Tofu Mexicana, which was mushy tofu and overcooked vegetables.  As hit or miss as Mad Mex can be, since it opened I have been there more times than Fajita Grill.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000103Z', '2019-08-18 18:48:30', 'Overall a great experience: Food was great and the staff was very friendly.  The owner came to the table to  ask how the food was and we talked for a few minutes. He was genuinely interested in feedback and his passion for cooking and providing a great experience for his customers was very evident.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000103Z', '2018-01-17 17:29:58', 'My guess is that they garner the majority of their business from out of towners staying in the hotel it is connected to.  This will definitely not be in my lunch rotation downtown.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000269Q', '2019-09-23 01:11:23', 'I came here on a saturday night for dinner to celebrate my 25th birthday with the best of company, fun entertainment, and delicious food!!! I"d been here before but always sat in the front of the restaurant... had NO clue how HUGE this place was!!! We sat in the very back (where it seems many of the large birthday parties were seated) The ambiance of the restaurant is very dark and jungle esque (if i remember correctly o.o) lol very ruckusy and vegas appropriate! There were drummers and scandalous (but h0t) dancers going up and down the aisles which provided for the fun entertainment.  But enough of that, on to the main event.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000163Z', '2018-08-28 18:55:50', 'The one downfall to this place is the bathrooms are in the basement and are by no means roomy. In fact I smacked my head off the roof as I tried to squeeze my way into the stalls.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000099I', '2019-03-22 21:43:12', '3.5. Patio is great and spacious. Selection of beer and menu also great. I came here because of the more sophisticated menu variety. I ordered the steak tartare. It"s okay, but if you"ve had steak tartare done right before skip it here. They use a chicken egg yolk. Tartare itself is not seasoned enough and left more to be desired. Salmon quinoa bloated. Duck fries were quite good and a large portion too. In terms of fruity beers, I didn"t like my friend"s cherry beer (reminded me of medicine taste(, but my peach beer was quite interesting and more bitter than I thought. The seating with half booth half stools are a bit weird, apparently my back doesn"t like backless chairs. Either way, I would come back if I want beer in a less rowdy bar with an interesting menu for food.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000296W', '2019-02-24 01:59:03', 'But alas, the service and food are simply too good even with that inconsistenci.  Sorry I couldn"t resist.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000279Y', '2019-10-23 16:19:24', 'Except for the BIG Bloody Mary meal - slim jim, pickles, cheese cubes, peppers,  candied bacon !!!!; sausage; red onion (see pics, only large U6 shrimp were missing. ..) everything else was a disappointment.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000254G', '2019-05-15 21:07:30', 'no-contract membership options');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000279Y', '2018-08-04 20:20:57', 'I"ve received great service and highly recommend Stone Law. I"ve been a client for many years and can attest they do great work!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000099I', '2019-06-12 07:46:09', 'After being a HUGE fan of the Mission I decided to try this place out seeing that it"s owned by the same owners even though I was very skeptical that it could possibly be as great. To my surprise it lived up to what others had told me. The ambiance was amazing. Very much like the mission. Candles light up the entire place. The outside patio is quite large and there is a lot of seating available. The staff was great and very helpful with making suggestions on the menu. My favorite items on the menu are the scallops and the Apple caramel upside down cake. They were cooked to perfection and melt in your mouth. They have a great wine list and its a perfect setting to enjoy a few glasses of wine:) This is a great date night spot that I recommend it now to all my friends.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000063D', '2018-08-27 08:53:20', 'Amazing service, great vibe, and fair prices.  Their Asian/Hawaiian fusion was perfect.  We"ll be back!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000149A', '2018-01-29 11:14:06', 'the staff is really helpful, I"m always asking them questions and they are nice and pretty knowledgable.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000291F', '2018-08-18 17:17:19', 'The good stuff first...nice décor, great samosas and chutneys. Great chicken tikka masala (sp?). The bad...the awful shrimp dish...spiced just right but the shrimp was overcooked...how much...obviously reheated, or held too long...like biting into a whole water chestnut. I should have sent the dish back. Did mention it too the waiter...oh, I will tell the chef...no response at all from management...were busy bs..ing at the bar.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000279Y', '2019-06-21 01:12:35', 'I expected to pay a lot in the Venetian, but I expected to be blown away. I would have preferred dining at several places we walked at on the way to this one. I paid $17 for spaghetti carbonara. It was very tasty, a well-balanced sauce with a decent amount of pancetta. However, I finished the whole thing. I can"t finish an entree at Olive Garden for the same price. I also ate a few pieces of bread. One of my friends ordered a chicken kabob (who knows why that"s sold at an Italian restaurant). It was one single kabob with perhaps 4-5 pieces of chicken and 4-5 vegetables on a bed of rice and it cost $25! Absolutely outrageous.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000047G', '2019-10-20 05:23:29', 'Hank"s definitely stays on my list of places that wow me. Great atmosphere from the bar area with live music, to the great booth in the dining room with all the hustle and bustle of the staff creating that fine dining experience.  We felt very comfortable and well taken care of. Even had the manager share a bottle of wine with us! A memorable evening.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000233C', '2019-10-08 03:23:21', 'As for the tenants who are complaining, I am hard-pressed to believe that Rich and the entire Active Renter crew have treated anyone poorly or have not serviced rentals in a timely manner. There are also people who tear up property (not their property!!) and then complain when they get billed for all the damages.  These are probably the same tenants who punch holes in dry wall, steal furnaces (who DOES that!?!?!?!), damage landscaping, tear up concrete driveways, etc.  - and then later complain when they are held accountable for the damages they created.  It"s said that people who have negative comments are much more likely to post a review than people with positive comments - on a 9 to 1 basis!  So for every complaint, remember there are dozens, hundreds, perhaps even thousands of individuals who have wonderfully positive things to say about Active Renter, but just don"t take the time to post a review.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000182E', '2018-01-13 12:55:49', 'Woke up earlier this week with a crazy case of Torticollis. Couldn"t turn my head to the right and I was having spasms like crazy! Went to The Joint on Wednesday, Thursday, and Friday (today).');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000217H', '2018-11-04 00:01:56', 'Thanks again! :-)');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000047G', '2019-02-22 03:50:40', 'Tacos dorados- they are the best ones I have tried in the city!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000118M', '2018-01-29 08:25:05', 'Service was very good, the LARGE Bloody Mary was impressive, and the Jack Daniel"s chocolate cake was to die for.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000043D', '2018-09-13 00:36:28', 'Our regular plumber is great, but a little pricey, so we decided to try someone new.  Belsito"s rating on Yelp made us give them a try.  We called on a Saturday afternoon for a non-emergency.  They told us someone would call us back and let us know when they could come out.  About an hour later the doorbell rang and it was the plumber.  Luckily we were home as we never got a call.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000158F', '2019-07-16 06:52:43', 'Overall the food is really good. We had bruschetta and it seemed to have just a tad bit too much olive oil on it. Had it had anymore on it we would not have eaten it. My husband had chicken Parmesan and I ordered a salad with grilled salmon. He said his tasted good and my salon was cooked perfect. I also enjoyed whatever the dressing was, I just wish it would have been on the side. For whatever reason it was poured on and also came with a cup of it on the side. We agreed that the prices seemed a bit high for the experience. It has a similar feel to Bravo but service just isn"t at that level yet (from our experience). Our sever did not know anything about the menu or what is fried in their fryers which should be expected at $18+ a plate. (We asked because of food allergies) She did however make sure to note allergies on our order which we appreciated! The music also did not match the setting. I really wanted to relax but the music was super up beat and almost had me rushing to leave. We will try again in a few months and I"ll update my review then.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000175P', '2019-09-24 02:44:41', 'Remember 98 South Wine Bar?... or the 2nd 98 South Wine Bar?... or Fat Cat?  That space in Downtown Chandler has a new tenant, and they seem like a keeper.  DC Steak House is a rarity in Phoenix; a mid-priced, independent steak houses in a sea of chain restaurants and a la carte wallet busters.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000047G', '2018-09-10 08:59:29', 'New Burgers come out, they get the toppings right and the chef wasn"t as enthusiastic with the mustard the second go round. HOWEVER! My meat was still dry and over cooked. {sigh}.... whatever. I couldn"t finish the burger. Like the meat was a choking hazard.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000233C', '2019-09-11 15:11:25', 'We all started with cocktails - Margaritas and Mojitos.  The Margarita was made with bourbon and rimed with crushed bacon and salt (yes I said bacon).  The Mojitos were fresh and minty.  The one thing I we all really like about the drinks was that they were not too sweet.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000014L', '2019-03-06 04:23:09', 'Decent burgers here.  Didn"t live up to the hype, though.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000277N', '2019-02-22 04:52:21', 'My girl friend and I went to Social House last Saturday a little before 5, before the restaurant opened for dinner.  The host was very friendly and informed us that the restaurant was not opened for dinner yet.  My girl friend and I each had a a cocktail while we waited.  Wow! I loved their "Socialite" cocktail and my girlfriend was amazed by their "lycheetini".  Both drinks were incredible!! This definitely gave us a boost of confidence about the meal we were about to have.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000287V', '2019-03-03 22:37:52', 'Okay, we kinda freaked out when  we heard the half off starts and pizzas.. we ordered way to much but was so worth it.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000065M', '2018-06-13 22:13:27', 'This is a hidden gem , the decor is a bit dated but the pizza is awesome.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000259X', '2018-03-11 15:08:47', '- If you get in during breakfast time, do try the Portuguese sausage.  It"s the only breakfast food really worth it.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000137S', '2018-05-08 12:01:14', 'But alas, the service and food are simply too good even with that inconsistenci.  Sorry I couldn"t resist.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000137S', '2019-07-17 16:19:22', 'It used to be 8.99 for a haircut. It"s now 9.99 and that"s cheaper compared to other hair places still, however, this place isn"t as professional as the other ones I"ve been too.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000080C', '2018-01-22 02:39:28', 'A little on the expensive side.  The portions were a bit small for the prices they are charging.  I guess they can get away with it, their food is pretty good after all.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000110N', '2019-08-16 22:42:38', 'I like to come here every 3-6 months. I"m not huge on injera, so every quarter to half a year is enough to get my fix.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000241P', '2019-10-06 17:00:53', 'Plus to top it off, when local school invited local pizza places to present to a class on making pizza and recycling issues, Mario came and talked to the kids as if they were adults. All the other places treated it as a marketing event and brought coupons.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000125U', '2018-03-22 15:32:09', 'The lamb shawarma was also good.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000197C', '2019-01-27 07:20:08', 'The staff are always very helpful and friendly. They don"t always have enough baggers, but last time I was there they had plenty, and wouldn"t even let me unload my cart (they had a separate person in the aisle that unloaded people"s carts for them). First time I"ve experienced that and it was pretty great.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000241P', '2019-04-03 23:07:48', 'Good place always willing to stop by n shop. Hate that they dnt have what they are kniwn for but some of the buttenders help out !');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000185A', '2018-10-23 07:37:34', 'You can imagine how happy I was to find the Bagel Cafe!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000241P', '2018-11-12 01:26:27', 'Oddly enough, it was a negative Yelp review that drew me to Diamond"s in the first place (a review I see is no longer on Yelp). But after putting up with crappy service just to get the Sourdough burger I love, the argument with a man who was either the GM or the owner about whether a service dog could come in his bar was the last straw.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000147I', '2019-08-15 08:14:47', 'Trust me. I know food.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000179Y', '2018-06-29 17:44:16', 'Pros:');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-07-05 04:49:03', 'A0000125U', '2018-08-18 04:51:25', 'Giant portions,be warned.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000065M', '2018-04-27 14:37:12', 'ended up here because Raku was closed and it received great ratings on Yelp.  I"m so glad I came here.  One of the better meals I"ve had.  Started off with the mushroom dish and the lettuce wrap.  both were amazing. the lettuce wrap is like having a flavor party in your mouth.  also had the panang duck which was terrific. highly recommend all three dishes. one dish that wasn"t so good was the seabass with drunken noodles. overall it was an excellent meal, intimate setting, and great service. definitely will be back.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000287V', '2019-09-07 11:51:11', 'Oh my gosh I fell in love with this place today! Lots of vegan options, delicious food - my fav was the falafel and baba ghanoush - and friendly service. Prices are reasonable too. Can"t wait to go back for the open face eggplant soon!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000185A', '2018-12-26 03:36:51', 'I ordered the Packhouse burger; because, if you can"t do a burger right, then something is seriously wrong. And it was ALL wrong. Not once but twice.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000178S', '2018-09-29 20:41:58', 'I went to Dr. Goth for a couple procedures, including wisdom teeth and to have a suspicious oral growth removed. Only one word - fantastic! His staff is excellent, and his art in dentistry and patient care unsurpassed. Cut and dried - Dr. Goth was outstanding. He is the man to see in the Pittsburgh area.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000185A', '2018-10-08 23:48:29', 'The jade chicken quesadilla was decent, but nothing special. Just imagine orange chicken in between a tortilla and cheese. A friend of mine ordered a jade chicken burrito and we were confused when we pulled it out of the bag because it was literally the size of Mcdonald"s apple pie. If you order the burrito, be warned that it"s a burrito for gnomes and smurfs, but he said it was tasty.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000287V', '2019-04-15 08:50:10', '24 hours access with your keycard');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000197C', '2018-12-12 01:29:38', 'Prices were on par with other Mexican restaurants and you get more than enough to eat.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000240X', '2019-01-19 21:45:24', 'Went to see the exhibit "killer heels" and was greatly surprised. The shoes that were there were breathtaking for a real show lover like me. Everything from classic Pravda to crazy lady gaga shoes. It was a great girls day on a hot day. :)');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000049T', '2019-03-30 03:19:46', 'One really cool feature here is the salad bar, where they make you a salad fresh for you. I really enjoyed the Chinese Chicken Salad. There"s also a dessert area that has more choices than a lot of the other buffets, though the execution of them aren"t so great.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000193L', '2019-02-12 17:27:33', 'The room itself was dimmed and the ambiance was more intimate.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000103Z', '2018-05-11 04:54:47', '- Sea Bass with oversized Peruvian corn!!! YUMMMY!!!! The sea bass was nice and flaky.  Flavoring was a bit salty but I feel like at these restaurants they tend to do that a bit...i mean, everyones a bit intoxicated so salty foods are what people want LOL The peruvian corn was just really fun to eat!! My friends really enjoyed it but I definitely like summer sweet white corn on the cob better :)');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000052Z', '2019-06-23 18:35:57', 'It"s pretty rare for me to write fast food reviews. But considering I have always have superb experiences, it"s only fair to give them the credit they deserve. As far as I know, until now, Vegas only had one Freddy"s location. I was stoked to find out the new one was opening near me. For me, fast food consists of maybe 5 places- and this is one of them.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000296W', '2018-10-02 14:10:24', 'Everything was fantastic, although I was expecting a little more paneer flavor to my paratha.  This place is very casual, which I really like about it.  Don"t come in expecting the same food that you would get at a sit-down Indian restaurant; instead, expect the kind of food you would get if you were invited to a grandma"s kitchen.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000158F', '2018-07-13 06:39:54', 'Price was good, service was professional , quality is outstanding. These guys are connected to the guys at Toronto T"s. I could not be happier with both of their services, I use them regularly and would not hesitate to recommend them.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000136L', '2019-10-03 22:29:57', 'friendly employees');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000118M', '2019-02-01 18:26:52', 'I"d go back just for that; I"d stay away for everything else (well, the Jack Daniels chocolate cake makes a compelling point...)');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000242A', '2018-12-23 20:32:46', 'Their web site lured me in, impressive as it is... "Largest service fleet in the area... etc. etc."');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000158F', '2019-05-27 16:42:36', 'Salmon is a tricky fish as I have mentioned in previous reviews. I was happy to taste well cooked and tender salmon. The red enchilada sauce was spicy, but not unbearable.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000166F', '2018-05-22 10:35:45', 'I have loved this place every single time I went, except the last.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000175P', '2019-01-12 22:18:43', 'The waitstaff is very friendly and took great care of us.  They chatted with everyone who came in and made them feel at home.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000262K', '2019-05-02 12:33:46', 'Love this pub. The food is not great but if you stick to the pub grub faves. You should be fine. The best part about this place is the staff! All the girls that work here are amazing! :)');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-02-24 23:42:01', 'A0000014L', '2019-10-17 08:30:59', 'The kicker though, was that near the end of our session, our new buddy server out of the blue told us that the day after Christmas, there was a five hour wait, and they ran out of food, and booze, and kegs, etc.  He told us that they were going to get a lot of negative reviews for that on an email service card that is sent to you the next day after playing.  He asked us if we wouldn"t mind marking everything 5 stars because they really needed the good marks, and he would buy us desert if we said yes.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000110N', '2019-09-03 14:37:44', 'Ok, I"ve been living in Madison for over a year, and had been trying to find a place with decent but inexpensive chinese food. Fugu was ok, but overpriced and their delivery is slow. Ichiban seemed just ok. I"ve tried others with no luck. Finally I tried double 10, and I"m soooooo happy! It"s really good, but also way cheaper than anything else I"ve found in town. I really liked the garlic sauce they have. They also had super fast service. This is my new go to Chinese place!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000241P', '2018-12-04 16:14:18', 'I love Savers - the deals are great and the staff is positive. There is good quality and you don"t see much of anything with stains, etc. on them. Everyone has a great attitude and it"s clean.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000025Y', '2019-03-16 05:10:56', '( 2 ) breakfast desserts');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000214M', '2018-07-16 07:47:02', 'The Buffalo  (seems like a standard combo of whirl and franks) someone is mixed in a way that exceeds other standard buffalo combos.   Also enjoyed the dry cajun.  The sirachi were a bit of a miss though.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000049T', '2018-04-04 13:47:08', 'Don"t expect a hot tub or something fancy. Like I said, just a place to crash.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000163Z', '2019-04-16 07:27:52', 'As far a dunkin donut locations I have been to better. It"s close to where I am staying for my birthday week and I have the app with a few free coffee rewards. That is the main reason I came to this location 2 days in a row. First day there was no line but I had to wait since I ordered a smoothie that apparently only one person knew how to make. And of course they were busy. Day two I decided to go simple and got a large coffee with two donuts. Coffee order was right but they gave me the wrong donuts');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000291F', '2019-09-26 14:44:08', 'Fastening vibe and Vegas Strip friendly. Staff takes care considerably and is very current. Love the scenery! Thank you Azuza staff. xoxo ACE ENCORE');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000291F', '2018-05-04 07:34:57', 'We met Juan the owner who welcomed us and our little toddler.  Juan said he built the place to accomodate families and that their daily Happy Hours are restaurant-wide - and not exclusive to the bar only like many places in town.  Their daily happy hour from 3-7pm looked really good!   Our server was very friendly and the service was great!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000193L', '2019-09-23 17:43:38', 'I would definitely come back here good food, good service and fair prices. Oh and I forgot to mention they also have cool smoothies I got the Lychee...yum I love the fruit!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000093D', '2019-09-31 06:36:02', 'Today was my first time seeing the staff at Bella Smile and it was a great experience.  Although I"m not currently living in Las Vegas I plan on coming back for checkups and any other problems that may arise.  There was no wait time whatsoever and I was out of there without a drop of pain or discomfort.  The manager Severn was very accommodating and will be getting business from my family and friends in town.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000103Z', '2019-07-23 21:29:17', 'Man, I love Toronto! Hiding in a strip mall on Overlea, find a dingy looking restaurant that serves up fantastic, cheap kabob...be warned regardless of when you come here you"ll likely be waiting for a table as this place is always overrun with people...If you"re a fan of perfectly grilled spicy meat, you must try this place out...now that I"ve been here I need to limit how many times I go here per month :)');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000240X', '2019-01-04 10:38:28', 'Definitely would like to try take-out next time.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000063D', '2019-07-27 20:31:32', 'Started with the meaty Sicilian pizza, topped with Capacola, Salami, Meatballs, Asiago Cheese, Red Onion, which was probably my favorite. The crust was thin and crunchy and all of the flavors of the meats and cheese really were balanced so I could taste each with one bite after the next.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000163Z', '2019-04-03 21:17:54', 'Absolutely love this place! I"ve been here many times and it never fails to impress me  the bff burger is unreal and the tsoynamis and cupcakes are amazing!! Everything is pretty much the best');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000193L', '2018-07-21 07:03:51', 'To whomever owns Lucki Thai:   Lucki is actually spelled with a y.   Sheesh, how embarrassing.   Beyond the (yes, I do realize it was intentional) misspelling of the name of the restaurant, Lucki Thai doesn"t miss on many marks for me.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000149A', '2019-07-28 01:07:22', 'I had the LA wrap and my wife had more soup. Both were really good. They make fresh, homemade soup every day.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000221B', '2018-06-22 20:36:03', 'We lived in Mexico for several years so are always looking for authentic restaurants. La taquizza does a good job.  Their menu is diverse and includes many of our favourite dishes you don"t typically find in Canada.  The food is much better in house than as take out.  We have ordered many dishes off the menu and love anything carnitas and the fact that they have decent corn tortillas. The huraches are great too. I am a bit biased about the tacos al pastor since I lived in Puebla, but they are still ok. Can"t miss the mandatory churros though. They are amazing!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000052Z', '2019-10-25 23:45:33', 'I recently visited Pieology for the first time with friends recently and was really pleased with the selection and taste of the pies. For a set price you can pick your crust, base sauce and toppings, regardless of the amount and variety. The pizzas are made to order and placed in the oven for maybe 5-10 minutes.  There are gluten-free options as well for those that need.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000221B', '2019-10-18 14:20:58', 'When you come out, you have the option of using one of several free vacuum which are powerful.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000149A', '2019-03-20 10:42:52', 'I opened up a business and needed photos taken for my website. I told her my vision, gave her a couple sample images of what "look" we were going for, and I just sat back and watched her as she just took off with our concept and did something incredible with it. Michelle is an incredibly talented person. She picked the best locations and went above and beyond to ensure that our photos and website turned out great! I would recommend her in a heartbeat and she is who I will continue to go to for all our business" photography needs. Thanks Michelle!');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000163Z', '2019-03-05 07:39:19', 'Got a pepperoni and sausage half sheet pizza from here last weekend and it was delicious. The pepperoni was awesome! The sausage pieces are huge like small meatballs. The sauce is thick and sweet which I like. Tons of cheese on this pizza which caused me to have an upset stomach aftward. Not their fault. I didn"t go into the building to pick up the pizza so I can"t say what it"s like to eat in.');
INSERT INTO ForumEntries VALUES('QS0004', 2019, 2, 'P0000004E', '2018-12-07 19:06:31', 'A0000052Z', '2019-10-12 13:49:54', 'First I want to say that our group had an AMAZING time at Encore Beach!!!!!  BUT, we did end up dropping a ton of cash.  If you read the reviews carefully, you"ll notice that the people who had the best time are usually the ones who bought a lily pad, or a couch area.  It was a $500 minimum for the couch area by the blackjack tables, but I"m telling you that it was 100% worth it!  We had a bottle of Vodka and ordered some food and it was yummy :)');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000009L', '2018-08-01 13:19:44', 'Cafe Maya, the newest coffee shop in this location. Not too much has changed, although the inside seems a bit more spacious and cozy. They offer all of your typical coffee drinks and prices are reasonable. They have a couch and a large chair as well as around 10 wooden tables with chairs. They offer a food menu for breakfast and lunch, but not dinner. They also have a rewards punch card for loyal customers. This place is usually pretty quiet and chill and not too busy, so a good place to go for some casual studying. There is no parking lot, so you have to hope to find a street parking spot available nearby which is the main limitation if you are driving. Overall a nice little coffee shop.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000174P', '2019-09-13 07:25:06', 'We will be back for sure.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000009L', '2018-05-25 04:57:04', 'Overall, I love the place.  They have a raw bar that often has happy hour specials for $1 oysters.  It is not too casual, but also not fussy.  Everyone is very friendly and welcoming and the food is great!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000002S', '2018-06-07 06:51:47', 'I love Mexican food.  I live across from the Fajita Grill.  I have only been there twice (in 4 years).');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000174P', '2018-12-07 13:27:42', 'There are better and worse Y"s for sure.  This place is nothing compared to Dowd or Davidson, but it does the job.  I would give another star, but I"ve just been told they are raising the already high price.  Plus, people don"t seem to understand the one way signs in the parking lot, or just the parking lot in general.  I"ve def been honked and yelled at for following the rules.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000280M', '2018-11-03 22:24:14', 'If I could give them 10 stars, I would!  They are that awesome!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000280M', '2019-02-14 21:55:17', 'Yet another example of a business cashing in on location at the expense of quality. Cocktails are chain-restaurant worthy, wine list is weak, and seafood is only barely competently prepared.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000002S', '2018-03-12 07:40:19', 'The one and only cashier working was so slow and  chatted with every customer while there is a long line. I never seen anything like it! Shooting the breeze while there is a long line of people who have other things to do is unacceptable. With all the other negative reviews I hope they get there act together because Sephora has much better service and hate to see another store close.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000009L', '2018-05-05 07:45:12', 'It looks much better on the inside than the outside, as at first we were a little concerned.  However the place has tight security and large balconies.  We stayed there for several days and found the motel to be exceptionally clean, the owners/operators were very friendly.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000059N', '2019-04-01 07:15:15', 'I"m very captious about my pizza, but I honestly state I would order another one again in the future.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000157L', '2019-01-15 04:44:28', 'I would rate these guys 5 stars because of the professional, friendly and understanding way in which they handled the matter. Oh, and we were also able to get big discounts on parts and labor which is always awesome.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000157L', '2018-12-30 23:18:12', 'Ikea....an experience!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000077U', '2019-04-02 16:41:59', '-- I highly recommend the banana nutella crepes.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000270U', '2018-04-09 03:18:53', 'We ordered a couple of pints and enjoyed the vibe of this place overall.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000242A', '2018-03-31 08:45:44', 'We were immediately greeted with the large screens in preparation for the Super Bowl.  They even had the volume turned up so that people in the area could listen.  They also had some TV"s over the blackjack tables which was where we spent the second half watching the game.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000242A', '2018-03-06 15:50:29', 'Got a pepperoni and sausage half sheet pizza from here last weekend and it was delicious. The pepperoni was awesome! The sausage pieces are huge like small meatballs. The sauce is thick and sweet which I like. Tons of cheese on this pizza which caused me to have an upset stomach aftward. Not their fault. I didn"t go into the building to pick up the pizza so I can"t say what it"s like to eat in.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000270U', '2018-05-17 17:58:35', 'I normally stop here for breakfast when travelling through calgary international airport.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000242A', '2019-01-17 15:40:49', 'Craig was our host for the evening.  He contacted me promptly to provide detailed instructions on where to meet him and when.  Craig was waiting to greet us and, as promised, walked us right into the club and to our table, which had our bottles, mixers and waitresses waiting.  Craig stopped back a couple of times before leaving to make sure we were settled and having a good time.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000270U', '2018-06-23 21:47:42', 'Fastening vibe and Vegas Strip friendly. Staff takes care considerably and is very current. Love the scenery! Thank you Azuza staff. xoxo ACE ENCORE');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000203D', '2019-04-22 00:16:42', 'Delicious oatmeal raisin cookie. Cute little spot and decor. Nice little place to sit and chat over coffee or lunch.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000242A', '2019-01-22 16:19:10', 'Price was good, service was professional , quality is outstanding. These guys are connected to the guys at Toronto T"s. I could not be happier with both of their services, I use them regularly and would not hesitate to recommend them.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000203D', '2019-05-24 20:47:49', 'Staff was eh.. I mean the place is busy. No time to be too friendly to all the damn tourist. Can"t say that I blame them.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000077U', '2019-10-12 10:56:06', 'When a group says "We"re really thirsty. Could you please bring water while we look at the menu?" You"d better frickin" BRING IT!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000077U', '2018-11-10 19:45:07', 'This place is over the top! The food is great and the portions...when the hell did every restaurant in Vegas begin serving only sumo wrestlers. My family had a great mix of food - the Mayor of Flavortown Burger, Motley Que Sandwich and Vegas Fries. Don"t kid yourself, the fries aren"t a side; not by a long shot. They are a meal and for $13, they"re a very filling meal. We all loved our food, but I"ll have to say the Motley Que was the best meal of the night. Damn it! My wife is always bragging about how she"s better at ordering, and she did it again here.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000077U', '2018-10-13 16:51:00', 'Okay, we kinda freaked out when  we heard the half off starts and pizzas.. we ordered way to much but was so worth it.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000203D', '2018-02-08 15:15:28', 'I"m not into seafood but it was my husbands birthday and he loves it.. There were other options then seafood that made me happy...and my husband said his was great..');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000270U', '2019-05-08 13:33:54', 'Drink - 4 stars for the cucumber cocktail & bottle of Santa Margaritta Pino Grigio');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000077U', '2018-05-31 10:19:16', 'The Four Stars = to  how expensive this place is.  I only saw two dollar signs for this place, but it should be four dollar signs.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000077U', '2018-06-27 19:16:08', 'Unbelievable experience start to finish.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000203D', '2019-02-27 09:26:57', 'I tried this place because my girls are away for a month, and I REALLY wanted to try to wait until they came back, because NOBODY can hold a candle to them, but my toes were desperate.  When I went in, they were almost twice what I usually pay to begin with.  Then, before starting the pedicure, I specifically told them I already had gel polish on my toes.  They didn"t tell me right then and there "that will be an extra $5".  No, they waited until it was time to pay, and not only charged me for that, but they charged me all kinds of extra fees that I didn"t even ask for!  I had also informed the girl that my toenail was loose and needed gluing.  While I was looking at my phone, all of a sudden I felt this sensation, and she RIPPED OFF MY TOENAIL!!!!  Without even asking me!!!!!!  So then she had another girl come and put acrylic on there since the nail underneath was only 1/2 grown.  Again, they didn"t tell me how much this would be, or even ask my permission, they just charged me at the end.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000057U', '2018-01-24 11:27:53', 'Even though I haven"t had much luck at this location over the years, I still stop by when I am at this mall. I"m still a longtime fan of the brand (since high school, mind you) and I am still optimistic.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000245I', '2019-04-25 01:44:31', 'Eating in, however, avoid it! The decor is dated and tacky, not a pleasant environment to dine, although the servers are all pleasant.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000100F', '2018-01-11 08:21:12', 'Pros:');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000100F', '2019-08-24 21:43:06', 'Here"s why I don"t write reviews for Chinese restaurants: I have to look up their English names...');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000196F', '2019-01-10 10:58:33', 'Best Chinese food in LKN area. Never disappointed with the take out we get.  They speak English well too!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000057U', '2018-06-27 10:54:59', 'Cannot praise this place enough!!  If there were 10 stars, I"d give them a 10 star rating.  I called them about some custom lighting I needed for my handicap van and they scheduled an appointment for me to come in and see Jay for advisement.  The service was impeccable, the pricing was reasonable, and they were honest.  I plan to go back for some other custom work and will be letting everyone I know what a great place this is to deal with.  It"s a nice relief when you find a great business when there are so many questionable businesses these days.  Highly recommend!!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000068V', '2018-09-27 03:25:25', 'First my french onion soup had very little flavor, almost watered down.  The cheese was overcooked and clumping and the bread was just... bread in my soup.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000100F', '2019-04-03 19:32:15', 'We probably will not be returning to Toast for dinner. It just seemed way to pretentious and we were not impressed by the food or the 93.5 sanitation grade.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000057U', '2018-10-06 05:05:06', 'We ended off with the 22 oz. porterhouse steak, which was cooked perfectly to order and was more than enough for the both of us.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000111T', '2019-07-30 05:11:52', 'Real Ecuadorian helado de paila or Gelato!! Beautifully fresh and flavorful Gelato!. Also wonderful service to boot!! My favorite is key lime and twighlight flavored! The owners are amazingly sweet people come support this business!! You wont be disappointed!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000221B', '2018-10-20 23:10:53', 'After about 40 plus minutes we got a table and were so hungry and I ordered the chef special vegan dish which was the only Vegan dish on the list. I was immediately told that the chef special was SOLD OUT and that happened about a half hour before I ordered (meaning if we had a seat I wouldn"t got to have it ). Mind you it was only like 11:30am *insert Kanye shrug*');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000221B', '2019-06-25 00:04:25', 'We have had a wonderful experience with Dr. Beals treating our son. He"s been seeing him for about 8 months now and are very satisfied with the care he receives here. Dr. Beals is very helpful, we never feel rushed to get out of his office and he"s patient in answering our questions. One of the things I most appreciate is that I"ve never felt like his solution is to throw a bunch of meds at my son. He"s conservative and has started on low doses, moving up only when we were comfortable. My son loves coming to the appointments and playing with all the Minecraft toys in his office!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000105U', '2019-09-22 10:43:41', 'We choose to stay here simply because it was close to our client"s office and because every other hotel doubled their rates due to spring training by baseball teams.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000120U', '2018-09-08 09:34:14', 'There"s definitely something off here. The machines need to be calibrated properly.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000105U', '2019-07-19 22:21:15', 'Thanks Ashley. i highly recommend you and Ill be back.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000120U', '2019-08-10 07:13:23', 'I think when the first people I encountered was courteous and friendly then the critic inside of me melts a little, the front desk was very helpful and friendly, the therapies were excellent.  I even decided to join their wellness program because it"s very accommodating and manageable for my expenses.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000221B', '2019-08-24 18:27:06', 'Paid for the works. They didn"t even wipe the dash or any of the interior. Outside still has crap all over it. Should have gone back inside and asked for a refund.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000221B', '2018-03-29 10:10:01', 'This is a great alternative to the full service places.  It"s quicker and you don"t have to wait for someone to towel dry your car.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000120U', '2018-08-11 07:28:31', 'I won"t be back, but I"m glad to have visited this historic spot.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000221B', '2019-09-02 13:52:28', 'Well they definitely lost me as a customer! RC Willey here I come!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000221B', '2018-02-24 06:13:17', 'So I"ve been coming here for years and have never had any issues until today. I ordered what I"ve always ordered. A bean burrito, a taco and a drink. It cost over $9 dollars!! The lady didn"t tell me a price in the drive through which is annoying because they don"t have a screen that tells you. She asked if I wanted a bean and cheese burrito. Well obviously I said yes I want cheese in it. The price on the menu said it was like $2.50. There was no mention of cheese in my burrito costing more. So I pull up to the window and she tells me it will be $9.40 or whatever. I said, I"m sorry how much?? So I"m sitting there doing my own math and it still didn"t add up. $2.09 for a drink, $2 something for the taco and $2 something for the burrito. Even with tax there was absolutely no way that it would have added up to that much. So I get the receipt and they charged me $4.58 for a burrito!! There sign said $2 something. I pulled around and went in and their price inside said $3 something for the burrito. I went up and asked why I was overcharged $4.58 for a burrito. He said because I got cheese in it. I said, your burritos don"t come with cheese in them??? They always have and I"ve never been charged extra for it!! What place doesn"t put cheese in a burrito?? Also, for the first time their taco was bad. I opened the box and the taco shell was wet and soggy!! Usually it"s nice and crispy/crunchy and this time was not. I told them their signs are wrong. Also that it"s ridiculous you charge that much for a burrito with cheese!! Told them I will never be back!! I can get better food at Taco Bell and more food for the same price!! They don"t false advertise there either! Furious!  Their food and prices have gone downhill fast! They lost mine and my family"s business for good!!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000120U', '2019-10-25 09:08:08', 'Met an old close friend for dinner at Portofino.  Great intimate dinning with class. Excellent pasta and meat dishes. Delightful service and great drinks. Will come back!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000111T', '2018-05-09 06:22:37', 'The Buffalo  (seems like a standard combo of whirl and franks) someone is mixed in a way that exceeds other standard buffalo combos.   Also enjoyed the dry cajun.  The sirachi were a bit of a miss though.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000105U', '2018-05-26 21:56:54', 'Overall, I liked the yogurt better at Kiwispoon. The frozen yogurt seems less rich in Piccadilly"s and the flavors are not as strong.  The price per ounce is also marginally higher at Piccadilly"s.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-04-26 23:49:04', 'A0000105U', '2018-03-31 06:55:09', 'We"re from the Texas Hill Country;');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000165H', '2019-05-24 16:02:29', 'Palermo"s was a pretty decent pizza for the price. I got the chicken fingers and pizza special for $12, which was a great deal. The delivery was a bit slow but free, so no complaints there. I"d order again.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000105U', '2018-11-08 05:15:40', 'Awful place. Staff is not nice, very rude.  They never seem to want to help at all..Their service is not up to par & always out of bagels');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000120U', '2019-03-09 05:47:27', 'thanks again.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000105U', '2018-02-18 18:00:35', 'The beauty salon business does well around this area. There"s many!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000120U', '2019-05-12 21:03:54', 'Sometimes they run dinner specials - an appetizer, entrée, & dessert - somewhere around $11.99 or they"ve got some 2 for $20 deals.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000111T', '2019-04-22 20:24:42', 'Lesson: NEVER GO TO THE 7700 LOCATION! ALWAYS GO TO THE 616 LOCATION!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000111T', '2019-10-25 00:52:47', 'The food is the thing in any restaurant and pretty much everything was just ok. Our salesman/server;) confidently stated the steak tacos were the best menu item, and they were, but still only rated a just above average 3.5.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000120U', '2018-10-29 15:49:55', 'My good friend loves the place and found it a few years before. So he recommended a few things, we had a bottle of Riesling with our baked Bree and blackberry (I think it was jam) it was amazing. Truly, and I am very particular about the types of cheese I"m okay with (food allergies)');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000111T', '2019-07-11 20:28:53', 'I was also bummed that stores didn"t carry Peanut Butter Twix anymore, but now I"m happy that they can also be found at Rocket Fizz.. On our way out, wifey grabbed an RC Cola and I tried a Key Lime Pie soda which was pretty good.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000105U', '2019-09-23 23:56:58', 'When Petal first opened I was taken aback by the open, airy space but also by the prices. At first blush, this store didn"t offer much under $150-$200 besides accessories. Yet, over time, Petal has begun to bring in a more varied selection that appeals to a wider, stylish market. While they still offer the $300-$450 cocktail dresses, they also showcase a variety of merchandise in the $75-$100 range. Plus, if you can catch them on a sale day, it"s worth a trip.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000105U', '2018-05-25 16:02:28', 'Will be going back for my next mani/pedi.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000120U', '2018-08-06 19:33:55', 'Listen don"t complain that you got in late or the guy at the door was rude if you get there if you get there past 11pm who do you think you are the Kardashians?! I mean seriously I get bottle service every single time and I do not get there later than 10-1030 pm sure the club may still be empty but i would muchhh rather hang out at my sickkk table than wait in a line for 2 hours. AMAZING CLUB if you have game you willl have fun I highly recommend a table it is keyyy because you get tired of dancing for a few hours you go back to your table with some chicks hang out for a quick 20 then your back at it going nuts!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000120U', '2018-03-13 05:03:52', 'We have been wanting to try this place since it opened and finally went Saturday evening.  We sat on the patio and had some delicious cocktails.  We eventually went in and sat at a table for dinner.  The chicken and waffle appetizer was delicious.  For entrees we ordered the shrimp and grits and the steak.  Everything was delicious except for that the cook could not get my steak right.  They tried three times to achieve medium rare but just couldn"t get it right.  Fortunately, for me our waitress who was fabulous was more upset about it than I was.  She would take it back to the kitchen even before I had the opportunity to complain.  The manager stopped by and was so apologetic and gave us a gift card to come back.  Even though I would probably never order the steak again, we will definitely be back for the ambience, the drinks, the other yummy food, but most of all for the EXCELLENT customer service that is so rare to find these days.  Well done Trey!  Thank you!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000165H', '2018-12-10 14:59:22', 'The service was very good and the food came out hot and quick.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000111T', '2018-11-22 07:31:49', 'Very impressed. Jim from Dodge plumbing came out today and presented a very rational and logical argument for why his company should not take my money to convert over to an electric tank-less water heater due to out current logistics and electrical set up and why instead we should forgo this and stick with a gas system to save us money.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000120U', '2019-04-18 22:11:40', 'Service: No complaints here. Our server (Eric, I believe) was extremely pleasant and most helpful. He took the time to explain some of the menu items, checked on us fairly often, and  was generally very friendly. High marks here.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000105U', '2018-05-25 18:54:27', 'All in all, I will be back again to try more.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000165H', '2019-09-23 00:39:59', 'I have been getting monthly massages here for the past five months. A couple of the therapists are good, and some lack experience. As a stocking stuffer for my husband, I scheduled an appointment for him to meet with Roberta, a very capable therapist. When he arrived for his appointment, his name did not show on the schedule. Yet the gentleman working the front desk clearly remembered scheduling that appointment with me. He blamed it on glitchy new scheduling software. I was extremely disappointed and embarrassed, since it was a gift. But what else could we do but reschedule? An appointment was set, again with Roberta, through the same desk attendant, for this afternoon. When my husband arrived this afternoon, he was placed with a different therapist, who confessed that she did not know how to work with his specific shoulder issue. So he again rescheduled. This is getting ridiculous, and I"m considering canceling my membership over it.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 1, 'P0000004E', '2019-09-11 19:41:24', 'A0000111T', '2019-09-29 19:26:40', 'I e-mailed head office months ago about a lousy experience at their Yonge & College Street location and never received a response. Was never a huge fan to begin with but that confirmed things for me.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000289B', '2019-02-06 15:28:59', '( 2 ) other breakfast sandwiches');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000263B', '2018-12-25 19:29:47', 'I am always pleased with the help I receive and am thankful this place is in my neighborhood.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000064S', '2018-04-25 03:03:28', 'The only thing I found interesting about the place was the self tap tables which I didn"t sit at. The service was horrible, my Bloody Mary was disgusting, and the place was a sausage fest ( too many guys). Also I was extremely disappointed by the small dance floor. I knew Dierks Bently was a sellout when they opened their bar in old town Scottsdale. This place is not true to country roots at all.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000289B', '2018-03-03 11:28:05', 'We got a great package that started with 2 magnums of grey goose, which did great for our group. I was impressed how they handled both my large group (12 on table, 14 total that night) and the speed-bump of my credit-card declining as I forgot to tell the bank I was leaving the state. My Host Alexia, beholder of a supernatural beauty, waited patiently and kindly while I called the card and had them over-ride the security hold. She was calm and pleasant, and simply said "this happens all the time." (This was in stark contrast to the treatment at Omnia the night before where the bartender threatened to have my friend arrested when his card declined).');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000064S', '2019-04-22 11:06:12', 'The dining area was empty and only a few people were at the bar upon my arrival for a late lunch. Adlai our server was very helpful with recommendations and was knowledgeable of the menu. I had a overstuffed grilled chicken taco which arrived with Mexican rice, mixed cabbage coleslaw and, their own, Charro style pintos, all at the incredible price of... drum roll please... 7 Bucks! My buddy tried Paco"s Taco which is shredded beef and was equally as tasty. Servings are huge and everything was fantastic.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000263B', '2019-04-14 08:32:11', 'It looks much better on the inside than the outside, as at first we were a little concerned.  However the place has tight security and large balconies.  We stayed there for several days and found the motel to be exceptionally clean, the owners/operators were very friendly.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000135S', '2019-04-11 02:39:34', 'As far a dunkin donut locations I have been to better. It"s close to where I am staying for my birthday week and I have the app with a few free coffee rewards. That is the main reason I came to this location 2 days in a row. First day there was no line but I had to wait since I ordered a smoothie that apparently only one person knew how to make. And of course they were busy. Day two I decided to go simple and got a large coffee with two donuts. Coffee order was right but they gave me the wrong donuts');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000005O', '2019-09-21 12:12:05', 'hi, went to anthonys last thurs. night with a party of seven. We were celebrating an anniversary , we all dressed up to the nines ! ! wanted to have a fun nite out !');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000044J', '2019-09-09 06:37:11', 'It hurt. But I came out looking fabulous! #worthit');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000010N', '2018-05-30 12:37:43', 'We were told they were out of the ricotta ravioli (the dish I happened to be eyeing) but was told they can substitute the mushroom ravioli.  I ordered the mushroom ravioli,  my husband the lasagna, our friends ordered the chicken pot pie (all white meat), and chicken Marsala with ravioli side.   The server came back out and told us there was only enough ravioli for one of us...... so my friend changed his order to the green beans and mashed potato side. When our  meals came out they served him ravioli, he was told by the server they found some ravioli in the back- um okay, would have been nice to know before he got his meal as he was already looking forward to eating the dish he thought he ordered.  He was served a 2 mushroom ravioli and 1 ricotta (which he said was much better than the mushroom).');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000072U', '2019-02-27 07:38:14', 'I can honestly say you get so much more for your money at Subway for much less and you can make the sub the way you want and you get very full and sometimes even have leftovers!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000005O', '2019-09-15 06:28:36', 'For my hard lens it took time to get that correct as well, but that is expected. It also took me several times asking my Oakland optometrist to get my records faxed to them. McCauley-Celin at first said they never received them, but they then found them in another computer system. When the first lens didn"t fit quite right I went to the Wexford office to get it checked and left my lens there as it needed to be returned. When my new lens came they asked for my old one and apparently it was lost out there or somewhere. I paid for my lens with my FSA account but then was told that it should be covered under my insurance and that they would take care of it. That didn"t happen so I called to ask about it. They never got back to me so I went to their Gibsonia office and they said that they owed me money and it was fixed. This all again took several months.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000005O', '2018-08-22 05:25:36', 'Value wise, this has got to be one of the best lunches you can get for $5.99.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000010N', '2019-03-17 08:12:38', 'So, we shoo waiter off to get another bucket of beer and a refill of chips, and he comes back with the beer, and no chips (and again, all chatty - does this guy have other tables?).  The refill of chips took about 20 minutes.  We came at an odd time, and we were expected home for dinner, but the burgers and sandwiches on other tables looked very good.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000044J', '2019-01-09 14:35:38', 'OVERALL: by going here, you have the ability to make any outing into a good time ;)');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000072U', '2018-07-21 20:47:35', 'There are definitely pluses to Piccadilly"s yogurt though.  I liked the toppings better - I thought the mochi tasted better, the brownie pieces were bigger, and the chocolate caramel turtles went great on ice cream.  The chocolate caramel turtles should be a standard topping for both frozen yogurt and ice cream places.  Also, with the huge map of Cleveland Heights behind the cash register, this feels more like an authentic "neighborhood" froyo joint.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000072U', '2019-10-28 21:52:11', 'It use to be that when I have my annual vacation to Vegas with either my girlfriends or husband, Koi was the place to go to get my sushi needs.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000044J', '2019-06-23 03:10:04', 'Good food but service sucks: waitress apparently was in a rush, serving appetizers and burger plates at the same time... didn"t ask for desert and brought the bill and the credit card machine all together... almost cleaning the table as we were sitting at the table. No smile, no care.... almost rude.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000044J', '2018-05-05 12:24:13', 'Johnny did my acrylic nails (full set) which I am totally in love with. He did a great job and was also really personable.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000044J', '2018-08-26 17:47:57', 'After they got the person in front of us through the drive thru, they then told US to hold on a minutes because they are "backed up inside", but they weren"t at all. The parking lot had 2 cars and 3 people behind us in line, and when I was inside, a server was sitting at a table texting. So don"t tell me you are busy if your staff is getting paid for nothing. I yelled "are you getting paid for this?" Through the speaker and he had time to answer and tell me to CALM DOWN but couldn"t take my damn order.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000072U', '2018-05-01 05:00:09', 'The Server, Dawn, was friendly and accommodating. Very happy with her.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000005O', '2018-01-26 07:38:19', 'Visited this restaurant after a 3 hour drive to get to it.  We, my boyfriend and I,  saw their ad on their website for an $$85 per couple Valentine"s Day Dinner.  We had reservations for 6p.m. this reservation was made on Friday, we dined on Saturday. When we arrived right at 6p.m. there were plenty of OPEN tables in the restaurant.  When the hostess looked for our name on the reservation list it showed we were to be sat at table 14.  The list said in large print at the top..DO NOT CHANGE TABLES.  The hostess walked us past 8 - 10 2 person tables to sit us at a 2 person table literally 6inches from the neighboring table!  Could we have asked to sit elsewhere? Apparently not as the hostess was under direct orders not to change tables.  Could we have dined elsewhere...probably not considering it is Valentines Weekend and we drove 3 hours to get there and have no reservations any where else, and no idea at 6p.m. where to go.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000010N', '2018-05-22 10:54:53', 'So if you folks ever load up on omiyagi when you travel..............may I suggest this method to work around the dilemma you"re in.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000044J', '2018-09-04 20:45:47', 'Worst customer service ever had me waiting  a hour and then skips me never coming back do not go there if you want a haircut');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000005O', '2018-12-06 04:35:35', 'This place will not be recommended to anybody I know');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000229S', '2019-01-23 23:11:21', 'The staff are always very helpful and friendly. They don"t always have enough baggers, but last time I was there they had plenty, and wouldn"t even let me unload my cart (they had a separate person in the aisle that unloaded people"s carts for them). First time I"ve experienced that and it was pretty great.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000232Z', '2018-05-02 14:21:55', 'Fred is also an excellent negotiator and helped us feel confident and comfortable with what could have otherwise been some very overwhelming circumstances.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000152P', '2018-01-06 08:56:54', 'A mainstay for meal options when I"m traveling, Fresh has fresh bowls, juices and more. Yes it might just be rice and steamed greens but their sauces enhance everything.  When I come for healthy vegan food, that"s all I really want. I don"t care for the vegetables to be made into unrecognizable too small, creative portions. With that being said, Fresh still has some interesting spins on their menus, most notably the quinoa onion rings which are out of this world! And their homemade hot sauce is equally as good (I finish half the jar with every meal). I just wish there was somewhere like this in Calgary.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000229S', '2018-03-01 22:18:58', 'But alas, the service and food are simply too good even with that inconsistenci.  Sorry I couldn"t resist.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000017C', '2019-09-19 03:18:34', 'After living in Tempe for several months and not finding a nail salon, I went on yelp :) and found Nancy"s. The reviews looked pretty good so I decided to give it a try. Like some of the other reviews mentioned, the salon doesn"t look like much from the outside, but on the inside everything is great. The facility is clean, but what makes the difference for me is the fact that the staff there was so friendly, and welcoming. All of the technicians were talking with the clients and there were even a few friendly group conversations between everyone in the salon. It was very comfortable! Most of the ladies in there during my appointment were regular clients and they had nothing but good things to say about the place after learning that it was my first time there. Loyal clientele is always a good sign.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000232Z', '2019-02-22 02:08:54', 'I tried a bite of the steak which was very tasty and the side of smashed/fried red potatoes were oh so good. I enjoyed my french onion soup and arugula salad as well.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000017C', '2018-11-22 05:31:50', 'Our family LOVES the food here. Quick, friendly, delicious, and a great restaurant to take kids to. 5 stars!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000152P', '2019-09-16 08:24:02', 'They worry about their therapist but not their customers. I"ve been going on here for awhile and one time I missed and forgot about my appointment they charged me $60. They said that"s the least they charge. Normally it"s full price of your service. If it was so important not to miss an appointment why don"t they give an automated text reminder within 1-2 hours of appointment like other places???');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000152P', '2019-05-20 22:05:19', 'After a spontaneous visit to Piccadilly, I am sold on their artisan organic froyo (with vegan options!) I was skeptical, which is why I held out for so long on a visit...but I was very pleased with the overall experience.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000152P', '2018-06-25 07:31:01', 'Tried almost all the appetizers and "small plates" and they were exceptional.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000229S', '2018-07-03 16:06:21', 'Nice, relatively new, Mesa gun shop in the old bank building w/the clock tower on Main St.  Good prices, decent ammo inventory, helpful, knowledgeable, friendly staff.  Veteran owned with a modest veteran"s discount on purchases.  My new favorite gunshop in the area.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000152P', '2018-05-04 04:31:06', 'Our reservation was for 3:00.  At 2:48 I received an email confirmation that my car was ready for me and even given a stall # to find the car and license plate # to identify the car and even the color-white.  When we got to the stall there was a car, but not the car I had reserved and received confirmation for.  So, I explain my situation to a couple of workers that were walking by and they tell me that there was a Mercedes there earlier but somebody else got it.  Somebody else got it?  It was in a stall reserved for me, right?');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000017C', '2018-06-29 16:37:31', 'A bottle of Riesling, calamari app, two delicious entrees and dessert for $92!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000152P', '2018-06-22 06:44:31', 'I also love that they have no agenda when it comes to helping you select a certain food. They listen to what you"re looking for and then make suggestions based on the info you"ve given them. They"re also well versed in the latest pet food recalls (which are hard to stay on top of these days!)');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000152P', '2019-08-15 08:18:31', 'The food was great Our server Karu was the bomb he was cool, very nice and good looking guy. It"s the perfect spot for the bring friends and group. Great atmosphere and great menu choices.  SPICY... but its good haha.  Defenitely coming back!!!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000232Z', '2018-04-12 16:57:32', 'Went with my daughter and two of her friends- and I totally loved this place! I liked the high ceilings, the cozy decor, the lighting, and the marketplace feel of the interior... Because of numerous raves on yelp, we ordered the bacon wrapped dates for an appetizer. It"s true, they are totally fabulous- not to be missed!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000229S', '2018-05-25 23:35:03', 'Before Colburn, we had another plumber company (they advertise on the fwy billboards ("Yes, they can rip you off") come in to give an estimate.. What they quoted was 200% more expensive then what Colburn worked on for us. I called the office and asked why they are so expensive. The person on the phone told us that, "We are the best".... Well, I have to respond, "Best at ripping us off!" and hung up the phone up.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000132X', '2018-06-10 14:05:36', 'Terrible customer service , overprice , only one mechanic at the shop , 3 weeks to fix my bike ; owner dale kieffer so rude I never come back again.... Yamaha dealer same price excellent service');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000151T', '2018-06-06 11:34:01', 'Maybe I was too consumed consuming the bowl sized meal of a Bloody Mary.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000151T', '2018-05-28 20:27:57', 'We returned for breakfast the next day.  Breakfast menu was considerably smaller and a lot less options, but the food was really good.  I had the ham & cheese omelette, which was great.  Large portion of toast accompanied my omelette, and the crispy potatoes that came with the omelette were really good.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000151T', '2019-04-21 11:08:14', 'Authentic and Rustic full of ambiance.. Great for families aswell as romantic dinners.. Ahhh the memories');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000151T', '2018-08-11 03:44:21', 'It was my first time here and I was definitely');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000060R', '2018-10-26 04:52:33', '- Ahi tuna over a piece of bamboo and basil leaf.  This was an interesting combination.  Probably my least favorite dish of the night.  The basil leaf was a bit overwhelming and covered the taste of the ahi too much.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000132X', '2019-04-11 07:12:53', 'Oh man this is going to be a long review so if you want the gist, god awful, do not go. I was so dissapointed with everything that once I got home I had to write a review.  First of All I am Vietnamese and Pho is such a soulful dish, the pho I had today was the worst thing ever.  My parents came to visit with my sister and a friend, and after a long day we wanted to finish with a hot bowl of pho.  I have seen this place, I have even walked by it when I ate at Sura.  There was a smell so tantalizing that I had to go and try it. I thought it would be a good idea to try Jenni Pho Grill tonight.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000132X', '2018-03-19 11:44:05', 'Mac and cheese..not the best but not the worst');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000060R', '2018-06-08 17:22:39', 'Love this bubble tea shop! Green grotto has a very nice and comfortable atmosphere and definitely a place where you can relax and have a drink. The drinks here are good and the food as well. They give out free popcorn which is very unique and cool. The service was great and the workers were also very kind.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000151T', '2018-12-04 10:32:18', 'One day after I satisfy my frozen yogurt craving at Kiwispoon... I get invited out to eat frozen yogurt at Piccadilly.  A rare opportunity to truly compare the two yogurt places.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000151T', '2018-04-11 08:14:33', 'i have ordered from here 5 times. each time a different sandwich. greasy soaked texas style toast and bland as ever. they could have put anything on it to be honest, it tasted like hot grease. perfect for those who like indigestion and stomach pain. over-hyped restaurant, not worth the visit.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000151T', '2019-09-07 16:39:51', 'I think when the first people I encountered was courteous and friendly then the critic inside of me melts a little, the front desk was very helpful and friendly, the therapies were excellent.  I even decided to join their wellness program because it"s very accommodating and manageable for my expenses.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000151T', '2018-07-05 21:07:11', 'This place has rows and rows of machines, some are really old and some are more of a mid 80"s theme.  There is even a Ms pac man!  It was fun to spend an afternoon playing the machines and remembering all the fun of my early teen years.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000151T', '2018-08-26 06:10:11', 'In town for a convention and looking for something away from the strip. Found this place on Yelp and was not disappointed. Mango margaritas were tasty as were the shrimp tacos. The waiter mistakenly brought me the fish tacos (which were actually quite good as well) and was very apologetic when I pointed this out. He then replaced them as quickly as possible.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000151T', '2018-09-14 04:19:03', 'no showers');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000132X', '2019-09-08 23:01:21', 'Toppings - They Spicy Cajun Burger - Avocado, jalapeños, lettuce,');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000132X', '2018-10-10 11:41:39', 'This is my first yelp.  This restaurant was soo good I felt compelled to yelp about it.  Went for dinner with a friend of mine, really nice space.  All the staff were amazing!!  The chef even came out to our table which was cool.  And the Food, well I think even the most discerning top chef judges would be impressed.  A++ across the board.  We had the tenderloin and mac and cheese.  As well as the tomatoes two ways both are excellent choices.  I can"t wait to go back.  Cielo, kudos.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2019-09-02 01:21:25', 'A0000151T', '2019-07-24 12:24:07', 'Fresh and quality sashimi and great lunch time prices.  I tried it for lunch once and I am a fan, there are few quality Japanese restaurants in the city but this is amazing (even though it"s Korean owned) and great value for the money.  Great decor and swift service.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2018-10-10 15:30:39', 'A0000135S', '2019-02-16 06:31:39', 'This place isn"t inexpensive, but the portions and quality make it well worth it. We had dinner at BurGR the night before and for the same $100, this is the better option by a long shot.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2018-10-10 15:30:39', 'A0000135S', '2018-05-09 08:49:01', 'Well, on my trip I decided to got to Trader Joe"s (It"s a Hawaii thing.........we don"t have TJ in Hawaii).');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2018-10-10 15:30:39', 'A0000135S', '2018-09-14 06:46:22', 'Customer Service: When I walked in, I was greeted with warmth. It was about 1 am, so not many people were in the lobby. Which was actually the case throughout my entire trip. I chatted with the front desk associate like we were old friends. He was just that nice. And he made me feel so welcome!');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2018-10-10 15:30:39', 'A0000289B', '2018-02-06 20:10:17', 'That"s right folks - tongue. I love it. Name the animal - duck, pig, cow - it"s definitely one of the best eating parts of the animal. (what, were thinking about something else? You guys have dirty minds ;P  !) Being Asian, my parents indoctrined this love at a very early age.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2018-10-10 15:30:39', 'A0000289B', '2019-04-20 21:44:23', 'I called them but they let us wait for 2 hours and just transfer a key company.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2018-10-10 15:30:39', 'A0000135S', '2019-06-18 21:16:34', 'This is my favorite place to go for sushi, because of the ambiance, service, and overall quality of the menu items.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2018-10-10 15:30:39', 'A0000135S', '2019-09-01 08:01:47', 'Service was really great too and the staff was so welcoming. It was our first stop just after landing so really appreciate the service.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2018-10-10 15:30:39', 'A0000263B', '2018-06-16 08:48:12', 'I had the pleasure of enjoying the croissant, it had the right amount of flakiness and was bigger than expected.  The atmosphere was casual and laid back.  I now look forward to trying this place out later in the day.');
INSERT INTO ForumEntries VALUES('EC1301', 2018, 2, 'P0000004E', '2018-10-10 15:30:39', 'A0000263B', '2019-02-21 12:23:24', 'Interior is super cool and chill & the place has numerous decorative pieces if you look carefully.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000249V', '2018-01-02 17:43:08', 'Please go to Vintner Grill.  It is worth the drive from the Strip.  Just be patient in case the service is a little slow.  Besides, you never know what celebrity you may see!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000220U', '2019-09-04 02:18:06', 'Certainly a fun place to shop. The sales people are very nice they just really don"t have a clue about anything and the parking is always a mess. I bought a jacket today, and it had an unusual rear pocket and I asked what was the purpose and they really didn"t know so there best guess was that it could be for carrying your skies or poles lol.  I don"t shop here often but it is the first place I will come when looking for sporting equipment/clothes. I don"t rely on the staff, I do my research before I arrive. I have bought many items here including skies, inline skates, ice skates, and other odds and ends. Good selection and pleasant staff, just not that bright. Bring your own light bulb! lol. Watch out for the parking on side streets. I got towed once, that is never fun.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000040P', '2018-04-26 17:22:51', 'A simple taro with coconut with tapioca pearls was like $5.25 or something. Basically all the desserts were more than $5. That"s crazy! I can literally just make this dessert at home and for a bowl, it would probably cost like $0.50. A few years ago, I think I can still get it for like $3-$4, which is more reasonable, but wow, more than $5 is a little over the top for this dessert. Though I must say, it is Tracy Dessert, and they are a little more on the expensive side.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000246Y', '2019-05-05 18:08:05', 'Management provided a friendly compensation, but I don"t want anyone to get poisoned, sooo yeah, eat at your own risk!!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000246Y', '2018-04-29 11:50:15', 'First the good: 616 W Baseline');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000279Y', '2018-01-24 08:22:39', 'I also saw other items on the menu like fish balls, chicken wings, shaved ice. My friend got a mango drink with fresh mango in it!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000254G', '2019-10-26 22:46:21', 'The waitresses are really nice and friendly, which is the kick start of a good morning.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000254G', '2018-06-19 06:33:15', 'I appreciate the staff, clean facilities and responsiveness to maintenance requests. I have utlized the gym and access to wi fi in the office with no issues,');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000256O', '2018-01-22 10:01:46', 'The food was very good . The waitress was very inventive . The only thing is my I felt so sick after eating it . I"m not sure if it"s just my stomach not being able to handle it or what but I felt terrible . The staff at the front was very friendly and talkative');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000279Y', '2019-09-08 00:08:11', 'Prices were on par with other Mexican restaurants and you get more than enough to eat.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000254G', '2018-03-01 23:38:41', 'NEEDLESS TO SAY I LEFT A GOOD TIP BECAUSE I"M THAT KIND OF A GUY. But honestly, this woman did not deserve one stinking penny, and I"ll probably never go back here because of her attitude. It"s sad to say because I live in this neighborhood and I like supporting this neighborhood"s businesses.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000101O', '2018-01-01 06:43:45', 'This place brings back so many memories with my family. It has been here for years and unfortunately the service and food quality has gone down.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000101O', '2019-07-31 20:55:58', 'This Post Office also has a automated kiosk, which is nice, because to can still ship items out when the post office is closed, or say you come here on a Sunday to ship something out (when the post office is closed).');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000043D', '2019-07-10 06:00:51', 'Awesome food and service! Really wish we had one in Oahu! Our servers were on it! Thank you for working it out and fitting in our party of 9!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000219A', '2018-04-20 22:23:39', 'Our lane broke down repeatedly, it even gave up and powered itself off one time.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000040P', '2018-08-18 23:06:11', 'It was a journey to get to this place as it took about 30min from my house but the service and food here made it worth the drive. I also love how they had a poster of Keali"i Reichel. (They had other posters but Keali"i Reichel happens to be my favorite). Place is clean, service is fast and friendly and food is delicious. What more could you ask for?');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000147I', '2019-01-17 04:00:58', 'I first went in to see a couple of puppies, and I really like 2 in particular.  Because I already have a dog at home, and my boyfriend wasn"t able to join me, I put one of them on hold (they will hold your pet for the day) and went back a few hours later.  It is required that if you already have a dog, you must do an introduction to make sure it is a good match.  My dog loved Sayuri, but was not as fond of the other dog.  I like to say that my dog chose our new puppy :).');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000169M', '2018-11-06 22:31:26', 'As a Mexican born and raised in California I"m sorry this place was horrible!! The chili had a strange taste !! We just threw it away! And bought hamburgers from B K and that says a lot!! Don"t waste your time!!!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000195Z', '2019-06-30 09:29:49', 'He tells me he has a better car for me:  A Cadillac.  We go out to see the Cad and I see a Mercedes, a white one, and I ask for it.  He tells me it"s held for someone.  I say Yah, me.  He says he can"t do it.  I ask why not.  He says it"s on hold for someone else.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000269Q', '2018-07-14 00:56:49', 'I think when the first people I encountered was courteous and friendly then the critic inside of me melts a little, the front desk was very helpful and friendly, the therapies were excellent.  I even decided to join their wellness program because it"s very accommodating and manageable for my expenses.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000136L', '2019-09-24 17:09:09', 'Came in for some Chinese dessert, and I must say their selection has increased tremendously over the years. I might as well add that the price has also increased tremendously as well. The waitress gave us tea, which I could taste had red date in it. Fancy!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000150P', '2019-09-28 10:24:44', 'So, yeah, im not worried about coming back to this place any time soon in this lifetime. (You think?). Lol. Maybe as a duck.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000204V', '2018-07-05 03:00:00', 'The most important thing for a restaurant is food safety and clean. See what I got from my dish. Other bugs maybe still forgivable. But cockroach means this restaurant is really dirty nasty and not take their kitchen clean job seriously.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000107C', '2019-06-20 12:04:51', 'Decided on Valley ENT because my insurance provider covered them and they were conveniently located. I needed a quick appointment and didn"t want to wait several weeks. I took a gamble and picked first available, which was Dr. Chuang. After I made my appointment, I began reading reviews on Valley ENT and Dr. Chuang. I couldn"t have disagreed more on the negative reviews. Both Valley ENT and Dr. Chuang were professional, courteous, thorough and friendly. I will enthusiastically recommend both to anyone looking for quality healthcare. I strongly endorse them. They were excellent.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000078A', '2019-04-06 09:08:10', 'Well this was the first time trying this place since they just opened not long ago.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000168B', '2018-06-01 01:15:38', 'I also had their moscow mule. Cocktails were expensive, so I decided to go for one that was all alcohol. Others in our group had several cocktails that were all extremely tasty. Additionally, I tried a few bites of what my friends had. I had a bite of the spaghetti and meatballs. The meatball melts in your mouth, and the sauce was phenomenal. The linguini and clams came in the most decadent white wine sauce with perfectly prepared clams. The french onion soup was rich, buttery, and tasted phenomenal.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000012R', '2018-03-30 21:05:34', 'Let me be clear: this food tastes much better than Mandarin, but is less mainstream than the late Chitose. Newmarket is so desolate in the "good Chinese food" category that Cambodian Noodle King is my go to when I can"t justify a drive to Markham.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2019-09-20 22:46:02', 'A0000204V', '2018-10-12 18:22:43', 'The service was friendly. I thought it was weird that drinks come in massive beer steins, which do not exactly mesh with the contemporary Asian fusion decor, which is classy and understated.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000075D', '2018-01-22 13:25:36', 'So there you have it.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000235C', '2018-05-16 12:00:46', 'I thought the sushi was pretty good. I went in the afternoon (paying dinner buffet price) on the weekend. The selection was pretty good, and every time I returned, there was more stuff. It really surprised me that they had sashimi, which was well cut. They had a good variety of sashimi, and only one was strong (but I dont remember ... maybe the hamachi?). The rolls were rolled well, too.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000110N', '2018-03-14 16:44:31', 'Came here for lunch. It"s  16.99 per person and that includes drinks. Huge selection, flavorful, and not your typical buffet. Great place!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000139U', '2019-09-25 16:29:00', 'I was near empty, and just got a fill up here where 20.5 gallons were poured. Generally near empty, the max I"ve ever seen is 18 - 18.2, because there"s reserves.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000110N', '2019-07-10 13:23:17', 'Having dined at many other Vegas buffets (the Wynn, the Paris, the Mirage, etc.) I found myself very underwhelmed. Everyone raves about the Bellagio buffet but I just kept wishing I had gone to the Wynn.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000168B', '2019-08-23 06:15:18', 'If Union Social was located closer to where we live it might merit another chance but we live in the south end of Mississauga and thus will be sticking closer to home.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000204V', '2018-05-26 16:35:05', 'I contacted Sammy a couple more times throughout the weekend for various things, and he was more than helpful even though we weren"t using them for additional reservations or nights out.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000150P', '2018-03-23 02:19:29', 'My wife and I have been clients of Dr. Tran and Floss Dental Orthodontics since they opened their office on West Cheyenne 9 years ago. When we moved across to the southwest side of town, we moved over to this location. All of the dentists and staff are so professional and kind. One of the most important things to my wife and I is a clean and sterile environment. The office is immaculate and is completely up to date with all of the latest technologies. We absolutely recommend this to all of our family and friends.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000204V', '2019-07-12 22:00:42', 'We frequented the happy hour several times during our trip, and we were stoked every visit.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000240X', '2019-10-27 09:21:11', 'We had a side of asparagus, which was amazing.  Cooked perfectly al dente.  We also had the "canon" potato on the side, upon recommenation from our server.  I am SO glad I tried this.  It is actually an English food called "bubble and squeak." Mashed potatoes are sauteed with bacon and chopped cabbage and then topped with a cheese sauce.  Sounds strange, but it was a great combination!  I would go back for that dish alone.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000040P', '2019-09-13 20:43:02', 'It"s a good casual spot for drinks and munchies in a cute neighborhood but nothing to write home about on a normal day.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000220U', '2018-12-20 02:54:38', 'We"ve always been customers of Petco. We like the layout and the products they carry. Of course you can find some of the products cheaper elsewhere but we"re fans of "one-stop-shop". One of our dogs comes here for his monthly wash and brushout, they ladies are great with him. They also have a woman who is "certified" for cats, didn"t know you needed to be certified but I guess it"s a good idea. Friendly staff and a great dog trainer too!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000234Y', '2019-08-07 03:01:43', 'I have eaten at Pan Asian about 15+ times, and have taken several friends here.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000279Y', '2018-09-27 22:12:49', 'PVSEC was amazing when our family dog was attacked by a deer. They took excellent care of our dog and provided constant updates and visits to make us feel as comfortable as possible during a traumatic time. The staff and doctors were wonderful. I was even able to call in the middle of the night and speak to a staff member about how our dog was doing. Everyone clearly loves animals who worked there and made it as easy as possible on our family. They even provided help locating another 24 hour emergency clinic when our dog relapsed a few months later while we were on vacation out of state. Would highly recommend this clinic to care for your furry friend.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000220U', '2018-10-08 12:08:35', 'Such a unique place & a great find. Our waitress was funny, knowledgable, and did a fantastic job. The food was amazing. We will definitely return and recommend this restaurant to other couples!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000249V', '2019-03-04 10:29:53', 'Do yourself a favor and skip Wendy"s, McDonald"s, and for sure pass by the Taco Bell next to this place, you won"t regret it.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000219A', '2018-08-20 14:22:48', 'Keep walking.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000040P', '2019-08-21 21:57:09', 'Right off the bat, I need to tell you that I love thrift store shopping. Adore it. occasionally have sultry dreams about it. Okay, we"ll stop there.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000219A', '2019-07-28 21:20:56', 'Was very excited for happy hour and heard great things. Food was less then average we were charged $10 for BREAD.  Most apps were greasy or fried and still spent $250 on happy hour menu for a group of 4. First review on yelp so cared enough to take the time to write this. Sorry won"t come back.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000156L', '2019-03-17 16:23:27', 'Today we found a carpet we wanted and asked the sales guy to come over to price it out. It is an 8x10 and he gave the price, we agreed and then he went to write us up. When we went to pay, I noticed the price was different that the quote from 10 minutes ago by about $40. He said I needed to buy 8x12 instead because they don"t have a use for the other 2". Well, neither do I, this was not in the agreed upon price and it is a remnant so they can cut however they want.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000246Y', '2018-07-31 20:07:08', 'Keep walking.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000254G', '2018-03-24 07:18:50', 'How does the Post Office come into play?');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000040P', '2019-09-15 16:12:22', 'Love this hidden gem!  The food is excellent, well-presented and affordable. I have tried the Kiss Taco, Kiss Papa Taco and Kiss Salad...all delicious!!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-04-05 14:46:58', 'A0000040P', '2018-03-11 04:35:22', 'Palermo"s was a pretty decent pizza for the price. I got the chicken fingers and pizza special for $12, which was a great deal. The delivery was a bit slow but free, so no complaints there. I"d order again.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-05-01 00:10:27', 'A0000170Q', '2018-09-08 19:18:32', 'People go to spine specialists because THEY"RE  IN PAIN. Making patients wait for extended periods of time in terribly uncomfortable chairs is painfully ironic.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-05-01 00:10:27', 'A0000220U', '2019-09-16 13:56:56', 'Tried hamburger steak and it was so delicious. Gravy/sauce they put on the hamburger steak was perfect! Also came with onion rings on top which I love. Chicken katsu was amazing! Chicken katsu here is crunchy and surprisingly has a flavor by itself that you really don"t need a sauce for it. Best chicken katsu I had.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-05-01 00:10:27', 'A0000254G', '2019-09-28 10:50:45', 'This place gets crowded. Waited 20 min for a table at 12:30pm during the lunch rush. it clears out after 1:30pm, no waiting after the lunch rush. The portions are HUGE here with the typical Deli style sandwiches and bagels.  The bakery has great items too.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-05-01 00:10:27', 'A0000236Z', '2018-09-27 11:55:26', 'So-');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-05-01 00:10:27', 'A0000236Z', '2018-11-11 12:43:20', 'A mainstay for meal options when I"m traveling, Fresh has fresh bowls, juices and more. Yes it might just be rice and steamed greens but their sauces enhance everything.  When I come for healthy vegan food, that"s all I really want. I don"t care for the vegetables to be made into unrecognizable too small, creative portions. With that being said, Fresh still has some interesting spins on their menus, most notably the quinoa onion rings which are out of this world! And their homemade hot sauce is equally as good (I finish half the jar with every meal). I just wish there was somewhere like this in Calgary.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-05-01 00:10:27', 'A0000246Y', '2018-06-13 03:15:31', 'On another note, the manager/possible owner who was walking around seemed to run the place with an iron fist and simply not be a very nice person. At one point I heard him chew out a chef about how "When I say something, that"s it. There"s no discussion." Interestingly, he checked in with us mid-meal and was very friendly but his repor with his employees did not put be at ease and I"m less likely to visit a place because of that.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-05-01 00:10:27', 'A0000220U', '2019-07-01 13:22:16', 'Some of the equipment is showing signs of wear (ripped pads on weight machines and cracks in the weight benches pads and the numbers have rubbed off on some of the dumbbells, so you can"t tell what the weight is. I wouldn"t think it would be that hard to slap some stickers on there but it"s been that way for months.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-05-01 00:10:27', 'A0000170Q', '2018-06-11 23:11:29', 'When I compare Over Easy with other places, maybe I don"t find it my ultimate Sunday morning family breakfast place, but I"d definitely drop by with my pals for some home-style fries once in a while...');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-05-01 00:10:27', 'A0000043D', '2019-10-13 18:22:19', 'Out of all the places in Las Vegas to pick for Cinco de Mayo food, drinks, and music, we picked this one based on YELP reviews.  We were first time visitors.  We will definitely return very soon!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-05-01 00:10:27', 'A0000162Y', '2019-04-10 08:24:28', 'Went in for a lunch. Steak sandwich was delicious, and the Caesar salad had an absolutely delicious dressing, with a perfect amount of dressing, and distributed perfectly across each leaf. I know I"m going on about the salad ... But it was perfect.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-05-01 00:10:27', 'A0000220U', '2019-08-31 20:16:59', 'It is conveniently located very close to the convention center so it gets packed when events are going on.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-05-01 00:10:27', 'A0000043D', '2019-06-05 17:09:57', 'While I was in Las Vegas, I decided to go up with just a duffle bag for my luggage, as I was basically away for just 2.5 days.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-05-01 00:10:27', 'A0000209N', '2018-11-28 20:50:44', 'Food taste Ok. I like the pasta selection. However, there is No seafood choices at all. If you are looking for seafood, skip this place.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 1, 'P0000007K', '2018-05-01 00:10:27', 'A0000220U', '2019-10-27 17:51:18', 'So fresh and delicious! My go to poke spot in the city! Generous portions, clean and great selection of accouterments!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000154K', '2018-12-23 16:42:36', 'As a long-time fan of Chick-fil-A, I wasn"t walking in expecting to be comparing the two. But as we ordered, sat down, and were served, I couldn"t help it. The service is as good, if not better here than at CFA. The sauces are better, and so is the chicken! Everything was very clean and we were thoroughly impressed. I would like more sandwich options--I think next time I"ll just be getting chicken strips because I ended up eating just the chicken off my pimento crunch sandwich. Very impressed!!!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000297I', '2019-04-14 07:05:20', 'I love this place.  I admit I am stuck on the Old Fashioned Turkey sandwich with cranberry sauce.  This is real fresh roast turkey (I think roasted daily but not sure) on great wheat bread, the sauce has just a bit of a bite and compliments the sandwich well.  Huge helping of turkey.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000133D', '2019-09-30 02:19:35', 'Even though I haven"t had much luck at this location over the years, I still stop by when I am at this mall. I"m still a longtime fan of the brand (since high school, mind you) and I am still optimistic.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000029M', '2019-03-13 21:00:56', 'We order from this Pizza Hut often and always order a very similar order a stuff crust pizza with chicken, Bacon, and onion on half. We ordered today and the pizza had onion on the whole thing. The manager was rude and didn"t want to replace the pizza. After telling him I will come in and talk to the store manager did he change his attitude toward the situation.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000191G', '2019-09-18 06:16:38', 'Not the best part of town.  Not particularly good (or particularly bad) service.  Even the food isn"t the best.  But the variety is awesome, and unlike many places, everything is pretty good.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000166F', '2018-10-06 09:49:06', 'I still love your stores anyway but this would be a great help and not so frustrating!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000191G', '2018-09-08 21:03:56', 'Expect to be here for a while. Our reservation was at 9 and we only finished eating at 11:37- and we"re not slow eaters. I think the wait had to do with our party being big and the rest of the place being packed');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000250Y', '2019-01-16 08:21:02', 'Great food, great service. Obviously fried chicken isn"t the healthiest food on earth, but once a month I get that craving for good fried chicken. Their chicken is great, doesn"t seem too fatty, and their sides are excellent too. A+');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000094V', '2019-01-09 05:15:30', 'A good work in progress.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000049T', '2018-09-09 02:21:27', 'the food is good, very high end .  2 of us ordered the prime rib, 2 others ordered filet, 3 others steak, plus apps of sashimi, tator tots, mashed potatoes,');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000024S', '2019-01-07 23:40:55', 'I replaced the o-rings, pulled the diode and got the ac working after I vacuumed it and refilled, what armatures..  I guess I got to go to ford, spend $80 on a new Power steering Bottle and tell LKQ to send me the money..');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000082X', '2019-09-17 22:48:31', 'The decor and atmosphere was surprisingly nice, from the outside I expected to be more run down inside. The staff was very nice. We were surprised how empty the dining room was for a Friday evening.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000295G', '2019-07-28 08:01:14', 'Love this hidden gem!  The food is excellent, well-presented and affordable. I have tried the Kiss Taco, Kiss Papa Taco and Kiss Salad...all delicious!!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000082X', '2018-07-13 16:56:56', '2 mini starters, 2 entrees (tapas style) shared + 1 desert with one glass of wine gave us a $90 bill and we left without feeling full. The desert was a caramel fondant with pear ice cream, probably the only thing we ate that was so incredible we would have paid twice the price for. Otherwise it was too pricy.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000001P', '2018-01-15 11:29:20', 'Oh man this is going to be a long review so if you want the gist, god awful, do not go. I was so dissapointed with everything that once I got home I had to write a review.  First of All I am Vietnamese and Pho is such a soulful dish, the pho I had today was the worst thing ever.  My parents came to visit with my sister and a friend, and after a long day we wanted to finish with a hot bowl of pho.  I have seen this place, I have even walked by it when I ate at Sura.  There was a smell so tantalizing that I had to go and try it. I thought it would be a good idea to try Jenni Pho Grill tonight.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000268B', '2019-09-26 10:40:49', 'I will definitely go here again. I would recommend making an appointment. It was a Saturday when I went and they were turning people away.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000001P', '2019-05-24 03:39:10', 'We were told by Westgate staff that no hand stamps or wristbands would be given and we were ON OUR OWN if we choose to leave and we would not be allowed back in. Wow.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000179Y', '2018-01-05 11:23:59', 'Filled out the security forms  with the EMT .');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000134L', '2018-08-04 06:39:53', 'Didn"t try the chips, salsa or bean dip. I"m just not one to fill up on that stuff then take two bites of my food. No, i wanted to have a empty stomach for my meal so that i could write about my experience. [yes, i know im just brilliant, no need for the pat on the back]');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000172O', '2019-10-06 23:38:35', 'Very nice eating environment and the food are quite nice. Very native Japanese style.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000172O', '2019-05-13 05:22:19', 'I liked it and it was 33 degrees outside. I usually don"t eat ice cream with gloves on. Three scoops for a regular was more than enough for the two of us. valhrona chocolate was really good. pumpkin pie was so so.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000284F', '2018-08-15 17:16:30', 'I"ll tell you. When we walked in there was a large grill at the front of the restaurant with a number if steaks cooking on it. But the chef was not watching the meat. He wasn"t even in front of the grill. He was nowhere to be seen as we walked through the doors. And there were at least 4 steaks cooking when we arrived. So I figured that my steak would receive the same lack of attention.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000180L', '2018-03-15 17:57:26', 'They always greet everyone with a smile who enters even when super busy. They have excellent customer service and I never had any problems coming to this store. I  highly recommend them and go see Mitch who will go above and beyond.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000067A', '2019-09-06 17:24:12', 'I ordered the Mediterranean and it had a lot of flavor from all the different veggies and spices. My only complaint is: the crust was a bit dry, a little more olive oil wouldn"t have hurt.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000016W', '2018-05-19 20:19:44', 'This is a picture of an **INSECT that I was about to eat!! I was really hungry and decide to stop by and eat.. Thank goodness this was my second plate and I wasn"t too full because I gulped down the first plate.. This is your soup of toscana that I was served.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000247B', '2018-07-11 20:04:48', 'Party of 3 ordered the fish tacos, pork belly banh mi, corn beef hash Benedict, and bam ham. Everything was delicious, esp the pork belly banh mi. It"s tender and juicy and the baguette was nicely toasted. Love the crispy fish taco too. Their compliment chips and salsa were fresh and super good and crispy. Service was excellent. Our waitress did a great job checking up on us and serving us. I really want other food options too but I"m too full. Next time i visit i will definitely come back.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000164A', '2019-06-24 06:36:49', 'I made a yelp account just so I could write this review, that"s how rude the staff is here! The first time I came here I thought maybe it was just a one time thing. But they are consistently, unfailingly, disrespectful. I will never in my life come back here again.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000257O', '2019-10-18 19:45:04', 'I"ve been there twice. The first time I got a load of pastries to go (which turned out to be yummy!) and the second time I went for breakfast. Both times, the service was great and the food was great. I don"t know what it"s called, but there"s a filo dough "tube" filled w/ spinach and cheeses... get it!  Their signage is practically non-existent, so they"re unfortunately easy to miss. It"s worth a visit.  :)');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000016W', '2019-09-18 21:39:04', 'Okay, so, we had a full meal here, with drinks, for less than $20. Can somebody say Value?!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000037E', '2019-08-20 09:14:48', '2. The waiting time in the clinic is too long. I ALWAYS have to wait there for 30-50 minutes passed the appointment time. I know the doctor is busy, but the patient"s time is precious too. I don"t like taking my work hours off and just wasting it on waiting for the doctor. And when I finally get to meet with the doctor, I can tell that she is not patient enough. She seems in a hurry, I know she wants to finish up our conversation asap and move on to the next patient.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000194A', '2018-12-13 10:44:25', 'I used to come here a lot. It was the best boba place around here but lately the tea just taste like water, sugar, and flavor. There is no tea taste but the texture of boba is good.  The squid balls are still great. But I guess if you like slush and blended drinks its still good. I will still come because its the closest by my house.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000185A', '2019-07-10 04:28:44', 'I was very impressed by the cleanliness of the salon. They have a large polish selection. My nails have lasted a long time and that means a lot to me.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000067A', '2019-06-13 04:36:57', 'So Mary and her husband came out and assembled a few pieces. Some large, some small. All in all they did a very good job and were polite. I think that we extended the same courtesy. We actually asked them to come back and do another small job. We needed fixtures attached to all our cabinets and drawers. Mary quoted me a price, which I accepted and we agreed on a date. On the day they were suppose to come out, about an hour before our scheduled time, Mary texted and told me her husband had a flat tire and that they"d be late. I told her, no problem. I was ok. Then......SILENCE. Never heard back from her again. I texted a few more times to reschedule, I asked her if everything was alright, I even asked if they were OK? I know Mary got my messages because I had gotten read receipts. She just completely ignored me. It was all very strange. So, for the work they did I"d rate them a four but for the appointment cancellation and non responsiveness Id give them  a zero if I could. Stephen W. said " They"re real pros" I beg to differ. Professionals who own and run their business should always respond to it"s customers.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000257O', '2018-04-26 09:48:10', 'Visited this restaurant after a 3 hour drive to get to it.  We, my boyfriend and I,  saw their ad on their website for an $$85 per couple Valentine"s Day Dinner.  We had reservations for 6p.m. this reservation was made on Friday, we dined on Saturday. When we arrived right at 6p.m. there were plenty of OPEN tables in the restaurant.  When the hostess looked for our name on the reservation list it showed we were to be sat at table 14.  The list said in large print at the top..DO NOT CHANGE TABLES.  The hostess walked us past 8 - 10 2 person tables to sit us at a 2 person table literally 6inches from the neighboring table!  Could we have asked to sit elsewhere? Apparently not as the hostess was under direct orders not to change tables.  Could we have dined elsewhere...probably not considering it is Valentines Weekend and we drove 3 hours to get there and have no reservations any where else, and no idea at 6p.m. where to go.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000087Y', '2019-01-22 02:48:32', 'long and the workers incapable of handling the slightest issue. I m sitting upstairs if there is a next time I come to a Knights game.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000257O', '2019-05-26 10:38:50', 'My friend lost the key in the car and we were locked out of the car.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000185A', '2019-10-13 19:55:48', 'We called George the next day to discuss food options, and he said yes everything we wanted we could have for the price we discussed. Tasting was included for 6 people. I asked him to send me an email confirming what we spoke about on the phone. When the email arrived it simply had generics such as "assorted veggies, assorted cakes, hors d"oeuvres" as well as a tasting for 2 people. As well he upped the amount of people we had to guarantee for the price.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000247B', '2019-10-16 04:00:04', 'I think the prices were great for the Waxhaw area. I paid $57 (without tip) for a full set French manicure with sparkles, and pedicure with design. I used to pay $75 for the same service at my last salon.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000019J', '2019-05-27 16:39:22', 'Another solid BBQ place in Calgary. This is definitely a great place to go if you are craving something smokey and delicious.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-02-06 08:29:25', 'A0000061X', '2019-06-25 16:59:51', 'I started taking my dog here after she expressed her hatred of her previous vet, who felt that it was "no big deal" and that they could always just muzzle her or sedate her for check ups. I felt that was ridiculous and brought her to Doctor Youssef who felt the same and is doing everything in his power to make her comfortable with him and his staff. He has even let me take her around the whole building just to get use to it.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000067A', '2019-03-07 00:47:58', 'After an afternoon hike along the Don River, we were in dire need of some sweet sweet therapy.  Close proximity to downtown we decided to venture towards Lickadee Split on Coxwell.  I have a soft-spot for soft-serve and confectioneries! With a ton of selections to choose from Lickadee Split is a classic, popular and awesome joint for some cool treats if you"re ever in the east-end of the city.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000180L', '2018-06-30 09:47:16', 'Very impressed and will be returning with friends :)');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000019J', '2018-10-14 20:28:38', 'Also don"t believe when they say they will give you a credit for unsatisfactory meal because for some reason they have a tendency to forget they said it.  They no longer have to worry about my business.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000194A', '2019-04-23 21:50:26', 'So why 2 stars? well..the food absolutely sucked.  I ordered a Swiss mushroom burger w/curly fries.  First off, the burger and curly fries LOOKED delicious..but upon eating my food..I found absolutely no taste in any of the food, even after adding tons of salt and pepper to it. It"s as if some mixture of oil and plastic got in my food that negated anything that could add taste to my food. Plus the mayo I got came in this bowl and let"s say something about it"s color and texture didn"t look right.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000014L', '2019-06-20 09:45:01', 'They charged me twice what I expected to pay. The guy at the counter small-talked me, asked me if I wanted "any additional insurance" - I said no - and just initialed where he told me to, not noticing that one thing I initialed was collision waiver insurance, which I did not need and ended up doubling the original cost. He did not walk me through the additional cost and may even have been purposely misleading by distracting me with small talk. I am an experienced traveler and nothing like this has happened to me before. When I returned the car and expressed my surprise at the doubled cost they essentially said "well you signed it" and "it"s worth it anyway." I will never rent from this Payless again.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000194A', '2019-06-27 09:49:03', 'Was this a good show? It was ok, it was entertaining and interactive, which i thought was nice. would i go again though? probably not. Next time, i"m trying chippendales. maybe their attitudes will be better.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000016W', '2018-10-17 00:02:49', 'They specialize in Southern California-style food like burritos, salsas and fish tacos. The decor and ambiance is great. The tables and bar stools, exposed-brick wall, modern light fixtures etc. make for a classy and comfortable dining experience. I saw a few craft beers and a respectable bourbon list. However, we did an early Saturday morning breakfast, which was fantastic. The banana pancakes were unreal.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000272I', '2018-07-13 08:21:38', 'Good tex.mex food. Live close so easy for me. Good margaritas. Decent service. Prefer the local mexican places, but this place is good and closeby. Upset that I don"t get my work discount anymore.:-(  But will return.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000082X', '2019-02-16 19:53:11', 'I have visited this place several times. They have great happy hour prices and their regular menu prices are very reasonable too. Their entrees are big enough to share, my favorite is their fish tacos. They tend to get pretty busy on Friday nights, so there is sometimes a bit of a wait. Overall, thumbs up!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000260L', '2019-09-06 01:21:36', 'This is such a great attraction!!! My 13 year old son loves all things Marvel - it made the highlight of our trip! Staff are very helpful and the venue makes you feel like you are in the middle of the movie!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000260L', '2019-03-19 05:20:15', 'A must go destination in Phoenix.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000082X', '2018-04-08 19:25:06', 'I have been back a few times so far, and this won"t be the last time. It has room to grow on me, and so does the rating.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000025Y', '2019-10-20 16:45:28', 'Service was great, unlike some other posters, but that did not make up for the food.  Maybe I ordered the wrong thing?');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000082X', '2019-09-02 10:55:24', 'Very large space, open layout.  Been here a few times years ago. I ate mostly the crab legs. Prime rib.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000260L', '2019-04-06 19:59:10', 'Anyhow, on to the food!!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000295G', '2018-04-30 12:24:09', 'A co-worker of mine kept talking about Tottie"s, so last night I finally gave it a try.  I don"t know if it is different dining in, because I ordered take-out, but it was good.  It didn"t blow me away, but it was good.  Very similar to good chinese take-out, or maybe a notch up.  I ordered the Tottie Rolls as a starter.  They are crispy egg rolls that you wrap in a lettuce leaf, with mint and parsley.  They come with a sort-of sweet and sour sauce for dipping that was quite nice.  Or atleast I think that is how you are supposed to eat them?  I had a big take out container full of lettuce, mint and parsley, so I figured that was the drill since I didn"t order a salad?  They were good.  I ordered the Tangerine Chicken and the Beef Pad Lard Na.  The chicken dish was good, tasted like an orange chicken, deep fried until crispy then tossed in a sweet tangerine sauce.  It had a few strips of red bell pepper also.  The beef dish I liked a little more, it was the wide egg noodles and had chunks of beef, onion, pea pods and bok choy in a really good brown sauce.  You can order many of the dishes mild to HOT, so I did a medium hot since I sharing the dishes I didn"t want to blow them out of the water with too spicy of a dish.  Next time I will definitely go hotter!  The dishes came with 2 containers of sticky white rice, which was exactly what it sounds like. I didn"t have any dessert, but the crispy bananas sound great, and I am interested in trying the ice creams I keep hearing about.  I also really want to try the soups, they sound good.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000134L', '2019-09-24 12:33:09', 'for their own protection.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000179Y', '2018-07-01 23:45:47', 'Customer Service: When I walked in, I was greeted with warmth. It was about 1 am, so not many people were in the lobby. Which was actually the case throughout my entire trip. I chatted with the front desk associate like we were old friends. He was just that nice. And he made me feel so welcome!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000179Y', '2018-12-28 14:16:30', 'When I got home and went to unpack the food, I realized the order was completely wrong. Checked the receipt and the order that was rung in was completely different then what I asked for and with totally different quantities. It was as if the order was erased and the guy just tried to make it up out of memory. Certainly was not please to have ordered mainly calzones and end up with almost all subs.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000268B', '2019-01-12 09:04:07', 'Worst customer service ever had me waiting  a hour and then skips me never coming back do not go there if you want a haircut');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000284F', '2019-02-04 06:37:33', 'So there you have it.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000295G', '2019-09-13 06:05:09', 'Overall, I had a great experience at Surrender. The club was beautiful, my group had a blast, and Morgan Page (and his opener) rocked it! Learn from my mistake, stay away from the indoor bar, and come with great people and you will have one memorable night! 4/5.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000293L', '2018-09-03 23:22:38', 'Too much food and not good for diabetics the food is delicious.  Just had a spread of the waffle, protein omelette, veggie omelette, brioche french toast and chicken and waffles between 6 of us.  Oh left off apple pancakes.  All great and Tracee was the best waitress. She leads a great happy birthday too.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000171X', '2019-07-06 23:18:35', 'CONS: sort of back alley, private area. it"s a little cluttered and heavily stacked inside!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000098D', '2019-08-26 04:13:41', 'It"s extremely annoying that the Venetian chooses to broadcast Fox News at their VIP lounges against their customers" will and employees" will.  I would consider this harassment since neither have a choice to change the channel. I"ve tried. I have complained to the employees who state they are not able to change the channel. Trust me, the Venetian customers and their employees do NOT want to be forced to watch Fox News. Please change to a neutral channel or CNN which provides more transparent news.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000275Z', '2018-06-02 12:28:23', 'Heard about this place and was dying to check it put-and I"m very glad I did! Decent beer selection and kind of a hipster vibe, but $8 for a loaded hot dog and tater tots has got to be one of the best deals in town. Tons of unique toppings to pick from and delicious dipping sauces for tots (secret fry sauce was my fav). We were there early and had no problem getting a seat at the bar, but I can see how during prime time or when live music is on how it could be kind of tight. If you"re going for the food is get there earlyu because that loaded dog would have been super hard to eat while standing.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000192R', '2019-09-01 18:30:55', 'Excellent chaat, okish biriyani, great service. Fresh food. The place is very clean and lively. Unlike the other Indian restaurant s we visited which were so dead!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000121F', '2018-02-23 06:16:03', 'This is my go-to grocery store when I am too lazy to head to Winco. I have been here well over a hundred times, and the experience is pretty standard for Smith"s stores in my experience.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000098D', '2018-10-22 05:07:25', 'So at the end, I pulled out my Groupon and gave it to our server, apologizing that I had "hid" it until the end, but that Yelp reviews had indicated Groupon-ers got short shift as far as service went.  She took it graciously with a smile and said one of the issues was when they were Fuego Tacos, people ordered $9 plates than proferred a $10 Groupon.  Not nice.  (BTW, Fuego del Mar entrees from $20-$25)');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000275Z', '2018-03-29 13:47:14', 'To share, we decided on the fried jerk chicken wings, which were delicious. Bae ordered the baseball steak and I opted for a soup and salad.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000121F', '2019-03-01 09:03:17', 'Fastening vibe and Vegas Strip friendly. Staff takes care considerably and is very current. Love the scenery! Thank you Azuza staff. xoxo ACE ENCORE');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000020H', '2019-02-06 00:33:30', 'My favorite burger joint! Simple, yet delicious! Service is always great with cheerful greetings and happy smiles.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000127E', '2019-09-28 09:52:34', 'Delicious oatmeal raisin cookie. Cute little spot and decor. Nice little place to sit and chat over coffee or lunch.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000259X', '2019-10-11 19:50:48', 'Will not offer refund and will charge you for cancelled flight. Even a month in advance i tried and they will not work with me. Dont use this cut rate airline');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000020H', '2019-09-05 14:55:03', 'I have no idea what the owner"s problem is, but he"s incredibly rude. His wife, on the other hand is super nice (an odd mix).');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000127E', '2019-09-13 18:18:54', 'Mario and his sons work hard to please and we"ve never had a bad meal here. I"ve seen them bend over backwards to try and take care of obvious jerks.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000266H', '2019-10-25 17:31:16', 'Gold Ribbon- mix of caramel, chocolate, and vanilla, I truly loved this trio of flavor, each complemented one another. TRULY delicious!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000008J', '2019-04-05 02:14:15', 'Came here while in town for a country concert.  What better way to start our day.  Everything was great.  The service was amazing from the time we walked in the door.  We were sat at a table and to our surprise there is a beer and whiskey tap at the table.  You pay by the ounce and there is a screen to show you what you"ve drank.  The food we had was great.  The whiskey burger was my favorite.  For you country fans this is a must when in Scottsdale!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000230T', '2019-03-25 08:15:10', 'We had a great lunch experience today at Rubios. It didn"t start out that way but was quickly turned while we were checking out since we were using promotions.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000230T', '2019-09-07 06:13:09', 'The amount of food you get for the price is unbelievable!  The donairs and shawarmas are so big I struggle to finish one.  Even when I"m stuffed to the brim, I can"t bring myself to throw any away, so I always make myself sick by force feeding the remaining wrap into my mouth.  I wouldn"t for one second dream of wasting a Jimmy donair.  I know that everyone who goes here will all be saying the same thing: it"s so delicious and marvelous that nothing else will ever be satisfying again!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000008J', '2019-09-23 11:00:55', 'Mario and his sons work hard to please and we"ve never had a bad meal here. I"ve seen them bend over backwards to try and take care of obvious jerks.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000228K', '2018-08-28 20:11:58', 'Highly recommended!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000142J', '2018-06-18 08:41:01', 'My friend lost the key in the car and we were locked out of the car.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000297I', '2019-10-08 00:47:01', 'Great food. Try the chop its huge.friendly service and down home atmosphere.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000090V', '2019-10-18 21:19:07', 'We spent about $250 for three people on very basic food and a glass of wine each.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000191G', '2019-08-18 01:49:03', 'Jared to the rescue:');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000008J', '2018-11-16 17:12:01', 'Again, overall the place is well lit and looks great.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2019-03-07 23:13:55', 'A0000008J', '2018-04-05 13:57:12', 'There are some mixed reviews here about Fresh and from a food creativity standpoint I can appreciate that on some of the menu items. However, you"re getting what you came for and that"s what matters to me.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000090V', '2019-07-24 21:58:55', 'We were craving breakfast food and decided to check this place out. We shared a skillet and a few breakfast sides, each of which were cooked to perfection and super tasty. The atmosphere here is cute, clean, and just what you want for enjoying your breakfast.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000201O', '2019-09-23 15:10:34', 'The food, oh the food was just so incredible.  My favorites were hamachi jalapeno, hamachi tartar, miso cod lettuce cups, and uni.  All of the dishes have nice portion since it"s meant to be shared, which I thought was a great concept!  The food was just so fresh and nicely flavored we actually ordered some dishes again!  My girl friend and I were definitely in sushi heaven.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000191G', '2019-09-14 20:30:56', 'Give me someone who can make me laugh... and I"ll be your friend for life.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000266H', '2018-01-27 07:20:59', 'PROS: I love this lee"s location! it"s my favorite to go to since it"s near my home. it has everything you would want, they even have a growing sake collection!! they restock a lot.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000201O', '2018-07-16 16:19:29', 'I would definitely check this place out again, maybe for breakfast next time! I love that they do reward cards for locals to earn free sandwiches and even deliver within a 5 mile radius. I"ll update after my next visit.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000041C', '2019-09-27 00:34:50', 'Very disappointing.  Overpriced mediocre food.  Refried beans served with fajitas were so hot that they not only burned my tongue but throat as well.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000024S', '2018-02-08 08:52:15', 'The experience.  The menu did not have a lot of lunch options (brunch was the focus of the day) and the ones that were offered were somewhat difficult to figure out.  Frustrated I ordered the bison burger and my wife had the flatbread.  The food came quickly enough (wasn"t busy) but that is where it all went awry.  The bison burger was small yet I could not finish it as there was a strange flavour to it that made it sickening after a while.  The potato salad that accompanied it was good.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000083Q', '2019-06-28 16:21:17', 'Everytime I"m in town I hit this place for curds, beer and brats. I spent a whole Sunday watching football here and had a blast. Crowded times are a little annoying, but it is a college place. Love the mustard selections too. Curds are a must!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000094V', '2018-04-19 03:18:23', 'Really the food was pretty good, so maybe it is just my son"s behavior that"s coloring my opinion on our meal,  but I just can"t help but feel like we over paid.  There was nothing remarkable offered.  The service was iffy, the food was unexceptional.  Well, dessert was pretty great, but I don"t need to pay almost $100 for my family to eat dessert.  I"m just not feeling the love for this place this time.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000094V', '2018-10-20 10:23:10', 'Cons:');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000083Q', '2019-07-23 02:35:01', 'When a group says "We"re really thirsty. Could you please bring water while we look at the menu?" You"d better frickin" BRING IT!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000001P', '2018-11-08 15:39:50', 'Duck Hunt is the biggest tease....NEVER in working order when I"m there.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000284F', '2019-03-05 23:14:38', 'The added stone "massage" was barely a massage!  She rubbed the stones up my lower legs a couple times, and that was it.  It lasted about 30 seconds.   And when I asked for a design, I"m used to getting a board with a bunch of designs to choose from.  She didn"t even ask me what I wanted, she just painted a few lines on my two toes and then charge me 5 MORE dollars for that!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000037E', '2019-04-11 19:04:05', 'I think pastel is a great dessert spot after having dinner around the area. The outdoor seating also makes it a perfect date spot in the summer.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000037E', '2019-08-17 18:10:12', 'Anyways as we ordered through the Drive thru I was practically yelling thinking Omgosh really!!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000067A', '2018-11-13 07:59:44', 'Crawford"s Auto repair was extremely thorough. They pinpointed a noise to three contributing factors: a rock in the tire, a roof rack bolt, and something in the sun roof. I love how detail-oriented these guys are.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000257O', '2018-02-09 16:16:23', '( 2 ) bacon egg sandwiches');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000061X', '2018-10-31 06:06:31', 'Came here for drinks and dinner, the cocktails were 10$ and were pretty small and not very strong but they have good variety. The food was average at best and quite overpriced. Not authentic at all but I guess for a bar that is to be expected. Pad Thai was flavourless and honestly Thai express does it better :/ the snacks to share are super pricy for what they are, it was 10$ for 3 tiny satay skewers, and another 10$ for 4 tiny pieces of popcorn chicken on a small bed of rice.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000037E', '2019-09-24 22:39:12', 'You cannot go wrong with them.  Shell out the extra dough and book your Vegas clubbing experience, you wont be disappointed.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000257O', '2018-06-04 14:06:43', 'Great Columbian street food place.  A lot of options in the place that it"s located, but I think we chose right.  We got the hot dogs, Columbian style, empanada and yucca.  All great!!');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000079A', '2018-02-01 00:39:47', 'The lady who was assisting me on the kiosk phone was pretty friendly, but she was doing a lot of up-sell so it was kind of bothersome.  I didn"t need a bigger car than an economy size since there was only 2 of us.  I understand that they probably work off of commission, but sometimes it"s unnecessary to try and convince you to get something that you don"t need.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000087Y', '2019-09-24 16:41:51', 'lockers (bring your own lock)');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000087Y', '2019-10-11 03:19:20', 'In the end it was just terrible.  My family and I went home unhappy.  And the thing is I love food, I work in the industry so I timing is very important.  Having only two servers is rough but it can not be the only excuse.  If there was something wrong or if it was going to take a little longer, they should inform the customers.  The worst part was watching tables come in before us and eat before we got anything.  I am never going back.  I really hope they clean up their act, there are a lot of pho places out here and if they don"t fix things it will be buried beneath the rest.');
INSERT INTO ForumEntries VALUES('EC1301', 2019, 2, 'P0000005R', '2018-03-22 04:28:49', 'A0000079A', '2018-10-15 14:35:19', 'My husband and I used to order from here more than I"d like to admit (almost weekly). The pizza is pretty mediocre, but it"s really cheap and convenient. The cheesy bread, subs, chicken fingers, and onion rings are pretty delicious. We always order online (which I love), it"s right around the corner, delivery is always under 45 minutes (yes, we"re that lazy and really hate winter), and the delivery people are always super nice. Sadly, they had to go and screw up the good thing we had going.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000161B', '2018-01-10 12:13:07', 'I drove 30 minutes to try to find someone who could help me repair a watch band.  I was barely greeted upon arrival and right away felt like I was bothering them.  The girl behind the counter obviously just wanted me to leave, the blond kid working snapped at me when I asked a question and when I re-asked in order to clarify what he said he snapped again and said, "I already told you?!?"  "Is this even authentic?"  Shouting at me over his shoulder as he work on something else.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000025Y', '2019-03-03 09:27:14', 'Serene patio seating for fireside canoodling, sunset viewing or enjoying the early desert spring weather.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000292K', '2019-04-23 21:10:05', 'Standouts were: almond spread, harcha bread, quinoa salad, beef kefta');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000292K', '2019-03-21 20:13:20', 'First time I had the fried chicken. It was delicious, but be warned, extremely salty. I couldn"t even finish the last piece of chicken after experiencing a salt overload.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000055R', '2018-08-18 12:44:57', 'Driving late at night we were lucky to find the last room available at this location. The front desk clerk Breanne was super nice and helpful. The hotel felt welcoming and clean walking in, and the room was no different! I"d definitely stay again. We did not explore the other amenities.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000041C', '2018-03-16 03:55:05', 'The perfect ending however, are the deserts.  They are all hommade, and terrific.  I can"t get past the pecan pie, perhaps the best in Phoenix.  The crust is just right flaky, and it"s loaded with pecans.  I"m hungry again just writing this review');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000065M', '2019-03-28 09:08:46', 'The appetizer - Artichokes with Prosciutto.. YUMMO!');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000031G', '2019-09-04 09:50:46', 'Give me someone who can make me laugh... and I"ll be your friend for life.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000292K', '2018-12-29 20:38:20', 'They came out when they said they would, did the job in the amount of time they said it would take for the amount they said it would cost. They sold me exactly what I needed to hopefully keep my basement from flooding and didn"t try to sell me a bunch of things I didn"t need, subsequently their quote was 1/3 of those other waterproofing guys and I"m willing to bet my basement will stay dry just as long! Thanks to Nick"s crew!');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000292K', '2018-12-26 13:40:36', 'COBBLESTONE, BAD MANAGERS MAKE FOR A BAD STAFF. GREAT MANAGERS MAKE FOR A GREAT STAFF.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000031G', '2019-09-11 13:36:03', 'BUT Kelly did my hair and she was extremely nice and chatty. I told her what i wanted and she made it happen. They also didn"t nickel and dime me or add on any surprise prices.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000262K', '2018-06-06 05:53:19', 'Miso Soup, Massaman Curry, Basil Fried Rice, and a Thai Iced Tea  is my fav at the moment and what I wish I was eating right now...');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000168B', '2018-04-02 13:45:05', 'In the end it was just terrible.  My family and I went home unhappy.  And the thing is I love food, I work in the industry so I timing is very important.  Having only two servers is rough but it can not be the only excuse.  If there was something wrong or if it was going to take a little longer, they should inform the customers.  The worst part was watching tables come in before us and eat before we got anything.  I am never going back.  I really hope they clean up their act, there are a lot of pho places out here and if they don"t fix things it will be buried beneath the rest.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000041C', '2019-04-21 09:14:53', 'Don"t let the location or the look of the building fool you. When I tell you this is THE BEST PLACE FOR AUTHENTIC MEXICAN EATS! I cannot stop eating their taco gringos Omg so yummy and everything is cooked to order right in front of you. This is the only place that can compare to the Hispanic food in California! You have to try it! DEFINITELY DESERVES MORE THAN 5 stars!!!!');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000204V', '2019-07-10 03:45:12', 'Looking for a big, hearty breakfast? Then look no further because this place has got exactly what you"re looking for (and for a pretty reasonable price). I went here with my friend after a night of *ahem* good old Madison weekend fun, and this was exactly what we needed. I got the eggs mornay, which has this sausage patty and poached eggs with this very nice sauce on top of an English muffin. And if that wasn"t enough carbs for you, it comes with a generous helping of fried potatoes. Good stuff.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000168B', '2018-11-03 10:53:24', 'I"ve taken my kids here several times, and we"ve never had to wait more then 5 minutes. We go right up, sign in, and they usually call us back right as I"m done signing their paperwork. The doctors have always been super nice. My daughter had stitches done, and she was a nervous wreck. The staff tried so hard to make her comfortable and gave her a stuffed toy when she was done. It was very nice. I wish they would open a bit earlier in the day...otherwise, they"re great.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000262K', '2019-02-14 19:47:07', 'Very nice little casual eatery.  Intimate setting but very flavorful dishes.  I tried the chicken shwarma and it was delicious.   Great prices and the service was reasonably quick as well.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000292K', '2018-04-29 00:35:44', 'I"ve had their "Cleveland"s" breakfast many times and it is perfect every time. The best eggs and sausage breakfast in town. I don"t know how they do it, but their scrambled eggs are the best I"ve ever had. I"ve tried to duplicate it at home without success. I get the same thing every time I go. Scrambled eggs with sausage, potatoes and toast with a side of Guinness. Yum!');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000178S', '2018-10-05 20:00:34', 'Definitely not the best looking places and the food was just OK. Crab rangoons were disgusting, I couldn"t even eat them and the chicken and broccoli was weird tasting, the gravy was really thick and the rice wasn"t the best i"ve ever had. It took five minutes to be greeted and to order my food. Will I go back, NO!');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000179Y', '2019-02-15 00:23:37', 'Awesome breakfast!!! Had the Rubin Benedict and wow was it good! Loved it!! Kid friendly & mom approved,  in fact she had the Florentine Benedict... Good service and prices.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000130G', '2019-06-17 22:29:05', 'Thanks Ashley. i highly recommend you and Ill be back.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000159H', '2018-02-01 12:29:39', 'Plus to top it off, when local school invited local pizza places to present to a class on making pizza and recycling issues, Mario came and talked to the kids as if they were adults. All the other places treated it as a marketing event and brought coupons.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000162Y', '2018-07-20 13:25:44', 'Look I"m honest so here is the run down on what you we had:');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000092M', '2019-01-18 23:41:48', 'I had to get my nails done last week when I was out shopping, so I decided to stop in and see if I needed an appointment or if they could take me. When I walked in, all nail techs were sitting around and there were no customers.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000199K', '2018-03-12 18:23:18', 'I"ve had everything from their Eggs Benedict to their salad bar. Their salad bar is very basic. Cheap square croutons, fake Baco Bits, half-wilted(so take your time picking out the good lettuce, and leave the crap to another patron, haha) lettuce, and OK dressings. I get it. They can"t have fresh stuff at this price.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000130G', '2018-07-02 07:22:34', 'All in all, like I said earlier, a great place for good times and smokey flavor.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000191G', '2018-09-14 16:35:00', '- Sea Bass with oversized Peruvian corn!!! YUMMMY!!!! The sea bass was nice and flaky.  Flavoring was a bit salty but I feel like at these restaurants they tend to do that a bit...i mean, everyones a bit intoxicated so salty foods are what people want LOL The peruvian corn was just really fun to eat!! My friends really enjoyed it but I definitely like summer sweet white corn on the cob better :)');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000117Q', '2019-06-12 15:45:00', 'It"s just not worth spending the money on this place when there are so many other options.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000192R', '2019-01-09 09:06:18', 'Our recommendation is to pass on this location. Not a fair example of a typical Johnny Rockets quality.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000110N', '2018-05-24 12:16:22', 'I have no idea what the owner"s problem is, but he"s incredibly rude. His wife, on the other hand is super nice (an odd mix).');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000199K', '2019-09-30 10:59:17', 'Great lunch today. Staff was very helpful in assisting with selections and knowledgeable on the ingredients. We enjoyed the BBQ chicken with tika masala sauce and really good naan bread. The biryani with chicken was also yummy! Fun to see the food being prepared in the tandoori ovens. Great addition to the fast casual scene in Cleveland.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000159H', '2018-12-17 00:36:07', 'Bruh, I"m a stickler for good wings.  Like to the point I can only eat them from about 4 places and I find those places to usually be inferior to the ones I make with my brother.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000017C', '2019-05-23 21:34:19', 'I miss Tram so much I wish I could"ve taken her with me to AZ she"s knows what I want and exactly how I want my hands to look. Whenever I needed her to fix a nail she did it without complaints she was always happy to perfect my hands');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2018-05-23 17:01:59', 'A0000117Q', '2019-08-12 22:25:57', 'I get follow-up phone calls and e-mails and if I have any questions about my car, David responds quickly.  If you ever need/want a car, contact David Politzer - he is fantastic and he has a nice profile picture on his business card too.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000252I', '2019-08-25 16:04:07', 'This place brings back so many memories with my family. It has been here for years and unfortunately the service and food quality has gone down.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000299D', '2018-05-17 01:11:50', 'I realize no one cares or will ever read this. My husband has already chastised me for wasting my energy on it, but I was just so incredulous about the entire thing. It was cathartic. I feel better. Though that will be of little comfort next time I want cheesy bread (with ranch!) and have to order elsewhere.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000272I', '2019-04-12 19:56:06', 'I was really disappointed with my most recent visit to Vintage 95. I make it out there every six months or so and always talk it up to friends. Tonight I went with my husband and in-laws. We ordered a carafe of sangria, which as always was top notch. My in-laws ordered bruschetta - they ended up with a ton of untoasted bread with a very thin coat of ricotta and a light topping of good quality tomatoes. Tasty but not bruschetta and definitely not worth $14. My husband and I got the "artisan board" with one meat and one cheese. For $13, we got a teeny tiny piece of cheese, four thin slices of not-so-good sopressata, stale bread, 2 crackers, raw unsalted almonds, six grapes, and about half a jar of very oniony cornichons! The food was a huge rip-off, and not at all the quality or quantity we have gotten in the past. The saving grace of the night was the sangria, which I still think is one of the best in the area. But overall, I don"t think this place is worth a trip out anymore.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000133D', '2019-07-29 20:19:26', '- Sea Bass with oversized Peruvian corn!!! YUMMMY!!!! The sea bass was nice and flaky.  Flavoring was a bit salty but I feel like at these restaurants they tend to do that a bit...i mean, everyones a bit intoxicated so salty foods are what people want LOL The peruvian corn was just really fun to eat!! My friends really enjoyed it but I definitely like summer sweet white corn on the cob better :)');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000227F', '2019-09-12 04:05:51', 'Hy Steakhouse is a contemporary and elegant  traditional steak house, with lots of open space and an intimate dinning experience.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000112O', '2019-03-03 16:03:42', 'All in all, it was good (I keep saying good!)  the prices are reasonable, and the portions are big.  I have enough for lunch leftovers today.  So, it is worth giving them a try, and I will be back.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000264R', '2019-07-08 20:08:12', 'My regular cleanings are smooth and I"ve always appreciated the timeliness of each appointment. Any work performed on my teeth have been pain free and effortless which very much appreciated.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000025Y', '2019-03-03 18:44:55', 'Good food but service sucks: waitress apparently was in a rush, serving appetizers and burger plates at the same time... didn"t ask for desert and brought the bill and the credit card machine all together... almost cleaning the table as we were sitting at the table. No smile, no care.... almost rude.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000127E', '2019-09-15 20:33:22', 'Also the mango bubble tea was tasty.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000161B', '2018-03-15 08:31:01', 'Food is still excellent! Service is still Meh! Prices and portions are still a disappointment!');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000127E', '2018-02-13 10:44:23', 'This is my go-to grocery store when I am too lazy to head to Winco. I have been here well over a hundred times, and the experience is pretty standard for Smith"s stores in my experience.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000208O', '2018-04-14 12:21:05', '7. It"s in Yorkville - the perfect locale for a quaint after dinner walk');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000178S', '2019-02-24 01:13:39', 'My daughter and her boyfriend were very excited to go here. They paid almost $200 for 2 Buffet of Buffet 24 hour passes . They had crab sushi shrimp and oysters.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000065M', '2019-09-08 14:37:16', 'The O"Donnells');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000041C', '2018-09-16 16:50:30', 'It"s difficult to have a favorite and yes, I"ve had every item on the menu');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000075D', '2019-01-12 12:07:20', 'Review 1 for 2017');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000293L', '2018-11-17 03:09:28', 'Also the staff in this place was very friendly, helpful and fun. It was good to hear youthful energy enjoying their work instead of the normal this is just my job type of employee"s. This staff gave good service and enjoyed what they do.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000274S', '2019-05-09 20:32:22', 'I"ve done a mix of delivery and take-out many times since, and every time the delivery is at the house by the promised time (usually well before), and the food has almost always been ready to go when I arrive for a carry-out order.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000041C', '2019-10-15 00:12:29', 'Go. Seriously. You will not be disappointed one bit!');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000204V', '2019-04-10 19:25:29', 'This is a hidden gem , the decor is a bit dated but the pizza is awesome.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000075D', '2018-05-07 16:33:28', 'My friend ordered an everything slice, said it was good, just wished so cheese was on the toppings to hold it together.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000065M', '2018-10-07 21:21:48', 'I was told by my friends that the chicken Marsala and chicken pot pie were good. My husband"s lasagna was good but very rich!! I could only eat a couple bits, he couldn"t finish it.  My mushroom ravioli was bland and tasteless. The cream sauce was very watery. I did not enjoy my main dish at all.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000274S', '2019-06-10 03:56:38', 'As for the food itself, I"d call it "decent". The donuts were delicious, but the chocolate mousse-like dip it came with was rather tasteless. Actually, I actively didn"t like the chocolate dip and I LOVE chocolate. My duck scramble was good but nothing special. I loved the potatoes, but everything else just...normal.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000050J', '2019-03-21 23:21:40', 'We went on a Friday after a long stressful week where we had our wedding coming up a week later  and it provided comfort food for us, typically not what we would normally have but it hit the spot. I had the fried chicken and waffles so a little dinner and breakfast in one and my husband had the smaller chicken fried steak. The portions were large.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000178S', '2018-08-04 14:17:42', 'the staff is really helpful, I"m always asking them questions and they are nice and pretty knowledgable.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000274S', '2019-04-07 20:32:44', 'The arugula salad with goat cheese and lemon vinaigrette is to-die-for. I crave that dressing days later. So light and fresh but flavorful.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000055R', '2019-09-14 09:50:49', 'Got the tech scheduled as best they could as quick they could and we"re professional the whole time.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000262K', '2019-01-13 08:18:59', 'COBBLESTONE, BAD MANAGERS MAKE FOR A BAD STAFF. GREAT MANAGERS MAKE FOR A GREAT STAFF.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000300H', '2019-05-08 20:06:28', 'The wait staff is always nice and attentive. I remember the first time we visited, it was pretty busy but we didn"t have to wait too long for a table.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000017C', '2019-01-04 02:41:00', 'We were about 10 deep in out party.  2 booths seated directly next to each other. One table ordered chicken tacos.  The minute the server sat the plate down we noticed there was hair in it.  She took it right back.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000017C', '2018-03-07 04:23:50', 'It"s located below the Saloon at the NC Music Factory. Yes, it feels like you are in someone"s basement, but not in a "it rubs the lotion on its skin" kind of way.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000191G', '2019-09-29 13:36:26', 'I was excited to go in buy my first car the last week of November 2014. At the beginning the owner was very nice and was giving all the details of the car I bought a Mini Cooper. Knowing that it had issues in the transmission. Witch he promised he would cover with and insurance ASC warranty a Vehicle Protection Plan within three months or 3000 miles. I contacted him several times for him to get my car fixed he kept saying that he would fix it after the holidays. January, February passed the car was not fix yet. I contacted him one las time, I told him that I would give him one more month than he told me that he has been working on it still. He told me that it was an imported part witch was not easy to find. I told him I will take legal action and he than answered with "" do whatever you have to do"" with a arrogant tone so unprofessional till now I can say that he has NEVER!!! Contacted me!!! To keep me updated or give me a solution. I believe I have been more than patient at this time it is incredible how they claim to be a legal business. I will be contacting him again and demand a solution. I highly suggest you think twice about going here. I have read another review regarding several comparable issues. I have never had this experience and it is horrible driving your first car with a bad transmission.');
INSERT INTO ForumEntries VALUES('CM0006', 2018, 1, 'P0000005R', '2019-07-29 23:01:55', 'A0000110N', '2018-05-23 06:47:42', 'For the price range, you can"t beat it.  I would stay there again as it was one of the best no-frills motels I"ve been in.  Two blocks away are the high priced hotels, so we were happy we could save a few bucks.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2018-05-08 12:24:07', 'A0000102W', '2019-09-28 11:54:38', 'A simple taro with coconut with tapioca pearls was like $5.25 or something. Basically all the desserts were more than $5. That"s crazy! I can literally just make this dessert at home and for a bowl, it would probably cost like $0.50. A few years ago, I think I can still get it for like $3-$4, which is more reasonable, but wow, more than $5 is a little over the top for this dessert. Though I must say, it is Tracy Dessert, and they are a little more on the expensive side.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2018-05-08 12:24:07', 'A0000046H', '2018-06-20 20:34:11', 'I paid in advance and added a 20% tip (on take-out) thinking that would help make up for any "inconvenience" or cost of my ranch requests (we ordered the exact same thing for delivery the previous time with absolutely no problem, by the way). My husband showed up about 20 minutes after I ordered. Not only wasn"t the food ready, but apparently they hadn"t even started it and were in no hurry. He waited almost another HOUR (seriously--from ordering til he got home was an hour fifteen and it"s about a one minute drive) to get our food. They didn"t comp or discount or offer any vouchers or coupons or anything.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2018-05-08 12:24:07', 'A0000296W', '2019-05-14 09:08:35', 'We ordered two apps for the table - Lobster Fritters and Braised beef short rib poutine.  OMG the poutine was out of this world!!  The fritters were good but there was no lobster flavor.  I think next time I would just order the vegetable fritters.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2018-05-08 12:24:07', 'A0000210S', '2019-06-24 20:00:02', 'Desserts are kept simple like the rest of the menu so we shared with Cherry Crustada. The crust was light and flaky, the cherries filling slightly tart and the ice cream rich and creamy, *pant pant* yum!');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2018-05-08 12:24:07', 'A0000296W', '2019-10-08 03:07:43', 'You"ll find URBO on the bottom floor of the Pure Fillmore Apartments on Fillmore Street just east of 7th Avenue.  The brainchild of DeSoto Central Market alum Shawn Connelly, you enter here through the front patio area (where there"s seating for eight by the way).  Inside, its a whole lot of stuff mixed into a small space.  Behind the counter, you can get coffee, tea, or even a sandwich made on the spot.  In front of the counter, it"s essentially a small independent convenience store with many of the things you"d expect.  Candy bars, meds, condiments, snacks, microwavable items, beer, wine, soda, as well as odds and ends like tissue paper, shampoo, and storage bags.  I can well imagine some Downtown college students living in the apartments upstairs too hung over or too tired to drive two miles to Safeway and instead opting for a stop here.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2018-05-08 12:24:07', 'A0000210S', '2018-10-19 14:45:00', 'We are so sad to see Sabrina leave Orange County!!!  We have depended on her for the past 4 years petsitting our huge English Mastiff.  Sabrina has made our lives so much easier to travel with peace of mind knowing that Kali would be well taken care of and even giving up updates and pictures while we were gone.  Do not hesitate to use Sabrina - she is really as fabulous as everyone on this site says.  NO KIDDING!!!  And if she ever comes back to O.C. we will welcome her back with OPEN PAWS!!!');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2018-05-08 12:24:07', 'A0000186D', '2019-01-20 08:48:22', 'Love this place. Great atmosphere - sports bar but with just the right amount of class. Great house beers, friendly serving staff, amazing drunk food. A fun place to go with friends ir family + an adventuruous take on the traditional bar menu');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2018-05-08 12:24:07', 'A0000170Q', '2018-11-11 04:45:17', 'Place was okay...');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2018-05-08 12:24:07', 'A0000072U', '2019-08-07 21:43:27', 'Finally, they took me. The nail tech complained about the gel on my nails and how tough it was to get off. She struggled with it.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2018-05-08 12:24:07', 'A0000170Q', '2019-10-13 05:55:31', 'One of my favorite breakfast place to go to with my high school son. He loves the food. We both love a good breakfast joint.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2018-05-08 12:24:07', 'A0000150P', '2018-06-20 07:13:21', 'What"s to say! It"s a grocery store with what ya need downtown. It"s not hipster or shady..it"s just a good, simple grocery store with a great mix of produce, organic and other baked goods. The prices are fair even though some things I know are cheaper elsewhere; for many of us it means not having to drive so its all good.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2018-05-08 12:24:07', 'A0000150P', '2019-02-25 20:34:08', 'the staff is really helpful, I"m always asking them questions and they are nice and pretty knowledgable.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2018-05-08 12:24:07', 'A0000200S', '2018-07-07 11:20:41', 'I love this place.  I admit I am stuck on the Old Fashioned Turkey sandwich with cranberry sauce.  This is real fresh roast turkey (I think roasted daily but not sure) on great wheat bread, the sauce has just a bit of a bite and compliments the sandwich well.  Huge helping of turkey.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2018-05-08 12:24:07', 'A0000150P', '2018-10-29 01:14:39', 'We just used Honest Air for the second time this year because they most certainly live up to their name. The first time was in the heat of the summer when water started dripping from the ceiling. Our home warranty said it would be four days (it was a Saturday, my husband was out of town and my elderly parents were staying with me) before anyone could be out to service our home so I immediately looked up local companies myself and called Honest Air at 3:30PM on a Saturday and had someone out to my house by 4PM. The gentleman that showed up was instantly able to locate the problem and solution - terrible install design by the home builders - and my dad actually was able to make the repair with the technician"s directions. The service charge was more than reasonable and I was just relieved to be able to continue using the AC. We just called them out again today to check our system as the vents do not blow equally throughout the house resulting in hot spots and cool spots. The very same technician came out and looked at our system again - and again all of our issues are due to how cheaply made the house was back in 1999 - and spent about 20 minutes teaching us how to have better air flow and utilize the vents in the house wisely. He was very kind, respectful, and clean. Whenever we need our AC or furnace repaired, replaced, or even just checked up on we will always be using Honest Air.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2018-05-08 12:24:07', 'A0000016W', '2018-12-15 06:50:56', 'I really don"t know how to rate this place. I came for brunch on a Sunday at 12:30 with a reservation. Side note: AWESOME that this place takes brunch reservations. More places should start doing that. But back to my review...so I came at 12:30 with my boyfriend and we promptly ordered a caesar, a bellini, an order of donuts, the duck scramble, and the two egg breakfast. Yes, we"re fatsos at heart.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000247B', '2019-09-16 05:50:45', 'Second time I have been here,  and the only reason I took a star away,  was because I had to toss my entire takeout dish except the cookie!! I very specifically made sure to say NO BEANS.... Unfortunately,  my food was covered in them!  The service here is very very good... They know their menu and will walk you through finding the order right for you.   The food is very good,  was looking forward to it...  Looks like totinos is lunch today!!');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000268B', '2019-04-08 21:48:03', 'Everyone knows the hummus rocks. I love how they let you split up a small order between the roasted bell pepper and jalapeno cilantro. It"s like a little hummus sampler for less than $5.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000268B', '2019-09-12 15:00:45', 'The appetizers were by far the best thing - the entree"s were good with red meat being the star.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000268B', '2019-04-27 08:26:48', 'Then about 2 hours later she started feeling very Sick . For the next 2 days she could barely move , vomiting , diarrhea cold sweats . Her whole vacation was ruined.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000247B', '2018-01-04 13:50:33', 'Today was my first time seeing the staff at Bella Smile and it was a great experience.  Although I"m not currently living in Las Vegas I plan on coming back for checkups and any other problems that may arise.  There was no wait time whatsoever and I was out of there without a drop of pain or discomfort.  The manager Severn was very accommodating and will be getting business from my family and friends in town.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000247B', '2019-09-02 22:11:30', 'We ordered the beef brisket curry, a fried rice and 2 extra orders of roti.  I wish there was just a bit more beef in the curry.  Other than that, things were pretty good.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000023E', '2019-06-22 04:46:43', 'Loved the New York decor. Pretty sure the owner was working the cash register(you could tell he"s from NY), there was around 100 things on the menu. For a sandwich joint I think that"s a little much, so it took me a few minutes to decide. Food was so-so it would of been a lot better if the "grade" of meat was better. The owner also didn"t seam to happy, I mean c"mon man! If your gonna have your own business love it! Don"t look like your gonna kill the next person who orders a sandwich.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000023E', '2018-06-28 04:29:23', 'That company required us a annual fee for one time unlocked.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000016W', '2018-03-16 06:59:55', 'The service was pretty bad. There were these two grouchy ladies dealing with us at the entrance and we have to wait ridiculously long for a table even though the restaurant is almost empty. Then we have to sit as far away from the food as possible. When we ask to sit closer they say no. We ask why and they say no one is covering that area. Seems like they could easily fix that or make one exception, I mean its a buffet. we won"t be needing much service if any.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000023E', '2018-09-28 21:05:01', 'Huge portion---I ended up bringing home half the Relleno, Slaw and two hush puppies---LUNCH!  YUM!  DH swined his plate so it"s deli turkey for him, hahaha!');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000268B', '2018-03-01 20:45:14', 'The only big miss on their beers I"ve had is the Big Chuck Barleywine. It could probably benefit greatly with age, but at this age all there is to taste is the alcohol.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000023E', '2019-09-10 22:30:27', 'Our friends love their beer, we gushed over their root beer. The malted berry drink was perfect for lightweights.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000247B', '2018-01-02 03:01:55', 'It used to be 8.99 for a haircut. It"s now 9.99 and that"s cheaper compared to other hair places still, however, this place isn"t as professional as the other ones I"ve been too.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000247B', '2019-04-25 05:47:50', 'The perfect ending however, are the deserts.  They are all hommade, and terrific.  I can"t get past the pecan pie, perhaps the best in Phoenix.  The crust is just right flaky, and it"s loaded with pecans.  I"m hungry again just writing this review');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000023E', '2019-03-28 05:50:59', 'Mac and cheese..not the best but not the worst');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000072U', '2018-05-09 01:01:40', 'Loved the one out Rea Rd and now thrilled they are open near my house.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-02 15:42:29', 'A0000072U', '2019-10-20 19:32:18', 'My first time visiting Sabor today and all I can say is what an absolute spectacular culinary experience! Their Latin Street food was fresh and very, very tasty. The Empanadas were perfectly cooked and juicy, not dry at all. The street corn, which is a favorite of mine, was the best I have had so far. I can highly recommend their shrimp and steak tacos which were soft and had great flavor. We ordered sliced avocado, creamy cold quacamole and together with the rosa sauce and fresh lime on the side made for a meal levels above what we paid for or expected. I love that you have so many choices to choose from to make up a meal that will satisfy any food cravings or preferences you might have and it is fresh and clean. On top of this the staff is friendly and very helpful. Such a joy! My kids loved this perfect little addition to Davidson as well and I can definitely see us becoming regulars.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000046H', '2018-07-22 08:26:05', 'Went in for a lunch. Steak sandwich was delicious, and the Caesar salad had an absolutely delicious dressing, with a perfect amount of dressing, and distributed perfectly across each leaf. I know I"m going on about the salad ... But it was perfect.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000046H', '2019-09-16 22:31:17', 'Went in for a lunch. Steak sandwich was delicious, and the Caesar salad had an absolutely delicious dressing, with a perfect amount of dressing, and distributed perfectly across each leaf. I know I"m going on about the salad ... But it was perfect.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000210S', '2018-03-28 13:21:53', 'Had the soup and sandwich.  Wow, it was great.  I can"t wait to return.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000186D', '2019-10-17 16:56:58', 'Went in on a Friday since I was strolling around the Venetian and came across this place! The wait wasn"t too bad around 1pm (probably 25 minutes max). This place serves a variety of Latin American cuisines including tapas, tacos and burgers! It"s standard pricing for Vegas. I ordered the brisket tacos and I didn"t feel that they tasted anything out of the ordinary. Service was okay, but I thought it was really awesome for the server to ask my party right away if we have any allergies or items that we don"t enjoy eating. However, the portions are on the smaller side so it"s perfect to have lunch there if you don"t want lug any leftovers around!');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000102W', '2019-01-23 21:55:44', 'Too much food and not good for diabetics the food is delicious.  Just had a spread of the waffle, protein omelette, veggie omelette, brioche french toast and chicken and waffles between 6 of us.  Oh left off apple pancakes.  All great and Tracee was the best waitress. She leads a great happy birthday too.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000108T', '2019-01-27 15:55:57', 'The decor is very cute. It looks like you are in a cozy cabin.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000221B', '2018-04-16 02:39:19', 'We love Johnny Rockets. I am not sure what goes on at this location-or if it was just an off day-but the chicken sandwich was inedible. It tasted like nuked chicken.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000221B', '2019-09-20 19:45:43', 'This is a place worth visiting!  Good food, good drinks, good prices, and good service!  Locally owned.  Flaming Fajitas - what more can you ask for!!!');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000221B', '2018-07-14 01:32:34', 'I replaced the o-rings, pulled the diode and got the ac working after I vacuumed it and refilled, what armatures..  I guess I got to go to ford, spend $80 on a new Power steering Bottle and tell LKQ to send me the money..');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000221B', '2018-02-19 08:57:23', 'Listen don"t complain that you got in late or the guy at the door was rude if you get there if you get there past 11pm who do you think you are the Kardashians?! I mean seriously I get bottle service every single time and I do not get there later than 10-1030 pm sure the club may still be empty but i would muchhh rather hang out at my sickkk table than wait in a line for 2 hours. AMAZING CLUB if you have game you willl have fun I highly recommend a table it is keyyy because you get tired of dancing for a few hours you go back to your table with some chicks hang out for a quick 20 then your back at it going nuts!');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000221B', '2019-09-17 00:57:24', 'Swamp cooler parts are very large so they don"t have space to keep them in their vans, but Derek assured me he could buy the parts and complete the repair the very next day. I explained that my husband and myself would need to wait until Friday when we were getting paid for repair and he was kind enough to work with us so we could come to an arrangement for payment so we wouldn"t have to deal with our house being so hot. He came back the next day and was here for a good amount of time as swamp coolers take more time for repair and he was very thorough and explained everything to me again. I asked questions about how to best maintenance our swamp cooler and he was happy to answer. I"m very glad we chose Mr Cool and would HIGHLY recommend Derek as he was so patient, kind, and hardworking. Swamp coolers are a pain for repair so if they were affordable for our repair I"m sure they"re even better with AC units. Thank you Derek and Mr Cool, our house gets soooo cold now, just how I like it!');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000108T', '2019-09-25 16:02:04', 'Had them last night. Great morning left overs. The staff is polite and courteous. I love their beef Mongolian. I feel like they bread their chicken too much it is mushy. BUT great place, fast, good, and clean!');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000187A', '2019-09-23 01:39:40', 'Have you ever gone to a restaurant with great expectations based on reviews and left disappointed?  That was our experience.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000269Q', '2018-03-26 10:17:20', 'Yes, this IS as good as it gets!  Dr. Dameron and his team make going to the dentist actually a really good experience!  The whole staff is very professional, kind and accommodating.  Not to mention HAPPY!  The hygienists are just the best, as are all the staff.  Dr. Dameron"s work is beautifully done and my teeth have never looked or felt better.  I HIGHLY recommend this whole office to anyone needing work done!  You will not be disappointed.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000269Q', '2019-06-09 12:01:38', 'The food:');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-08-09 00:24:30', 'A0000221B', '2019-08-15 04:03:13', 'New to Calgary, we did our homework on line and settled for Capo for one of our first meals out. Did not disappoint! A 9 table restaurant, intimate, contemporary but not stuffy decor, washrooms spotless, service friendly and on point. They truly want your dining experience to be a cut above the rest. They are attentive without being intrusive and the FOOD.... the gnocchi was suggested to us by a guest seated nearby who heard we were new to town. This selection was wonderful, pillowy dumpling puffs with lobster and truffle oil... I was sold! My husband and I shared this plate of deliciousness and the restaurant will split the plate for you in the kitchen, no problem. The fresh bread came with shallot butter - WOW, a must try, I love flavoured butters! For the main meal trio, I got the Dock Side which is a perfect scallop, perfect shrimp and the most tender, buttery fish filet once can ask for. My husband chose the meat option and he too could only describe his filet as "butter" and loved everything else that accompanied it. The small hot pots with the fresh veg inside in a butter broth were hits as well! The sparkling volcanic water was a nice change for us and the wine list was beyond impressive. We each had one glass, a red and white. MMMMM! Everything here is 100% Italian including the waiters and it was so nice to see how knowledgeable they are about the menu and passionate about what they serve! The chef obviously took a lot of pride in her work and created for us, THE perfect plates!');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-09-29 08:57:00', 'A0000221B', '2019-02-06 04:08:25', 'Fries: skinny, crispy, salty, and plentiful | Coleslaw: a bit bland for my taste');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-09-29 08:57:00', 'A0000108T', '2019-06-17 10:48:55', 'Anyways, this place is nothing special.  But if you"re in the area, try it out and you"ll get exactly what you expect when you"re walking in.  No big surprises here.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-09-29 08:57:00', 'A0000221B', '2019-06-30 20:41:16', 'Spaghetti Carbonara:   The reason we came was because Hubby was craving Carbonara and based on great reviews we thought we would try it here but he found Fieramosca"s version disappointingly bland, even with extra Parmesan cheese and fresh ground pepper.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-09-29 08:57:00', 'A0000022N', '2019-08-24 06:22:00', 'My hubby got the crab tortellini and also loved his. I heard "mmmm this is so good" from all around the table. Our waiter was super nice and even gave us free desserts because we were some of the last people in the restaurant. Service was very slow and the place was PACKED but we had our jugs of wine and a large group with good conversation so it didn"t seem to bother anyone.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-09-29 08:57:00', 'A0000221B', '2019-08-28 21:20:58', 'What an awesome pool party!!! I wish there was a tad more interactive aspects. I want hot girls and guys spraying champagne all over us or dancing with us.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-09-29 08:57:00', 'A0000221B', '2018-11-03 10:03:42', 'I would choose this one 9/10 times over the other.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-09-29 08:57:00', 'A0000022N', '2019-05-06 08:07:22', 'Paid for the works. They didn"t even wipe the dash or any of the interior. Outside still has crap all over it. Should have gone back inside and asked for a refund.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-09-29 08:57:00', 'A0000187A', '2018-06-01 13:18:28', 'Mais c"est aussi une coopérative d"artiste, avec une estrade etc.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-09-29 08:57:00', 'A0000221B', '2018-06-01 17:17:42', 'Juan"s is ALWAYS busy because it"s ALWAYS good. It"s great food, but the excellent, friendly service is what keeps people coming back. I"ve been here dozens of times...date nights, with family, with kids, girls nights. Always wonderful. Try the shrimp ceviche!');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-09-29 08:57:00', 'A0000187A', '2019-05-10 14:56:51', 'The most important thing for a restaurant is food safety and clean. See what I got from my dish. Other bugs maybe still forgivable. But cockroach means this restaurant is really dirty nasty and not take their kitchen clean job seriously.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-09-29 08:57:00', 'A0000221B', '2019-09-19 17:09:44', 'Let me be clear: this food tastes much better than Mandarin, but is less mainstream than the late Chitose. Newmarket is so desolate in the "good Chinese food" category that Cambodian Noodle King is my go to when I can"t justify a drive to Markham.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-09-29 08:57:00', 'A0000108T', '2018-04-29 10:02:52', 'I signed up for the monthly program and I"ll for sure be taking full advantage of it.');
INSERT INTO ForumEntries VALUES('CM0006', 2019, 2, 'P0000002X', '2019-09-29 08:57:00', 'A0000187A', '2019-10-29 17:25:24', '* Lunch Box Special Deal:  M-F |  11am - 4pm  | 3 whole wings, fries, and a drink = 8 bucks');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000028T', '2019-08-07 12:42:41', 'Finally, they took me. The nail tech complained about the gel on my nails and how tough it was to get off. She struggled with it.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000049T', '2019-06-27 12:12:46', '2. Amazing service');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000134L', '2019-07-14 08:24:59', 'If you can avoid this company, I recommend you do so. They are in the midst of overcharging me $100 for nothing, and insist I have to prove I don"t owe it by going to their inconveniently located offices. They won"t take a letter or FAX. Rude on the phone to me.  You have to watch them every month, as we have had other bills that were inaccurate (overbilling us) before, too. NO, I do not recommend.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000049T', '2019-09-06 07:15:03', 'Planning ahead is the way to go when it comes to Vegas, and while I don"t think you HAVE to use an outside VIP company to plan, I don"t really see a disadvantage to doing so.  I would definitely call Red Carpet VIP again.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000005O', '2018-12-21 00:21:45', 'Neighborhood bar  & grill featuring volleyball courts and outdoor patio/bar. Atmosphere is great, but food is just ok. Wings are best bet... stay away from steaks. Service is sub par at best... they are nice, but there are a ton of waitresses but they still take forever to wait on you and forget refills, etc.  Bar is empty most of time during summer when everyone is outside playing volleyball');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000098D', '2019-04-21 08:27:16', '-Fresh, seasonal fruits and vegetables with everything from plump bing cherries to more exotic fare like chayote and California avocados.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000005O', '2018-10-12 06:33:41', 'To those unfamiliar with The Big Game experience at WestGate you typically would get in line to watch the Superbowl in the theater portion of the hotel around 8 am on Superbowl Sunday. This line can get extremely long yet the earlier you get in line your choice of seating significantly improves.So...after waiting in line for a few hours we were notified the lower portion of the theater was reserved for paid customers who previously purchased wristbands for $100 (including alcohol and hot dogs) and instead we would be seated in the balcony portion of the theater.No problem, something different, we said. Mistake.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000286J', '2019-09-14 15:23:48', 'Yeah I hear people always raggin" about the post office, but you know what gang? The postal service has the best deal anywhere in the world! You can ship stuff all over the world, it is cheaper to use the the US Postal Servie, then any of those private shipping companies - FedEx, UPS, DHL.........etc.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000017C', '2018-01-31 18:43:47', 'I was very surprised and happy about finding this store. It didn"t seem so promising from the outside, but they have the best selection of dresses and awesome service! They definitely know their business and were very helpful in my quest to find the perfect dress!');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000114I', '2018-05-13 12:14:42', 'Last year, I was here on vacation. We had a great experience, which ultimately led us to spending a good amount of money.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000203D', '2019-07-08 23:02:42', 'After living in Tempe for several months and not finding a nail salon, I went on yelp :) and found Nancy"s. The reviews looked pretty good so I decided to give it a try. Like some of the other reviews mentioned, the salon doesn"t look like much from the outside, but on the inside everything is great. The facility is clean, but what makes the difference for me is the fact that the staff there was so friendly, and welcoming. All of the technicians were talking with the clients and there were even a few friendly group conversations between everyone in the salon. It was very comfortable! Most of the ladies in there during my appointment were regular clients and they had nothing but good things to say about the place after learning that it was my first time there. Loyal clientele is always a good sign.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000203D', '2019-09-25 13:18:08', 'My family and I have been visiting this location since it opened. Can"t really remember the year now.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000296W', '2018-09-16 17:14:27', 'This place is quite possibly my favorite restaurant in Phoenix.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000114I', '2018-12-30 21:02:52', 'I love this place. I come here whenever I"m in town for business. The taco Tuesday deals are unbelievably amazing. The tacos are only two dollars each, but they could be charging much more for the quality that they are. They also have a good IPA on tap that is only five dollars a pint. All of the staff is incredibly nice and they have great music here too. I also love the fact that there"s tons of monitors everywhere so you can see games from every angle of the venue. They also have a great outdoor seating area that is right on the sidewalk and located on a busy downtown corner which suits all the people watchers well.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000210S', '2018-07-21 17:55:19', 'Now that is off season for summer take advantage of the 49.00 tune up.  Just had mine done today.  We also just purchased a condo for my mom and the inspector from our realtor"s referral  was not allowed on the roof as an inspector to check the unit, so we hired Dukes of Air and it needed a $300 repair that the seller will have to fix.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000192R', '2018-07-11 09:07:51', 'One of my coworkers mentioned this little spot he heard about not too far from work. So today for lunch a few of us decided to check it out. My personal favorite places are hole in the wall joints so walking into this restaurant definitely provided that vibe. Miss Dee, the owner I believe, was one of the nicest owners I have met at a restaurant. She immediately came out of the kitchen and personally greeted us with amazing hospitality. She gave us the low down of her spot answering any questions about the food we had. Now onto the meat and potatoes, literally! Three of us got a large loaded potato, each topped with different meats. One had the beef brisket, the other had pulled pork, and I got the buffalo chicken. Don"t expect your food to come out in a minute like it was just microwaved. Everything was freshly put together and it was beyond worth it! Each meat was cooked to perfection with amazing flavors throughout the potato. Combine that with melted cheese, sour cream, and other delicious toppings, this potato can"t be beat!  Will definitely be a return customer to try out other various customizations on my loaded potato!');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000035K', '2018-01-30 00:45:59', 'I"ve been looking at this black wool boucle motorcycle jacket and now it"s on sale for $49.99 (regular price $89.99). I tried it on today and it fits me like a dream. My husband says that I have enough jackets, though. But I am still debating. After all, I need to shop for my next trip to Hawaii (next month) and comfy shoes are on the top of that list (we are pretty active on our vacations and walking is an everyday thing for us).');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000204V', '2019-05-03 10:22:58', 'I"m not sure why he thinks he can refuse service to someone coming in with a service dog, but that was the last straw for me.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000128N', '2019-03-07 05:42:12', 'We came here on Super Bowl Sunday because we were visiting a friend who lived not far from this place.  When deciding on a place to watch the game, a couple of friends suggested this casino because they had a big sports booking place, and also because it wouldn"t be as packed and crazy as the casinos on the strip.  This casino is about a 15-20 minute drive from the strip.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000204V', '2019-02-09 22:58:28', 'That has to be assembled anyhow?  Our waitress made a huge deal out of it and that we should be pretty grateful they were willing to do it.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000035K', '2019-06-04 11:10:38', 'I was skeptical about all these great reviews. After taking my car into the shop, I won"t take my car anywhere else in the Phoenix area.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000065M', '2019-06-15 22:44:49', 'I actually noticed this place because I wandered by when I was walking downtown and it"s impossible to miss that lovely smokey/BBQ smell if you"re on the block. However, it looks kind of like a hole in the wall. The entrance doesn"t look like it"s been updated in years, and that"s ok because it just adds character. The entire decor is wood/country (to include buffalo head on the wall) and there is also a downstairs where there is live music on the weekends.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000172O', '2018-10-18 00:29:49', 'So if you are even a little claustrophobic,  be warned, you won"t be comfortable here.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000198B', '2019-01-15 16:31:53', 'Cheap tickets, awful staff, probably a good idea they got the self serve kiosks. The remodel is nice but doesn"t make up for the lousy customer service and rude popcorn makers');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000103Z', '2019-04-02 14:32:20', 'Easily entering my top 3 restaurants in Charlotte after just one visit!');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000210S', '2019-05-22 11:18:36', 'Do not use. Should be call Unreliable towing service. Never showed up. Kept saying they were minutes away');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000035K', '2019-10-10 14:43:39', 'You go to a casino to gamble money ,not your health!');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000103Z', '2018-01-08 09:54:01', 'Good luck getting an appointment  before you end up in the E.R.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2018-02-03 02:13:20', 'A0000101O', '2019-07-15 17:47:11', 'Avoid:');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-02-13 13:34:05', 'A0000010N', '2018-09-03 22:34:23', 'Walked into EBC- no problem-    9 dudes');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-02-13 13:34:05', 'A0000056Z', '2019-08-24 04:34:59', 'I think pastel is a great dessert spot after having dinner around the area. The outdoor seating also makes it a perfect date spot in the summer.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-02-13 13:34:05', 'A0000012R', '2018-03-12 14:45:16', 'Otherwise, it seems fine. Kind of dingy for a Terrible"s location. I also wouldn"t use their car wash. It"s the "touchy" kind that gives your car a million little scrapes, ruining the paint job, especially apparent if you have a dark car.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-02-13 13:34:05', 'A0000056Z', '2019-09-05 23:14:04', 'I"m from LA and been looking for an awesome cut here in Vegas. I got that here from Favio. He took his time and gave me EXACTLY what I wanted. I"ll definitely be back!');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-02-13 13:34:05', 'A0000153D', '2018-12-16 10:12:55', '15 dollars for breakfast');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-02-13 13:34:05', 'A0000224Y', '2018-08-08 20:36:26', 'Like walking back in time, every Saturday morning my sister and I was in a bowling league and after we were done, we"d spend a few quarters playing the pin ball machines until our mother came to pick us up.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-02-13 13:34:05', 'A0000121F', '2019-07-24 13:11:15', 'This place will not be recommended to anybody I know');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-02-13 13:34:05', 'A0000121F', '2019-09-27 20:06:16', 'Went to Vegas again Memorial Day Weekend but this time with my girlfriends so wanted them to try this place since LOVED it so much when I came with hubby.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-02-13 13:34:05', 'A0000217H', '2019-06-10 16:40:29', '24 hours access with your keycard');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-02-13 13:34:05', 'A0000068V', '2019-03-11 13:09:05', 'On another note, the manager/possible owner who was walking around seemed to run the place with an iron fist and simply not be a very nice person. At one point I heard him chew out a chef about how "When I say something, that"s it. There"s no discussion." Interestingly, he checked in with us mid-meal and was very friendly but his repor with his employees did not put be at ease and I"m less likely to visit a place because of that.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-02-13 13:34:05', 'A0000085R', '2019-09-22 05:20:25', 'The service I recieved was 5 stars. Everyone was nice, I noticed there was mostly teenagers working there, and they were very friendly and helpful.  They checked up on us to make sure everything was alright, but they weren"t overly obtrusive to where you feel bothered.  They put some restaurants to shame, and this isn"t even that type of restaurant.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-02-13 13:34:05', 'A0000068V', '2018-05-16 12:50:40', 'why do these guys suck? how hard is it to ring a bell to see if the receiver is home?  I"ve had multiple issues with them, and wish Amazon would stop using them.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-02-13 13:34:05', 'A0000068V', '2019-01-23 10:01:41', 'Drink prices were pretty good.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000157L', '2019-09-03 03:27:16', 'Lobster roll was rubbery and tasteless. The bun was exceptional however. The salmon was Kirkland"s best, and "crusted with pecans"=sprinkled.  Hmm. The grouper sandwiches were passable. McCain fries. Yum.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000243L', '2018-12-23 13:49:59', 'I will definitely go back once they revise their price!');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000049T', '2018-12-10 00:23:33', '2 mini starters, 2 entrees (tapas style) shared + 1 desert with one glass of wine gave us a $90 bill and we left without feeling full. The desert was a caramel fondant with pear ice cream, probably the only thing we ate that was so incredible we would have paid twice the price for. Otherwise it was too pricy.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000296W', '2019-03-28 14:55:52', 'Then about 2 hours later she started feeling very Sick . For the next 2 days she could barely move , vomiting , diarrhea cold sweats . Her whole vacation was ruined.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000134L', '2019-03-24 06:22:01', 'When a group says "We"re really thirsty. Could you please bring water while we look at the menu?" You"d better frickin" BRING IT!');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000211O', '2019-02-12 10:28:28', 'Turkey..very good moist and tender');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000057U', '2018-11-20 23:38:38', 'I e-mailed head office months ago about a lousy experience at their Yonge & College Street location and never received a response. Was never a huge fan to begin with but that confirmed things for me.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000210S', '2019-09-02 18:31:06', 'Our nine person group stopped in while experiencing the "Glendale Glitters" celebration for dinner.  We tried to call ahead and make reservations but they informed me that they did not take reservations.   I have eaten here from the 1980"s forward to today, so I was familiar with the menu and layout.  It wasn"t very busy and the hostess got us right in and let us pick out where we all wanted wanted to sit.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000035K', '2018-07-17 20:26:49', 'This place sucks.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000279Y', '2019-02-08 09:46:55', 'Real Ecuadorian helado de paila or Gelato!! Beautifully fresh and flavorful Gelato!. Also wonderful service to boot!! My favorite is key lime and twighlight flavored! The owners are amazingly sweet people come support this business!! You wont be disappointed!');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000279Y', '2018-07-26 18:22:57', 'When.she told me that the oven is 2,000 degrees so it only takes the pizza 90 seconds to cook and my order would be ready in 5 minutes I should have hung up the phone! by the time I got it home it was rubbery. (Is that a word?) Anyway, Yuck! We won"t be back.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000066S', '2018-03-22 12:17:55', 'Had a fantastic experience dining at Olive & Ivy! Believe it or not, we even thoroughly enjoyed dining outside in the August Scottsdale swelter- their misting system works amazingly well.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000224Y', '2018-06-11 17:34:36', 'Th service here is very hit or miss... Sometimes the staff is personable and attentive. Other times I ask myself, "Why do I come here???" The staff often has the  "GTFOH" stamp placed permanently across their foreheads, and we as patrons just have to go with it, otherwise we are deemed "that guy."  I would say that my continuos visits were for the great HH, but there are several other options close to home, with the same food and drink options for me to choose from. I think today may be last visit...');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000010N', '2019-09-13 15:30:38', 'Sucks. I"m there trying to buy texture for paint and four guys in that department are all busy bullshitting, except for the black man that is there to work and help people. Also, I bought a toilet a month ago and they said someone would contact me in two days. A little over two weeks after my son and I ended up installing it they called. One star because I had too.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000068V', '2019-08-05 07:11:05', 'There"s also an aquarium and aquarium-themed restaurant in which they have a [fake] mermaid swimming in the aquarium and then people can take pictures with her afterwards.  There were TV"s in the restaurant showing the Super Bowl as well.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000066S', '2018-11-03 10:30:36', 'I had THE BEST VEGAN Gardein chicken plate with broccolini. I was blown away!!! The decor is cute! Nicely dimly lit, It was romantic and very chic. I recommend coming if you"re a vegan looking for a good dinner!');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000224Y', '2019-01-12 09:07:29', 'Then, we get our text message - our bay is ready, requiring us to go muscle into the line and tell the check in staff we are ready (which then irritates everyone in line because you are obviously butting in), but thats the way they like it here I guess.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 1, 'P0000003W', '2019-07-06 05:59:54', 'A0000045R', '2019-05-12 23:13:48', 'Wild every night! My favorite place hands-down in AZ! The night life here is contagious and Iv never been disappointed with there Sunday fun day! Every Sunday they have a corn hole competition and crazy drink specials like penny refills!! You also have to try there duck and pork tacos or there Hefe Hamburger! My favorite margarita on the menu is the la chica flaca. If you want a fun place to get lunch and a few drinks or looking to go crazy night this is the spot.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000264R', '2018-10-10 21:05:56', 'I was most impressed with the service!  We were greeted right away.  While we were eating our dessert both a manager and the chef stopped by to check on us.  I was most impressed that the chef and manager cared so much about our experience!  A+ service!  I"m glad I found this new gem in Old Town Scottsdale!');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000230T', '2019-07-03 00:37:58', 'I started going here more than 15 years ago (I think, more than 10 for sure).  I was referred here by my relative that knows the now famous Clarance, the owner of the place.  I told him I am the niece of such and such and he said he remembers them.  I didn"t have insurance for glasses then he gave me a very reasonable price.  He is very friendly and chatty, and despite our age difference (I am probably not much older than his children) we became quick and great friends.  I even go over just to chat after I got my glasses.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000300H', '2018-04-23 00:44:29', 'The staff are always very helpful and friendly. They don"t always have enough baggers, but last time I was there they had plenty, and wouldn"t even let me unload my cart (they had a separate person in the aisle that unloaded people"s carts for them). First time I"ve experienced that and it was pretty great.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000181Q', '2018-03-25 00:01:47', 'Quiet bar and grill great waitress and the margarita pizza was very good. Small sign out front and almost missed the place.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000181Q', '2018-07-13 10:32:09', '- I hate crab legs in general, but everyone else says they were great here, really fresh.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000199K', '2019-10-29 11:55:50', 'Toppings - They Spicy Cajun Burger - Avocado, jalapeños, lettuce,');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000003G', '2018-07-09 19:37:06', 'The food was really good, I highly recommend the ahi tuna appetizer, ravioli and the skirt steak!');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000110N', '2019-04-10 13:37:13', 'Recommended for sure');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000300H', '2019-10-12 17:20:52', 'Just a couple days ago, I adopted my little Sayuri from the Arizona Humane Society.  The entire process was seamless, and it was evident it was in the societies best interest to make sure these lovable pets find the right home.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000124V', '2019-01-02 11:44:37', 'Great ambiance, great food, although their policy of no reservations can be a drag.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000131L', '2018-01-31 09:04:54', 'Even when I called for unlocking key, they said we do not have insurance.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000024S', '2019-09-14 04:29:00', 'Unbelievable experience start to finish.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000079A', '2019-02-03 03:12:52', 'I took my wife out for a Birthday dinner with my daughter on 12-16-14  at Alfonsos.  I heard the food was good and it was and my waitress ( Dawn ) was also good ( even with it being very busy ). The problem I have is some of the waitress staff are rude. I had a gift card/ certificate to pay for dinner. After a few minutes, a big blond waitress came over and said  ( in a loud and rude tone ) I couldn"t use it cause I needed to spend $100.00 in order to get $50.00 off. She then insulted me by saying (so the tables around me could hear ) couldn"t I read the fine print telling me of requirements to use gift card. I showed her the certificate and the fine print was not legible She told me, sorry that"s not our fault it"s yours and she walked away. I am having second thoughts about going back to use gift card. I may give it away or toss it out.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000199K', '2019-06-22 20:28:59', 'I had the short ribs for my entree.  The ribs where extremely dry and overcooked.  The portions are small and the meat was so inedible that I didn"t even finish my meal.  What flavor that was infused was just sauce cooked onto the meat and no flavor from the meat itself.  I was extremely disappointed.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000235C', '2018-09-01 06:20:54', 'another awesome thing about this salon is that they offer a 5% discount to anyone that pays in cash! 5% isn"t a lot, but it"s still a pretty cool little perk. I will definitely be returning.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000230T', '2019-09-19 10:06:36', 'I went to Dr. Goth for a couple procedures, including wisdom teeth and to have a suspicious oral growth removed. Only one word - fantastic! His staff is excellent, and his art in dentistry and patient care unsurpassed. Cut and dried - Dr. Goth was outstanding. He is the man to see in the Pittsburgh area.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000075D', '2019-04-10 06:23:58', 'It"s extremely annoying that the Venetian chooses to broadcast Fox News at their VIP lounges against their customers" will and employees" will.  I would consider this harassment since neither have a choice to change the channel. I"ve tried. I have complained to the employees who state they are not able to change the channel. Trust me, the Venetian customers and their employees do NOT want to be forced to watch Fox News. Please change to a neutral channel or CNN which provides more transparent news.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000290B', '2019-06-18 20:59:47', 'All in all, I will be back again to try more.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000088F', '2018-02-23 23:42:06', 'OVERALL');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000088F', '2018-09-26 04:05:57', 'But sometimes the square is best when there is nothing going on and instead it"s a big empty space available for a time out away from the crowds right across the way at the Eaton Centre.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000069F', '2019-03-11 05:21:22', 'It"s difficult to have a favorite and yes, I"ve had every item on the menu');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000069F', '2019-09-06 12:08:56', '- Filet Mignon with oversized asparagus.  The meat was tender and very well cooked, very pink in the middle.  I"m not a big beef eater so I only ate the edges of the piece but my friends seemed to enjoy it.  Definitely not one of the top dishes of the night but was still yummy.  The ASPARAGUS however, was QUITE delicious!! they probably cooked it in butter... hahaha i"ll take it :) A good bite on the outside and nice and tender on the inside!');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000075D', '2019-09-21 06:56:51', 'Kind regards,');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000050J', '2018-01-03 02:19:27', 'Just a great place. Perhaps my expectations were set by all the bad service reviews, but I was not disappointed.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000259X', '2018-09-13 17:34:33', 'If you"re in the area and are looking for a good sushi restaurant I"d recommend you try Sakana out.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000051B', '2019-08-08 23:58:33', 'Johnny did my acrylic nails (full set) which I am totally in love with. He did a great job and was also really personable.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000208O', '2018-02-11 23:56:01', 'We started out sharing the french onion soup, a caesar salad and the tater tots.  All were delicious.  The croutons were homemade on the salad and very flavorful.  The soup was served in a litte crock and was very cheesy.  The tater tots were not my favorite in town, but they are still good.  They are homemade and served with tomato jelly instead of ketchup.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000023E', '2018-02-22 01:53:28', 'My friend lost the key in the car and we were locked out of the car.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000246Y', '2018-05-20 12:45:08', 'Been here a few times, the service is super slow just to order a coffee. Coffee prices are not cheap. Ive had the sandwiches which are pretty good but heavy. Most people come here to use the free wifi and they sit for hours drinking water. Not my favourite place and the inside could be fixed up a little more.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000148M', '2018-08-03 15:08:26', 'I so disagree with a couple of the reviews I read. Dr Miller is one of the best doctors I"ve ever seen and I"ve seen and worked with many as a medical professional. She is very detailed and shows concern regarding all aspects of my health. I have referred several people to her.   Highly recommended!!!');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000299D', '2019-09-13 05:32:48', 'I"m a sucker for a good falafel,  and this place delivers. Ordered the combo with a side of hummus. Tasty,  fresh falafel and good but a little loose hummus. Would definitely come here again.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000023E', '2018-09-09 07:09:04', 'This company tried deliver flowers to our home- my son was home by himself and called me.  I had him keep me on the phone while he opened the front door (our security screen door was  locked though).  He told the gal that he was not going to open the door, that his mom (me) was on the phone and he asked the driver to call me, his mom.  The driver was very insistent about getting a signature and became argumentative.  My son kept saying, call my mom, she"s on the phone now.  And she kept interrupting and insistent on a signature.  I told my son to close the door.  I then called the company and spoke with a Manager, Sara.  She understood my concern and said she would make sure the driver was trained on these situations.  Three days pass and I still don"t have my flowers or a phone call.  I called and spoke with Sara and she had a completely different tone with me than previously.  She was very curt and tried to give me lots of excuses. I asked that the Owners call me.  Five days later, I"ve never received a call back from the Owner or my flowers.  I called to find out when one of the Owners would call back, and Linda told me it would be by Friday, which meant six days later than my initial request.  I told Linda that was pretty unreasonable and she told me that the Owners are busy and have several other businesses.  In my opinion, that"s completely unacceptable- do yourself a favor and do not order from this Company.  They are very unprofessional and not very concerned about customer service.');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000250Y', '2018-10-15 20:09:13', 'Dr. Bang is by far the best chiropractor I"ve ever been to. Most chiropractors just crack all your joints and call it a day, but Dr. Bang believes chiropractics is not just about cracking bones. He finds the movement and alignment through other stimulation"s such as heat therapy, electricity, and a couple other devices. We actually didn"t start adjusting joints until my 4th visit! Every session I feel a lot better, he runs the facility by himself so when you come in it"s a personable experience all around. Highly recommend!');
INSERT INTO ForumEntries VALUES('ST2334', 2018, 2, 'P0000004E', '2019-10-17 18:52:13', 'A0000050J', '2019-03-01 17:11:53', 'Jared to the rescue:');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000169M', '2019-01-06 18:08:35', 'We went on a Friday after a long stressful week where we had our wedding coming up a week later  and it provided comfort food for us, typically not what we would normally have but it hit the spot. I had the fried chicken and waffles so a little dinner and breakfast in one and my husband had the smaller chicken fried steak. The portions were large.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000095I', '2018-12-16 05:25:35', 'I have visited this place several times. They have great happy hour prices and their regular menu prices are very reasonable too. Their entrees are big enough to share, my favorite is their fish tacos. They tend to get pretty busy on Friday nights, so there is sometimes a bit of a wait. Overall, thumbs up!');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000144N', '2019-10-19 15:36:38', 'Great Columbian street food place.  A lot of options in the place that it"s located, but I think we chose right.  We got the hot dogs, Columbian style, empanada and yucca.  All great!!');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000113D', '2019-09-13 18:13:00', 'I went here yesterday and I got the best service I ever got at a restaurant. The waiter helped me on the grill constantly checked on me to see if everything was ok, the food was great and so was the service and everything was A++++ pricing was great as well it came out to around $18.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000284F', '2018-10-16 12:19:11', 'Swamp cooler parts are very large so they don"t have space to keep them in their vans, but Derek assured me he could buy the parts and complete the repair the very next day. I explained that my husband and myself would need to wait until Friday when we were getting paid for repair and he was kind enough to work with us so we could come to an arrangement for payment so we wouldn"t have to deal with our house being so hot. He came back the next day and was here for a good amount of time as swamp coolers take more time for repair and he was very thorough and explained everything to me again. I asked questions about how to best maintenance our swamp cooler and he was happy to answer. I"m very glad we chose Mr Cool and would HIGHLY recommend Derek as he was so patient, kind, and hardworking. Swamp coolers are a pain for repair so if they were affordable for our repair I"m sure they"re even better with AC units. Thank you Derek and Mr Cool, our house gets soooo cold now, just how I like it!');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000082X', '2018-02-09 16:18:13', 'I have eaten at Pan Asian about 15+ times, and have taken several friends here.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000113D', '2019-09-14 06:41:50', 'What a great class.. I feel refreshed! A great studio as well - nice and roomie. Looking forward to my next class!');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000062J', '2019-06-08 00:49:12', 'Because the ring had a lot of sentimental value I decided to call the  Hong Kong location where the ring was purchased. Over the phone the clerk, Jane, and amazing representative knew the ring as well and again it was out of stock but she offered to check with head office in to see if any exist  at any location world wide.  She called me the next day from Hong Kong to inform me she found the last ring in London and it was now in transit to her store where she would hold it for me until I return to Hong Kong in a few months.  Not wanting to risk the ring getting sold or lost, I paid for it with my credit card over the phone and arranged for a friend to pick it up and send it by courier.  The ring now sits on my finger never to be removed again :)...  This is the type of service that builds loyalty.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000284F', '2018-09-17 09:18:36', 'Very fast to go service. The pad thai is made from bigger noodles than i"m used to but had a very good flavor');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000009L', '2019-04-01 21:56:33', 'Nice enough theatre, but not a great overall experience.  Only one person working the ticket counter at 7pm on a Saturday night.  Long line to get tickets meant standing outside in the sun.  No kiosks.  Screen, sound and chairs were good.  Way too hot.  I"ve never walked out of a theatre with swamp ass before.  10 mins of commercials prior to the "start time" followed by another 30 mins of previews.  Talk about pinching pennies and squeezing every ounce of profit out of the movie experience.  I"d liken it to one of those free iPhone games with adds running constantly.  Cheap. Cheap.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000238W', '2019-04-10 21:07:10', 'I will never go there again unless I hear they have found a way to set up temperature of the room.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000297I', '2018-01-30 07:34:40', 'Our recommendation is to pass on this location. Not a fair example of a typical Johnny Rockets quality.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000247B', '2018-02-05 04:09:16', 'Back to the Eggs Benedict. Everything on the Benny was cheap. The English muffin WASN"T TOASTED! Never seen that before. The hash browns were WAY too crispy.. Like eating unflavored Pop Rocks.. The Hollandaise sauce was just ok..');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000238W', '2018-09-12 19:37:57', 'Place took forever... Come to find out that they didn"t have my oil filter and a hour and a half into me waiting the Napa parts guy pulls up and 10 mins later it was done... Hmmm.. But they didn"t even let me know what was going on! Never going back');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000238W', '2019-02-10 23:06:24', 'She could have found a nicer approach instead of yelling at me. I got to the window to pay for what I was able to order and she told me that if I wanted my food I would need to come inside and leave my dog in the car because it was unsanitary for me to have my 3 lbs yorkie in my lap while she was handling food.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000297I', '2018-11-16 23:26:06', 'Variety of balls available if you dont have your own.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-10-23 15:51:16', 'A0000247B', '2019-05-16 11:48:22', 'Worst customer service ever had me waiting  a hour and then skips me never coming back do not go there if you want a haircut');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000030A', '2019-09-17 16:09:26', 'It"s definitely not for everyone - there is a price tag attached. But if you shop at places like Holt Renfrew or even the Bay then this place is considerably better in my opinion.  The reason - the sales agents are just better. They have pretty good sales twice a year, which is when I tend to go but sizing is obviously an issue at those times. I appreciate that they carry various price points in the mid to high range.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000020H', '2018-08-22 08:35:23', 'Service was okay nothing really stood out as good or bad, and prices are actually good for being on the strip and having burgers around $9-10 and steaks  are like $25 (although i"d rather spend $5-10 more and go to a legit steakhouse).');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000213C', '2019-09-03 13:05:14', 'Do not use this service, it might be cheaper but not cheap enough to deal with all this BS they put you though.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000141G', '2019-09-03 12:32:19', 'I think the prices were great for the Waxhaw area. I paid $57 (without tip) for a full set French manicure with sparkles, and pedicure with design. I used to pay $75 for the same service at my last salon.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000020H', '2018-03-20 05:49:53', 'My last visit. I will say the pizza prices are fair for what they are offering.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000030A', '2018-10-27 20:57:37', 'Ordered 2 coffee, and two breakfast croissant sandwich for me and bf.   The croissant was very tasty but the size is tiny....so it"s quite expensive for the size.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000244V', '2018-03-09 15:19:31', '- Sea Bass with oversized Peruvian corn!!! YUMMMY!!!! The sea bass was nice and flaky.  Flavoring was a bit salty but I feel like at these restaurants they tend to do that a bit...i mean, everyones a bit intoxicated so salty foods are what people want LOL The peruvian corn was just really fun to eat!! My friends really enjoyed it but I definitely like summer sweet white corn on the cob better :)');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000036E', '2018-02-21 05:17:30', 'Went in for a lunch. Steak sandwich was delicious, and the Caesar salad had an absolutely delicious dressing, with a perfect amount of dressing, and distributed perfectly across each leaf. I know I"m going on about the salad ... But it was perfect.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000002S', '2019-07-06 03:37:52', 'Great food, great service. Obviously fried chicken isn"t the healthiest food on earth, but once a month I get that craving for good fried chicken. Their chicken is great, doesn"t seem too fatty, and their sides are excellent too. A+');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000030A', '2019-02-15 22:40:14', 'the few times i ordered from here i was greatly disappointed. freezer burned strawberry ice cream, microwaved food and run of the mill breakfast.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000020H', '2019-03-16 18:37:35', 'The arugula salad with goat cheese and lemon vinaigrette is to-die-for. I crave that dressing days later. So light and fresh but flavorful.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000244V', '2019-02-05 13:13:34', 'Definitely not the best looking places and the food was just OK. Crab rangoons were disgusting, I couldn"t even eat them and the chicken and broccoli was weird tasting, the gravy was really thick and the rice wasn"t the best i"ve ever had. It took five minutes to be greeted and to order my food. Will I go back, NO!');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000048W', '2019-04-04 03:14:04', 'Believe the negative reviews. I came here after a round of golf, in order to have dinner and a few brews. The service wasn"t terrible, it was non-existent. The waiter seemed to take an eternity to take our order.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000144N', '2018-02-13 15:15:01', 'I contacted Sammy a couple more times throughout the weekend for various things, and he was more than helpful even though we weren"t using them for additional reservations or nights out.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000113D', '2019-07-31 01:44:33', 'The 27/7 cafe has decent food.  Though I think next time, I"ll just order a side of bacon and an order of sourdough toast instead of a club on sourdough.  The bacon they have there...seriously...AWESOME!');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000201O', '2019-09-09 08:44:44', 'Freaking BOMB Macaroni & Cheese and Everything Else was Awesome as well great Service again everything was OUTSTANDING');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000247B', '2018-12-14 04:14:10', 'They"ve got a variety of meats you can choose from.  Some favourite being chicken, halibut and beef.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000201O', '2019-05-31 07:21:54', 'Do make a reservation but still expect to wait for your food. Go with a large group of people and plan for it to be loud. Don"t go with a date unless you"re fighting and don"t feel like hearing anything they have to say.  Ask to sit in the side room if it"s available.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000169M', '2019-09-27 23:55:03', 'That lone other time is in the event I run out of a special shaving soap that only seems to be sold there. I don"t particularly like Giant Eagle unless I"m armed with coupons. They double coupons, but their regular prices are high.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000169M', '2018-03-18 12:05:12', 'Beware their one scoop is a MASSIVE one, thankfully the person helping me recommended I first see their quantity before being so keen on jumping on the two-scoop-wagon.  Thankfully One was enough, both Jen and I each took something we liked.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000284F', '2019-08-11 06:39:35', 'This is one of the best "hole in the wall" spots I"ve been to in years! Fresh home-made tortillas, great steak, people are amazing! I came with a party of 10 ppl and the food was fast, delicious and prefer was perfect. I will definitely be back!');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000144N', '2018-07-23 21:24:00', 'They serve steak-burgers, so it may cost more than average, but not by much. You can get 2 different styles of burgers: A Freddy"s burger that comes with pickle, mustard, and onion. (my preference) Or a California burger. Same meat, but this one comes with lettuce, tomato, onion, and a "Freddy"s sauce" which is your typical thousand island, fry sauce, spread, etc.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000201O', '2018-05-19 15:13:58', 'I think pastel is a great dessert spot after having dinner around the area. The outdoor seating also makes it a perfect date spot in the summer.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000095I', '2019-10-17 18:00:32', 'So we were seated upstairs...stuck. With no food or soda available for purchase. Only beer and water was sold in the balcony food counter. That was at 1:45 p.m. After vigorously complaining to Westgate staff ( to ushers with yellow jackets and security with black jackets ) at 3:04 pm wristbands were given out. At 3:18 hot dogs and soda were made available for sale in the balcony. I believe this was a direct result of all the upset patrons like myself that were seated in the balcony level.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000095I', '2018-06-18 19:48:18', 'So fresh and delicious! My go to poke spot in the city! Generous portions, clean and great selection of accouterments!');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000009L', '2019-06-23 07:36:57', 'We met Juan the owner who welcomed us and our little toddler.  Juan said he built the place to accomodate families and that their daily Happy Hours are restaurant-wide - and not exclusive to the bar only like many places in town.  Their daily happy hour from 3-7pm looked really good!   Our server was very friendly and the service was great!');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000013R', '2018-01-25 02:57:41', 'Giant portions,be warned.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000201O', '2018-05-07 17:19:48', 'FOOD');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000062J', '2019-09-30 00:27:03', 'My search for the best beautician with great customer service skills,  hairstylist and applying my weaves are over. Rasheen"s skills surpassed my expectations. Rasheen"s expertise in the use of different techniques that would be best for your natural hair when applying your weave, shows that she cares about your natural hair. My hair looks amazing, and I have received so many compliments.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000105U', '2019-06-14 10:57:37', 'Food: You go and order at the counter and then sit and they will bring it to you. The woman at the counter was very friendly and helped us making our decisions. They have a wide variety of items including ice cream, coffee, desserts, salads, sandwiches, breakfast, tea, etc. Very reasonably priced menu! I got the tuna melt, it was just ok. The tuna salad was a bit too over dressed for my liking. It felt gluttonous with all the mayonnaise and I think there was mustard in there maybe? It came with a side and I chose coleslaw, it felt kind of like the kind you would buy in a big jar at sam"s club, not my favorite but others like their sides so maybe I"ll try something else next time. The others liked the chips and the macaroni salad. Chicken salad on the croissant had similar opinions on the tuna that it was thick and over dressed but the croissant was toasted and good.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000195Z', '2019-08-04 05:47:28', 'Came here on a whim to try it out with my fiancée and we were not impressed at all. Ordered the street corn queso and it was super lacking on flavor and also pulled a large chunk of butter from it. Tried to save it a little with the sauce tray and even added salsa to it and still wasn"t there. My Sonoran dog looked like it was from the previous day... typical dry wrinkled no snap day-old dog, the brioche bun was soggy from too much butter. And the tacos were cold. We Couldn"t even finish the meal. The salsa was the only highlight of the lunch. Also watched a server shatter a glass over the ice well and proceed to use the ice that the glass had broken into to serve a customer. I will NEVER return.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000283C', '2019-10-04 21:23:55', 'AWFUL AWFUL PEOPLE! I"m only giving them one star because I can"t post otherwise, but they"re not even worth that. I used MovingAPT.com to find them - won"t ever use them again either. I thought having an agent would prevent this kind of crap from happening. I don"t even know where to start with my complaints; this entire move was a mess from the beginning due to lack of communications and professionalism. I paid extra for a specific move date and time, as well as a "special handling fee" because of my piano.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000139U', '2019-01-28 13:43:15', 'Dr. Bang is by far the best chiropractor I"ve ever been to. Most chiropractors just crack all your joints and call it a day, but Dr. Bang believes chiropractics is not just about cracking bones. He finds the movement and alignment through other stimulation"s such as heat therapy, electricity, and a couple other devices. We actually didn"t start adjusting joints until my 4th visit! Every session I feel a lot better, he runs the facility by himself so when you come in it"s a personable experience all around. Highly recommend!');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000160N', '2018-09-21 20:08:47', 'Bun - Very soft, tasted good, but didn"t hold up against the burger and all the toppings and at the end I was left with lots of bun and no more burger.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000138V', '2019-05-22 04:07:30', 'Real friends show up with BOSA donuts when things are awry. Their boba tea is yummy but needs more ball choices.');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000160N', '2018-10-09 08:12:56', '* Lunch Box Special Deal:  M-F |  11am - 4pm  | 3 whole wings, fries, and a drink = 8 bucks');
INSERT INTO ForumEntries VALUES('ST2334', 2019, 2, 'P0000004E', '2019-02-26 08:57:13', 'A0000285W', '2018-12-30 15:53:53', 'Hands down worst gluten free cupcake I"ve ever had. I cannot believe anyone would associate that product with their name, it was terrible.  Not only are all the other bakery"s gluten free cupcakes superior to this one, but so are the grocery store box mixes like the gluten free Betty Crocker or Pilsburry. This was the first time I"ve ever thrown away dessert half-way through, I always finish or save it for later. The vanilla flavor wasn"t the problem. It was so dry, that I had to take a sip of water with each bite because it would get stuck in my throat. If you"re at Fashion Square and craving a gluten free treat, do yourself a favor and go to the Macaroon place. I"m disappointed, especially considering the cupcake was $5 after tax. The one star is for gluten free cupcakes only, as I have not (and cannot) try a regular one.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000232Z', '2019-03-30 12:33:10', 'Travis"s greets you with his perfectly green swoosh in his otherwise perfectly styled black hair and a Vegas-worthy rockstar outfit.  Next comes the most relaxing and incredible shampoo -- where you get a full head message that could cure even the very worst migraine in minutes --- and the scented shampoo room.  Travis has freakishly strong fingers (in a good way) and use the perfect amount of pressure.  That was superb!  Then starts the glorious blowout... where not one, not two, but THREE people were involved in doing the best round-brush action my hair has ever seen.  The team of stylists clearly gets along extremely well, as it"s evident from the way they talk to and help one another that it"s really genuine and not some corporate requirement.  It was so much fun to be there!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000161B', '2019-01-28 23:43:16', 'Club Layout: The club itself is very nice. Not quite as grand or spacious as XS next door, but a beautiful venue nonetheless. Main dance floor is average sized. It was spacious enough so that we didn"t feel like canned sardines and had adequate room to dance. There are no stairs or steps to climb, a la Marquee, so ladies will appreciate this. The main room is flanked by a large tent-like area and the outdoor wading pool/patio area. The easiest accessible restrooms are outside as well (the indoor one gets crowded). The outdoor area is ideal for those who want to socialize more, take pictures, take a breather, etc. It"s beautiful.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000003G', '2019-06-25 09:23:35', 'A co-worker of mine kept talking about Tottie"s, so last night I finally gave it a try.  I don"t know if it is different dining in, because I ordered take-out, but it was good.  It didn"t blow me away, but it was good.  Very similar to good chinese take-out, or maybe a notch up.  I ordered the Tottie Rolls as a starter.  They are crispy egg rolls that you wrap in a lettuce leaf, with mint and parsley.  They come with a sort-of sweet and sour sauce for dipping that was quite nice.  Or atleast I think that is how you are supposed to eat them?  I had a big take out container full of lettuce, mint and parsley, so I figured that was the drill since I didn"t order a salad?  They were good.  I ordered the Tangerine Chicken and the Beef Pad Lard Na.  The chicken dish was good, tasted like an orange chicken, deep fried until crispy then tossed in a sweet tangerine sauce.  It had a few strips of red bell pepper also.  The beef dish I liked a little more, it was the wide egg noodles and had chunks of beef, onion, pea pods and bok choy in a really good brown sauce.  You can order many of the dishes mild to HOT, so I did a medium hot since I sharing the dishes I didn"t want to blow them out of the water with too spicy of a dish.  Next time I will definitely go hotter!  The dishes came with 2 containers of sticky white rice, which was exactly what it sounds like. I didn"t have any dessert, but the crispy bananas sound great, and I am interested in trying the ice creams I keep hearing about.  I also really want to try the soups, they sound good.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000240X', '2019-07-04 15:39:13', 'The Venetian is an elegant and distinguished resort and casino. Gorgeous and romantic decor and interior. On the way to your room, you are greeted by candlelit hallways and ceilings to light your way. Even though I didn"t try the restaurant, Bouchon, the smells emanating from the kitchen made my mouth water. The casino was expansive and had signs everywhere for easy navigation. Rooms are huge, clean, and well-maintained. The convenience store and bakery/coffeeshop is located at the entrance to the casino and near the elevators to the rooms which is a plus if you need to get a quick pick-me-up or forgot to pack something. The Venetian is a must-stay if you are ever in Las Vegas and will give you a dining, gambling, and staying experience that you will never forget.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000047G', '2018-12-26 03:30:56', 'I first went to this location because I needed an oil change and the 616 location does not do oil changes. I got a heavy up-sale routine but went with it anyway. I also got a wash that was far below the standards of the 616 location. I let that all slide, as just being an off day.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000192R', '2018-09-27 03:09:50', 'The dessert - Chocolate Creme Brulet...   Umm not so much..it was quite clearly 3/4 cup of Chocolate Mousse with a sliced strawberry on top and a store bought sugar cookie in the shape of a heart.  Yes it did taste good, however...where was the Creme Brulet the waiter raved about?');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000259X', '2018-11-21 02:58:18', 'My usual is the Portabello burger. The balsamic marinade they use is fantastic. The presentation is a little messy, but once it hits your lips it"s so good.  I pass on the new potatoes for steamed spinach and it"s pretty amazing.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000209N', '2019-08-30 01:32:47', 'There was one UGLY thing about this place though which is why I removed 1 star, and that is that they don"t allow "oversized" bags or backpacks and force you to check them for $20!!  $20!!!!  It"s insane!  It really pissed off our group at first cause there were 2 of us with big bags, but at least they let us put them together for $20 total.  Jerks.....  I"m sure there"s some good reason for not having oversized bags, but they didn"t tell us.  One other messed up thing that happened is that we were approached by a promoter the night before after leaving XS and he offered us free admission AND a cabana for free.  We were like, hell yes!!  And then we we get to Encore Beach, the guy isn"t around and no one would help us and we were stuck paying for the spot ourselves.  We were pretty pissed about that too, but we didn"t let it ruin our time and got over it and just ended up paying.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000010N', '2019-01-31 07:02:26', 'We started out sharing the french onion soup, a caesar salad and the tater tots.  All were delicious.  The croutons were homemade on the salad and very flavorful.  The soup was served in a litte crock and was very cheesy.  The tater tots were not my favorite in town, but they are still good.  They are homemade and served with tomato jelly instead of ketchup.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000092M', '2018-04-25 05:55:34', 'I will never rent from Budget Rent A Car, again.  I got totally ripped off by their employee at the Phoenix Airport location on 5/3/18.  He added the fuel surcharge of $40+ to my bill, despite specifically being told I didn"t want that, I would fill the car up with gas myself before returning the car.  He also told me insurance would be $30, not specifying that it would be $30 + taxes for each day I had the car.  When I asked how my $61 booking (on Costco) became a $200+ rental, he told me "Arizona has a lot of taxes".  Given that it took so long to wait and then for him to prepare the contract, I did not read everything---I had my 87 year old father in a wheelchair with me.  When I complained to Budget later, I was told, sorry, you signed the contract.  Shady, shady business.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000062J', '2018-08-11 12:43:21', 'Last year, I was here on vacation. We had a great experience, which ultimately led us to spending a good amount of money.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000182E', '2019-08-28 07:28:19', 'I will definitely go here again. I would recommend making an appointment. It was a Saturday when I went and they were turning people away.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000092M', '2018-12-30 14:16:20', 'Fact that this location is in tempe marketplace, makes a high difference so we can enjoy outdoor seating in evenings.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000092M', '2018-02-21 19:04:13', 'The soup dumplings are good but not amazing. If you"ve never had it before, give it a try and you probably will like it.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000182E', '2019-09-04 08:24:43', 'These guys literally saved me.  I had a RFP due during the holidays.  With my computer and printer crashing, I was in a serious bind.   I usually go to Staples Printing Centers-- but, they couldn"t get it done in time.   So, I got on the Peoria Chamber website and International Minute Press/Desert Sky Printing came to the rescue.  They finished my printing and the RFP was turned in with 1 hour to spare.  I recommend them highly!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000209N', '2019-03-25 18:33:39', 'A hidden gem! Initially I thought this was a drive thru coffee stand. To my surprise they serve breakfast, lunch dinner and happy hour. An adorable pet friendly patio that was busy what look like with local patrons. Inside tables and bar seating. Cozy fit and counter service for lunch. Check out the unique bathroom. The entire staff was extremely friendly and going the extra mile to make every guest welcome.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000286J', '2018-03-18 06:00:58', 'Dr. Bang is by far the best chiropractor I"ve ever been to. Most chiropractors just crack all your joints and call it a day, but Dr. Bang believes chiropractics is not just about cracking bones. He finds the movement and alignment through other stimulation"s such as heat therapy, electricity, and a couple other devices. We actually didn"t start adjusting joints until my 4th visit! Every session I feel a lot better, he runs the facility by himself so when you come in it"s a personable experience all around. Highly recommend!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000010N', '2018-05-25 01:06:34', 'I"ve been here 10+ times now and each time the service has been excellent. They have slowed down a little since the grand opening like most places do which to me has only allowed them to improve.  I will continue to frequent this convenient location.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000008J', '2019-07-07 00:36:31', 'The desserts are also pretty delicious.  The best time of year is when they have the red velvet cake blast.  I wish they carried it year around.  :(  The pumpkin pie blast is also a really good seasonal treat.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000072U', '2019-09-26 16:52:45', 'Their red velvet cupcakes are AMAZING! Their buttercream frosting is fantastic and I also like their brownies when they have them. The location couldn"t be better. I"d say you couldn"t find a more romantic date-spot. I won"t give them 5 stars though, since I have had some dry cupcakes in the past and they seem to always run out of the good stuff (mostly the red velvet) on weekends which is the only time I can make it over there.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000008J', '2018-02-08 03:22:35', 'Paco"s Tacos is the real deal! In spite of the great Yelp reviews, I still had my reservations about eating at another TexMex chain. How good could it be I thought? Well they totally nailed it, from the complementary chips and dip to the sauce stains on my napkin!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000020H', '2018-11-04 08:10:09', 'Im sure I left something out but you get the gist right? If not....stay here!! You won"t regret it!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000265D', '2019-09-24 11:36:06', 'After being a HUGE fan of the Mission I decided to try this place out seeing that it"s owned by the same owners even though I was very skeptical that it could possibly be as great. To my surprise it lived up to what others had told me. The ambiance was amazing. Very much like the mission. Candles light up the entire place. The outside patio is quite large and there is a lot of seating available. The staff was great and very helpful with making suggestions on the menu. My favorite items on the menu are the scallops and the Apple caramel upside down cake. They were cooked to perfection and melt in your mouth. They have a great wine list and its a perfect setting to enjoy a few glasses of wine:) This is a great date night spot that I recommend it now to all my friends.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000008J', '2019-02-02 15:33:47', 'I booked a session and decided to also use my coupon for free Easter collage. The girl told me it would take 45 min to print. Showed up 45min later and I guess they were having issues formatting it to print out correctly. Hour and a half total spent waiting and the guy kept saying if you wait I"ll give a free print. I had already waited hour and a half along with session time and a five month old wasn"t going to deal with it much longer. I don"t travel to chandler often and live 30min from this location. I told them they needed to mail it to me and I left furious. Never again!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000072U', '2018-02-28 00:10:02', 'He did a decent job and was a nice guy.  But, they were extremely expensive.  We certainly did not save any money going with Belsito.  Also, when he was out the first time the plumber left some dirt on our carpeted steps.  He was wearing booties, so not sure how he got the dirt there.  It was easy to clean up, so not a huge problem.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000056Z', '2019-05-29 11:47:57', 'I have taken my family to this place before.  We were quite happy with the service and food.  Recently, I bought a groupon for this restaurant.  We were not happy at all with the service and food.  First, they ask if we were using groupon and they marked it in a separate sheet.  We had no service at all.  The restaurant was not full and we saw other tables had their food while they order after us.  We waited for almost 30 minutes only two dishes came.   We spoke to the manager and the Waiter for the rest of the orders.  They said to check on our orders.  My kids got hungry and only ate fried rice that came.  Finally when the order dish came and it was very salty.  We would definitely not recommend this place if you plan to buy Groupon.  We felt we were second class.  We would prefer to go elsewhere where we get excellent service and much better vegetarian food and we don"t mind paying the little extra,such as graceful vegetarian by market village.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000072U', '2018-06-24 02:43:21', 'But it"s an alright spot. I may or may not go back.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000300H', '2019-01-25 10:33:16', 'Ugh, I don"t care HOW ugly my toes look next time, I will NEVER go anywhere else besides Bella Nails again, they ROCK!!!!!!!  This place was appalling.  I didn"t want to make a scene, so I just paid the money, but I will NEVER go back!!!!!!!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000072U', '2019-06-30 05:07:55', 'I would like to return but I probably will need to order two just for myself and it would be too expensive for breakfast :(');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000072U', '2018-03-29 11:57:21', 'Great food and greatCustomer service.They messed up my order and when they realized they apologized and returned our money.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000267T', '2019-09-12 03:39:38', 'Battista"s Hole In the Wall is awesome! Went here for the first time when I was in Vegas for my kickball tourney (WAKApalooza) early October. My teammate is a huge fan and suggested this place to the rest of the team for a big team dinner Saturday night.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000096O', '2018-11-19 02:15:53', 'I considered giving this place 4 stars, because we went back a couple days later and the food was cold and missing that extra special love like we had the first time.  But it was a Friday evening and there was an Indian soap opera on the TV I think we interrupted....So, obviously, I can"t blame them.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-01-15 01:05:43', 'A0000265D', '2019-09-07 07:39:12', 'The end of the meal sadly came and although we were stuffed, we chose to share the lemon curd with berries plate to cleanse the palate. The best choice we could of made - or was it?! We will have to find out next time we come! We enjoyed the location of Capo in Inglewood, quite central and the waiter who called a taxi for us even waited with us outside chatting with us until the cab came. What a gem of an eatery if you can afford to splurge now and then! A highlight of my week and would recommend to anyone!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-03-19 01:16:00', 'A0000281B', '2018-07-29 15:50:13', 'Lemon Sorbet:  Frozen sorbet in a scooped out lemon, menu says imported from Italy.  I actually liked it better than the sad face Tiramisu so hubby swapped with me because while he usually loves anything lemon, he found an odd aftertaste.  I joked it was the jet fumes to bring frozen sorbet from Italy but the truth is, it was the perfume worn by the woman at the table next to ours.  Thankfully she arrived as we had dessert, so our entire meal was not ruined, but the smell was so overpowering that it gave us both a headache and we wanted to get out of there fast, since with the cramped layout she was almost on top of our table.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-03-19 01:16:00', 'A0000041C', '2019-10-08 08:58:33', 'Had a groupon decided to check it out, steak was good, server was lacking. It was busy and loud which wasn"t bad but it was our first time there, so we weren"t familiar withthe menu. Some of us had steak and some had salmon. The salmon came with sides and the steak did not. I wish the server would have told us more about the menu or asked if we wan"t sides. The server checked in once and never offered anyone a refill of their drinks.  It felt like they were put out by the groupon and didn"t want to deal with us. Prob won"t return.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-03-19 01:16:00', 'A0000238W', '2018-10-05 07:28:54', 'I first went to this location because I needed an oil change and the 616 location does not do oil changes. I got a heavy up-sale routine but went with it anyway. I also got a wash that was far below the standards of the 616 location. I let that all slide, as just being an off day.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-03-19 01:16:00', 'A0000142J', '2018-01-07 04:12:25', 'We were able to get a same day reservation on a Monday night.  The space was about 3/4 full, and the meal took 2.5 hours due to the numerous tastings and relaxed pace.  The decor is modern chic, and there is a bar area to do bites/drinks.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-03-19 01:16:00', 'A0000223L', '2018-05-22 04:22:14', 'Best fried pickles in town! Great prices, fabulous and friendly staff. Zero complaints.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-03-19 01:16:00', 'A0000058A', '2019-01-09 14:06:48', 'Both of those tasks sound SO easy - and they should be - yet we still waited in line for about 40 minutes to accomplish these two tasks.  The entire time, we and everyone else in line are talking about how inefficient this place is and you would think the managers would see this once, and rearrange things to make it easier.  After all, we really wanted a beer - we could have been through two rounds at the bar in the same amount of  time we spent waiting around to check in.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-03-19 01:16:00', 'A0000024S', '2018-04-30 10:32:53', 'Ok onto the food. I have been here a couple of times now, so I think I can comment on the menu pretty well. My friends and I have ordered the brisket, the catfish, the veggie burger, the mac n cheese, the cesar salad, the chili, and the garlic fries. If I had to review this place based on the delicious and garliciness of their fries, this would be a 5-star review hands down. I mean, seriously, vampires beware, but everyone else should enjoy a-plenty.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000144N', '2019-09-04 13:41:53', 'I ordered a simple naked potato and a side salad to accompany my steak. Both were fine. But there is not much room to mess up a potato and iceberg, is there? People rave about the garlic bread and I think it"s because the rest of the meal is so mediocre, that the cheesy bread becomes the highlight if the meal. It was just OK. The most inexperienced cook could make it at home with sourdough, butter, and three types of cheese.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000144N', '2019-02-23 11:45:33', 'Great environment, I loved their meat jun. Very flavorful. Also they give side dishes which is definitely a bonus');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000161B', '2018-05-01 14:27:04', 'Watch the game somewhere else.....');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000144N', '2019-09-06 07:09:24', 'Ever since I went to Social House, I certainly changed my mind about going to Koi again!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000204V', '2018-01-28 16:15:16', 'Prices are decent, they have Groupons available for this place a lot, so if you are nervous about going, wait for a Groupon to be available and that should cover half the meal for 2-3 people.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000153D', '2018-11-22 00:41:19', 'This was my first time going to Harvey"s. I was so impressed! The service was wonderful. The cook even came out to check to make sure we were enjoying our meal. The burgers were the best burgers I have had since moving to Phoenix. The restaurant it"s self is no thrills but I would recommend it to anyone is craving an incredible burger and great service.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000161B', '2019-10-05 08:12:17', 'I got the wings - terrible, even though they are a signature dish. Bland, small, bones broken with sharp points and bone chips all throughout...now that I think about it, I don"t know why I didn"t complain and send it back.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000153D', '2018-01-29 13:46:38', 'Great wings , and the breakfast is pretty good also .the Cook does a great job on the food . I don"t drink so I can"t say anything about that but over all a good neighborhood place .');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000232Z', '2018-04-29 12:49:54', 'But, (I"m using a lot of buts...) the unchicken & waffles was quite okay. They used veggie meat & they did quite a good job making it like chicken. Since I can"t do Roscoe"s cause I"m a veggie, this spot did the trick. If Roscoe"s was in Europe it would be a different story...');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000041C', '2019-08-03 04:03:41', '-Reasonable prices. It"s not as cheap as fast food, no. But if you"re gonna spend your money somewhere why not make it your health.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000024S', '2019-07-05 13:34:31', 'By the way, the carnitas were excellent, as well.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000142J', '2019-10-14 00:44:08', 'I liked it enough to want to go again.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000273F', '2019-09-24 05:24:10', 'A must see is the  Carrolier Academy of Irish Dance! The children participated in the parade and scheduled events throughout the weekend. Led by Debbie Carroll and Shelley Locklier, the two dancers have Irish dance teaching credentials; both teachers travelled the world with Michael Flatley"s Lord of the Dance.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000231F', '2018-07-02 08:36:02', 'My only complaint is sometimes, especially towards the end of the year, appointments are hard to book - but that"s kind of how it goes most places.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000010N', '2018-01-18 20:41:26', 'That being said.  I was pretty edgy by the time we arrived.  We"re from Cave Creek and had been out shopping and then had a heck of a time finding the place, so we arrived about 8.15---pretty close to closing.  And I had a Groupon---and there are Yelp reviews that said the staff DOESN"T like Groupon-ers.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000259X', '2018-12-10 09:35:46', 'Scheduled a spa day for ourselves while we were on vacation beautiful cozy robes access to steam room sauna and jacuzzi enjoyed a hot stone massage with aromatherapy and foot soak from beginning to end so wonderfully relaxing able to also use a nice shower to finish my visit highly recommended');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000047G', '2018-12-03 21:40:05', 'A simple taro with coconut with tapioca pearls was like $5.25 or something. Basically all the desserts were more than $5. That"s crazy! I can literally just make this dessert at home and for a bowl, it would probably cost like $0.50. A few years ago, I think I can still get it for like $3-$4, which is more reasonable, but wow, more than $5 is a little over the top for this dessert. Though I must say, it is Tracy Dessert, and they are a little more on the expensive side.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000115N', '2019-09-13 20:52:01', 'Ok, this place had us right from the start. My wife just finished  running a marathon and was extremely cold. Seeing her shiver, our waiter brought her a cup of homemade chicken vegetable soup on the house. Who does that these days?');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000286J', '2019-02-21 16:10:08', 'We were about 10 deep in out party.  2 booths seated directly next to each other. One table ordered chicken tacos.  The minute the server sat the plate down we noticed there was hair in it.  She took it right back.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000209N', '2019-09-15 15:57:20', 'Had the soup and sandwich.  Wow, it was great.  I can"t wait to return.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000111T', '2018-02-05 07:57:05', 'New management sucks. I used to get my nails done here all the time but now they do a horrible job.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000115N', '2018-09-28 07:56:54', 'It looks much better on the inside than the outside, as at first we were a little concerned.  However the place has tight security and large balconies.  We stayed there for several days and found the motel to be exceptionally clean, the owners/operators were very friendly.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2019-09-06 05:04:10', 'A0000182E', '2018-11-14 11:14:01', 'Sadly, the smiling faces might not always be there, but thankfully, we always have a smile on OUR FACE that transfers to them weather the staff likes it or not. LoL');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 1, 'P0000004E', '2018-07-30 23:23:47', 'A0000192R', '2019-10-30 04:56:58', 'So if you folks ever load up on omiyagi when you travel..............may I suggest this method to work around the dilemma you"re in.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000043D', '2019-06-16 09:21:14', 'I have dined here Teppan twice, a la carte twice.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000295G', '2019-08-19 06:44:40', 'Great beer.Matt Cole has matured into a great craftsmen.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000295G', '2018-09-06 12:05:53', 'Almost everything we tried was really good.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000014L', '2019-10-09 19:27:13', 'After my second, alcohol only, visit, I was excited to taste what vegetarian options they had.  I had the grilled cheese with spicy asparagus and portobello.  Let me tell you...grilled cheese is amazing, add a few interesting touches, it becomes addicting.  I was very happy with my sandwich.  Also, they have a very tasty appetizer of Goat Cheese Fritters with a red wine sauce.  Goat Cheese is one of my favorites and frying anything makes it better. I was in love.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000085R', '2018-04-17 19:50:21', 'The desserts are also pretty delicious.  The best time of year is when they have the red velvet cake blast.  I wish they carried it year around.  :(  The pumpkin pie blast is also a really good seasonal treat.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000014L', '2019-03-19 12:23:32', 'Parking is a bit tricky during busy hours and the wait times for food can get a bit long, so I recommend calling your order ahead of time (unless you want to take a look around while you wait, first-timers).');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000220U', '2019-09-01 13:32:25', 'First my french onion soup had very little flavor, almost watered down.  The cheese was overcooked and clumping and the bread was just... bread in my soup.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000294V', '2018-06-13 02:18:53', 'Someone from the company was in constant contact with me leading up to our night out.  Sammy, knowing how large of a group we had and how important a good table was to us, called me the night of to let me know they"d had a different, better table open up, and that he was giving it to us at no extra charge.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000180L', '2019-09-09 00:13:53', 'long and the workers incapable of handling the slightest issue. I m sitting upstairs if there is a next time I come to a Knights game.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000236Z', '2018-07-21 01:18:36', 'I went here  they were about to close but the cashier was especially helpful ..but I guess they were tired of work...');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000236Z', '2019-06-19 13:26:33', 'I had the pleasure of enjoying the croissant, it had the right amount of flakiness and was bigger than expected.  The atmosphere was casual and laid back.  I now look forward to trying this place out later in the day.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000083Q', '2018-08-08 01:04:55', 'All in all, like I said earlier, a great place for good times and smokey flavor.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000014L', '2019-04-29 15:24:18', 'OMG SO good!! I can"t wait to go back!! Love the atmosphere and the food was amazing (I had the eggplant)....This was one of my favorite culinary experience of my life! We didn"t leave anything in our plate!!! Thank you guys!!!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000180L', '2019-02-24 13:48:10', 'The suites are large, well equipped (full kitchen with a dishwasher in ours--I loved storing all  of our leftovers in our full fridge) with a full walk out balcony furnished with a patio table and four chairs.  The attached bedroom was large and outfitted with a King size bed.  As much as we liked the room, we obviously didn"t spend tons of time in it since we hung out on the Strip during much of the day and night.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000037E', '2019-03-25 16:50:56', 'I honestly think this was the most disrespectful customer service I have ever received. It certainly tops the list as worst interaction/confrontation with a stranger. I can"t believe anyone would treat or talk to anyone like that, let alone a proprietor to a customer. I worked in a restaurant for seven years and one of the cardinal rules is own up and apologize when you make a mistake--99% of the time people will completely understand. Offer them a discount or a freebie and the mistake is completely forgotten.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000037E', '2018-08-30 13:31:23', 'Travis, I will see you every single time I"m out in Vegas.  You make me feel beauuuutiful!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000155H', '2019-05-14 11:28:35', 'The Venetian is an elegant and distinguished resort and casino. Gorgeous and romantic decor and interior. On the way to your room, you are greeted by candlelit hallways and ceilings to light your way. Even though I didn"t try the restaurant, Bouchon, the smells emanating from the kitchen made my mouth water. The casino was expansive and had signs everywhere for easy navigation. Rooms are huge, clean, and well-maintained. The convenience store and bakery/coffeeshop is located at the entrance to the casino and near the elevators to the rooms which is a plus if you need to get a quick pick-me-up or forgot to pack something. The Venetian is a must-stay if you are ever in Las Vegas and will give you a dining, gambling, and staying experience that you will never forget.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000019J', '2018-04-10 05:10:58', 'Service was amazing, Christina was extremely tentative and took care of our whole group. Asked about splitting checks from the beginning which for a large group is very convenient!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000255J', '2018-07-25 18:17:27', 'After about 40 plus minutes we got a table and were so hungry and I ordered the chef special vegan dish which was the only Vegan dish on the list. I was immediately told that the chef special was SOLD OUT and that happened about a half hour before I ordered (meaning if we had a seat I wouldn"t got to have it ). Mind you it was only like 11:30am *insert Kanye shrug*');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000042W', '2018-06-21 00:07:17', 'Gluten free options promised, so we tried a turkey sandwich with avocado.   Large portion--very delicious.  5 choices of iced tea blends(free refills) and coffee choices made for a perfect girls" afternoon. Lots of seating outside on the covered patio.  Their parking fills quickly, but plenty of options on street or at the Municipal Bldg.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000042W', '2018-03-31 18:16:17', 'If you"re searching for a candy or soda pop you grew up with and can no longer find, there"s a good chance you"ll find it here. If only Now and Later would bring back their bubble gum flavored taffy, and If Tidal Wave Gum came back to life...The Green Apple was my favorite!......ALOHA!!!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000002S', '2019-09-19 10:56:34', 'Some notes: restaurant is located in the Esplandade with the AMC cinema and to the east of the Ritz Carleton.  Best bet is to park in the parking garage and then go to the walking mall.  Even so, it"s tough to find.  Don"t give up.  Also, it is no longer Fuego Tacos, but now Fuego del Mar, with a seafood-centric menu.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000278E', '2019-01-19 11:11:01', 'This particular location is hit or miss with the waitstaff - some act like they love their jobs, others look like they hate their lives. Past couple of times I"ve been there the food came out lukewarm at best. Yesterday, it just so happened that I found a lemon seed in my Brushetta Chicken Pasta, after almost cracking a tooth on it, ew. Although, I will say, I just moved that bad boy to the side and acted like I never saw it. It"s probably better that way.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000205A', '2019-09-02 23:20:12', 'Definitely worth going to for the food, but I really thought the service was the worst out of all the restaurants I went to in Vegas. For those reasons I probably won"t go back, but I wouldn"t tell people not to go.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000002S', '2018-04-07 14:21:32', 'Naked BBQ was fun, fast, and tasty. The staff was ridiculously nice and fun. As for the food, the sides are bit lackluster and need a bit more of a spicy punch or additional creamy, fatty goodness.  But, that is totally okay as the meat is the real star here. We tried four options, and we agreed that we both liked the brisket the most. Pulled pork and chicken were tasty as well. Overall, it was a fun, casual lunch with the before mentioned meat on a tray. I would totally stop by here for lunch or a brisket pick-up adventure again.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000255J', '2019-02-25 05:56:33', 'There is nothing bad in here !! It"s true. Amazing bagels, bakery section, I"ve always loved their sandwiches and there omelets are so good. I remember they used to be in the sun coast hotel and they had some amazing sugar free desserts. I don"t know if they make them anymore. Sad . But do go, it"s so good .');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000255J', '2019-10-30 13:22:22', 'We all started with cocktails - Margaritas and Mojitos.  The Margarita was made with bourbon and rimed with crushed bacon and salt (yes I said bacon).  The Mojitos were fresh and minty.  The one thing I we all really like about the drinks was that they were not too sweet.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000255J', '2019-07-25 10:56:49', 'Great ambiance, great food, although their policy of no reservations can be a drag.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000255J', '2018-01-14 10:07:01', 'We arrived at Hertz at around 2:15 PM on Aug. 24th and was able to get our rental in about 20-25 minutes.  The pick up process is pretty simple.  You can either go to a customer service rep or use their self-serve kiosk, which is what I ended up doing.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000205A', '2018-12-19 18:19:53', 'Herold was the customer services rep who helped us out and he was a very very big help. He got everything done and really understood the urgency of the problem (I had to drive 550 miles to SC the next day). He was delightful to talk to and was very patient and understanding as well.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000255J', '2018-05-02 16:27:56', 'The jade chicken quesadilla was decent, but nothing special. Just imagine orange chicken in between a tortilla and cheese. A friend of mine ordered a jade chicken burrito and we were confused when we pulled it out of the bag because it was literally the size of Mcdonald"s apple pie. If you order the burrito, be warned that it"s a burrito for gnomes and smurfs, but he said it was tasty.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000254G', '2019-09-03 22:59:19', 'Food is pretty good overall.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000199K', '2018-10-05 05:12:02', 'I tried this place because my girls are away for a month, and I REALLY wanted to try to wait until they came back, because NOBODY can hold a candle to them, but my toes were desperate.  When I went in, they were almost twice what I usually pay to begin with.  Then, before starting the pedicure, I specifically told them I already had gel polish on my toes.  They didn"t tell me right then and there "that will be an extra $5".  No, they waited until it was time to pay, and not only charged me for that, but they charged me all kinds of extra fees that I didn"t even ask for!  I had also informed the girl that my toenail was loose and needed gluing.  While I was looking at my phone, all of a sudden I felt this sensation, and she RIPPED OFF MY TOENAIL!!!!  Without even asking me!!!!!!  So then she had another girl come and put acrylic on there since the nail underneath was only 1/2 grown.  Again, they didn"t tell me how much this would be, or even ask my permission, they just charged me at the end.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000188F', '2019-04-04 19:46:55', 'The room itself was dimmed and the ambiance was more intimate.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000063D', '2019-01-31 07:01:36', 'Recommend the fish filet and jelly fish.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000229S', '2019-05-17 02:40:07', 'Located at the Venetian Hotel in Las Vegas. Great service, fast or slow depending on how busy it is. I ordered beef/broccoli, chicken chow mein soft noodles, & a small wonton soup. I didn"t like the green bell pepper in the chow mein (next time I will order without it). Today, I ordered a noodle soup with chicken and vegetables. Definitely, hit the spot. I added some soy sauce and chili for flavor. One of my favorite chinese restaurants".');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000104O', '2018-05-24 12:35:27', 'Great ambience and decor! And the food is delicious. Pan fried fish, street side Indian noodles, hongkong chicken are a few names to start with !');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000191G', '2019-08-29 00:11:57', 'I"ve never been to Akina for their AYCE dinners, only for their WONDERFULLY priced bento box set lunches.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000060R', '2018-07-31 08:38:20', 'I"m the first to give any Starbucks 5 stars because I am usually a fan. With that said, I am not a huge fan of this location.  First of all, I am not sure if this is country wide, but they charge 70c CAD to add a few drops of soymilk to some cold brew iced coffee, which is free in the US.  Additionally, their cold brew did not have the smooth flavor of the cold brew I am used to at Starbucks.  Third, mobile ordering doesn"t appear to be functioning for this store or in Canada (this may be an app limitation and not specific to this location). On a good note, the bagel was edible and they had some type of guacamole avocado spread in a container which was better than I was expecting.  Update: I did write to corporate on the fact that I was charged money to put a few drops of soy milk in my cold brew and they did confirm that this is not a correct practice to charge for tiny amount of soy milk in iced coffee.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000060R', '2018-10-11 06:08:02', 'Have you ever gone to a restaurant with great expectations based on reviews and left disappointed?  That was our experience.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000060R', '2019-06-21 09:49:21', 'I will never go there again unless I hear they have found a way to set up temperature of the room.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000132X', '2019-09-08 12:17:35', 'Travel weary and need of food - as I walked out my hotel heard some excellent acoustic music - enjoying some music ,  turns out it was $5 burger night - bonus -  California burger was juicy and the gauc and grilled onion perfect - i also tried the tortilla soup which i enjoyed. I also enjoyed the skinny crunchy fries and the chilled and crisp pickle The service was fast and friendly.  When i back to PHX and near the convention center I"ll come again');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000007E', '2018-03-28 07:12:33', 'Club Monaco is a bit on the pricey side, but I usually find great sales that are a great value..');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000091A', '2018-05-07 22:53:29', 'When you come out, you have the option of using one of several free vacuum which are powerful.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000124V', '2019-04-17 16:32:59', 'The search for Pasta Carbonara continues... maybe a trip to NYC or even Rome!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000191G', '2019-08-13 01:29:29', 'I loved my little cake, but the owner is her own worst enemy to her business. A friend took me there because we went on a cupcake tasting that day. He said a better product was awaiting me as the grand finale. When I walked in the store, I didn"t know who the owner was, until my friend pointed it out when we left. I wanted to take a look around, it was nicely decorated, but I could clearly see the person in charge slightly annoyed that I wanted to browse before buying. I explained it my first time at the store and she pushed me to buy a large cake. I explained again that I was not from Scottsdale and am only one person. So I"m not going to buy a large cake. When we started talking a bit more, I could see her employees sort of clam up. I had no idea what was going on. When I chose my little cake, any sort of customer service went out the window once the money transaction occurred.  She didn"t even say, "Thank you," It was so unusual for a bakery or any business dealing with customers. I was upset and quite frankly, so angry that I wanted to turn around an return my cake and tell the owner to keep my money. I am not rich - I am passionate about bakeries and tour around when I"m in a new town to support local business. I was genuinely interested in hearing about the seasonal cake that she was trying to sell me. I had heard through other locals that they love the cakes, but not the owner when she"s in the shop because she"s so rude. I give this a two stars because I liked the cakes, but the service was very, very caustic that I could not justify scoring more. I was trying to figure out how she stayed in business, but then heard she has a contract that keeps her afloat to sell cakes to a prominent medical clinic. I love the cakes there - the store is creative, but I sense a level of stress that turned me off. If it"s the economy, that"s one thing, but in the U.S., customer service is not taken lightly.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000229S', '2019-09-21 04:14:59', 'Five stars! I highly recommend this place if you"re in the mood for authentic Latin American cuisine. Coming from someone raised in Latin America, I"m usually skeptical of restaurants that claim to have Latin American food because although the dishes try to imitate Latin American styles, they usually come up short and completely miss the subtle flavors that make these dishes what they"re supposed to be. However, Chica completely nailed it. The whole chicken with chimichurri is a must-have (we shared it among four people) and the small dishes were delicious as well. The mini arepas that came with the guacamole were a really nice surprise and the empanadas were simply amazing and tasted just like the ones back home. Besides that, the latin music was on point and the cocktails were great too!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000136L', '2018-07-29 14:26:28', 'The food is great and the prices are reasonable. They give you a nice amount of food for what you pay for.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000229S', '2019-09-16 19:03:18', 'This is a place worth visiting!  Good food, good drinks, good prices, and good service!  Locally owned.  Flaming Fajitas - what more can you ask for!!!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000132X', '2018-02-11 18:21:44', 'I love Mexican food.  I live across from the Fajita Grill.  I have only been there twice (in 4 years).');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000139U', '2019-03-13 23:44:37', 'Service was prompt and good. I ordered the roti canai which was excellent and also filling. The chicken curry for the roti wasn"t thick, I think that"s a good combination as a dip. I also ordered the lamb curry (I forgot the exact name.. Rendang?) the flavor was good but I didn"t like the taste of the meat the chicken or beef version is probably better. The lamb meat I feel tastes like lamb sweat. At least that"s what I imagined it to be. I only gave it 4 stars because I wasn"t satisfied with the lamb meat and some of the items there were a bit pricey. Other than that it"s excellent and I like their beverages that they have a grass jelly drink and Malaysian iced tea :). Will definitely come back again next time.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000104O', '2018-03-05 22:28:11', 'This is my first yelp.  This restaurant was soo good I felt compelled to yelp about it.  Went for dinner with a friend of mine, really nice space.  All the staff were amazing!!  The chef even came out to our table which was cool.  And the Food, well I think even the most discerning top chef judges would be impressed.  A++ across the board.  We had the tenderloin and mac and cheese.  As well as the tomatoes two ways both are excellent choices.  I can"t wait to go back.  Cielo, kudos.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000136L', '2018-09-30 05:46:02', 'Always slow service. They don"t always have what you initially wanted and then they mess that order up, too. I come  here because of the proximity but I think I"ll just make the drive out to a different Starbucks from now on. I agree with some of the other reviewers, the coffee is weak and the parking/drive thru  set up is hell. Overall  not worth going to this location.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000139U', '2019-01-14 23:59:22', 'My company hosted a dinner and awards night at the hotel last night and the experience was the best we could have imagined! Working with Kristine Cole was fantastic and the communication was always on point. I walked in to be blown away by the set up and I had compliments on the food all night. I came into work today to be flooded with emails on how impressed everyone was with the presentation. The staff that was there to help us was GREAT! I believe Tim was in charge and he had Anna and one other gentleman with him and they made us laugh and gave us the privacy we needed. We will be back and I will be recommending them to everyone!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-02-22 17:23:23', 'A0000248T', '2018-08-13 22:08:50', 'It turned out to be a bit pricy, but I"m willing to pay for it - the whole thing, from the froyo to the overall experience.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000089C', '2019-02-25 22:28:38', 'We went to get food at 2am, pulled into the drive thru at 2:32. We waited there for 15 minutes, then we got trapped in the drive thru by a curb and other vehicles for 25 more minutes. I got incredibly fed up and walked inside. There were 2 tables seated - and they were already eating. One woman was ordering at the counter when I went in.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000031G', '2019-03-30 22:44:46', 'Beer, beer, and more beer.  It"s definitely a low-key nieghborhood bar.  As an out of towner, I enjoyed it.  It felt like Pittsburgh"s version of Cheers except grimier.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000213C', '2019-06-14 14:12:26', 'Skillet (cauliflower, squash, sweet potato & red peppers) - This  we super tasty but extremely small.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000029M', '2019-08-14 18:00:56', 'Well, we got off to a bad start.  My son fell asleep in the car on the way over (he"s five and had been in the pool all day) and I carried him into the restaurant.  At the register, I discovered that there was no children"s price and that I would be paying more than $30 to enter with my sleeping child.  Because it was mom"s birthday, I went with it, but I was annoyed.  No child is going to eat $30 worth of buffet food. They want the pizza and dessert and not much else.  Of course he didn"t want to wake up at all and refused to eat much of anything, so I paid for him to sit there and be cranky.  My bad.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000290B', '2018-11-29 08:25:05', 'Amazing service, great vibe, and fair prices.  Their Asian/Hawaiian fusion was perfect.  We"ll be back!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000233C', '2019-05-13 08:42:44', '**** UPDATE*****');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000029M', '2018-08-07 00:02:33', '- MUSHROOM POT ON CRACK. THIS WAS DEFINITELY THE SHOW STOPPER OF THE NIGHT!!! the flavoring of the sauce, the textures of the 3? 4? different mushrooms. happiness. The sauce was like a cream of mushroom, milky, full flavored, salty, a hint of sweetness... too good. needless to say we all took a bite and just smiled in satisfaction. We all stared at each other and knew rice was needed to soak up all that bomb sauce!!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000210S', '2019-09-26 23:46:38', 'I would definitely come back here good food, good service and fair prices. Oh and I forgot to mention they also have cool smoothies I got the Lychee...yum I love the fruit!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000123T', '2019-10-31 21:13:39', 'Indoor parking is the best on rainy days.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000031G', '2019-06-21 14:27:44', 'Paco"s Tacos is the real deal! In spite of the great Yelp reviews, I still had my reservations about eating at another TexMex chain. How good could it be I thought? Well they totally nailed it, from the complementary chips and dip to the sauce stains on my napkin!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000210S', '2018-01-24 03:49:30', 'Finally, they took me. The nail tech complained about the gel on my nails and how tough it was to get off. She struggled with it.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000213C', '2018-02-22 12:03:49', 'Yes, this IS as good as it gets!  Dr. Dameron and his team make going to the dentist actually a really good experience!  The whole staff is very professional, kind and accommodating.  Not to mention HAPPY!  The hygienists are just the best, as are all the staff.  Dr. Dameron"s work is beautifully done and my teeth have never looked or felt better.  I HIGHLY recommend this whole office to anyone needing work done!  You will not be disappointed.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000089C', '2018-06-26 23:46:53', 'The first & most important thing you need to know is this place is NOT FAMILY FRIENDLY, leave the kids at home because they are certainly not welcomed...they"re allowed inside but make sure they leave any kind of expression of joy at the door before entering.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000210S', '2019-02-15 22:57:35', 'The decor is very cute. It looks like you are in a cozy cabin.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000216S', '2019-07-05 09:31:59', 'Five stars for the Iced Espresso Bianco!!!  I am not an iced coffee fan, whatsoever, but this was amazing.  We were at the Venetian for date night - dinner and a show, so got here early to walk around.  We stopped in here to get a drink and I took a chance on this drink.  I did get the caramel flavor, but it was not to flavored, which I was happy about.  Not sure how they layered it, but the frothed milk was on top and it mixed it on its own and/or with stirring - so flavorful.  This drink really kept the coffee flavor without getting diluted by the ice or caramel.  I wish I had one later today!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000031G', '2019-09-03 19:42:57', 'Hands down worst gluten free cupcake I"ve ever had. I cannot believe anyone would associate that product with their name, it was terrible.  Not only are all the other bakery"s gluten free cupcakes superior to this one, but so are the grocery store box mixes like the gluten free Betty Crocker or Pilsburry. This was the first time I"ve ever thrown away dessert half-way through, I always finish or save it for later. The vanilla flavor wasn"t the problem. It was so dry, that I had to take a sip of water with each bite because it would get stuck in my throat. If you"re at Fashion Square and craving a gluten free treat, do yourself a favor and go to the Macaroon place. I"m disappointed, especially considering the cupcake was $5 after tax. The one star is for gluten free cupcakes only, as I have not (and cannot) try a regular one.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000089C', '2018-09-30 16:10:22', 'I will def be going back for my comfort food fix!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000256O', '2019-03-26 23:05:01', 'What an incredible experience this was. There is nothing particular special about the neighborhood atmosphere, but don"t let that deter you. We were seated on the outside patio which was lovely on a warm summer evening. The service was exceptional as the staff was incredibly kind and attentive, but it was the food that really made this experience. From the crispy shrimp appetizer and beef tartar, to the octopus special and veal flank steak, the food was simply amazing. Unfortunately, we"re from the San Francisco area so may not be back any time soon, but if this were in our home town neighborhood, we would come back weekly!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000089C', '2018-03-27 09:50:15', 'I ordered the Akropolis Pizza and Pork Gyro. The first thing I noticed when the pizza came out was how vibrant the toppings were! You can tell the veggies are fresh just by looking at them. The gyro was one of the best I"ve had and the fries were awesome. Great service! They really care about giving you a good experience. I will definitely be back!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-09-19 00:11:51', 'A0000210S', '2019-04-29 03:24:22', 'The drinks are the best part.  I love that you can customize your soda to add any flavor combination.  There is nothing like a raspberry limeade on a hot day! :)');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2018-05-30 18:36:41', 'A0000089C', '2018-01-12 20:35:39', 'Some places have a good dish or two, but the rest stinks.  Not the China King.  It"s all just solid food.  And not just Chinese either - pizza and even macaroni and cheese can be found, along with a huge salad bar, dessert bar and real ice cream (not a soft serve machine).');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2018-05-30 18:36:41', 'A0000290B', '2019-05-08 01:39:33', '* Large TVs (we watched football during one of our visits)');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2018-05-30 18:36:41', 'A0000290B', '2018-08-27 04:48:20', 'thanks again.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2018-05-30 18:36:41', 'A0000123T', '2019-09-06 01:25:26', 'inconsistent membership rates (my friends got quoted several different rates than what I pay)');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2018-05-30 18:36:41', 'A0000233C', '2019-06-23 12:12:46', 'The desserts (forgot to take pics) were actually really good. The hummingbird cake was moist and not too sweet. I don"t like nuts but I had several bites anyway cause the flavor was really good.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2018-05-30 18:36:41', 'A0000216S', '2019-04-13 13:37:42', 'The location was excellent and the restaurant was beautiful. The food was awful and our server was very rude and impolite.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2018-05-30 18:36:41', 'A0000210S', '2019-09-14 20:59:17', 'There was a group there (I think it was somebody"s birthday or engagement or something) and it was clear that this is a good place for a group of people to go.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2018-05-30 18:36:41', 'A0000031G', '2018-07-09 02:29:33', 'Price was good, service was professional , quality is outstanding. These guys are connected to the guys at Toronto T"s. I could not be happier with both of their services, I use them regularly and would not hesitate to recommend them.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2018-05-30 18:36:41', 'A0000031G', '2018-05-09 12:51:25', 'It is one of the few restaurants available once you pass security.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2018-05-30 18:36:41', 'A0000029M', '2019-09-19 21:46:04', 'Absolute waste of money. My husband and I felt no different after using the oxygen bar, massages and drinking the $5 peppermint drink. The employee was very sweet, but don"t waste your money. This place would get 1 star if the customer service sucked. And they tell you it"s $22 for the oxygen, but they also charge $5 for the thing that goes in your nose.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2018-05-30 18:36:41', 'A0000216S', '2018-05-24 17:03:56', 'Hands down worst gluten free cupcake I"ve ever had. I cannot believe anyone would associate that product with their name, it was terrible.  Not only are all the other bakery"s gluten free cupcakes superior to this one, but so are the grocery store box mixes like the gluten free Betty Crocker or Pilsburry. This was the first time I"ve ever thrown away dessert half-way through, I always finish or save it for later. The vanilla flavor wasn"t the problem. It was so dry, that I had to take a sip of water with each bite because it would get stuck in my throat. If you"re at Fashion Square and craving a gluten free treat, do yourself a favor and go to the Macaroon place. I"m disappointed, especially considering the cupcake was $5 after tax. The one star is for gluten free cupcakes only, as I have not (and cannot) try a regular one.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2018-05-30 18:36:41', 'A0000256O', '2018-09-25 19:57:10', 'Go. Seriously. You will not be disappointed one bit!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000043D', '2018-03-24 23:32:34', 'Hands down best Bloody Mary ever. So many things in my BM, veggies  mmm bacon.  "Nailed it" it"s an appetizer. I also had the burger with fries. Who knew fries could be so good. The presentation doesn"t disappoint ether. Very nice. Great seating outside although we sat inside. Would love to see this restaurant near my hometown. Seriously. Get the BM. You rock Guy!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000043D', '2018-05-25 15:01:59', 'This place was bookmarked by me so we went to check it out after seeing the menu had Vegan options and our boys and I are Vegan.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000038M', '2019-10-11 02:22:56', 'I love Pizza, but I try to stay away for dietary reasons. I went here last week with my daughter and mom, and was pleasantly surprised. Thin crust New York style pizza at a good price. The menu is kind of simple, but that"s the way these places are nowadays. Friendly staff and clean simple surroundings.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000038M', '2019-07-23 22:23:24', 'After another 5+ mins, the GM finally stopped over to take our drink order. The smugness of this guy was amazing. The thought of offering a simple apology never seemed to enter into his head.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000043D', '2018-09-20 10:58:32', 'Sexy, swanky Art Deco/Craftsman interiors with nightly piano.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000043D', '2018-04-02 20:16:00', 'Medium Flat Rate Box cost only $12.65 to ship. And again..........if it fits........you can ship!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000019J', '2018-10-14 12:12:32', 'Five stars! I highly recommend this place if you"re in the mood for authentic Latin American cuisine. Coming from someone raised in Latin America, I"m usually skeptical of restaurants that claim to have Latin American food because although the dishes try to imitate Latin American styles, they usually come up short and completely miss the subtle flavors that make these dishes what they"re supposed to be. However, Chica completely nailed it. The whole chicken with chimichurri is a must-have (we shared it among four people) and the small dishes were delicious as well. The mini arepas that came with the guacamole were a really nice surprise and the empanadas were simply amazing and tasted just like the ones back home. Besides that, the latin music was on point and the cocktails were great too!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000019J', '2019-05-10 05:41:30', 'As an ex-NYer, I have a pretty high standard of bagel. These did not disappoint, but I wouldn"t say they are truly singular in their yumminess. My review is based solely on these, as we did not try the desserts or anything else. Some of the bagels seemed "fresher" than others, and if you"ve ever had a NYC bagel before 8am, you know the expectations I have. I also feel like the bagels were kinda skinny, and the holes were big. I"m used to really fat, chewy but pillowy ones. Sigh.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000155H', '2019-01-23 13:28:04', 'I have noticed when 2 guests come and sit on a 4-seating table, the owner always makes it a point to move them saying that maybe there will be a lot of people who in and it will be a hassle to move them later so they shift to the smaller tables.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000295G', '2018-01-15 15:20:36', 'Enchiladas with Boom Boom Sauce and Mango Margaritas were good. I think I"d like to come back in summer and sit on the huge patio. Really good Tres Leches cake too.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000180L', '2019-10-23 21:28:09', 'After a day of shopping at the local mall and with dinner still hours off, a friend and I popped into Grazie (based on a recommendation from a former Phoenix resident) for a snack.  Didn"t hurt that my hotel was just up the street.  After a quick review of the menu, pizza seemed the best option and settled on the Capricciosa (Tomato Sauce, Mozzarella, Artichokes, Olives, Mushrooms, Salame, Ham, Parmigiano Reggian).  The pie emerged from the wood fire oven piping hot, with a slightly burnt crust.  It lasted approximately 5 minutes before vanishing into our hungry bellies.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000085R', '2018-02-02 16:48:42', 'standing.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000173C', '2019-09-06 09:10:48', 'Nice place. We were seated after a short wait on the patio. If I remember correctly, they had a water dispenser for those waiting. Place was packed. Seats were OK. Small menu. There wasn"t really a combo that did it for me. A lot of good looking food on the daily special list, problem is, you"d have to come that specific day. Today"s daily specials were steak and eggs and jalapeño hash thingy. They just ran out of steaks I was told. Made the decision easier. I got jalapeño hash thingy. The food was OK. It was well executed, but nothing jumped out to me as being special, or deserving of the hype.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000295G', '2019-01-08 04:52:28', 'So idk why ppl are giving this place such a hard time. I"m reviewing for EDC weekend. We checked in Thursday (the 20th). The guy up front gave me great service.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000014L', '2019-03-02 09:07:04', 'second A place that proudly serves "Middle eastern" and also "Greek" food usually misses those authentic flavors. For example serving Jewish Latkes, Israeli/middle eastern humus, and Greek moussaka is usually just too much for a fusion.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000155H', '2018-11-15 12:28:30', 'The toast & cheese was good, but by the time we were able to dig into their heartiest offering of food, saltines and butter may have been equally pleasing.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000083Q', '2018-10-09 23:07:13', 'Here"s why I don"t write reviews for Chinese restaurants: I have to look up their English names...');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000236Z', '2018-09-11 15:59:52', 'The great manicure that I got here lasted all the way through my vacation to Mexico without  so much as a chip! This was a regular manicure and not done with shellac.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000294V', '2019-09-24 18:20:27', 'Very disappointing.  Overpriced mediocre food.  Refried beans served with fajitas were so hot that they not only burned my tongue but throat as well.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000220U', '2019-06-29 15:29:44', 'Service was very strange - the smiles were abundant, but everything else about the service was off, from how scarce our server was, to her not willing to take an order for breakfast from us,  yet a table seated after us served by someone else got breakfast; to how long it took to place our orders, to how long it took to get our order.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000246Y', '2019-02-18 20:18:18', 'Second visit, Thursday night and the place was much more hopping. There was live music, drink specials and a generally good vibe in the place. I had steak frites, which was cooked to the medium I specified (I was asked this time) and good, though not exceptional. The fries (aka frites) were very good. The highlight of the meal, believe it or not, was the pea soup which was so good I almost licked the bowl when I finished! You can bet I"ll be ordering that again next time I"m there. Oh, and I had a house beer or two ($6/pint).');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000172O', '2019-06-10 10:37:21', 'The young man at the register "Chris" was very helpful with ordering and extremely pleasant. I will definitely be coming back to check out the $1.50 tacos on Tuesday.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000015A', '2018-09-02 11:18:46', 'I"ve heard great things about Toast for breakfast and lunch so thought we might get it a try for dinner...  We walked in around 6:30pm on a Friday night,  the restaurant was about half filled. There were plenty of seats in the the front of the restaurant but our party of four was seated in the very back beside the bathrooms and back door.  We sat there for a few minutes (not wanting to be difficult or affecting the order in which the servers were sat)  but  we really couldn"t take the cold draft from the back patio door and constant bathroom visits.  We politely ask if we could move to the front.  The hostess obliged but didn"t seem too happy about it.  The same server continued to wait on us once we sat in the front (we were glad because we did not want to make him lose a table) .');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000188F', '2019-10-08 05:40:32', 'This is a great place to go on a small cute date ~');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000046H', '2019-10-20 17:50:54', 'Price was right - under $10 for food with tax.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000278E', '2018-07-22 12:16:16', 'Brandi is awesome... love her demeanor and personality. She is an excellent stylist.. I am also a cosmetologist so I know  the real deal when I see one! I will be back again for sure! Her scalp message was perfection.. so relaxing and I had a blast talking "shop" with her. Highly recommend this lady!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000042W', '2019-07-06 00:56:00', 'I have visited this place several times. They have great happy hour prices and their regular menu prices are very reasonable too. Their entrees are big enough to share, my favorite is their fish tacos. They tend to get pretty busy on Friday nights, so there is sometimes a bit of a wait. Overall, thumbs up!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000042W', '2019-03-30 05:47:51', 'Awesome breakfast!!! Had the Rubin Benedict and wow was it good! Loved it!! Kid friendly & mom approved,  in fact she had the Florentine Benedict... Good service and prices.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000199K', '2019-04-24 09:31:28', 'Drink -Jones Strawberry-Lime Soda - Yummy not sour but good balance,');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000205A', '2019-08-09 08:59:17', 'Very rude staff. Slow little to no communication between the team. Very grumpy short responses from multiple staff.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000188F', '2018-06-20 04:29:38', 'Unfortunately, I don"t understand the negative reviews, maybe it was bad timing? But I LOVED the crazy burger. I brought my American friend and he had the Green burger, and was impressed about how good it was. SUPER friendly staff, they made sure I had every condiment (ketchup, napkins etc.) I didn"t expect any service at all from a burger joint but it was an pleasant addition. I"ll be coming back for the food and the exceptional service. I"ve never had such a nice experience at a burger joint before. I"d recommend the Crazy Burger combo (Onion rings and Boylan"s Black Cherry Soda). Although it was a bit messy it was delicious, and I loved every single bite of it. I"ll definitely be coming back soon.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000199K', '2018-08-08 00:39:08', 'I had to get my nails done last week when I was out shopping, so I decided to stop in and see if I needed an appointment or if they could take me. When I walked in, all nail techs were sitting around and there were no customers.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000046H', '2018-03-03 20:50:35', 'I was most impressed with the service!  We were greeted right away.  While we were eating our dessert both a manager and the chef stopped by to check on us.  I was most impressed that the chef and manager cared so much about our experience!  A+ service!  I"m glad I found this new gem in Old Town Scottsdale!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000046H', '2018-12-30 20:32:38', 'Flies on the pizza that was sitting out there.  Ew.  Very disgusting.  I would NOT recommend it ... very unsanitary!');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000278E', '2019-09-05 22:37:45', 'All in all, I will be back again to try more.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000255J', '2018-03-21 17:51:57', 'Employees talking over my head and seriously, 5 minute haircuts...I don"t understand. Last time I went, they refused to take me even though they were still open. An hour before closing hours, still open. I stood there, in front of the glass door while the lady swept by me, ignoring me. I was disappointed about that, but went back since second chances exists. I went a couple more times and wasn"t too happy about the service and cut.');
INSERT INTO ForumEntries VALUES('VM0008', 2018, 2, 'P0000007K', '2019-08-19 15:47:38', 'A0000199K', '2019-03-30 02:29:44', 'Swamp cooler parts are very large so they don"t have space to keep them in their vans, but Derek assured me he could buy the parts and complete the repair the very next day. I explained that my husband and myself would need to wait until Friday when we were getting paid for repair and he was kind enough to work with us so we could come to an arrangement for payment so we wouldn"t have to deal with our house being so hot. He came back the next day and was here for a good amount of time as swamp coolers take more time for repair and he was very thorough and explained everything to me again. I asked questions about how to best maintenance our swamp cooler and he was happy to answer. I"m very glad we chose Mr Cool and would HIGHLY recommend Derek as he was so patient, kind, and hardworking. Swamp coolers are a pain for repair so if they were affordable for our repair I"m sure they"re even better with AC units. Thank you Derek and Mr Cool, our house gets soooo cold now, just how I like it!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000075D', '2018-07-06 06:14:43', 'Would I go back when in town again? No.  At the risk of being sat in that situation again.  The food can be the most delicious in the world, but I still prefer and deserve privacy when dining.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000122F', '2019-02-17 01:32:55', 'Ladies, please don"t drown yourself in perfume and go to a restaurant!  Ugh!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000156L', '2018-10-27 14:54:02', 'Be careful about total fee and I do not recommend ask them to rent a car.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000156L', '2018-03-22 02:11:05', 'Woke up earlier this week with a crazy case of Torticollis. Couldn"t turn my head to the right and I was having spasms like crazy! Went to The Joint on Wednesday, Thursday, and Friday (today).');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000291F', '2019-09-29 11:31:43', 'Our waiter was pushy, rude, and S...L...O...W...');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000122F', '2019-09-08 15:13:56', 'Also an important note:  One of my top five places to drink a house margarita.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000156L', '2019-05-31 04:12:10', 'Pork Belly, unreal! Had an AMAZING prime NY Strip with bourbon butter jam, PHENOMENAL!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000156L', '2018-09-07 20:59:35', 'The only negative I did feel could be addressed is the tables are made of some type of epoxy resin so being outside, May be melting or something because there was a sticky residue on the table top. I just played a napkin over it so it was acceptable.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000156L', '2019-04-06 02:11:32', 'Wine list is all-Italian and well priced, with many by the glass selections.  I opted for a nice Barbera, which was poured generously into a large glass.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000006R', '2018-09-13 04:33:40', 'Cheap tickets, awful staff, probably a good idea they got the self serve kiosks. The remodel is nice but doesn"t make up for the lousy customer service and rude popcorn makers');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000221B', '2019-10-02 13:57:16', 'I love NY city pizza pie.  Excellent rendition of sharing a portion of NY here in the desert.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000012R', '2019-08-13 22:25:55', 'Listen people this is the spot. Stop paying too much at over priced place where the portions are small and mash potatoes are green. This place portion size it meant to feed a horse not a mouse like the other places. Like I"m coming back here over and over again. Plus my gf lives not far is its convenient.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000174P', '2018-01-05 04:01:27', 'The brussel sprout nachos are really as good as the other reviewers have mentioned! I"ve had them more then a few times and everyone always loves them, be careful because they can easily fill you up! Individual tacos and the burritos are great too. I"ve also had a few of their salads and love them, big a portion sizes. Great classic margarita as well, love this place for groups esp on Sunday when is all day happy hour!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000138V', '2018-11-10 21:28:15', 'I had the southwestern omelette and I LOVED the salsa inside it was so yummy and really added a nice touch to the meal. Prices were also fair. I decided to branch out from my usual egg benny. It was a nice change.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000149A', '2019-09-08 20:43:38', 'Have you ever gone to a restaurant with great expectations based on reviews and left disappointed?  That was our experience.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000287V', '2018-04-14 20:25:12', 'lockers (bring your own lock)');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000138V', '2018-01-01 08:18:19', 'There was one UGLY thing about this place though which is why I removed 1 star, and that is that they don"t allow "oversized" bags or backpacks and force you to check them for $20!!  $20!!!!  It"s insane!  It really pissed off our group at first cause there were 2 of us with big bags, but at least they let us put them together for $20 total.  Jerks.....  I"m sure there"s some good reason for not having oversized bags, but they didn"t tell us.  One other messed up thing that happened is that we were approached by a promoter the night before after leaving XS and he offered us free admission AND a cabana for free.  We were like, hell yes!!  And then we we get to Encore Beach, the guy isn"t around and no one would help us and we were stuck paying for the spot ourselves.  We were pretty pissed about that too, but we didn"t let it ruin our time and got over it and just ended up paying.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000149A', '2019-06-22 03:12:24', 'After a while we decided to walk around to check out the rest of the park. We see ducks everywhere especially in the pond that has the nice waterfall going into it. Unfortunately, this is where the "nice stuff" ends. Everywhere on the paths we were walking on were green duck crap. Which brings the question, "Is there some kind of spray or force field they have on the playground?" Because there were no ducks or green duck crap anywhere in the playground. Im also curious as to how many people would actually spread out a blanket and have a picnic on the grass for the crap was all over that as well. Just doing this review im starting to get grossed out thinking about that day.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000174P', '2019-07-02 16:57:25', 'Good food all around. The meal begins with complimentary sides as most Korean restaurants are known for. In addition to the usual sprouts, kimchi, etc. Island Style also gives you boiled peanuts which were a nice touch. I went wth cold noodles half and half for my meal. I really liked the dish, with each side offering a nice taste. I wish it could have been spicier but in the end I was contently full and very happy with my choice. $14 for the dining experience was well worth it. The restaurant itself had a very mom and pop feel and seemed authentic in every aspect. A very good option for eating in the area.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000138V', '2018-04-03 09:03:18', 'I initially passed the place up since it is nestled in a typical strip mall off next to a Kinko"s just off Rural Road on E University.  I was meeting a friend for a quick, inexpensive and hopefully tasty pre-movie dinner at the Valley Art Theater on Mill.  The decor was what I would call, the "basic, no frills cafeteria like set up" that can be found in many Indian and Thai restaurants I have frequented.  Practical and comfortable.  The staff was friendly and welcoming and the menu had typical Indian fare.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000149A', '2018-01-04 11:35:45', 'Great cocktails and very good food.  Overall first class restaurant.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000287V', '2018-07-10 17:55:20', 'Ikea....an experience!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000174P', '2019-07-07 09:11:31', 'I liked it enough to want to go again.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000012R', '2019-01-10 08:33:17', 'None of these things happened.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000287V', '2018-08-21 11:43:09', 'This was a great find near Pittsburgh alternative to down town scene. Ambiance was great on the deck by the river, and service was excellent (Thanks Melisa for history lessens!). Seafood including Oysters were fresh and well prepared. Price was reasonable for "Prefix" menu including scrumptious dessert.  What an evening to end a fantastic summer day in Pittsburgh.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000138V', '2018-11-29 19:52:39', 'The Cajun beans were also spicy but tender. They were made with white beans. These beans had the right kind of tenderness to indicate they were not canned beans.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000293L', '2019-05-16 03:45:04', 'It could have been an off day for them!!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000174P', '2018-03-15 01:09:31', 'Pizza was fine, but barely had enough cheese on it to cover it. Fair for the price.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000012R', '2019-09-17 11:58:21', 'My husband and I drove by Rani"s a couple weeks ago and he said, "International Market? That looks interesting."  So I made a note to check it out on Yelp later.  After reading the reviews I channeled Liz Lemon and exclaimed, "$6 vegetarian Indian food? I want to go to there!"');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000174P', '2019-04-19 13:53:02', 'The service can be spotty, especially when it comes to drink refills, but I"ve surprisingly never had an order come out incorrectly. I normally would not be surprised by this standard service expectation being consistently fulfilled, but I have had some BAKED servers here, so the fact that they can remember my steamed spinach substitution each and every time is kind of impressive. So, good job, stoned servers. Maybe work on the drink thing, though.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000033P', '2018-08-21 03:30:30', 'Got a chance to check out this spot while catching up with a business contact for coffee.  The gentleman working this morning was patient in explaining their offerings .  The coffee was smooth and only needed a bit of almond milk - kudos to the cafe for having that as an available option.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000094V', '2019-02-04 17:51:56', 'If you haven"t been to Chino"s - it"s time - make a run for the border/great wall/beach!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000274S', '2019-08-12 16:20:24', 'Food was somewhere between okay and decent. Service was somewhere between piss poor and terrible.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000130G', '2018-02-16 11:16:45', 'Still the best dinner buffet on the strip. Start with the king crab and shrimp cocktails. Then move on the specialty meats.  Everything sings quality...especially the hand made desserts.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000130G', '2018-02-13 08:04:09', 'Jared to the rescue:');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000130G', '2018-05-15 22:04:32', 'Good environment, I ordered the famous meatloaf and it is large but a little bit salty. The waitress is not that friendly but overall I had a great experience.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000023E', '2019-09-24 05:45:07', 'Service was great.  Food was delicious.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000023E', '2018-01-19 03:09:51', 'The oatmeal cream pie cookie joint was pretty good but again I"m not a fan of nuts and thick creamy icing. But anyone who is down for this, would love it!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000033P', '2018-07-01 15:17:49', '3. Fabulous Wine Selection');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000033P', '2019-09-15 22:12:21', 'I"d like to say how wonderful DH"s meal was, but basically I got one bite of his pork---that"s all he would share---before he devoured it.  He said it was one of the best pork dishes he had ever enjoyed.  He felt like he was in the Caribbean!  I got no bites of the Succotash, darn him---looked so good!  He scarfed it all!   His hush puppies went that fast too!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000033P', '2018-08-27 01:43:45', 'Overall, the experience was great. I found it easy to schedule an appointment. I respected the fact that they honored their estimated time frames. I love how communicative they were.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000035K', '2018-01-05 04:47:10', 'Absolute waste of money. My husband and I felt no different after using the oxygen bar, massages and drinking the $5 peppermint drink. The employee was very sweet, but don"t waste your money. This place would get 1 star if the customer service sucked. And they tell you it"s $22 for the oxygen, but they also charge $5 for the thing that goes in your nose.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000023E', '2018-12-25 05:01:03', 'Right off the bat, I need to tell you that I love thrift store shopping. Adore it. occasionally have sultry dreams about it. Okay, we"ll stop there.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000035K', '2019-06-27 17:09:28', 'One star is for the decor not the food.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000130G', '2018-08-18 18:36:20', 'We were about 10 deep in out party.  2 booths seated directly next to each other. One table ordered chicken tacos.  The minute the server sat the plate down we noticed there was hair in it.  She took it right back.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000035K', '2018-06-06 22:56:04', 'Sadly, the smiling faces might not always be there, but thankfully, we always have a smile on OUR FACE that transfers to them weather the staff likes it or not. LoL');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000130G', '2019-05-14 22:24:43', '15 dollars for breakfast');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000280M', '2018-11-19 23:27:43', 'Here, I tried three flavors - chocolate, pumpkin, and caramel sea salt.  Added toppings of brownie bits, chocolate caramel turtles, and mochi.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000118M', '2018-01-15 17:05:15', 'The Venetian is an elegant and distinguished resort and casino. Gorgeous and romantic decor and interior. On the way to your room, you are greeted by candlelit hallways and ceilings to light your way. Even though I didn"t try the restaurant, Bouchon, the smells emanating from the kitchen made my mouth water. The casino was expansive and had signs everywhere for easy navigation. Rooms are huge, clean, and well-maintained. The convenience store and bakery/coffeeshop is located at the entrance to the casino and near the elevators to the rooms which is a plus if you need to get a quick pick-me-up or forgot to pack something. The Venetian is a must-stay if you are ever in Las Vegas and will give you a dining, gambling, and staying experience that you will never forget.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000118M', '2018-03-01 19:42:49', 'From out of state and rolled up.  Richard greeted us and we had great customer service.  Thanks so much.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000280M', '2019-09-15 20:04:19', 'A tale of two locations (AKA: AVOID 7700 S Autoplex, GO TO 616 W Baseline)');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000118M', '2018-10-10 02:34:38', 'To share, we decided on the fried jerk chicken wings, which were delicious. Bae ordered the baseball steak and I opted for a soup and salad.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000215E', '2018-07-17 18:54:18', 'I don"t normally like to do this, but I have to after the terrible experience I just had. Centurylink has the WORST customer service I"ve ever experienced. Two weeks ago I put in my order and the tech was scheduled to come in yesterday. Nobody showed up and nobody called to reschedule. Today I called, was on the phone for almost two hours, transferred to four people and was told they had to reschedule for Thursday, there was nothing they could do to help me earlier. I even talked to a supervisor who was the worst "supervisor" I"ve ever dealt with. Two hours later and I now have to wait until Thursday. Nobody apologized, nobody seemed to care. I told them if they don"t come Thursday I"ll be cancelling my service and going with Cox. Also, this whole time I was on their site talking with a live customer service rep online trying to figure this out, but all they told me was they couldn"t do anything. So today"s Worst Company Award goes to Centurylink.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000118M', '2018-12-04 22:36:27', 'Great food and prices.  Servings are generous and the atmosphere is good.  A nice place for traditional Mexican in Old Town.  Really liked the Pollo Relleno.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000018R', '2019-03-23 01:31:34', 'Listen people this is the spot. Stop paying too much at over priced place where the portions are small and mash potatoes are green. This place portion size it meant to feed a horse not a mouse like the other places. Like I"m coming back here over and over again. Plus my gf lives not far is its convenient.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000215E', '2019-08-31 02:59:24', 'This place has the best beer selection that I"ve seen in the city. The variety of beers is unparalleled. barVolo doesn"t touch this Barhop! I also like that they let you do samplers of their draft beers.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000215E', '2018-11-29 11:50:29', 'She could have found a nicer approach instead of yelling at me. I got to the window to pay for what I was able to order and she told me that if I wanted my food I would need to come inside and leave my dog in the car because it was unsanitary for me to have my 3 lbs yorkie in my lap while she was handling food.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000280M', '2019-01-03 18:01:25', 'We look at the Cad and he tells me there are two to choose from and I would like it better than the Mercedes anyway.  Is that why there were 2 Cadillacs and 0 Mercedes available?');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000280M', '2018-08-21 15:26:29', 'His prices are very fair, and he himself is the most trustworthy vet I have yet to meet. One conversation with him and you can tell he does not care about money, he is truly one of the very few who are in this business just because they care about animals.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000118M', '2019-03-08 22:31:39', 'I called them but they let us wait for 2 hours and just transfer a key company.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000018R', '2018-07-14 22:01:49', 'Foodwise....id go somewhere else.  As a local i should"ve known better but wanted to try something new.  Now i know, i won"t go back.  There are other places around town to get same food for cheaper price and same quality. Good luck.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000147I', '2019-07-24 20:40:35', 'A little pricey but worth it! Crepes were delicious! We got the seafood and chicken pesto. Really cute back area and service was good. Would come back!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000270U', '2018-08-09 03:03:25', 'And If you sign up for a players card, you get a free buffet (which we didn"t take advantage of, though).');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2018-07-15 11:05:13', 'A0000270U', '2019-07-30 22:05:57', 'Lesson learned by me...just return the "bloody" dish...just hate doing that though...would I go back...yes, definitely');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000280M', '2018-01-06 18:36:47', 'Will be going back!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000018R', '2019-07-04 15:56:42', 'Oh man this is going to be a long review so if you want the gist, god awful, do not go. I was so dissapointed with everything that once I got home I had to write a review.  First of All I am Vietnamese and Pho is such a soulful dish, the pho I had today was the worst thing ever.  My parents came to visit with my sister and a friend, and after a long day we wanted to finish with a hot bowl of pho.  I have seen this place, I have even walked by it when I ate at Sura.  There was a smell so tantalizing that I had to go and try it. I thought it would be a good idea to try Jenni Pho Grill tonight.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000018R', '2018-03-07 22:07:32', 'Food was pretty good however the prices are high. Waitress did a great job until she asked if I needed change.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000270U', '2019-09-11 01:34:32', 'Don"t expect any fancy surroundings. It looks like a hole in the wall but you"ll be convinced to enter the door when you get a whiff of the food (which can be detected from a block away). The staff are very friendly although sometimes the service is slow. If you don"t like to wait, call ahead and take it home!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000147I', '2018-04-08 18:56:50', 'I knew these were not my wife"s who is a small woman because these were of a rather robust size. Also these were obviously clean panties, so I gather that one of the employees has a fat girlfriend or wife who is missing something from the laundry.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000270U', '2019-08-21 02:26:42', 'The staff and materials used high quality.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000270U', '2018-03-17 07:14:51', 'Beware their one scoop is a MASSIVE one, thankfully the person helping me recommended I first see their quantity before being so keen on jumping on the two-scoop-wagon.  Thankfully One was enough, both Jen and I each took something we liked.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000270U', '2019-05-28 14:19:40', 'From either the property management or the leasing side, I don"t think you"ll get better service anywhere than Active Renter provides.  I would recommend them - WITHOUT RESERVATION - to any family member, friend, and/or colleague.  They are the best in the business and their high rate of growth is proof positive they are the best property management company around.  You can"t go wrong with Active Renter.  They are the real deal.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000147I', '2019-09-02 20:03:15', 'This is one of my favorite places to eat.  The food is delicious, fresh and almost everything can be made with tofu as a substitute.  The owners are very friendly and the food truly is superb!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000118M', '2019-10-18 05:53:39', 'Being a big Laguna Hills OHOP fan, I was disappointed when I visited the Scottsdale AZ location. It felt like a completely different restaurant.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000118M', '2019-04-21 10:36:24', 'Not a fan. Overpriced, over cooked bland burgers. Everything is extra (fries, onion rings).');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000118M', '2019-09-09 21:27:40', 'Christian and joe!! 5 stars!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000118M', '2019-05-07 20:50:56', 'Now I have to call LG, file a complaint, and find a *real* solution provider. This is a real *hassle* I don"t need right now.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000023E', '2018-07-12 05:41:00', 'for their own protection.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000033P', '2018-11-19 00:49:25', 'no showers');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000274S', '2018-06-21 02:18:22', 'We have been wanting to try this place since it opened and finally went Saturday evening.  We sat on the patio and had some delicious cocktails.  We eventually went in and sat at a table for dinner.  The chicken and waffle appetizer was delicious.  For entrees we ordered the shrimp and grits and the steak.  Everything was delicious except for that the cook could not get my steak right.  They tried three times to achieve medium rare but just couldn"t get it right.  Fortunately, for me our waitress who was fabulous was more upset about it than I was.  She would take it back to the kitchen even before I had the opportunity to complain.  The manager stopped by and was so apologetic and gave us a gift card to come back.  Even though I would probably never order the steak again, we will definitely be back for the ambience, the drinks, the other yummy food, but most of all for the EXCELLENT customer service that is so rare to find these days.  Well done Trey!  Thank you!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000130G', '2018-04-12 05:06:10', 'I"m truly disgusted by the service of this restaurant.  I came in with my family (Mom and Dad) and they said 10 minute wait, we said okay, we notice that they were short with their staff so we waited patiently till we were seated at a table, but that 10 minutes turned into a 30min wait. So the hostess sat us at a table saying how there may be awhile wait, after seeing 2 servers walk by us like we didn"t exist, the hostess later seated another table which were 4 Caucasian customers, we were still patiently waited for around another 30min, when those 4 sat down an Asian waiter quickly came to take their order, I got the waiters attention and said excuse me, we came here first. And she made up an excuse saying how "Oh we wait on different tables probably your waiter is busy" I knew this was an excuse, I was so disgusted. So we told the hostess that this waiter is waiting on a table after us, and she said oh well we said there would probably be a long wait, and the hostess had the audacity to say "Oh but they serve the people who come before" and I said, we were before them, we been waiting 30min at this table and you know this because you sat us at our table" she said it depends. So in the end we left the restaurant hungry and went to a much better restaurant which served us very well, called Rice Paper.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000274S', '2018-05-27 20:17:54', 'Ikea can be intimidating in it"s size and there being SO MUCH STUFF but it is well worth it! I always go to Ikea with a list of items that I am needing for the home and I always find it, while also finding MUCH MORE to leave with. The greatest part of Ikea is the price! There is a reason that you have to get your own furniture items and load your own cars/trucks/vans with your purchases...to save the costs of Ikea! This is a good thing because then the savings are passed along to you, the shopper!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000033P', '2018-06-12 20:04:25', 'Even though I haven"t had much luck at this location over the years, I still stop by when I am at this mall. I"m still a longtime fan of the brand (since high school, mind you) and I am still optimistic.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000023E', '2018-10-20 11:16:35', 'Really the food was pretty good, so maybe it is just my son"s behavior that"s coloring my opinion on our meal,  but I just can"t help but feel like we over paid.  There was nothing remarkable offered.  The service was iffy, the food was unexceptional.  Well, dessert was pretty great, but I don"t need to pay almost $100 for my family to eat dessert.  I"m just not feeling the love for this place this time.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000023E', '2019-10-27 10:42:24', 'I used to work for Skechers in Las Vegas YEARS AGO. Everything at this store is the same. Except this store is much smaller! Especially the clearance section. I tried on some shoes. And that was it really.  We were greeted, but no one checked up on me blah, oh well...');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000023E', '2018-06-16 22:38:44', 'The wait staff from about 11am on, are pretty nice. Before that time, get ready to deal with Dawn of The Living Dead. They"re like pissed off zombies.. Which sucks cuz this place"s best deal, is their "before 11am, $2.49 breakfast."');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000033P', '2019-01-01 07:17:01', '#1 it should be advertised as a vegetarian dinner. For the price we paid, I really would have liked a nice cut of meat.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000035K', '2018-03-12 22:01:00', '* Large TVs (we watched football during one of our visits)');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000274S', '2019-09-16 10:30:27', 'In conclusion, the food quality is above standard, service and cleanliness is high, and the atmosphere is intimate. The food is more old fashioned, come here for a great steak done right at a slightly higher price range than the keg.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000033P', '2019-06-17 05:17:05', 'Still the best dinner buffet on the strip. Start with the king crab and shrimp cocktails. Then move on the specialty meats.  Everything sings quality...especially the hand made desserts.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000033P', '2018-07-03 05:13:33', 'Still the best dinner buffet on the strip. Start with the king crab and shrimp cocktails. Then move on the specialty meats.  Everything sings quality...especially the hand made desserts.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 1, 'P0000007K', '2019-06-11 05:16:10', 'A0000035K', '2018-09-09 02:56:19', 'Did a BOGO for Samsung Galaxy S9 in April 2018. Arranged for in-store pick up.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000110N', '2018-09-08 09:04:07', 'Gold Ribbon- mix of caramel, chocolate, and vanilla, I truly loved this trio of flavor, each complemented one another. TRULY delicious!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000170Q', '2018-10-27 22:48:06', 'My daughter and her boyfriend were very excited to go here. They paid almost $200 for 2 Buffet of Buffet 24 hour passes . They had crab sushi shrimp and oysters.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000110N', '2019-06-08 11:49:31', '* Friendly & efficient service when you order at the counter');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000013R', '2019-06-23 08:25:14', 'This place rocks my world!!!! The servers are super friendly and the food is fantastic. I come here about 2 times a week and am extremely satisfied every time. They have a great happy hour too! Denise and Maggie are the best!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000284F', '2019-09-04 16:39:20', 'Too bad this and the playground were the only nice things I can vouch for.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000140O', '2018-03-21 10:50:36', 'Yum! I could eat it every day. My favorite is the "special" burro.  My second would have to be the two tacos. Beef or chicken, both delicious. Affordable, quick, and take some tortillas home for later.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000112O', '2019-06-06 18:14:55', 'PLEASE STOP OVER BOOKING. WE ALL KNOW IT"S NOTHING MORE THAN GREED TO BILL MORE APPOINTMENTS PER DAY.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000065M', '2019-08-06 18:53:06', 'Hands down best Bloody Mary ever. So many things in my BM, veggies  mmm bacon.  "Nailed it" it"s an appetizer. I also had the burger with fries. Who knew fries could be so good. The presentation doesn"t disappoint ether. Very nice. Great seating outside although we sat inside. Would love to see this restaurant near my hometown. Seriously. Get the BM. You rock Guy!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000284F', '2018-02-13 23:57:13', 'J"ai prit un thé qui était vraiment bon, et je me suis posé devant une des grandes baies vitrées sur un coussin et j"ai relaxé complètement pendant 2 heures.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000170Q', '2019-03-20 16:10:09', 'On our last visit ( less than a week ago) ,their baked beans were different...hopefully it was just a hiccup because they are usually incredible.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000241P', '2019-05-10 08:35:23', 'The server we had was a little sleepy but he was nice. I think he needed a nap though.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000168B', '2018-11-30 19:18:05', 'The food was brought to us within ten minutes of ordering (successfully taming the hangry beast that was brewing) and any modification to our order was done correctly! The food itself was pretty good.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000241P', '2019-02-16 06:46:18', 'The square plays host to so many things throughout the warm weather months, it"s a staple for those living right downtown.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000080C', '2019-02-18 13:09:35', 'We just recently purchased a house with a pool. Being first time home and pool owners we want to make sure we are doing it correctly. I"ve taken my water to be tested here multiple times and each time they act as if it"s a great inconvenience for them to spend a minute testing the water.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000080C', '2018-12-12 11:23:11', 'The food is always good and the prices are reasonable.  Although it"s not exactly a restaurant -- more like a snack bar, limited menu and you walk up to the counter, place your order, wait a minute or so for them to prepare your order, and pay the cashier, then search for a table.  Kind of like a sandwich shop.  Still a much better choice for value than the other hotel Deli"s on the strip.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000102W', '2018-07-25 07:53:27', 'While I was in Las Vegas, I decided to go up with just a duffle bag for my luggage, as I was basically away for just 2.5 days.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000101O', '2018-10-17 06:46:43', 'Certainly a fun place to shop. The sales people are very nice they just really don"t have a clue about anything and the parking is always a mess. I bought a jacket today, and it had an unusual rear pocket and I asked what was the purpose and they really didn"t know so there best guess was that it could be for carrying your skies or poles lol.  I don"t shop here often but it is the first place I will come when looking for sporting equipment/clothes. I don"t rely on the staff, I do my research before I arrive. I have bought many items here including skies, inline skates, ice skates, and other odds and ends. Good selection and pleasant staff, just not that bright. Bring your own light bulb! lol. Watch out for the parking on side streets. I got towed once, that is never fun.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000245I', '2019-07-10 03:36:44', 'Been here a few times, the service is super slow just to order a coffee. Coffee prices are not cheap. Ive had the sandwiches which are pretty good but heavy. Most people come here to use the free wifi and they sit for hours drinking water. Not my favourite place and the inside could be fixed up a little more.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000245I', '2019-05-13 15:22:14', 'This place is a bit of a drive for me and I wanted to be sure they had what I needed in stock before I drove down on a hot day. I called to ask about a specific kind of planter pot in stock, waited about 5 minutes only to have my call picked up and ended. I called back again and waited another 5 minutes for someone to tell me they had that type of pot in stock but couldn"t give me any specifics on a general price point. Star Nursery IS pricier than other places, such as amazon and Home Depot/Lowe"s. So when he told me they were "pretty cheap", I had to take it with a grain of salt.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000185A', '2019-10-29 12:46:23', 'PRC consulted on 2 tile roof replacements at apartment communities we manage in the greater Phoenix area. PRC was thorough and caught a number of items the roofer needed to correct on both jobs. Their communication was great. A roof is a major investment and having a professional help manage installation is money well spent.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000101O', '2018-09-24 16:07:33', 'Perfect treat this summer... Great service as well. Loved the passion fruit sorbet. Also the mango mojito was a hit');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000101O', '2019-10-10 22:46:20', 'I used to work for Skechers in Las Vegas YEARS AGO. Everything at this store is the same. Except this store is much smaller! Especially the clearance section. I tried on some shoes. And that was it really.  We were greeted, but no one checked up on me blah, oh well...');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000245I', '2019-05-29 08:35:49', 'The service is always, without a doubt, amazing. They train the employees well and it shows. Good quality, good prices, and good people.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000129F', '2019-03-13 18:32:22', 'My hubby got the pastrami and I ordered the tongue sandwich. Perfection. Really. And not hard on the wallet either which is the best part.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000076T', '2019-07-12 19:28:14', 'ooooooh yummy.  i"m a red meat eating midwestern girl, and 9 had the best steak i can remember having in....who knows how long, it was DAMN GOOD.  the mac and cheese is a tasty, tasty side.  try the snicker dessert...it"s basically two cookie/ice cream sanwiches with bits of snickers.  the s"mores my sister got were super fun too.  only complaint is that it was really loud and waaaaaaay too many annoying veil-toting bachelorette parties for my taste.  but hey, it is the palms.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000027M', '2019-10-11 00:16:27', 'IF you are EVER in Vegas THIS is a MUST!!!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000129F', '2018-03-07 22:40:01', 'friendly employees');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000185A', '2018-05-29 19:02:18', 'The search for Pasta Carbonara continues... maybe a trip to NYC or even Rome!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000103Z', '2018-06-13 04:38:16', 'I asked for a #10 Hunter"s Club with all the veggies. What I got was the standard #10 Hunters Club with lettuce and tomatoes.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000245I', '2018-10-23 01:03:21', 'the food is good, very high end .  2 of us ordered the prime rib, 2 others ordered filet, 3 others steak, plus apps of sashimi, tator tots, mashed potatoes,');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000185A', '2018-09-16 21:38:57', 'Ok, this place had us right from the start. My wife just finished  running a marathon and was extremely cold. Seeing her shiver, our waiter brought her a cup of homemade chicken vegetable soup on the house. Who does that these days?');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000101O', '2019-07-03 15:24:58', 'I also love that they have no agenda when it comes to helping you select a certain food. They listen to what you"re looking for and then make suggestions based on the info you"ve given them. They"re also well versed in the latest pet food recalls (which are hard to stay on top of these days!)');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-09-02 10:13:47', 'A0000129F', '2019-09-18 19:27:15', 'Best chinese resto. Highly recommended. 5 stars. Let us support this business. Best in the west valley. Trust me you wont gi wrong coming to this place');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000162Y', '2018-12-12 12:46:16', 'If I could give this place 0 stars, I would. They are RUDE, unprofessional and they have personal lockers that you HAVE to put your purse in to shop with them. I was asked to go and put my purse in my car. Excuse me?! Is this even legal? Are you going to replace my purse and it"s contents if someone steals my personal items? I"m not sure who is running this place but this insane policy is CLEARLY negatively impacting you business. BAD move, BAD business move. Go across the street to Sally"s.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000107C', '2018-07-29 07:04:17', 'I"ve heard great things about Toast for breakfast and lunch so thought we might get it a try for dinner...  We walked in around 6:30pm on a Friday night,  the restaurant was about half filled. There were plenty of seats in the the front of the restaurant but our party of four was seated in the very back beside the bathrooms and back door.  We sat there for a few minutes (not wanting to be difficult or affecting the order in which the servers were sat)  but  we really couldn"t take the cold draft from the back patio door and constant bathroom visits.  We politely ask if we could move to the front.  The hostess obliged but didn"t seem too happy about it.  The same server continued to wait on us once we sat in the front (we were glad because we did not want to make him lose a table) .');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000241P', '2018-12-09 02:12:47', 'My family waited around, no waters, no drinks nothing.  We watched three tables get seated order their food and get their food before we even had anything on our table!  after a 25 min wait, our waiter finally comes back with two waters.  We asked why the service was so slow, he stated that there was only two waiters and said sorry.  So it was fine for now.  After we got the water nothing else came to us.  We watched as the tables that came in after us eat, and one even finished before we were served.  After another 35 minutes, our food finally came out.  First the two dac biet bowls, then the last three.  Finally the drinks came out as well.  I have worked at a boba place before, making thai teas should not take a hour.  For waiting for so long I was really anticipating for a great bowl of pho.  Oh man was I wrong.  The broth was lukewarm, it could not even finish cooking my meat.  The broth tasty funky as if it was made with a pre made powder.  My parents and I watched a one cook was constantly tasting the broth, and we saw no bones that make a great broth.  The bowl was mostly disappointing broth.  There were very little meat and noodles.  We ate, and we wanted to get out as soon as possible.  We asked for a to go cup for the thai tea because it took so long we were just going to take it home.  It took almost another five minutes just to get a plastic cup.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000162Y', '2018-09-24 19:42:48', 'We had the curry it was really good but it was small portion for it"s price.. the garlic chicken wasn"t satisfying since it was dry, no spices, very plain and the chicken was kinda hard. Presentation was ok, you gotta order the rice seperate.. the service was fine the servers were pretty casual with their guests. Would come back for curry but not for tandoori or kabob.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000052Z', '2019-06-29 12:06:39', 'Greenbeens..good..the only hot side we got');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000030A', '2018-10-27 06:22:19', 'This is definitely a go to place if you"re anything like me and don"t know how to buy jeans. My last visit at the store, Jannette spent a great deal of time educating my friend and I on how to dress. We left the store uncharacteristically self aware of ourselves, but really, we learnt a great deal in the process.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000250Y', '2019-09-20 23:32:43', 'Only now, after two days back to work and polishing mad silverware, is it starting to chip. I"m upping the stars from my former 4 to 5.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000030A', '2019-09-15 12:39:44', 'Believe the negative reviews. I came here after a round of golf, in order to have dinner and a few brews. The service wasn"t terrible, it was non-existent. The waiter seemed to take an eternity to take our order.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000140O', '2018-06-20 13:36:50', 'Crawford"s Auto repair was extremely thorough. They pinpointed a noise to three contributing factors: a rock in the tire, a roof rack bolt, and something in the sun roof. I love how detail-oriented these guys are.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000112O', '2019-07-30 22:02:08', 'This random hole in the wall is located in the Park Rd. shopping center.  I had never heard of it until that fateful St. Patricks day when another beer was in order.  After making my way there and enjoying the patio, I decided the food was my next venture.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000013R', '2018-07-24 12:10:01', 'A little on the expensive side.  The portions were a bit small for the prices they are charging.  I guess they can get away with it, their food is pretty good after all.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000131L', '2019-09-29 16:50:12', 'Yes, this IS as good as it gets!  Dr. Dameron and his team make going to the dentist actually a really good experience!  The whole staff is very professional, kind and accommodating.  Not to mention HAPPY!  The hygienists are just the best, as are all the staff.  Dr. Dameron"s work is beautifully done and my teeth have never looked or felt better.  I HIGHLY recommend this whole office to anyone needing work done!  You will not be disappointed.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000112O', '2018-04-06 01:39:12', 'While I enjoyed the company of my friends, I would not come back to this restaurant, primarily because of the poor service. Once we were all seated, we were not greeted by anyone for over half an hour, and when someone did come by, we asked whether we could place our orders, to which he said he could not; he"s doing something else - so we waited at least another 15 minutes before someone came to finally take our orders.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000013R', '2018-03-21 05:33:37', 'As a professional traveler, I like to travel light, and if I take something with me on a trip..........I"ll be sure to use it!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000131L', '2018-07-09 16:59:07', 'The food is authentic. The ingredients are incredibly fresh - a necessity in Thai cuisine.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000140O', '2018-12-27 04:16:25', 'The Montblanc store in Hong Kong is located in Pacific Mall. Jane has since been promoted and transferred to their flagship store on Kowloon Side on Canton Road. I"m not surprised of her promotion given the service she provided me.  I will be forever be loyal to the Hong Kong location. Thanks Jane!  I"m giving 2 stars to the Toronto location, the Hong Kong location would easily have 5 stars.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000110N', '2018-12-21 03:36:00', 'Just got one of the worst haircuts of my life from a girl named Alex. Had to go home and use my own clippers to cut away her terrible job! TERRIBLE! Beware');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000065M', '2019-09-01 21:36:24', 'First off food is DELICIOUS! By far my favorite restaurant in downtown Phoenix. I have tried so many different things from the menu and it never disappoints, but the Saturday night special Prime Rib and Horseradish Dauphinoise Potato is my favorite. Second, the service is amazing. Ian is my favorite waiter, will request him every time! He is so personable with a good sense of humor! He constantly is checking up to make sure everything is good (but not too much). He made the experience at the Arrogant Butcher memorable!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000140O', '2018-03-05 06:28:21', 'You can put these price tags directly on leather and they don"t stick because leather breathes. It"s the synthetic material they use for the inside of shoes where adhesive really only does "its thing" leading to frustration.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000112O', '2019-10-18 01:56:36', 'Drink - 4 stars for the cucumber cocktail & bottle of Santa Margaritta Pino Grigio');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000140O', '2018-01-12 16:59:52', 'Love this pub. The food is not great but if you stick to the pub grub faves. You should be fine. The best part about this place is the staff! All the girls that work here are amazing! :)');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000112O', '2019-05-23 19:43:06', 'Mac and cheese..not the best but not the worst');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000140O', '2019-03-04 21:56:22', 'I had a glass of nice refreshing Greek white that hit the spot. The Greek Salad we had was super fresh and crunchy with a perfect dressing and just the right amount of feta.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000140O', '2019-09-13 05:03:37', 'Didn"t try the chips, salsa or bean dip. I"m just not one to fill up on that stuff then take two bites of my food. No, i wanted to have a empty stomach for my meal so that i could write about my experience. [yes, i know im just brilliant, no need for the pat on the back]');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000110N', '2019-03-23 10:39:09', 'We"re from the Texas Hill Country;');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000170Q', '2018-03-04 13:17:26', 'On a previous visit I had the gyro sandwich. I found it to be very wet and gooey, not much flavor at all to the meat.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000065M', '2018-04-25 21:26:18', 'Simply the best place to call home.  All the amenities, cool vibe, great pool scene, 24 hour concierge service, same day laundry, dedicated parking, secure entry.  HOA reasonable.  What"s not to like in condo living?');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000170Q', '2018-04-07 05:08:02', 'Jared to the rescue:');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000103Z', '2018-12-25 07:41:23', 'Third & last thing (I think) to know is not to expect favorable employee characteristics. At least not from the guy with the gray ponytail...especially not from him actually, maybe just avoid all contact with him if possible.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000129F', '2018-04-19 19:31:49', 'Lemon Sorbet:  Frozen sorbet in a scooped out lemon, menu says imported from Italy.  I actually liked it better than the sad face Tiramisu so hubby swapped with me because while he usually loves anything lemon, he found an odd aftertaste.  I joked it was the jet fumes to bring frozen sorbet from Italy but the truth is, it was the perfume worn by the woman at the table next to ours.  Thankfully she arrived as we had dessert, so our entire meal was not ruined, but the smell was so overpowering that it gave us both a headache and we wanted to get out of there fast, since with the cramped layout she was almost on top of our table.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000103Z', '2018-08-21 04:28:43', 'Everything was fantastic, although I was expecting a little more paneer flavor to my paratha.  This place is very casual, which I really like about it.  Don"t come in expecting the same food that you would get at a sit-down Indian restaurant; instead, expect the kind of food you would get if you were invited to a grandma"s kitchen.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000101O', '2019-05-06 03:51:51', 'I suspect these were a gift for my complaining about the condition of the car and the fact I was making them late from rushing home to see the next episode of moronic reality TV.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000101O', '2018-04-25 00:59:44', 'Located right beside the Erindale GO Station in the same plaza as Sushi Tei, Chili Chicken House, and Wonton Chai Noodle (among others), on the northwest corner of Creditview and Burnhamthorpe, and a few minutes away from the Mavis exit of Highway 403, this place really gives you bang for your buck. Plus, the food is delicious, prepared fresh. Overall, a really enjoyable meal.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000185A', '2018-10-08 17:41:40', 'How does the Post Office come into play?');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000245I', '2019-09-27 13:30:18', 'Went here as a last resort because a hose on my son"s truck busted and we were stuck.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000103Z', '2019-09-22 17:49:49', 'In most cases, I find kabob houses to be boring and that isn"t because I don"t love the almighty Kabob, it"s because I have come to expect that Kabob places outside of the Middle East, Detroit, and even Western Europe just can never get it right - every time there is hope, it normally ends in disappointment for me - I should have never made that trip to Iran in 2007 where I was in kabob paradise.  However, Chateau Kabob located in the Frankophilic metropolis of Montreal did me rare pleasure of maintaining that hope.  Here in Washington, DC we need to cling to places like Shamshiri and Alboorz to get our kabob fix but even that gets repetitive after a while - especially when there isn"t a single Kabob house in the region that can even hold a candle to those two places and therefor isn"t particularly incumbent of them to reach for the stars.  Chateau Kabob does it right and is about as close as you can get to some of the legendary places you can find in Iraq and Iran - the latter of which reigns supreme in the world of Kabobs.  At Chateau the spices are right, the juiciness is on par, and the meat is superb - all in all a very excellent Kabob.  And perhaps one of the most underappreciate techniques that Chateau also got right is the rice!  It is superb here - fluffy, velvety, and aromatic.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000103Z', '2019-03-09 10:28:26', 'The venue set up is great. There is seriously not a bad seat in the house. You can pick yours online when you buy tickets.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000129F', '2019-05-12 18:06:36', 'There are some mixed reviews here about Fresh and from a food creativity standpoint I can appreciate that on some of the menu items. However, you"re getting what you came for and that"s what matters to me.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000076T', '2018-08-09 21:16:16', 'I started taking my dog here after she expressed her hatred of her previous vet, who felt that it was "no big deal" and that they could always just muzzle her or sedate her for check ups. I felt that was ridiculous and brought her to Doctor Youssef who felt the same and is doing everything in his power to make her comfortable with him and his staff. He has even let me take her around the whole building just to get use to it.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000027M', '2019-02-05 01:02:29', 'I had the turkey chipotle club wrap. It was ok. Nothing special but not bad. The fries are so good! My husband had the open face meatloaf and was really disappointed. He didn"t even eat half!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000245I', '2018-03-31 08:41:15', 'We started out sharing the french onion soup, a caesar salad and the tater tots.  All were delicious.  The croutons were homemade on the salad and very flavorful.  The soup was served in a litte crock and was very cheesy.  The tater tots were not my favorite in town, but they are still good.  They are homemade and served with tomato jelly instead of ketchup.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000185A', '2019-05-06 09:26:03', 'These people are amazingly friendly, helpful and have high integrity. I feel very happy to have found them when I moved back to Phoenix and need someone to care for my car.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000245I', '2018-07-01 01:16:11', 'I LOVE this place! I have found the staff to be extremely knowledgable, beyond helpful and always willing to go above and beyond to do whatever they can to assist you. This store carries products that I can"t find anywhere else besides online. They are great about returns if you have a finicky eater (like mine).');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000103Z', '2019-09-15 16:33:33', 'I replaced the o-rings, pulled the diode and got the ac working after I vacuumed it and refilled, what armatures..  I guess I got to go to ford, spend $80 on a new Power steering Bottle and tell LKQ to send me the money..');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000103Z', '2019-05-24 16:41:07', 'I had the pleasure of enjoying the croissant, it had the right amount of flakiness and was bigger than expected.  The atmosphere was casual and laid back.  I now look forward to trying this place out later in the day.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000129F', '2019-07-16 12:50:08', 'I read on the specials menu that there was a skillet with lots of yummy veggies that I enjoy and some type of meat, I asked if the skillet could be made for me minus the meat. The waitress agreed so that"s what I ordered. My husband ordered a veggie egg while omelet dish with a sweet potato waffle. Our toddler had pancakes and fruit.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-11 17:01:25', 'A0000101O', '2018-12-29 18:15:58', 'I went with the ziti. Just as I remembered, the sauce was awful. The pasta was in a pool of water and the sauce had zero flavor. I just feel like a sauce can make or break the meal, and it was tasteless-- no garlic, onion, wine, basil.. Nothing. The portion was also quite small for the price. It was clearly boxed pasta and not homemade, so why so stingy? I"m surprised there are such high reviews on here actually as my experience and my family"s experience wasn"t great. I guess it"s a decent place for families, but I would definitely go to a different Italian restaurant if you"re looking for good food.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000120U', '2018-05-31 14:18:59', 'Also, lots of seating inside.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000264R', '2019-04-04 04:53:44', '...I made it healthier by adding spinach on top. Basically health food at that point.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000264R', '2019-04-08 02:49:22', 'Caution: will smell like BBQ grill after.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000120U', '2018-02-05 05:00:50', 'Had brunch here Sunday with a friend. The meal was very good. I mean the options were limited but over all a solid brunch! I"ve only come to Brewsters on one other occasion so I can"t speak to the service before as it was at another location in Calgary. The place wasn"t busy. The staff was rather slow but the food was good so no complaints on that.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000264R', '2019-03-26 22:26:42', 'I ate at New India Bazaar for dinner. I took it to go. I ordered samosa, pani puri chaat, and gobi. The samosas were very good and very big! The main dish, gobi was really great. As a vegetarian it seemed like I was eating chicken, but it was cauliflower dumplings. The gobi had a comfort food appeal. The pani puri chaat was weird. I"ve never had it before, so I don"t have a comparison. The description sounded yummy, but it just wasn"t. The total cost was about $14. I would recommend this restaurant. I noticed that they have a pastry case with desserts. I plan to come back to shop. They  have the best prices that I"ve seen on neem toothpastes.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000276T', '2019-09-07 08:26:28', 'On peu y mangé le midi, prendre une pâtisserie ou un café/thé.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000102W', '2018-07-12 16:38:18', 'A must go destination in Phoenix.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000299D', '2019-06-27 10:13:11', 'Some of the equipment is showing signs of wear (ripped pads on weight machines and cracks in the weight benches pads and the numbers have rubbed off on some of the dumbbells, so you can"t tell what the weight is. I wouldn"t think it would be that hard to slap some stickers on there but it"s been that way for months.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000080C', '2018-06-17 00:15:24', 'There"re a few reasons I don"t like it there:');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000276T', '2018-09-13 04:56:18', 'After we filled our bellies, we wandered through the aisles of the immaculately clean grocery store.  I hadn"t planned on buying anything, but when I found garam masala for super cheap, and black salt that I had been looking for everywhere and couldn"t find, and a giant bag of arrowroot powder for a couple bucks (normally $6-$12 for a tiny jar anywhere else)....well you get the picture.  Anything you would need for a well-stocked Indian pantry is here, and then some.    There"s also mint and tamarind sauces, bottled lassis, naan, and huge blocks of paneer.  Trust me when I say I seriously considered buying all the above to snack on at home.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000120U', '2018-01-10 21:53:02', 'Besides this Walmart being ghetto they are inconsistent. They charged about 15/16 dollars more on my oil changed');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000276T', '2019-09-14 09:27:18', 'Employees were to busy chatting with each other. One employee had his head out the  drive thru window talking to people the entire time I was there. The cook come from outside and made my food. Did he was hands before making my food???');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000102W', '2019-09-13 12:32:32', 'Pretty bad. Was this place good at one time? For the price I paid, I expected something much better.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000151T', '2019-02-06 04:19:01', 'Plus to top it off, when local school invited local pizza places to present to a class on making pizza and recycling issues, Mario came and talked to the kids as if they were adults. All the other places treated it as a marketing event and brought coupons.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000264R', '2018-11-19 14:47:07', 'Lovely food. I am also happy to eat at this location of paradise bakery.. they have fresh ingredients and make good alterations if asked for. Great for vegetarians and well as non vegetarians.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000264R', '2018-08-05 16:45:26', 'I love the staff and often drink with them. Til the wee hours.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000299D', '2018-11-08 17:49:35', 'Pick any meat on the planet and the chef will make a Mexican style dish with amazing flavor! Wow, fish and lamb tacos to die for. Drinks are great as well.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000080C', '2019-09-12 09:25:35', 'Mario and his sons work hard to please and we"ve never had a bad meal here. I"ve seen them bend over backwards to try and take care of obvious jerks.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000299D', '2018-06-15 17:33:31', 'Mr Cool Heating and Air Conditioning came to the rescue for me on short notice AND was able to work on a swamp cooler, which many companies do not.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000151T', '2018-11-30 03:07:35', 'Don"t push the "prompt service" button on the table. The waitress said that they ignore it.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000112O', '2018-02-27 05:04:36', 'These people are amazingly friendly, helpful and have high integrity. I feel very happy to have found them when I moved back to Phoenix and need someone to care for my car.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000065M', '2019-06-10 18:09:39', 'I just had a terrible experience with Dr. Jennifer Vonya-Novak"s front office.  I changed my primary care to Dr. Novak.  It took me 3 weeks to get an appointment because she ONLY DOES 4 NEW PATIENTS A DAY.  I waited the 3 weeks for what I was told was a 7:45 am appt.  I got to her office at 7:45 (actually 7:47 am according to my cell phone).  The door was locked and the office hours posted were 8:00- to 5:00.  I could see through the glass doors that there wasn"t anyone at the desk area.  l left ,went home and called a 8 am, no answer.  Called again at 8:10 and the lady said I missed my appointment and could not be seen today.  She argued that the door is always open at 7:45.  She was unapologetic and offered me a next day appointment, like she was doing me a favor since I "MISSED" my appointment.  She kept calling me "my dear" as if I was incapable of knowing the appointment time.  I found her very condescending.  Needless to say, I will not be going to Dr. Novak and will let my friends know the office procedures there and the unbendable and arrogant rules!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000065M', '2019-01-12 09:59:27', 'Used EAT24 take out. Great pizza. Wings are good.  We"ll worth it. I will be using them over the hut in the future');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000065M', '2019-03-21 09:53:09', 'This place.  We are staying at the Legacy Golf Resort and that we would grab a quick bite there since we were driving by.  Such a fun atmosphere !  And, fantastic food that has a unique flare and is healthy.  I also like the casual environment where you can play outdoor games with the family. Highly recommend this spot!!!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000112O', '2019-09-30 21:09:23', 'I placed a large takeout order (almost $100) late on a Thursday night and the gentleman made me repeat every part of the order at least twice. He didn"t even bother to tell me what time the order would be ready. I frequent this place for lunch and use them for work events pretty frequently and have always had a decent experience but not this time.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000170Q', '2018-06-16 06:30:02', 'I won"t go back. Food was, at best, mediocre in flavor and texture. If I ate the shrimp blindfolded I wouldn"t have been able to tell you it was shrimp. This place used to have great Chinese food but apparently not any more.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000284F', '2018-05-27 17:33:23', 'We will be back for sure.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000013R', '2019-05-10 19:29:11', 'The day was sunny. The company was excellent. I noted the The Pump ouse Grill on Lakeshore. I"ll park there next time and enjoy the wings.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000140O', '2018-01-12 05:47:46', 'Next time will def try the desert.. This time we were too full!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000131L', '2018-05-13 05:11:30', 'I just went there last week and I have no complaints. I made the appointment online and it was super easy to schedule.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000176G', '2019-09-23 04:10:28', 'I"d avoid coming here on wednesdays.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000168B', '2018-01-22 04:35:54', 'Here, I tried three flavors - chocolate, pumpkin, and caramel sea salt.  Added toppings of brownie bits, chocolate caramel turtles, and mochi.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000107C', '2018-05-22 14:29:22', 'Only my second maybe third time in life in Outback. I came late because that"s how I roll. I really don"t enjoy a crowd.  Headed straight for the bar which was pleasantly open. Kayla was my bartender, made me a flavored ice tea because I didn"t want water or regular unsweetened ice tea. Cheers to that and then she made the the huckleberry moonshine cocktail, only 140 calories. My meal was a 11oz center cut steak, sweet potato and brocoli and cheese. All the food was deliciously seasoned. I"ll be back');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000107C', '2018-12-06 22:00:37', 'For the price range, you can"t beat it.  I would stay there again as it was one of the best no-frills motels I"ve been in.  Two blocks away are the high priced hotels, so we were happy we could save a few bucks.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000241P', '2019-09-23 01:40:01', 'No matter what happened in the process, he did not let us down. He always had our backs, made sure that we understood all routes and options, and made the process fun and exciting.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000107C', '2019-09-15 20:50:57', 'They DEFINITELY need way more cart corrals in the parking lot. Like at least double the amount they currently have. There are none closer to the gas station, and when the store is busy people are too lazy to walk their carts back to the corrals, and I"ve seen carts fly into parked cars on at least three separate occasions. I hope Smith"s management reads this review and fixes this problem soon.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000052Z', '2019-04-20 04:23:45', 'The problem is that.... when I tried to wear the pendant regularly, I found that my skin would rash wherever the pendant would be resting on. My skin only rashes with low quality metals. My skin doesn"t rash with sterling silver or white gold, which this business claims to sell.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000250Y', '2018-06-01 08:43:33', 'Sicilian pizza here is amazing, as is the Alfredo sauce. Food and service are both great. Ordered pizza and cheesy bread for pick up, and everything was ready when I got there, no extra wait. Will definitely be back to try some of the other items on the menu :)');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000168B', '2018-03-29 17:41:41', 'Walked into XS -no problem-       9 dudes');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000030A', '2019-04-22 17:12:23', 'I ordered the Mediterranean and it had a lot of flavor from all the different veggies and spices. My only complaint is: the crust was a bit dry, a little more olive oil wouldn"t have hurt.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000107C', '2018-01-08 10:00:02', 'Rebel doesn"t take credit cards and charges you to use debit. Not very convenient for people going to the lake. We will just fill up elsewhere.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000176G', '2019-10-19 21:36:08', 'The specialty cocktails are also pretty good, and the beer prices are pretty decent. This is a great place to go for a long lunch, after dinner drink, or even a weekend brunch. There are vegetarian options on the menu (if you can ignore the buffalo head on the wall) and I believe even a few gluten-free options as well. It"s a fairly good place to go with a large group, just make sure to call ahead.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000162Y', '2018-06-13 11:35:32', 'I seriously love Jimmy"s so much.  I miss the days when a friend used to live behind the store and we ate there almost everyday.  Now I have to go a little out of my way to get there, but it"s totally worth it every time.  I love Jimmy"s so much and I"m positive that everyone who goes there loves it too.  It"s just one of those awesome finds that everyone in the world should know about.  *insert Homer Simpson drooling here*');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000052Z', '2018-02-17 09:09:13', '* Honey Dipping Sauce options: wildflower, chipotle and wasabi honey flavors');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000245I', '2018-02-19 08:31:50', 'The service is always sweet, nothing too spectacular happening with the food. They do make the place very cheery and comforting which isn"t easy for the space they"re working with.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000027M', '2018-12-24 19:09:40', 'I am not good with names or dates, but I remember this man"s name, because he does his job with pride. After Jared, I became a fastpass customer and still remain one.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000185A', '2019-09-01 07:06:07', 'Got a pepperoni and sausage half sheet pizza from here last weekend and it was delicious. The pepperoni was awesome! The sausage pieces are huge like small meatballs. The sauce is thick and sweet which I like. Tons of cheese on this pizza which caused me to have an upset stomach aftward. Not their fault. I didn"t go into the building to pick up the pizza so I can"t say what it"s like to eat in.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000076T', '2018-06-06 05:12:51', 'Great food and prices.  Servings are generous and the atmosphere is good.  A nice place for traditional Mexican in Old Town.  Really liked the Pollo Relleno.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000103Z', '2018-10-24 05:14:58', 'The gelato here is sent from the gods themselves.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000185A', '2019-08-29 21:16:47', 'These fries were actually very delicious - crispy on the outside and soft on the inside. If you visit this restaurant, I would recommend this particular dish, especially given the price ($8) and the portion size (it was quite large - almost the size of a large plate).');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000129F', '2019-05-12 06:32:43', 'They DEFINITELY need way more cart corrals in the parking lot. Like at least double the amount they currently have. There are none closer to the gas station, and when the store is busy people are too lazy to walk their carts back to the corrals, and I"ve seen carts fly into parked cars on at least three separate occasions. I hope Smith"s management reads this review and fixes this problem soon.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000027M', '2019-09-02 00:56:49', 'I bet at this point in time you are wondering why I am only giving this place 4 stars then? Well, not everything is as amazing as those garlic fries. The bourbon apples are fairly tasteless, the chili is ok (the meat was very tough), and the service is also just ok. However, the catfish is delightful, the mac and cheese is also delicious, and the brisket is quality.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000185A', '2019-08-26 22:51:40', 'Not a bad place to camp out for a night in Cleveland. The airport shuttle is easy to catch and the employees are friendly.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000245I', '2018-07-21 04:13:17', 'But it"s an alright spot. I may or may not go back.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000076T', '2018-05-13 05:27:20', 'Food was OK. Nothing special. Its tastes like frozen food. I had the chicken breast over veggies, and my son had a southwest wrap. I think the best part was the sauces they use. The smoothie is just some concentrated mix, no real fruit. Not my cup o tea. This is a family ran joint. Which is fine, but how I found out it was family owned and operated was not fine. Scene- Husband and wife arguing about daily duties and how they cant keep doing "this" every day. Along with the wife grilling (no pun intended) her daughter about letting the dog out, homework and so on. I wasn"t eves dropping, they were standing 10 feet away from my table. It was hard not to hear. Leave that stuff at home. Nobody wants to hear it.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000103Z', '2019-06-01 10:24:15', 'I LOVE all their honey options for my chicken tenders');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000101O', '2019-01-03 23:17:05', 'I gave this place 4 stars mainly because I had a great time that night, and the company I kept definitely played a big part in that.  The food IS goood, just a bit $$$$.  Its definitely a GREAT place to go with a group thats just looking for some good eats, good drinks, and a great time :O) BOTTOM LINE: I"d DEFINITELY GO BACK AGAIN!!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000101O', '2018-07-19 18:47:19', 'I love Mexican food.  I live across from the Fajita Grill.  I have only been there twice (in 4 years).');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000101O', '2019-03-16 03:37:16', 'Had a groupon so it was a good price.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000101O', '2018-07-03 11:49:37', 'Parking is a bit tricky during busy hours and the wait times for food can get a bit long, so I recommend calling your order ahead of time (unless you want to take a look around while you wait, first-timers).');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000101O', '2018-12-26 17:48:09', 'this hawaiian/korean restaurant brought me back to the local cuisine of  hawaii. I ordered the meat jun combo plate and it was good. the soy dipping sauce for the meat jun should be bottled and sold in markets. deifinitely stopping by to try the other items on the menu. The ALOHA spirit is deifinitely alive and well in las vegas..thanks to RUSSEL.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000185A', '2019-08-08 17:57:00', 'Updates to follow after I visit here a few more times!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000245I', '2019-08-25 14:20:25', 'I"m gonna admit, this place looks kinda dirty. I don"t think Arizona uses those health department letter grade system like California does, but if I were to just judge by how it looked inside, i"d give it a "C" grade lol. We waited for about 15 minutes or so and finally got our food. We took it to go and ate at our hotel room.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2019-03-23 07:28:10', 'A0000027M', '2019-09-14 14:17:42', 'I was told so many great things about this place but my entire experience was awful. The food wasn"t very good, way too greasy. My fries were luke warm and my tray was literally covered in grease. I needed about 50 napkins and a shower after that. The service was pretty awful too. I can"t believe I paid $14 for a small meal with no extra fixings. On national cheeseburger day of all days too. Such a disappointment and I"ve never gone back since. Best thing about it was the soda, but that"s pretty difficult to mess up.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000250Y', '2019-07-27 14:09:58', 'I"m sure that I will still stop in though, in the future, due to my optimism and love for the brand.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000052Z', '2019-09-26 02:45:01', 'YELP 100 CHALLENGE 2013-(3/100) "  Our Retro Return"');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000030A', '2018-12-17 16:31:58', 'However, I was a bit surprised at their dish with the steamed buns (I think it"s Kochu Japchae)... it was super pricey!!! That dish alone was $20.99 on the special... very little meat, mostly peppers and some other veggies. I"m guessing the expensive part was the steamed buns... "cause those looked really intricately made.  I think there are actually several pricey dishes they serve on their menu. I"ll just stick to the affordable menu items.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000052Z', '2018-12-02 14:58:02', 'John D');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000101O', '2019-08-01 04:33:01', 'Been traveling to this restaurant for years.  Can"t believe they were out of gaucamole, just lock the door!  Abt 4pm only one other couple eating, very slow svs.  Think they do better evening svs when more servers.  Than close during day!  At least 1 fam member needs to be around, this is what happens when you trust fam bus to someone else!  Food was ok, but I have had better there.  Disappointed but w return.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000027M', '2018-09-20 23:15:25', 'On a previous visit I had the gyro sandwich. I found it to be very wet and gooey, not much flavor at all to the meat.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000076T', '2019-06-16 08:33:29', 'It hit the spot. Came with sweet potato mash and collard greens on the side. It was all super healthy. No crazy amounts of butter or oil. Yet, it tasted amazing. But it definitely could have used a side of syrup. What was on there wasn"t nearly sufficient enough.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000245I', '2018-02-24 17:57:17', 'John D');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000185A', '2018-01-29 14:31:03', 'Lots of kinks for them to work out. Hopefully they do. No matter how beautiful a space: customer service as well as product are everything.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000103Z', '2019-04-14 10:58:24', 'I have purchased two carpets here and went for my third today. The first two worked out just fine. You save a little money by having very limited customer service but it has good variety as long as you are good with looking on your own.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000027M', '2019-04-03 12:23:44', 'And to the lady we sat next to...Good luck on your birth, maybe your dislike for cheese will go away after you give birth.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000101O', '2018-06-28 13:42:55', 'Secondly, they really nerfed the size of the Dutch Baby here. I worked up my friends at how awesome and overwhelmingly large the Dutch Baby is (and that you could share it with two people), but it was a disappointment. It was bit dry, almost burnt and stale tasting.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000103Z', '2018-02-14 02:04:44', 'Love Nicole. ..she"s a fabulous bartender.  Always gives us great service.  Love the wahoo salad with fish.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000129F', '2019-04-04 01:30:39', 'This is always a must visit on vegas trips.  I"ve had the St. Louis crepe (ham and cheese) and Nutella (peanut butter and banana). Yumm this place is consistently delicious every time.  The 20 minute wait is worth it for these crepes, just try and find a table early on since the seating is shared with the café next door. Seems a little pricey at about $10 but what isn"t pricey in Vegas?');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000076T', '2019-02-20 11:20:28', 'Finally, they took me. The nail tech complained about the gel on my nails and how tough it was to get off. She struggled with it.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000076T', '2019-09-07 11:27:41', 'We have been wanting to try this place since it opened and finally went Saturday evening.  We sat on the patio and had some delicious cocktails.  We eventually went in and sat at a table for dinner.  The chicken and waffle appetizer was delicious.  For entrees we ordered the shrimp and grits and the steak.  Everything was delicious except for that the cook could not get my steak right.  They tried three times to achieve medium rare but just couldn"t get it right.  Fortunately, for me our waitress who was fabulous was more upset about it than I was.  She would take it back to the kitchen even before I had the opportunity to complain.  The manager stopped by and was so apologetic and gave us a gift card to come back.  Even though I would probably never order the steak again, we will definitely be back for the ambience, the drinks, the other yummy food, but most of all for the EXCELLENT customer service that is so rare to find these days.  Well done Trey!  Thank you!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000076T', '2019-07-23 16:11:47', 'We went here for the 1st time this evening and really enjoyed it - great ambiance, delicious food with amazing flavors, and good service. We really liked the fresh roll, spring rolls, dumplings, wild curry (good spice!), and basil chicken. They served healthy portions. Cash only & BYOB. We will definitely return!');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000076T', '2019-09-26 16:05:07', 'The Brewben is one of the best sandwiches I"ve ever had.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000027M', '2018-04-17 04:34:27', 'Best fried pickles in town! Great prices, fabulous and friendly staff. Zero complaints.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000076T', '2018-08-21 09:30:35', 'I have been a loyal repeat customer of Cobblestone Auto Spa ever since I encountered Jared, one of the managers at the 616 W Baseline.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000103Z', '2018-07-25 22:15:32', 'Fun for the children included the ferris wheel and carousel.  Since the Las Vegas Valley does not have a permanent ferris wheel and carousel to ride, we enjoyed taking a twirl on both.  Ferris wheel tickets were 4 tickets per person. Carousel tickets were 3 per person, but an adult is free if standing next to small children who are on the ride.  Each ticket = $1.25.');
INSERT INTO ForumEntries VALUES('VM0008', 2019, 2, 'P0000004E', '2018-12-19 00:13:31', 'A0000151T', '2018-08-28 13:18:52', 'I was excited to go in buy my first car the last week of November 2014. At the beginning the owner was very nice and was giving all the details of the car I bought a Mini Cooper. Knowing that it had issues in the transmission. Witch he promised he would cover with and insurance ASC warranty a Vehicle Protection Plan within three months or 3000 miles. I contacted him several times for him to get my car fixed he kept saying that he would fix it after the holidays. January, February passed the car was not fix yet. I contacted him one las time, I told him that I would give him one more month than he told me that he has been working on it still. He told me that it was an imported part witch was not easy to find. I told him I will take legal action and he than answered with "" do whatever you have to do"" with a arrogant tone so unprofessional till now I can say that he has NEVER!!! Contacted me!!! To keep me updated or give me a solution. I believe I have been more than patient at this time it is incredible how they claim to be a legal business. I will be contacting him again and demand a solution. I highly suggest you think twice about going here. I have read another review regarding several comparable issues. I have never had this experience and it is horrible driving your first car with a bad transmission.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000093D', '2018-06-01 09:14:49', 'Ok so I have purchased items from RC Wiley and have spent a lot of money but will never again. I had a $500 credit limit after I purchased my fridge and when  iwent to use it towards ny bed room purchase it was no longer available due to me paying it off too soon????? (Apparently since I paid $500 in 2months instead of $25 in 10 months) When we attempted to question what they meant and if there was anything that couldbe done the supervisor emele pretty much told us to take a flying leap -are you serious!!  So I spent my $2300 at Ashley furniture. RC Wiley apparently is balling and they don"t need me to buy anything. Good luck! when u have poor customer service reps representing you like that their making your company look bad.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000076T', '2019-07-22 05:27:04', 'Mexican cafe with lively atmosphere and decent pricing.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000241P', '2019-06-11 15:40:30', 'One of my favorite breakfast place to go to with my high school son. He loves the food. We both love a good breakfast joint.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000198B', '2018-06-08 20:14:20', 'I remember coming to the Buffet at the Bellagio several years ago for Sunday Champagne Brunch and being blown away.   It was one of the best brunches I had ever eaten.  Alas, my most recent trip did not make nearly as stellar an impression.  I brought my mother here for her birthday dinner last month, wanting to share with her the wondrous buffet I remembered.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000021C', '2019-09-28 00:53:40', 'First trip out - chewed up Barbie dolls and incomplete board games. Second trip - A set of Christmas lights marked for $2 more than at the Walmart they same from. But then, on the third trip back, there it is - the chimera. The unicorn. The 36" 1970"s black velvet painting of two tigers in flagrante delicto. The Elvis cookie jar. The wine cooler made out of an abandoned suit of armor. The red leather Michael Jackson Thriller jacket. A bronze toreador sculpture. And it"s only $12.99.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000076T', '2018-02-04 17:50:01', 'Snow and Kind crab, caviar, steak tartare, all types of meat and cuts, sushi, soups, Asian cuisine, pastas and pizzas. Literally all you can think about.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000093D', '2019-01-21 11:52:54', 'I"m not sure what"s happened to Futo Buta, but the past couple times we"ve come it just hasn"t been the same.  We"ve received dirty utensils and the ramen just isn"t as good.  Recently took some family over and the food was bland and overly fatty.  I really do hope that it gets back on track because this was one of my favorite restaurants in Charlotte!');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000114I', '2018-11-06 19:00:49', 'I have been back a few times so far, and this won"t be the last time. It has room to grow on me, and so does the rating.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000132X', '2019-06-15 12:54:23', 'Good carpet variety but a lack of integrity and honesty. Maybe it is a new guy but the owner didn"t help. Be careful that the price they give is the same when you pay the bill.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000210S', '2018-09-20 12:16:11', 'Only now, after two days back to work and polishing mad silverware, is it starting to chip. I"m upping the stars from my former 4 to 5.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000264R', '2019-08-18 17:21:47', 'Travis"s greets you with his perfectly green swoosh in his otherwise perfectly styled black hair and a Vegas-worthy rockstar outfit.  Next comes the most relaxing and incredible shampoo -- where you get a full head message that could cure even the very worst migraine in minutes --- and the scented shampoo room.  Travis has freakishly strong fingers (in a good way) and use the perfect amount of pressure.  That was superb!  Then starts the glorious blowout... where not one, not two, but THREE people were involved in doing the best round-brush action my hair has ever seen.  The team of stylists clearly gets along extremely well, as it"s evident from the way they talk to and help one another that it"s really genuine and not some corporate requirement.  It was so much fun to be there!');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000045R', '2018-10-27 19:21:04', 'Herold was the customer services rep who helped us out and he was a very very big help. He got everything done and really understood the urgency of the problem (I had to drive 550 miles to SC the next day). He was delightful to talk to and was very patient and understanding as well.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000056Z', '2019-08-21 01:04:56', 'Nestled in what is (for now) a relatively sleepy corner of Downtown, Urban Bodega (aka URBO) feels like something of a throwback to some of the small convenience stores I used to see line the Roosevelt Row neighborhood.  Back when Downtown was still a neighborhood where only the most diehard entrepreneurs dared to tread, you could find one of these small neighborhood shops selling everything from wine and beer, to snacks, to cooking essentials, and even a few household cleaning items.  The relatively new Pure Fillmore apartment complex is currently the first of what will undoubtedly be many new apartment and condo complexes lining 7th Avenue in Downtown.  But for now, the nearest full sized grocery store requires a car.  All the more reason URBO"s location makes sense.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000131L', '2019-01-18 19:32:18', 'We love Johnny Rockets. I am not sure what goes on at this location-or if it was just an off day-but the chicken sandwich was inedible. It tasted like nuked chicken.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000153D', '2019-07-05 04:36:43', 'Very nice eating environment and the food are quite nice. Very native Japanese style.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000213C', '2019-07-02 07:42:08', 'This place looks hopeful on the outside but is actually pretty bad. My maple glazed salmon was very burnt and lacked flavor. The asparagus it came with was pretty disgusting and soggy. The waitress was great and the side Caesar salad I had was good. The experience was horrible simply due to the blasting crappy music as well. Probably don"t eat here.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000295G', '2018-08-22 23:25:27', 'Love this place!! Delicious! I just wish it was closer to my house. Other than that, I have no complaints. The price point is reasonable and the menu selection is great. Couldn"t ask for anything else!');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000295G', '2019-09-11 19:02:03', 'My favorites are the Chicken Scarpariello, the pizza and the Sangria. My wife can"t decide between four dishes. Our daughter loves the Penne ala Vodka, Lasagna, or Ravioli.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000004I', '2019-08-07 07:23:03', 'Pulled pork..very good..lot of flavor');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000290B', '2018-05-31 11:01:22', 'Bill Burr (He sells out pretty much every time. Buy immediately when announced)');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000142J', '2019-10-25 16:10:52', 'Some of the equipment is showing signs of wear (ripped pads on weight machines and cracks in the weight benches pads and the numbers have rubbed off on some of the dumbbells, so you can"t tell what the weight is. I wouldn"t think it would be that hard to slap some stickers on there but it"s been that way for months.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000142J', '2019-08-19 00:33:14', 'Bun - Very soft, tasted good, but didn"t hold up against the burger and all the toppings and at the end I was left with lots of bun and no more burger.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000030A', '2018-08-18 07:10:42', 'We checked this place out for dinner during race weeks. It was alllright. Ordered the "thunder thighs" - which sounded like buffalo wings made w chicken thighs, but ended up w regular wings. Not sure if we got the wrong order or if they are just called thighs when they are wings. Either way I was disappointed, but the wings were pretty decent after I got over the sadness.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000030A', '2019-01-29 03:49:13', 'I hope that every person who follows me, everyone I know and anyone contemplating this establishment reads this first and NEVER bothers to give this place with the crappiest staff of all time a second thought. Earlier today my friend and I dropped in to grab some lunch.. the staff either all lost their dogs this morning, or just have the absolute worst attitudes you"ve ever seen in human beings. Not only was the nasty woman who served me avoiding any type of pleasantry but she was yelling across two other workers and a line of patrons asking what I wanted from the other end of the shop. When I asked the server for lettuce, onion and roasted red peppers on my sandwich she quite literally moaned very loud and followed it with yelling "ughhhhh god help me!" Before adding my toppings to my turkey sandwich. When one of the other servers asked us if our food was for "here or to go" the original server says aloudly "to-go hopefully!!!" Wtf... I"d love to know who this terrible human being thinks she is! I found my jaw on the floor more than once, wondered why she thought I was such a headache, and my friend and I decided right there that we would NEVER return nor would we let this review go untold to everyone we know!! I feel the owners somehow have to be to blame! How the hell do you allow someone so miserable represent your livelihood? You don"t expect livelihood for very much longer, that"s how.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000213C', '2018-12-28 16:44:01', 'The first time I went there I had my car detailed for $150 after discounts. The detail had been a little rushed because the location was extra busy that day and they were also short staffed. As a result there appeared to be some minor scratching. Jared was immediately on the ball and worked to have the scratched buffed out and fixed. I was very impressed with him as I watched and saw him masterfully handle other customer issues like mine. I was impressed enough that I told the man to his face that I was going to be a loyal customer directly as a result of his good work.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000185A', '2018-05-20 00:52:32', 'Awesome smoke shop! Can"t say any bad things about this place. The son and dad are really nice and provide great customer service. I always come here for my hookah flavor and coal and will continue to do so!');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000231F', '2018-01-07 00:04:05', 'Service was great.  Food was delicious.');
INSERT INTO ForumEntries VALUES('FO0009', 2018, 1, 'P0000004E', '2018-10-21 12:22:25', 'A0000231F', '2019-09-13 16:23:38', 'I ordered the Mediterranean and it had a lot of flavor from all the different veggies and spices. My only complaint is: the crust was a bit dry, a little more olive oil wouldn"t have hurt.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000168B', '2019-09-02 18:03:05', 'Eyebrow threading is $4. That"s usually what it goes for at these places. No taxes on cash payments! I am not being racist but white places charge more and they don"t do a great job. So, always find an Indian or Arab place to go to for threading.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000008J', '2018-09-18 12:01:10', 'They serve steak-burgers, so it may cost more than average, but not by much. You can get 2 different styles of burgers: A Freddy"s burger that comes with pickle, mustard, and onion. (my preference) Or a California burger. Same meat, but this one comes with lettuce, tomato, onion, and a "Freddy"s sauce" which is your typical thousand island, fry sauce, spread, etc.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000273F', '2018-03-19 19:05:24', 'This is definitely a go to place if you"re anything like me and don"t know how to buy jeans. My last visit at the store, Jannette spent a great deal of time educating my friend and I on how to dress. We left the store uncharacteristically self aware of ourselves, but really, we learnt a great deal in the process.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000273F', '2019-09-18 00:24:09', '4.5 Stars');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000197C', '2018-08-19 07:35:31', 'Some notes: restaurant is located in the Esplandade with the AMC cinema and to the east of the Ritz Carleton.  Best bet is to park in the parking garage and then go to the walking mall.  Even so, it"s tough to find.  Don"t give up.  Also, it is no longer Fuego Tacos, but now Fuego del Mar, with a seafood-centric menu.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000117Q', '2019-09-26 08:39:06', 'Below average food. The service can be spotty, depending on the time of day.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000008J', '2019-09-07 03:48:05', 'This is one of my favorite places to eat.  The food is delicious, fresh and almost everything can be made with tofu as a substitute.  The owners are very friendly and the food truly is superb!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000008J', '2019-06-16 02:01:48', 'The food is pretty good, too.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000168B', '2018-05-03 06:50:19', 'Easily entering my top 3 restaurants in Charlotte after just one visit!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000197C', '2018-08-28 01:59:28', 'As convenience stores go, this one could be the poster child for what is wrong with the concept.  While the need for procurement of gas is a subject for another forum, the food options are fair game.  Or in this case, more like not fair and lame.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000175P', '2019-10-22 12:06:22', 'Ok, we"re hooked! Service was great.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000168B', '2019-09-26 20:01:35', 'The food was great!  When we walked in,  only one dark haired guy greeted us and I said it was our first time in to which he said nothing.  Then we ordered 3 salads,  4 meatballs,  one cheesy bread and one order of 4 canolis to go.  The order took about 25 mins to fill. We sat at an old card table that appeared to be in need of replacement.  Two chairs only so we grabbed another for our third person.  Leaving room only for two tables with one chair each.  Then we used the restroom which wasn"t clean at although tp was provided.  While the same guy who took our order prepared our food another customer came in and stood probably five mins for the guy making the food to come out and give our order.  The customer left as no one came out to get his order.  Then we finally got our food brought out in plastic to go containers.  The salads were delicious in spite of the dry chicken.  All the dressing was in small individual servings that you had to open. The meatballs were fantastic and moist.  Best I"ve had.  The cheesy bread was also delicious.  The dining room was very small and I think it"s geared towards pick up and take out mostly.  Not an enjoyable environment for dinner.  Great food. Though I would only get takeout.  When I eat in, I like real plates and silverware.  Also,  nice to get appetizer before main course instead of after.  Food was good.  One star for dining room experience.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000124V', '2018-08-26 17:09:22', 'I called the number provided and same day they showed up to my residence for an inspection. Was able to advise me of multiple broken and loose tiles on my roof and came out just a few days later and completed the repairs. Quoted me a good price for the repairs as well. No complaints!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000266H', '2018-08-21 23:31:37', 'Some places have a good dish or two, but the rest stinks.  Not the China King.  It"s all just solid food.  And not just Chinese either - pizza and even macaroni and cheese can be found, along with a huge salad bar, dessert bar and real ice cream (not a soft serve machine).');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000287V', '2018-02-14 11:45:40', 'The cons:');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000287V', '2018-10-12 08:50:21', 'After living in Tempe for several months and not finding a nail salon, I went on yelp :) and found Nancy"s. The reviews looked pretty good so I decided to give it a try. Like some of the other reviews mentioned, the salon doesn"t look like much from the outside, but on the inside everything is great. The facility is clean, but what makes the difference for me is the fact that the staff there was so friendly, and welcoming. All of the technicians were talking with the clients and there were even a few friendly group conversations between everyone in the salon. It was very comfortable! Most of the ladies in there during my appointment were regular clients and they had nothing but good things to say about the place after learning that it was my first time there. Loyal clientele is always a good sign.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000068V', '2019-04-04 13:10:24', 'My usual is the Portabello burger. The balsamic marinade they use is fantastic. The presentation is a little messy, but once it hits your lips it"s so good.  I pass on the new potatoes for steamed spinach and it"s pretty amazing.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000124V', '2019-04-13 15:16:02', 'The local opener will always be hit or miss. The headliner(s) will be worth the price of admission.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-01-10 22:08:45', 'A0000266H', '2019-02-22 02:07:53', 'My daughter and her boyfriend were very excited to go here. They paid almost $200 for 2 Buffet of Buffet 24 hour passes . They had crab sushi shrimp and oysters.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-08-02 14:45:40', 'A0000072U', '2018-04-12 20:01:42', 'The next day while examining the contents of the back seat that were just tossed about with no care, and no effort to clean anything, I discovered a pair of women"s panties placed in the center of the floor of the back seat. Keep in mind that the floor mats were not vacuumed, but tossed on the back seat.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-08-02 14:45:40', 'A0000124V', '2018-08-19 19:12:11', 'After all that, we still went to the bar and had two rounds while we waited.  Good selection of beer, bartenders were fast to see that we wanted booze and wasted no time in getting it.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-08-02 14:45:40', 'A0000135S', '2018-06-22 09:21:50', 'Cutest little dive bar in the city! Chill vibe, cheap (and yummy) drinks, delicious food, and family owned. Laura was an excellent bartender and made us feel right at home. Bonus points because it looks like a cute little house! A must-see if you"re in the area.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-08-02 14:45:40', 'A0000124V', '2019-09-19 19:34:35', 'We have been searching for a good Chinese restaurant that won"t break the bank. We found it! Chin"s is amazing! 3 of us went out to eat and all got a different dish and upgraded to the vegetable rice. Add 3 drinks and 6 cream cheese wontons and our bill was $33. The food was spectacular!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-08-02 14:45:40', 'A0000068V', '2019-03-22 23:13:23', '* Large TVs (we watched football during one of our visits)');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-08-02 14:45:40', 'A0000037E', '2018-03-13 15:54:37', 'The young lady was cleaning dirty tables with a rag  and spray. Not a problem except when she was done she put the spray bottle up and didn"t bother washing her hands either and went immediately to handling food items in the back.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-08-02 14:45:40', 'A0000190B', '2018-06-18 21:15:02', 'We also had a trio of their Dolcini desserts which made it perfect so we could have tiramisu and the limoncello and strawberry stuff!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-08-02 14:45:40', 'A0000108T', '2018-06-02 14:44:13', 'Third & last thing (I think) to know is not to expect favorable employee characteristics. At least not from the guy with the gray ponytail...especially not from him actually, maybe just avoid all contact with him if possible.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-08-02 14:45:40', 'A0000298D', '2018-12-03 19:37:39', 'delivery, pickup, whatever, the food always turns out good, for me.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-08-02 14:45:40', 'A0000036E', '2018-01-29 18:16:14', 'Serene patio seating for fireside canoodling, sunset viewing or enjoying the early desert spring weather.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-08-02 14:45:40', 'A0000178S', '2019-03-27 08:57:14', 'Oh my gosh.. BOMBBBBBBBB!!! This place is so amazing!! The food is incredible! I have had almost everything on the menu. They have milk shake happy hour every day between 3 p.m. and 5 p.m. with half price milkshakes. The first time you go in, tell them its your first time and they will give you a sample of all of their different sauces. My two favorite are sweet heat and creamy garlic. The staff is incredibly friendly and personable. The restaurant is clean and the hand washing station is pretty neat. Go check it out you will not be disappointed!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-08-02 14:45:40', 'A0000005O', '2018-04-11 22:17:09', 'I ordered a simple naked potato and a side salad to accompany my steak. Both were fine. But there is not much room to mess up a potato and iceberg, is there? People rave about the garlic bread and I think it"s because the rest of the meal is so mediocre, that the cheesy bread becomes the highlight if the meal. It was just OK. The most inexperienced cook could make it at home with sourdough, butter, and three types of cheese.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-08-02 14:45:40', 'A0000017C', '2018-10-16 07:07:40', 'Parking is a bit tricky during busy hours and the wait times for food can get a bit long, so I recommend calling your order ahead of time (unless you want to take a look around while you wait, first-timers).');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-08-02 14:45:40', 'A0000017C', '2018-12-26 23:24:46', 'Unfortunately, I must recommend not to conduct any business with Fast Fix Jewelry and Watch Repairs.  The staff is completely unprofessional and I have never been treated so rudely in my life.  I was actually shocked and walked away thinking "wow, how do those people even have a job?"');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 1, 'P0000004E', '2019-08-02 14:45:40', 'A0000155H', '2018-01-18 08:33:37', 'Awesome food and service! Really wish we had one in Oahu! Our servers were on it! Thank you for working it out and fitting in our party of 9!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000048W', '2019-02-13 07:57:36', 'Dreadful Service');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000043D', '2018-02-13 11:19:43', 'I am always finding things on the small side lately... no idea why!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000173C', '2019-04-11 17:23:18', 'This was my first time here. I tried the salmon enchiladas with brown rice and Cajun beans.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000278E', '2018-10-02 17:09:59', 'Linguini DI Mamma Ninetta:  I love mushrooms but was surprised that there were so many in this dish... With just 3 small shrimp and a few small pieces of chicken scattered throughout, and very little garlic flavour, this dish was edible but far from great.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000043D', '2019-06-03 10:51:43', 'You get what you pay for - and in this case, less. Lesson learned.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000212I', '2019-01-10 23:01:52', 'I normally don"t like fancy cupcakes because they consist of half icing in volume, and I"m not a big fan of frosting--it"s too much like eating heavy, creamy sugar. This place, however, has light and fluffy icing that I actually looked forward to biting into all on its own. Amazing.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000088F', '2019-06-06 18:47:44', 'After living in Tempe for several months and not finding a nail salon, I went on yelp :) and found Nancy"s. The reviews looked pretty good so I decided to give it a try. Like some of the other reviews mentioned, the salon doesn"t look like much from the outside, but on the inside everything is great. The facility is clean, but what makes the difference for me is the fact that the staff there was so friendly, and welcoming. All of the technicians were talking with the clients and there were even a few friendly group conversations between everyone in the salon. It was very comfortable! Most of the ladies in there during my appointment were regular clients and they had nothing but good things to say about the place after learning that it was my first time there. Loyal clientele is always a good sign.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000260L', '2019-07-03 09:39:48', 'Neat experience. Def worth a trip..');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000062J', '2019-07-26 15:03:30', 'One major downside: the food portions are extremely small for the price you pay. The value for money clearly isn"t fair considering they are dishes tapas style. In a regular restaurant you"d get real size dishes for the price you pay for tapas there.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000048W', '2019-03-30 03:11:46', 'Peach cobbler desert was all topping that I swear was merely microwaved and had one slice of grilled peach - putting a candle on it did nothing to make me think this was the birthday dessert I was for...');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000173C', '2019-06-08 16:37:08', 'I"m not sure how I rate this restaurant because I walked in to get some soup. It was around 4pm and I was in destroyed need of something that would clear my sinuses. Hot and sour soap always does the trick. I was told that I couldn"t order a cup because it was supper time. That"s okay, so I ordered a bowl of soup to take home... it was 11.00, and that okay too. My only thing is that it looked like a cup and the soup was not too fresh. It was good though. I"m not too sure if I would go back because the prices seemed too high and for a bowl of soup being 11.00, it wasn"t great and there was much, but broth.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000186D', '2019-07-25 02:16:15', 'I swear if the serving size was more this place could be a easy 4 1/2 Stars. My husband and I along with our boys were in SC last weekend for scheduled maintenance on one of our SUV"s and since the appointment was so early we rushed out without breakfast so of course the entire time in the waiting area we were searching for food.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000048W', '2018-09-18 12:50:51', 'Location: Located next to an AM/PM gas station. This was great because I could pregame on the cheap before we went to various places. The hotel is very visible but still in the cut. About a half mile or so from the Venetian.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000260L', '2019-03-17 00:39:02', 'Luckily that lady who took our drink orders was pretty nice and came over often to clear our plates and refill our mimosas.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000173C', '2018-02-03 22:14:21', 'I loved my little cake, but the owner is her own worst enemy to her business. A friend took me there because we went on a cupcake tasting that day. He said a better product was awaiting me as the grand finale. When I walked in the store, I didn"t know who the owner was, until my friend pointed it out when we left. I wanted to take a look around, it was nicely decorated, but I could clearly see the person in charge slightly annoyed that I wanted to browse before buying. I explained it my first time at the store and she pushed me to buy a large cake. I explained again that I was not from Scottsdale and am only one person. So I"m not going to buy a large cake. When we started talking a bit more, I could see her employees sort of clam up. I had no idea what was going on. When I chose my little cake, any sort of customer service went out the window once the money transaction occurred.  She didn"t even say, "Thank you," It was so unusual for a bakery or any business dealing with customers. I was upset and quite frankly, so angry that I wanted to turn around an return my cake and tell the owner to keep my money. I am not rich - I am passionate about bakeries and tour around when I"m in a new town to support local business. I was genuinely interested in hearing about the seasonal cake that she was trying to sell me. I had heard through other locals that they love the cakes, but not the owner when she"s in the shop because she"s so rude. I give this a two stars because I liked the cakes, but the service was very, very caustic that I could not justify scoring more. I was trying to figure out how she stayed in business, but then heard she has a contract that keeps her afloat to sell cakes to a prominent medical clinic. I love the cakes there - the store is creative, but I sense a level of stress that turned me off. If it"s the economy, that"s one thing, but in the U.S., customer service is not taken lightly.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000062J', '2018-06-28 20:08:42', 'This company tried deliver flowers to our home- my son was home by himself and called me.  I had him keep me on the phone while he opened the front door (our security screen door was  locked though).  He told the gal that he was not going to open the door, that his mom (me) was on the phone and he asked the driver to call me, his mom.  The driver was very insistent about getting a signature and became argumentative.  My son kept saying, call my mom, she"s on the phone now.  And she kept interrupting and insistent on a signature.  I told my son to close the door.  I then called the company and spoke with a Manager, Sara.  She understood my concern and said she would make sure the driver was trained on these situations.  Three days pass and I still don"t have my flowers or a phone call.  I called and spoke with Sara and she had a completely different tone with me than previously.  She was very curt and tried to give me lots of excuses. I asked that the Owners call me.  Five days later, I"ve never received a call back from the Owner or my flowers.  I called to find out when one of the Owners would call back, and Linda told me it would be by Friday, which meant six days later than my initial request.  I told Linda that was pretty unreasonable and she told me that the Owners are busy and have several other businesses.  In my opinion, that"s completely unacceptable- do yourself a favor and do not order from this Company.  They are very unprofessional and not very concerned about customer service.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000043D', '2019-10-18 19:52:06', 'PROS: I love this lee"s location! it"s my favorite to go to since it"s near my home. it has everything you would want, they even have a growing sake collection!! they restock a lot.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000186D', '2019-09-19 11:03:56', 'Real Ecuadorian helado de paila or Gelato!! Beautifully fresh and flavorful Gelato!. Also wonderful service to boot!! My favorite is key lime and twighlight flavored! The owners are amazingly sweet people come support this business!! You wont be disappointed!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000212I', '2018-07-27 12:45:30', 'I ordered the Akropolis Pizza and Pork Gyro. The first thing I noticed when the pizza came out was how vibrant the toppings were! You can tell the veggies are fresh just by looking at them. The gyro was one of the best I"ve had and the fries were awesome. Great service! They really care about giving you a good experience. I will definitely be back!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000091A', '2019-09-25 15:57:56', 'Drink prices were pretty good.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000115N', '2019-09-12 16:10:32', 'Some notes: restaurant is located in the Esplandade with the AMC cinema and to the east of the Ritz Carleton.  Best bet is to park in the parking garage and then go to the walking mall.  Even so, it"s tough to find.  Don"t give up.  Also, it is no longer Fuego Tacos, but now Fuego del Mar, with a seafood-centric menu.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000115N', '2019-03-19 17:25:05', 'Troy did my recessed lighting back in January, and he did an AMAZING job. Our home was a struggle, since our ceilings were about 16-17ft high, and he got the job done, fast, easy, and it was beautiful. Great experience.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000001P', '2018-07-20 06:06:46', 'I hate that my review is going to contribute to the growing popularity of this place and me waiting longer to get a table in the future, but oh well.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000001P', '2018-12-22 15:16:20', 'The soup dumplings are good but not amazing. If you"ve never had it before, give it a try and you probably will like it.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000095I', '2019-10-23 06:18:52', 'We would highly recommend Fred to anyone purchasing or selling a home. It was a privilege to work with him, Shannan, and the rest of the North&Co team!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000001P', '2019-02-15 20:48:14', 'Well this was the first time trying this place since they just opened not long ago.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000292K', '2018-06-21 00:54:30', 'There"s also an aquarium and aquarium-themed restaurant in which they have a [fake] mermaid swimming in the aquarium and then people can take pictures with her afterwards.  There were TV"s in the restaurant showing the Super Bowl as well.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000165H', '2018-03-29 17:13:49', 'TIP: Bring your own bagged lunch and sit on the shaded areas/benches during your walk of the dam to really enjoy the experience. There is a Subway on your drive in to stop at.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000137S', '2018-03-13 23:13:38', 'They DEFINITELY need way more cart corrals in the parking lot. Like at least double the amount they currently have. There are none closer to the gas station, and when the store is busy people are too lazy to walk their carts back to the corrals, and I"ve seen carts fly into parked cars on at least three separate occasions. I hope Smith"s management reads this review and fixes this problem soon.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000247B', '2018-12-18 04:16:28', '-A bakery with Cleveland favorites like kugel and kolaczki and a deli stocked to overflowing with meats and cheeses from all over Ohio and Pennsylvania.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000097E', '2018-01-18 13:17:10', 'This Pita Jungle is located in the food court at the Scottsdale Fashion Square Mall. Out of all the eateries in the food court, this is by far and away the healthiest. There are some vegetarian and vegan options for those looking for a meat-free dish. The lentil soup is super yum and they have some great dishes I haven"t seen anywhere else. They have several locations in the valley. The one on Ray and Dobson has a patio right next to a small lake. It"s a great location, but can get crazy busy, especially during lunch on the weekends or on gorgeous days.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000137S', '2019-07-21 13:19:39', 'I took my wife out for a Birthday dinner with my daughter on 12-16-14  at Alfonsos.  I heard the food was good and it was and my waitress ( Dawn ) was also good ( even with it being very busy ). The problem I have is some of the waitress staff are rude. I had a gift card/ certificate to pay for dinner. After a few minutes, a big blond waitress came over and said  ( in a loud and rude tone ) I couldn"t use it cause I needed to spend $100.00 in order to get $50.00 off. She then insulted me by saying (so the tables around me could hear ) couldn"t I read the fine print telling me of requirements to use gift card. I showed her the certificate and the fine print was not legible She told me, sorry that"s not our fault it"s yours and she walked away. I am having second thoughts about going back to use gift card. I may give it away or toss it out.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000247B', '2019-09-01 13:48:41', 'Dinner Was Fantastic! Service was great We started with the corn soup and the tuna tartare. We shared the Filet and Scallops. Both delicious entrees! We didn"t realize the steak came with potatoes and ordered two sides Mac and cheese and shishito peppers. I thought the peppers were really hot but I"m a whimp I guess! We will definitely come back');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000137S', '2019-06-18 13:57:12', 'I tried Nichiban for the first time, and I definitely have to agree with the reviews from the other users for this restaurant.  It"s a very small place, tucked in a little corner of a small plaza right across Pacific Mall at Steeles/Kennedy, but the food is delicious.  Being a big fan of salmon sashimi, I asked if the sashimi bento and other main courses containing sashimi, can be replaced with all salmon sashimi and yes, it can be done.  I had the salmon sashimi bento box accordingly, and I have nothing but praise for the quality of the sashimi and the taste of the tempura, spicy salmon sushi and even the salad that accompanied the bento.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000137S', '2019-04-10 18:34:52', 'It"s been about two weeks since Omar did my window tint. It looks great, he had to scrap off old nasty window tint that started to bubble. The work they do is awesome, this is the 3rd vehicle he has done for me. I"ve been very happy every time. I"ll for sure always keep my business with him. Prices are fair, but the quality and professional service speaks for itself.  Thanks Omar');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000236Z', '2018-02-18 13:17:47', 'Pretty bad. Was this place good at one time? For the price I paid, I expected something much better.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000116Q', '2019-02-05 15:05:36', 'The restaurant at the hotel served fairly yummy food at great prices (service was a little slow at times), but what was EVEN BETER was the KILLER Happy Hour at the lounge.  Every day from 4 to 8 with half off all their appetizer menu, signature cocktails, wines by the glass, bottles that are sold by the glass, and then a selection of bottles that are served half off all day, all night.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000118M', '2019-09-08 18:30:58', 'So there you have it.  A locally owned business filling a need in an emerging neighborhood.  Nothing pretentious.  Just a good, straight forward, progressive independent convenience store.  Even if you don"t live in this quiet corner of Downtown, its worth a look.  Or a sip and bite and it was in my case.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000239H', '2018-05-01 01:08:23', 'Ther service is great and they can accomadate large groups, the few times I"ve been has been with 7-20 people.  Great staff, awesome menu choices, I"ll be going back');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000146C', '2019-09-27 09:22:14', 'When.she told me that the oven is 2,000 degrees so it only takes the pizza 90 seconds to cook and my order would be ready in 5 minutes I should have hung up the phone! by the time I got it home it was rubbery. (Is that a word?) Anyway, Yuck! We won"t be back.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000146C', '2018-12-30 00:20:55', 'Had a groupon decided to check it out, steak was good, server was lacking. It was busy and loud which wasn"t bad but it was our first time there, so we weren"t familiar withthe menu. Some of us had steak and some had salmon. The salmon came with sides and the steak did not. I wish the server would have told us more about the menu or asked if we wan"t sides. The server checked in once and never offered anyone a refill of their drinks.  It felt like they were put out by the groupon and didn"t want to deal with us. Prob won"t return.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000146C', '2019-01-18 23:15:36', 'Just ok. Not a fun true busy dim sum place and I"m so sure they don"t make their own food. Won"t be back soon.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000229S', '2018-04-04 12:52:57', 'I am years out from surgery with sacs and I wish I could turn back time.  He promises great things them butchers your body. I should have left my body alone. It was not bAd. I was out to perfect it.  We often talk about how he ruined a good body.  I will never forget his dirty nasty slippers coming into the operating room. I should have run from the room then.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2019-02-06 07:49:18', 'A0000237J', '2019-09-06 03:46:05', 'But this particular Giant Eagle had one huge bonus: their bakery makes really good everything bagels... Better than the ones from the other Giant Eagle market district, even though that bakery is huge and fancy. Even before their renovation, I would go there just for bagels. Their donuts are just like other Giant Eagle bakery donuts...really good. Personally, I prefer them over Dunkin.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000116Q', '2019-04-02 08:27:14', 'The most annoying part of the experience is the sausage, pepper and onion subs were 85% peppers and onions. There was about 10 slices of very very thin sausage on the entire sandwhich which I think is a ripoff for $8.99. Terrible experience overall and will highly make me reconsider ever going here again.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000115N', '2019-08-10 15:49:11', 'Reclining chairs with arm rests that rise are very comfortable. Movie prices are rising more and more.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000149A', '2019-02-20 23:06:53', 'Terrible customer service , overprice , only one mechanic at the shop , 3 weeks to fix my bike ; owner dale kieffer so rude I never come back again.... Yamaha dealer same price excellent service');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000207E', '2019-06-15 23:28:37', 'If you haven"t been to Chino"s - it"s time - make a run for the border/great wall/beach!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000091A', '2018-01-30 20:27:56', 'As we finished up our main course our sweet crepe came out.  I was surprised how full I was from the one savory crepe, but I made room for my half of a simple bruleed crepe with nuts.  You can really taste the quality of the crepe itself when it"s minimally dressed.  We finished with the complementary dessert of chocolate triangles and a rose infused marshmallow roasted right at the table.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000091A', '2019-02-13 15:34:52', 'Unlimited alcohol, wines and beer. They have a bar area with one bartender working and a bunch of tv"s to watch or get updates on games.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000201O', '2018-11-11 19:11:43', 'Best fried pickles in town! Great prices, fabulous and friendly staff. Zero complaints.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000165H', '2019-01-31 03:39:36', 'For the first I"ve ever noticed, I think I was just cheated on gasoline!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000157L', '2019-07-24 11:11:00', 'Really happy to have such a unique place like this in Phoenix. The Tea was tasty and the interior is very well laid out. Will definitely come back!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000157L', '2018-11-30 12:01:28', 'What an awesome pool party!!! I wish there was a tad more interactive aspects. I want hot girls and guys spraying champagne all over us or dancing with us.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000002S', '2019-05-06 20:50:42', 'another awesome thing about this salon is that they offer a 5% discount to anyone that pays in cash! 5% isn"t a lot, but it"s still a pretty cool little perk. I will definitely be returning.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000001P', '2019-03-03 09:02:00', '- MUSHROOM POT ON CRACK. THIS WAS DEFINITELY THE SHOW STOPPER OF THE NIGHT!!! the flavoring of the sauce, the textures of the 3? 4? different mushrooms. happiness. The sauce was like a cream of mushroom, milky, full flavored, salty, a hint of sweetness... too good. needless to say we all took a bite and just smiled in satisfaction. We all stared at each other and knew rice was needed to soak up all that bomb sauce!!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000292K', '2018-02-03 07:55:23', 'Never, never, NEVER again');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000095I', '2018-07-07 18:06:53', 'Though they could have gone along with the estimate and soaked us for some money it was nice to get some honest feedback and Jim seems to have a great deal of varied construction experience to give just that.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000201O', '2019-03-17 19:19:16', 'The desperately needed water took almost twenty minutes to get to our table.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000002S', '2018-12-27 04:26:20', 'Only my second maybe third time in life in Outback. I came late because that"s how I roll. I really don"t enjoy a crowd.  Headed straight for the bar which was pleasantly open. Kayla was my bartender, made me a flavored ice tea because I didn"t want water or regular unsweetened ice tea. Cheers to that and then she made the the huckleberry moonshine cocktail, only 140 calories. My meal was a 11oz center cut steak, sweet potato and brocoli and cheese. All the food was deliciously seasoned. I"ll be back');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000095I', '2019-10-13 08:35:29', 'Crawford"s Auto repair was extremely thorough. They pinpointed a noise to three contributing factors: a rock in the tire, a roof rack bolt, and something in the sun roof. I love how detail-oriented these guys are.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000002S', '2019-09-27 22:53:26', 'Everything on the menu has a picture so you know what you"re getting, the coffee was on point and adorable foam design.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000001P', '2019-07-07 12:24:26', 'I took my revised sandwich and sat down to eat it, only to find that along with the veggies I had requested, they had piled on Italian vinaigrette and Dijon mustard, which I did NOT want.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000165H', '2019-10-13 15:40:16', 'Also the staff in this place was very friendly, helpful and fun. It was good to hear youthful energy enjoying their work instead of the normal this is just my job type of employee"s. This staff gave good service and enjoyed what they do.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000165H', '2018-12-10 02:05:07', 'I seriously love Jimmy"s so much.  I miss the days when a friend used to live behind the store and we ate there almost everyday.  Now I have to go a little out of my way to get there, but it"s totally worth it every time.  I love Jimmy"s so much and I"m positive that everyone who goes there loves it too.  It"s just one of those awesome finds that everyone in the world should know about.  *insert Homer Simpson drooling here*');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000260L', '2019-02-10 04:22:50', 'Just an FYI..........');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000043D', '2018-12-30 13:47:05', 'I have a confession to make... I have an obsession with tongue.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000043D', '2019-03-23 20:33:41', 'Good food but service sucks: waitress apparently was in a rush, serving appetizers and burger plates at the same time... didn"t ask for desert and brought the bill and the credit card machine all together... almost cleaning the table as we were sitting at the table. No smile, no care.... almost rude.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000048W', '2018-02-20 12:53:11', 'Every member of the staff is extremely friendly and courteous. No matter what time of day I am there everyone is (or pretends to be) in the best mood ever. Very professional, very clean and modern, even relaxing!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000062J', '2018-11-12 15:07:04', 'The toast & cheese was good, but by the time we were able to dig into their heartiest offering of food, saltines and butter may have been equally pleasing.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000043D', '2019-09-29 18:38:34', 'It is conveniently located very close to the convention center so it gets packed when events are going on.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000186D', '2019-05-21 03:09:17', 'I was most impressed with the service!  We were greeted right away.  While we were eating our dessert both a manager and the chef stopped by to check on us.  I was most impressed that the chef and manager cared so much about our experience!  A+ service!  I"m glad I found this new gem in Old Town Scottsdale!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000278E', '2019-04-14 10:55:26', 'We order out at work every week and got their menu in the mail and gave them a try last week.  Pizza, hoagies, salads and pasta dishes were ordered with no evidence leftover shortly after delivery.  I had pepperoni pizza and it was delicious.  Thinner crust than other places and light on the sauce, how I prefer my pizza.  Coworkers who had other food items enjoyed their lunch too.  Looking forward to trying other menu items!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000212I', '2018-03-29 02:33:17', 'What an incredible experience this was. There is nothing particular special about the neighborhood atmosphere, but don"t let that deter you. We were seated on the outside patio which was lovely on a warm summer evening. The service was exceptional as the staff was incredibly kind and attentive, but it was the food that really made this experience. From the crispy shrimp appetizer and beef tartar, to the octopus special and veal flank steak, the food was simply amazing. Unfortunately, we"re from the San Francisco area so may not be back any time soon, but if this were in our home town neighborhood, we would come back weekly!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000186D', '2019-09-11 02:41:14', 'I used to come here a lot. It was the best boba place around here but lately the tea just taste like water, sugar, and flavor. There is no tea taste but the texture of boba is good.  The squid balls are still great. But I guess if you like slush and blended drinks its still good. I will still come because its the closest by my house.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000278E', '2019-10-18 18:20:16', 'Unlike other agents that we had worked with, Fred never made us feel like he was reluctant to show us properties. He was very patient with us throughout the process, and gave us time and space to make decisions, all while going above and beyond in the "background" to be prepared for all scenarios so that we were always "ready to go" when needed.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000062J', '2018-04-02 13:16:58', '- Shrimp pad thai was served ice cold.  So gross.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000278E', '2019-10-28 17:54:18', 'This particular location is hit or miss with the waitstaff - some act like they love their jobs, others look like they hate their lives. Past couple of times I"ve been there the food came out lukewarm at best. Yesterday, it just so happened that I found a lemon seed in my Brushetta Chicken Pasta, after almost cracking a tooth on it, ew. Although, I will say, I just moved that bad boy to the side and acted like I never saw it. It"s probably better that way.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000252I', '2019-06-18 18:49:41', 'Tacos dorados- they are the best ones I have tried in the city!');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000223L', '2018-08-11 09:14:00', 'Great burger. One of the best fast food burgers I"ve ever had, right behind 5 guys.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000090V', '2019-02-03 11:16:23', 'I bought a house that had a safe with a dial.type lock which while definitely secure is a bit slow to open and makes me want to use the safe less often. I did have a business card from The Safe Keeper attached to opening instructions that was left by the seller. I went online, found their website and emailed them regarding changing to an electronic lock. They replied in the affirmative the next morning. I called and scheduled the work which was done within two days of my first contact. The service technician, Vid, was on time, knowledgeable, very personable and completed the changeover in the timeframe he had quoted even while explaining everything about the safe, the locking mechanism and answering all my questions.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000062J', '2018-05-25 21:50:16', 'I"ve been a fan of Pita Jungle since my ASU days, when I lived down the street from the Apache location. Now I live in the Arcadia area so this is the one we frequent. I haven"t noticed a huge difference between the two locations, same great food, same stoned servers.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000212I', '2018-12-08 10:54:15', 'The young lady was cleaning dirty tables with a rag  and spray. Not a problem except when she was done she put the spray bottle up and didn"t bother washing her hands either and went immediately to handling food items in the back.');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000088F', '2019-05-30 00:43:03', 'Food - 3.75 stars (except for the mushroom pot on crack... 4.5 stars for that)');
INSERT INTO ForumEntries VALUES('FO0009', 2019, 2, 'P0000004E', '2018-04-24 16:13:22', 'A0000252I', '2018-11-08 21:40:15', 'Review 1 for 2017');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000250Y', '2019-07-22 02:07:24', 'For sure, we will be back.  It"s a field trip for us, but worth it.  Just an all-around good experience.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000245I', '2018-07-27 21:06:51', 'Once you understand those 3 essential things you are sure to enjoy your time. With rows of pinball machines there is plenty to check out, the variety is not lacking. You can certainly stretch $10-20 into a good couple hours worth of play.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000016W', '2019-09-19 18:53:22', 'When a group says "We"re really thirsty. Could you please bring water while we look at the menu?" You"d better frickin" BRING IT!');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000062J', '2019-01-21 10:37:44', 'So there you have it.  A locally owned business filling a need in an emerging neighborhood.  Nothing pretentious.  Just a good, straight forward, progressive independent convenience store.  Even if you don"t live in this quiet corner of Downtown, its worth a look.  Or a sip and bite and it was in my case.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000180L', '2018-12-16 04:00:57', '(and make sure to read the non-PC T-shirts while you wait - funny!)');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000182E', '2019-07-14 08:01:23', 'Have you ever gone to a restaurant with great expectations based on reviews and left disappointed?  That was our experience.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000036E', '2018-09-01 08:07:02', 'It was great!');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000036E', '2018-08-22 04:21:46', 'We wanted to try something different so we ordered the half sub and soup special. I thought it was expensive if you ask me. It was like $9. So it was over $20 with 2 specials and a drink. It didn"t even fill you up for that kind of money!');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000077U', '2019-03-18 08:36:56', 'Def worth stopping by.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000250Y', '2019-09-08 21:25:11', 'If one of their specialty pizzas sounds good to you, go for it, as those are definitely a better deal for the amount of toppings you get for the money.  I wanted what I wanted, though, so I ended up with a medium, thin crust, regular crust pizza with jalapenos, pepperoncini, onions and feta.  It was pretty expensive at $2/topping = $20 med pizza. But it was delicious.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000182E', '2019-01-11 18:19:22', 'We had a great lunch experience today at Rubios. It didn"t start out that way but was quickly turned while we were checking out since we were using promotions.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000108T', '2019-10-01 03:58:41', 'for their own protection.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000036E', '2019-09-07 09:55:58', 'Wow! So fresh, ripe, and sweet! And right in my back yard! I have watched customers go in and out of this small location in the strip mall and always wanted to try this! So glad I did! Can"t wait to come back and try everything else!');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000245I', '2018-03-17 13:00:01', 'These guys literally saved me.  I had a RFP due during the holidays.  With my computer and printer crashing, I was in a serious bind.   I usually go to Staples Printing Centers-- but, they couldn"t get it done in time.   So, I got on the Peoria Chamber website and International Minute Press/Desert Sky Printing came to the rescue.  They finished my printing and the RFP was turned in with 1 hour to spare.  I recommend them highly!');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000078A', '2018-12-23 20:28:43', 'Greeted by guy that I assume is the gent someone described as "XL".  He"s just a little round.  And was a warm, welcoming fella.  He beamed a smile at us, waved at dining room and told us to sit wherever we wanted.  We chose a cozy booth in the corner.  Our server was there in moments with menus and take our drink orders.  I wish I remembered her name---dark hair in a pony-tail, glasses, and really personable and nice despite it being the end of the night and we were late-comers.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000119R', '2019-07-26 22:44:46', 'My girl friend and I went to Social House last Saturday a little before 5, before the restaurant opened for dinner.  The host was very friendly and informed us that the restaurant was not opened for dinner yet.  My girl friend and I each had a a cocktail while we waited.  Wow! I loved their "Socialite" cocktail and my girlfriend was amazed by their "lycheetini".  Both drinks were incredible!! This definitely gave us a boost of confidence about the meal we were about to have.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000050J', '2018-07-13 18:09:29', 'I"m very surprised that after 20+ reviews this place has a 4 1/2 average rating.  First off, so you don"t think I"m some elitist bastard, let me state that I happily eat food at IHOP and Denny"s.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000188F', '2018-07-03 15:42:47', 'PLEASE STOP OVER BOOKING. WE ALL KNOW IT"S NOTHING MORE THAN GREED TO BILL MORE APPOINTMENTS PER DAY.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-03-24 09:00:37', 'A0000188F', '2019-07-12 02:11:58', 'Extremely friendly staff. Smaller seating area than most Nekter Juice Bars, but that has been no problem. Always get my custom order correct. No issues. LOVE location! Conveniently close to physical therapy clinic where I run on antigravity treadmill & blocks from my OBGYN"s office. Ample parking.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-05-05 09:39:52', 'A0000117Q', '2018-10-21 15:46:16', 'The service was perfectly paced, with our server prepping our next course and pouring wine, and another server serving and explaining each dish.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-05-05 09:39:52', 'A0000044J', '2019-10-26 19:52:07', 'Beer Battered Onion Rings - Very thick batter on these rings, golden brown, crunchy, very filling.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-05-05 09:39:52', 'A0000138V', '2018-03-12 23:46:15', 'We"ve been a huge Slim"s fan since they opened one up in Texas about two years ago when we used to live there. This place never disappoints. They even have great salads and grilled chicken. Plus they have fresh brewed sweet tea, it"s the best!');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-05-05 09:39:52', 'A0000048W', '2019-02-07 22:44:28', 'Really confused about the high star rating here...  I was actually excited for airport food due to the high Yelp reviews.  Should have dialed down my expectations?  I got the teriyaki chicken with brown rice.  The rice and chicken were both really dry.  The veggies were soggy.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-05-05 09:39:52', 'A0000117Q', '2019-10-14 03:12:33', 'Good, clean place to get a mani/ pedi. The two came to $39 with tax and they did a great job of both. TVs all over so you can watch tv and freindly staff.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-05-05 09:39:52', 'A0000157L', '2019-07-19 16:23:07', 'Located at the Venetian Hotel in Las Vegas. Great service, fast or slow depending on how busy it is. I ordered beef/broccoli, chicken chow mein soft noodles, & a small wonton soup. I didn"t like the green bell pepper in the chow mein (next time I will order without it). Today, I ordered a noodle soup with chicken and vegetables. Definitely, hit the spot. I added some soy sauce and chili for flavor. One of my favorite chinese restaurants".');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-05-05 09:39:52', 'A0000044J', '2018-03-26 17:40:06', 'We came around 5 pm ans sat on the patio. We had several servers come and ask if we were ready to order, but we weren"t. We wanted fried calamari and also some hot apps, but the Hot Platter for 2 only had the grilled calamari. Our server was nice enough to substitute the fried calamari for us at no extra charge.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-05-05 09:39:52', 'A0000048W', '2018-06-08 23:56:00', 'Belgian Waffle saggy. Whipped cream from 99 cent store. Maple syrup is liquid sugar with water.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-05-05 09:39:52', 'A0000112O', '2019-03-05 04:38:07', 'So many great this about Yoga Factory! Excellent teachers, very friendly and professional; they have been very patient with my practice but know how to push me to meet my goals. Amazing location very easily accessible very easy city parking! Nice large space in the hot room, never did I feel like my elbow room was compromised and the room can get PACKED! The facility is clean, neat and I love the choice of decor. Highly recommended for a first-timer or for someone who has a frequent practice very friendly and welcoming place.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-05-05 09:39:52', 'A0000117Q', '2019-08-06 06:27:13', 'My friend lost the key in the car and we were locked out of the car.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-05-05 09:39:52', 'A0000294V', '2018-07-30 17:15:28', 'Looked forward to eating here for so long...too bad it was on my birthday - food was good but the service was deplorable so not going to rehash this too much (apologies to my man and bro as I know they were also hoping for better)');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-05-05 09:39:52', 'A0000294V', '2019-09-10 20:17:53', 'Walking in the decor was the usual.. whats the word.. oh yes.. Festive. But then again thats what you find at every mexican restaurant.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-05-05 09:39:52', 'A0000048W', '2018-06-20 00:24:05', 'You need to use an 8 lb ball if you want bumpers.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-05-05 09:39:52', 'A0000242A', '2019-08-30 13:51:43', 'I got stuck in Myrtle Beach last week and stayed here waiting for another flight.  Very clean, comfortable and right near the airport.  I would definitely stay again.');
INSERT INTO ForumEntries VALUES('MA1101R', 2018, 2, 'P0000007K', '2018-05-05 09:39:52', 'A0000138V', '2019-08-05 07:15:16', 'The shop staff are very friendly and more than willing to accommodate any request.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000219A', '2019-09-24 16:08:22', 'If they fix their thieving ways, I"d give "em 3 to 3.5 stars. For more, they"d need a serious cleaning and update.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000057U', '2018-12-22 05:12:01', 'Best Chinese food in LKN area. Never disappointed with the take out we get.  They speak English well too!');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000264R', '2018-01-19 18:04:04', 'who serve up grub this bad,');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000057U', '2019-01-25 17:53:04', 'Ugh here we go.. this is my second time ordering from crepe club through Postmates. Both times big let down. I order through Postmates several times a week and rarely ever have any issues so I know it"s nothing they could of prevented unless the drivers start sampling the food and drinks before delivery. I ordered the regular chicken florentine - crepe was cold, doughy and undercooked. It was generously stuffed, almost too much. Spinach was fresh, but not cooked so it was like eating a salad in my crepe...the mushrooms, clearly were canned precooked mushrooms. I"m not totally offended by them, but when you put a ton in a raw crepe...not really tasty.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000057U', '2019-07-29 17:47:20', 'Tried the fish tacos and churro, definitely a superior Mexican/ taco joint around in the city');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000038M', '2019-06-15 04:46:21', 'Look I"m honest so here is the run down on what you we had:');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000235C', '2019-09-28 09:13:38', 'Believe the negative reviews. I came here after a round of golf, in order to have dinner and a few brews. The service wasn"t terrible, it was non-existent. The waiter seemed to take an eternity to take our order.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000057U', '2019-10-12 07:10:40', 'I love coming to pastel ! My favorite items are the black sesame crepe and the green tea crepe. Their waffles are good too, but I personally like crepes more. The ice cream and whipped cream is not too sweet which I like. I recently tried their matcha batter crepe, it wasn"t bad, but I prefer sticking to plain crepes with green tea or black sesame ice cream.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000038M', '2018-03-17 05:27:09', 'We had the curry it was really good but it was small portion for it"s price.. the garlic chicken wasn"t satisfying since it was dry, no spices, very plain and the chicken was kinda hard. Presentation was ok, you gotta order the rice seperate.. the service was fine the servers were pretty casual with their guests. Would come back for curry but not for tandoori or kabob.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000038M', '2019-09-02 14:28:59', 'The soup dumplings are good but not amazing. If you"ve never had it before, give it a try and you probably will like it.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000235C', '2019-02-28 15:49:51', 'I took the car directly to the 616 location and saw Jared busily working with his staff. I pulled up and was greeted courteously by one of the staff. After being checked in I called out to Jared and explained the situation to him. He dutifully sought out to resolve this issues and return my car to its former glory.  This was not his problem, his staff did not cause it but he fixed it.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000072U', '2019-10-17 11:29:30', 'I"ve had 3 other laser tattoo removals before I came here so I know what I should be getting. Honestly she didn"t even go over it all the way with the laser. There"s quite a bit of the tattoo that"s untouched. I"ll be going somewhere else for the remainder. It"s not worth the pain if it"s not even going to make a difference.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000235C', '2019-09-08 01:21:12', 'Dinner Was Fantastic! Service was great We started with the corn soup and the tuna tartare. We shared the Filet and Scallops. Both delicious entrees! We didn"t realize the steak came with potatoes and ordered two sides Mac and cheese and shishito peppers. I thought the peppers were really hot but I"m a whimp I guess! We will definitely come back');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000235C', '2019-01-17 19:36:45', 'There was a group there (I think it was somebody"s birthday or engagement or something) and it was clear that this is a good place for a group of people to go.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000107C', '2019-08-09 12:15:48', 'Egg-celent! Was so delicious and would definitely recommend it. I gave only 4 stars because I wish they had more options on their menu. I didn"t want bread and opted for the salad at no additional cost. Although the salad was good, I"m not too sure about arugula with scrambled eggs and a slice of cheddar cheese.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000098D', '2019-07-11 15:27:10', 'Went here on new years day to grab a burger. Got in before the OSU game started. Tasty $5 cocktails (in pint glasses, mind you) and good burgers. The fries have large grain salt and were well prepared. I had the Oh Cheesus, which is a burger to be reckoned with. Seems a bit like a rip off from Melt but I didn"t care, it"s a burger between two grilled cheese sandwiches (with more cheese on top of the burger)');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000017C', '2019-09-02 18:13:48', 'Great burger. One of the best fast food burgers I"ve ever had, right behind 5 guys.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000247B', '2019-04-11 12:35:23', 'This restaurant is a real local secret. Open since 1965, the original owner and chef was still cooking in the kitchen on a Monday night at 10:00 when most restaurants were closed. So happy I found it. Amazing food, wonderful authentic Italian atmosphere and friendly, and well-timed  service in English, French or Italian!');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000286J', '2018-04-03 20:11:22', 'They charged me twice what I expected to pay. The guy at the counter small-talked me, asked me if I wanted "any additional insurance" - I said no - and just initialed where he told me to, not noticing that one thing I initialed was collision waiver insurance, which I did not need and ended up doubling the original cost. He did not walk me through the additional cost and may even have been purposely misleading by distracting me with small talk. I am an experienced traveler and nothing like this has happened to me before. When I returned the car and expressed my surprise at the doubled cost they essentially said "well you signed it" and "it"s worth it anyway." I will never rent from this Payless again.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000247B', '2018-06-21 21:02:12', 'I"d be a regular if living in the area.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000247B', '2018-08-07 17:21:07', 'We walk in saw that the place was not too busy maybe about 7 tables.  We got seated fairly quickly.  Our server was pretty nice, my parents attempted to order in vietnamese but the server informed us that he did not speak it.  Cool cool, no big deal, he seemed like a nice kid.  After that it went downhill from there.  We ordered three bowls of the Pho Dac biet, and two orders of the pho tai.  We finished our order with two thai teas, the jenni jelly drink, and two waters.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-03-13 01:55:44', 'A0000286J', '2018-05-08 11:23:37', 'The drinks are the best part.  I love that you can customize your soda to add any flavor combination.  There is nothing like a raspberry limeade on a hot day! :)');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-08-25 15:41:15', 'A0000286J', '2019-09-16 20:49:07', 'the food is good, very high end .  2 of us ordered the prime rib, 2 others ordered filet, 3 others steak, plus apps of sashimi, tator tots, mashed potatoes,');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-08-25 15:41:15', 'A0000247B', '2019-09-13 02:34:57', 'The beauty salon business does well around this area. There"s many!');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-08-25 15:41:15', 'A0000286J', '2019-09-30 17:35:29', 'Chocolate croissant- tasty, seemed fresh. Nothing special but compared to my $10 crepe and watered down overly flavored latte it shined.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-08-25 15:41:15', 'A0000247B', '2018-07-08 22:01:08', 'Where do I start!? Came here for the first time today and was a little shocked at the prices; we were already sitting down with our two little ones and they were hungry so we weren"t going to try and look for another place to eat. We ordered the fried pickles to start with, and wow! I could not believe the size of these things! Shortly after we got our meals, and once again the portions were huge! I finally understood why things were priced the way they were. Everything was sooo good; we will definitely eat here again!');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-08-25 15:41:15', 'A0000247B', '2018-07-27 13:11:19', 'As for the tenants who are complaining, I am hard-pressed to believe that Rich and the entire Active Renter crew have treated anyone poorly or have not serviced rentals in a timely manner. There are also people who tear up property (not their property!!) and then complain when they get billed for all the damages.  These are probably the same tenants who punch holes in dry wall, steal furnaces (who DOES that!?!?!?!), damage landscaping, tear up concrete driveways, etc.  - and then later complain when they are held accountable for the damages they created.  It"s said that people who have negative comments are much more likely to post a review than people with positive comments - on a 9 to 1 basis!  So for every complaint, remember there are dozens, hundreds, perhaps even thousands of individuals who have wonderfully positive things to say about Active Renter, but just don"t take the time to post a review.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-08-25 15:41:15', 'A0000286J', '2019-05-01 06:33:18', 'Service was attentive, quick and friendly.  The sunset margarita was a fruity and refreshing retreat and went perfectly with my awesome chicken quesadilla.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-08-25 15:41:15', 'A0000286J', '2018-12-01 20:19:22', 'Everyone in the restaurant were extremely friendly and seemed genuinely happy to be working there.  The manager came to ask us twice to see if we were satisfied with the food and if we were having a good time.  My water never went below half empty as the water and busboy constantly refills it as soon as I drank some.  For someone who drinks a lot of water with my meal and so I"m constantly asking for more water, this is a huge plus for me.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-08-25 15:41:15', 'A0000247B', '2019-01-24 11:44:00', 'I e-mailed head office months ago about a lousy experience at their Yonge & College Street location and never received a response. Was never a huge fan to begin with but that confirmed things for me.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-08-25 15:41:15', 'A0000161B', '2018-01-14 22:15:48', 'Mike and his crew did a very good job on our backyard waterfall. I waterfall is about 20 years old and had a lot of cracks and was leaking water. We also had part of a palm tree growing out of the stonework. He was very knowledgeable and experienced. Prompt to the minute! And we felt he did a very good job with his crew. He was on site most of the time for the job and  would highly recommend using again.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-08-25 15:41:15', 'A0000017C', '2018-06-21 10:27:00', 'I knew these were not my wife"s who is a small woman because these were of a rather robust size. Also these were obviously clean panties, so I gather that one of the employees has a fat girlfriend or wife who is missing something from the laundry.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-08-25 15:41:15', 'A0000052Z', '2018-09-12 03:55:46', 'Well this was the first time trying this place since they just opened not long ago.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-08-25 15:41:15', 'A0000161B', '2018-09-19 23:01:45', 'So at 1:30 pm we were sent upstairs to the balcony to take our seats and prepare to watch the big game at 3:30. Once we take our seats one of us ( we"re in a group of 8 ) will hold the seats while the rest of us will go out to the casino floor and gamble or go the the sports book and place a couple last minute bets.Please note the patrons that leave the auditorium will receive a hand stamp or wristband to allow reentry to the theater. BUT INSTEAD....');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-04-07 06:45:57', 'A0000017C', '2018-08-05 08:06:14', 'As for the tenants who are complaining, I am hard-pressed to believe that Rich and the entire Active Renter crew have treated anyone poorly or have not serviced rentals in a timely manner. There are also people who tear up property (not their property!!) and then complain when they get billed for all the damages.  These are probably the same tenants who punch holes in dry wall, steal furnaces (who DOES that!?!?!?!), damage landscaping, tear up concrete driveways, etc.  - and then later complain when they are held accountable for the damages they created.  It"s said that people who have negative comments are much more likely to post a review than people with positive comments - on a 9 to 1 basis!  So for every complaint, remember there are dozens, hundreds, perhaps even thousands of individuals who have wonderfully positive things to say about Active Renter, but just don"t take the time to post a review.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-04-07 06:45:57', 'A0000286J', '2019-01-28 12:24:09', 'I had this same waitress the Tuesday before accompanied by the same crummy service. That"s when I realized that it wasn"t just a bad or busy night (it was a Tuesday for crying out loud), but that this woman is just REALLY bad at customer service. Definitely do NOT recommend going there!!! Don"t know exactly which was our original waitress but our checks said Joanne G.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-04-07 06:45:57', 'A0000017C', '2018-03-18 22:51:03', 'WOW - this place is incredible.  It is huge, well lit, organized and everything is used and reasonably priced.  Saw this place on Yelp and had to check it out.  They advertise as an entertainment exchange store.  They take trades on books, magazines, movies, CDs, games......   I have never seen a used place this well, great.  Wish we had something comparable in Denver.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-04-07 06:45:57', 'A0000017C', '2019-10-18 11:39:49', 'Terrible Gym, the ceiling in the mens shower room is falling apart, Sauna has not worked properly for 6 months, change rooms are freezing cold in the winter and the Management could care less. Stay away from this Good life.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-04-07 06:45:57', 'A0000247B', '2018-08-14 21:07:49', 'LK is a great technician! He makes you feel relaxed and comfortable, as well as being extremely attentive to your nails.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-04-07 06:45:57', 'A0000286J', '2019-04-26 11:09:26', 'I worked with Sammy to coordinate a night out with 10 girls for a bachelorette party in Vegas.  We decided to go to Tryst.  Sammy was very patient in taking multiple phone calls and answering all my questions, even throwing in a couple of extra perks at my request.  The pre-pay service is great--the company takes the total cost of the evening and divides it per person, creating a link online where each girl can go and pay ahead of time.  We didn"t have to deal with a large bill or everyone"s credit cards at the end of the night.  It was SO easy.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-04-07 06:45:57', 'A0000017C', '2019-09-22 13:32:21', 'The service is slow & my salad, which was $15, was as bad as it gets.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-04-07 06:45:57', 'A0000017C', '2019-03-28 16:19:59', 'After they got the person in front of us through the drive thru, they then told US to hold on a minutes because they are "backed up inside", but they weren"t at all. The parking lot had 2 cars and 3 people behind us in line, and when I was inside, a server was sitting at a table texting. So don"t tell me you are busy if your staff is getting paid for nothing. I yelled "are you getting paid for this?" Through the speaker and he had time to answer and tell me to CALM DOWN but couldn"t take my damn order.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2019-04-07 06:45:57', 'A0000247B', '2018-07-07 03:56:21', 'Service: 4 stars');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000039C', '2019-05-04 07:42:26', 'Really confused about the high star rating here...  I was actually excited for airport food due to the high Yelp reviews.  Should have dialed down my expectations?  I got the teriyaki chicken with brown rice.  The rice and chicken were both really dry.  The veggies were soggy.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000114I', '2018-10-16 01:02:51', 'I feel like Friday"s food menu has gotten worse over the years. The alcohol menu - big improvements, I mean, who wouldn"t want a "Diddy Up" - right?!');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000039C', '2019-02-19 11:35:58', '- Ahi tuna over a piece of bamboo and basil leaf.  This was an interesting combination.  Probably my least favorite dish of the night.  The basil leaf was a bit overwhelming and covered the taste of the ahi too much.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000289B', '2019-08-06 15:32:09', 'Our reservation was for 3:00.  At 2:48 I received an email confirmation that my car was ready for me and even given a stall # to find the car and license plate # to identify the car and even the color-white.  When we got to the stall there was a car, but not the car I had reserved and received confirmation for.  So, I explain my situation to a couple of workers that were walking by and they tell me that there was a Mercedes there earlier but somebody else got it.  Somebody else got it?  It was in a stall reserved for me, right?');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000114I', '2018-02-24 17:41:51', 'The servers are great and friendly.... but relying on two servers to wait on 100+ customers says a lot about how inexperienced management must be. In fact, after waiting 15 mins at a dirty table I was finally able to track down someone I guessed was an employee to let them know we were even there!');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000022N', '2019-06-23 17:21:40', 'The atmosphere may be what you"d expect of a bar in the middle of a suburban development, but the food and drink are pretty good.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000098D', '2018-02-13 04:04:10', 'Absolutely no complaints! Stayed in the Bella Suite with a view. It was a fantastic room; amazing service and friendly staff. The only reason it doesn"t get 5 stars is room service.  Yeah yeah I know and can expect to pay higher prices for room service food, but $34 for hot tea and doughnuts (OUCH!) They charge $5 for room service, but I think that should be free.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000231F', '2018-06-06 15:18:21', 'It was great!');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000098D', '2018-07-23 09:58:07', 'I will miss the Sourdough Burger, but trust me when I suggest you find a nicer place and ask them to make a Sourdough burger (on sourdough bread with grilled onions and cheese).');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000022N', '2018-05-02 15:21:46', 'I am short. Pants are always waaaay too long. I have been taking my pants and jeans to Maria since we moved to this area 4 years ago. She always does a wonderful job and is very upfront about her pricing. I would be heartbroken if she ever closed up shop.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000022N', '2019-09-07 07:48:29', 'Price was good, service was professional , quality is outstanding. These guys are connected to the guys at Toronto T"s. I could not be happier with both of their services, I use them regularly and would not hesitate to recommend them.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000297I', '2019-02-19 16:36:39', 'Stop looking around and call them, you will be glad you did.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000231F', '2019-02-18 15:03:59', 'I give the space and decor 4/5 stars - it is small and decor is minimal, but it works.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000297I', '2018-05-21 20:31:34', 'Mac and cheese..not the best but not the worst');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000297I', '2018-11-21 08:35:48', 'Shaunz sells the most unique shirts I have ever come across! The staff, quality of clothing, and selection is incredible. Thank you Shaunz for selling shirts online now!');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000297I', '2019-03-06 15:16:30', 'I had a glass of nice refreshing Greek white that hit the spot. The Greek Salad we had was super fresh and crunchy with a perfect dressing and just the right amount of feta.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000107C', '2019-07-09 23:10:36', 'Services are reasonable priced and they are HONEST. They did not try to sell us unnecessary parts or services and they back up their work as well.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000098D', '2019-09-11 10:40:44', 'I really enjoyed coming here, it located near walnut st which meant parking was difficult.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000098D', '2019-03-31 06:53:50', 'Awesome food and service! Really wish we had one in Oahu! Our servers were on it! Thank you for working it out and fitting in our party of 9!');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000107C', '2019-08-04 14:01:07', 'I LOVE Sonic.  I was raised in San Diego, and we didn"t have any Sonics, so I was super excited to see them all over town here.  This is the location closest to my house, so it"s the one I visit most often.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 1, 'P0000006E', '2018-08-06 02:05:26', 'A0000231F', '2019-08-26 18:35:28', 'You can put these price tags directly on leather and they don"t stick because leather breathes. It"s the synthetic material they use for the inside of shoes where adhesive really only does "its thing" leading to frustration.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000049T', '2018-07-01 20:50:03', 'Also the Cancun fries are awesome. 1 order is for sue big enough to serve 2 people maybe even 3!');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000266H', '2018-01-25 09:08:08', 'Mr Cool Heating and Air Conditioning came to the rescue for me on short notice AND was able to work on a swamp cooler, which many companies do not.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000266H', '2019-01-17 13:32:38', 'We were told they were out of the ricotta ravioli (the dish I happened to be eyeing) but was told they can substitute the mushroom ravioli.  I ordered the mushroom ravioli,  my husband the lasagna, our friends ordered the chicken pot pie (all white meat), and chicken Marsala with ravioli side.   The server came back out and told us there was only enough ravioli for one of us...... so my friend changed his order to the green beans and mashed potato side. When our  meals came out they served him ravioli, he was told by the server they found some ravioli in the back- um okay, would have been nice to know before he got his meal as he was already looking forward to eating the dish he thought he ordered.  He was served a 2 mushroom ravioli and 1 ricotta (which he said was much better than the mushroom).');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000091A', '2019-09-31 04:40:26', 'Do yourself a favor and skip Wendy"s, McDonald"s, and for sure pass by the Taco Bell next to this place, you won"t regret it.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000281B', '2019-09-20 15:16:29', 'I had chicken scaloppini, which was delicious- perfectly prepared, and served with just the right amount of sauce and Mediterranean olives. The girls all ordered pasta dishes- raved about, and then subsequently demolished them. There wasn"t one crumb of food left on anyone"s plate!');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000281B', '2019-03-16 23:07:42', '( 2 ) other breakfast sandwiches');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000266H', '2018-07-25 00:55:58', 'Really confused about the high star rating here...  I was actually excited for airport food due to the high Yelp reviews.  Should have dialed down my expectations?  I got the teriyaki chicken with brown rice.  The rice and chicken were both really dry.  The veggies were soggy.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000029M', '2019-09-09 10:56:32', 'Great customer service! Lisa and Marie were a big help with deciding what I needed. With so many places to choose from it"s great to find a national level business treat you like new neighbors.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000281B', '2018-07-10 05:02:54', 'I actually noticed this place because I wandered by when I was walking downtown and it"s impossible to miss that lovely smokey/BBQ smell if you"re on the block. However, it looks kind of like a hole in the wall. The entrance doesn"t look like it"s been updated in years, and that"s ok because it just adds character. The entire decor is wood/country (to include buffalo head on the wall) and there is also a downstairs where there is live music on the weekends.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000206Z', '2019-09-12 15:54:13', 'Normally, I give a restaurant at least 3 stars as long as it has good food. However, our group was quite disappointed with this restaurant. Granted, we were expecting a lot from an Italian restaurant in the Venetian, but I also think those are fine expectations to have when eating at these prices.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000091A', '2019-05-21 02:41:41', 'Went here on new years day to grab a burger. Got in before the OSU game started. Tasty $5 cocktails (in pint glasses, mind you) and good burgers. The fries have large grain salt and were well prepared. I had the Oh Cheesus, which is a burger to be reckoned with. Seems a bit like a rip off from Melt but I didn"t care, it"s a burger between two grilled cheese sandwiches (with more cheese on top of the burger)');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000029M', '2018-11-05 11:06:40', 'Service was great.  Food was delicious.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000091A', '2018-06-28 00:16:11', 'Awesome breakfast!!! Had the Rubin Benedict and wow was it good! Loved it!! Kid friendly & mom approved,  in fact she had the Florentine Benedict... Good service and prices.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000091A', '2018-02-25 05:33:38', 'We were craving breakfast food and decided to check this place out. We shared a skillet and a few breakfast sides, each of which were cooked to perfection and super tasty. The atmosphere here is cute, clean, and just what you want for enjoying your breakfast.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000029M', '2018-06-01 17:47:51', 'Naked BBQ was fun, fast, and tasty. The staff was ridiculously nice and fun. As for the food, the sides are bit lackluster and need a bit more of a spicy punch or additional creamy, fatty goodness.  But, that is totally okay as the meat is the real star here. We tried four options, and we agreed that we both liked the brisket the most. Pulled pork and chicken were tasty as well. Overall, it was a fun, casual lunch with the before mentioned meat on a tray. I would totally stop by here for lunch or a brisket pick-up adventure again.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000049T', '2019-04-09 23:46:20', 'Starbucks NYNY was very disappointing today. Wouldn"t recommend coming back to this one.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000206Z', '2018-01-05 07:57:16', 'All in all, like I said earlier, a great place for good times and smokey flavor.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000049T', '2018-10-19 00:41:51', 'I normally only write positive reviews online, but this time i want to let people know about what"s really going on there. I would NOT go there any more and I do NOT recommend LifeScape to anybody.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000063D', '2018-11-11 00:42:09', 'I really enjoyed coming here, it located near walnut st which meant parking was difficult.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000045R', '2018-04-11 04:07:08', 'The return process was pretty quick and easy as well.  I ended up getting charged for an extra day because I brought the car back 1.5 hours after the pick up time since my flight didn"t leave until 8 PM.  Too bad they don"t have a "grace" period for regular customers.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000263B', '2019-10-10 12:23:49', 'I never heard of anything more stupid in my life. I won"t be going back there');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000045R', '2018-07-08 19:03:24', 'BUT Kelly did my hair and she was extremely nice and chatty. I told her what i wanted and she made it happen. They also didn"t nickel and dime me or add on any surprise prices.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000070T', '2019-01-31 08:33:50', 'I"m from Chicago were pizza is King and Pizzafarros is my favorite in Scottsdale!!!');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000116Q', '2018-07-05 00:09:55', 'Gold Ribbon- mix of caramel, chocolate, and vanilla, I truly loved this trio of flavor, each complemented one another. TRULY delicious!');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000070T', '2019-06-14 13:24:41', 'Review #189 - 2016');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000063D', '2019-01-05 04:31:23', 'There are definitely pluses to Piccadilly"s yogurt though.  I liked the toppings better - I thought the mochi tasted better, the brownie pieces were bigger, and the chocolate caramel turtles went great on ice cream.  The chocolate caramel turtles should be a standard topping for both frozen yogurt and ice cream places.  Also, with the huge map of Cleveland Heights behind the cash register, this feels more like an authentic "neighborhood" froyo joint.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000045R', '2019-10-02 20:49:38', 'Thanks again! :-)');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000063D', '2019-02-04 11:43:25', 'Pozole- which is really filling! Great for when is freezing outside....');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000116Q', '2019-07-13 21:49:54', 'Ordered 2 coffee, and two breakfast croissant sandwich for me and bf.   The croissant was very tasty but the size is tiny....so it"s quite expensive for the size.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000063D', '2018-01-22 16:55:33', 'I was very impressed by the cleanliness of the salon. They have a large polish selection. My nails have lasted a long time and that means a lot to me.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000045R', '2019-09-23 04:57:58', 'Very slow and incompetent staff. Food is okay, nothing special. I would definitely avoid this place next time I"m in Vegas.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000134L', '2018-02-16 08:53:30', 'My search for the best beautician with great customer service skills,  hairstylist and applying my weaves are over. Rasheen"s skills surpassed my expectations. Rasheen"s expertise in the use of different techniques that would be best for your natural hair when applying your weave, shows that she cares about your natural hair. My hair looks amazing, and I have received so many compliments.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-08-17 22:17:27', 'A0000070T', '2018-08-09 04:03:03', 'The shop is located in the weirdest shopping complex - it feels like a dr"s office belongs here. Inside, it was pretty poppin" (it was Sunday), but the line wasn"t bad.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-04-09 11:13:31', 'A0000026K', '2018-03-04 07:54:58', 'This place brings back so many memories with my family. It has been here for years and unfortunately the service and food quality has gone down.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-04-09 11:13:31', 'A0000273F', '2018-12-17 16:24:13', 'The only thing I found interesting about the place was the self tap tables which I didn"t sit at. The service was horrible, my Bloody Mary was disgusting, and the place was a sausage fest ( too many guys). Also I was extremely disappointed by the small dance floor. I knew Dierks Bently was a sellout when they opened their bar in old town Scottsdale. This place is not true to country roots at all.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-04-09 11:13:31', 'A0000273F', '2019-09-05 06:01:47', 'The waitresses are really nice and friendly, which is the kick start of a good morning.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-04-09 11:13:31', 'A0000193L', '2018-05-15 22:45:53', 'The service for the food depends on the day and if Glendale is hosting a event. I don"t recommend lunch or dinner here but the breakfast is like any ordinary restaurant. I was on  cleanse one weekend and they were awesome enough to give me egg whites even though it wasn"t on the menu.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-04-09 11:13:31', 'A0000026K', '2019-09-03 14:31:51', 'I will never go there again unless I hear they have found a way to set up temperature of the room.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-04-09 11:13:31', 'A0000006R', '2019-04-10 01:35:20', 'I drove 30 minutes to try to find someone who could help me repair a watch band.  I was barely greeted upon arrival and right away felt like I was bothering them.  The girl behind the counter obviously just wanted me to leave, the blond kid working snapped at me when I asked a question and when I re-asked in order to clarify what he said he snapped again and said, "I already told you?!?"  "Is this even authentic?"  Shouting at me over his shoulder as he work on something else.');
INSERT INTO ForumEntries VALUES('MA1101R', 2019, 2, 'P0000009B', '2018-04-09 11:13:31', 'A0000006R', '2019-09-14 22:54:50', 'We had a great stay at the Platinum.  I had no qualms at staying at a non-gaming (read: not a casino) hotel off the Strip.  It"s a quick walk to all the action (about 5 to 10 minutes to the Flamingo depending on how quick you pound the pavement).');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000228K', '2019-03-04 08:08:46', 'Our regular plumber is great, but a little pricey, so we decided to try someone new.  Belsito"s rating on Yelp made us give them a try.  We called on a Saturday afternoon for a non-emergency.  They told us someone would call us back and let us know when they could come out.  About an hour later the doorbell rang and it was the plumber.  Luckily we were home as we never got a call.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000190B', '2018-08-02 14:33:42', 'Ikea can be intimidating in it"s size and there being SO MUCH STUFF but it is well worth it! I always go to Ikea with a list of items that I am needing for the home and I always find it, while also finding MUCH MORE to leave with. The greatest part of Ikea is the price! There is a reason that you have to get your own furniture items and load your own cars/trucks/vans with your purchases...to save the costs of Ikea! This is a good thing because then the savings are passed along to you, the shopper!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000259X', '2019-01-23 17:01:43', 'Even though I haven"t had much luck at this location over the years, I still stop by when I am at this mall. I"m still a longtime fan of the brand (since high school, mind you) and I am still optimistic.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000285W', '2018-08-12 04:11:57', 'I initially passed the place up since it is nestled in a typical strip mall off next to a Kinko"s just off Rural Road on E University.  I was meeting a friend for a quick, inexpensive and hopefully tasty pre-movie dinner at the Valley Art Theater on Mill.  The decor was what I would call, the "basic, no frills cafeteria like set up" that can be found in many Indian and Thai restaurants I have frequented.  Practical and comfortable.  The staff was friendly and welcoming and the menu had typical Indian fare.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000135S', '2019-09-08 08:40:02', 'Listen don"t complain that you got in late or the guy at the door was rude if you get there if you get there past 11pm who do you think you are the Kardashians?! I mean seriously I get bottle service every single time and I do not get there later than 10-1030 pm sure the club may still be empty but i would muchhh rather hang out at my sickkk table than wait in a line for 2 hours. AMAZING CLUB if you have game you willl have fun I highly recommend a table it is keyyy because you get tired of dancing for a few hours you go back to your table with some chicks hang out for a quick 20 then your back at it going nuts!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000135S', '2018-01-21 16:51:16', 'There was a group there (I think it was somebody"s birthday or engagement or something) and it was clear that this is a good place for a group of people to go.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000285W', '2019-02-12 14:01:18', 'A little on the expensive side.  The portions were a bit small for the prices they are charging.  I guess they can get away with it, their food is pretty good after all.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000019J', '2019-07-12 14:03:28', 'I did not visit the Kent office, but the office of Dr. Brown in Fairlawn. She was lacking in compassion, clarity, kindness, and professional ethics. She judged me based on my  pharmacutical history, and did not even glance at the stack of medical records I brought with me. I have been treated by some of the best in the country at John Hopkins and Walter Reed, and to be treated so unprofessionally in this office was an insult to the profession. Do NOT waste your time with Dr. Brown!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000197C', '2018-06-07 09:44:51', 'The food is authentic. The ingredients are incredibly fresh - a necessity in Thai cuisine.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000259X', '2018-11-25 08:21:10', 'You can bet I"ll be back (probably very soon)!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000019J', '2019-03-23 15:20:49', 'We had breakfast there today for about $25 each with tax and fees included but 2 of our party of 4 were covered by the bed and breakfast deal from JW Marriott and they didn"t charge for the kid. Food was ok but plentiful and what makes it a 5-star for me is the ambience and the patio with the beautiful koi pond and cascades, refreshing in a summer morning. Staff was attentive amd we were there at 10 and breakfast ends at 11 but didn"t fell pressured at all and nobody gave us looks for taking some fruit with us on our way out ;-)');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000287V', '2018-10-06 03:41:53', 'Chocolate Fudge was for her.  Over-decadent, every chocolate-lovers love!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000190B', '2018-12-19 21:53:04', 'We used the Yelp check in offer for a free entree with the purchase of a drink which is an awesome way to try something new. It was also ocean day insulated bag day which is really nice and will be used when grocery shopping this summer or transporting hot food to keep it warm.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000228K', '2018-11-08 23:40:06', 'I went to Dr. Goth for a couple procedures, including wisdom teeth and to have a suspicious oral growth removed. Only one word - fantastic! His staff is excellent, and his art in dentistry and patient care unsurpassed. Cut and dried - Dr. Goth was outstanding. He is the man to see in the Pittsburgh area.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000055R', '2018-07-27 23:58:54', 'Drinks are reasonably priced. Bottled water only. The menu is your typical bar food, but pretty decent bar food at that. Service is good. I"ve yet to have a bad experience.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000020H', '2019-06-26 11:05:16', '- Gelato bar looks good, but the texture was more like the soft serve at Dairy Queen. (which I HATE) So disappointed.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000283C', '2018-03-13 10:57:59', 'The place is filthy, too.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000159H', '2018-03-04 01:52:20', 'long and the workers incapable of handling the slightest issue. I m sitting upstairs if there is a next time I come to a Knights game.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000035K', '2019-03-22 17:29:52', 'Sometimes they run dinner specials - an appetizer, entrée, & dessert - somewhere around $11.99 or they"ve got some 2 for $20 deals.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000283C', '2019-07-22 16:42:28', '#3. The food was Meh... I would have been okay with everything else if the food was outstanding. It really wasn"t... I probably ate 3 bites of my dinner entree just to taste what the different Ingredients were... It was far from savory and could have used even a pasta or something. A couple of dry (what tasted like hush puppies)?? I would have been impressed a little if when I told the server that I didn"t enjoy it if he would have offered to try one of the others, but I didn"t make a big deal because like I said before he was really nice. The dessert was literally the only saving grace.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000087Y', '2018-11-04 06:15:59', 'I"d say the quality of fish, rice and seaweed is good to very good. I had 3 rolls and walked away full and content. It"s not the very best sushi I"ve ever had but it"s a great choice here in Scottsdale.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000292K', '2018-03-29 06:06:35', 'Not a fan. Overpriced, over cooked bland burgers. Everything is extra (fries, onion rings).');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000035K', '2019-10-20 00:22:45', 'An extra star for the legendary Iraqi fish dish known as "Masgoof."  If you are a fan of fish dishes, this is a must as this is a delectable technique used for thousands of years in Iraq.  An entire fish is evenly flayed open and nailed to a plank of hickory wood, it is usually sprinkled with a little olive oil and perhaps some tamarind paste, and is then placed in a 45-degree angle by a charcoal fire.  Traditionally, large freshwater fish are used, but at chateau, the fish of choice is Tilapia - which is quite good and I suspect the best method to prepare this dish.  The result is a charred surface of the fish but all of the juiciness trapped inside - delectable.  It is not very often that I get the pleasure of enjoying a nice Masgoof.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000035K', '2018-12-10 14:53:38', 'An amazing collection of incenses. The salesman was really kind and had a very good knowledge about the incenses. He helped me choose the sandalwood I was looking for and he gave me some extra sticks for free. I"ll definitely go back next time visiting Toronto.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000168B', '2018-02-17 07:27:08', 'Food is prepared fresh and flavored are great. Eaten three lunches and all were great. Service is a combined effort, so they on top of any needs.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000168B', '2018-01-13 13:11:18', 'I went with hubski and a couple of friends for a nice weekend picnic. The experience would have been a 5-star one if we had brown-bagged it, but as it was, we purchased food from the quaint little house-converted-to-restaurant. Hubski and I shared a veggie sandwich and a peach pie thing. Tasty, but most definitely overpriced. The iced tea was tasty and refreshing, but still, sharing a meal with a drink each, it should have been less money.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000089C', '2019-09-18 20:21:10', 'Stop looking around and call them, you will be glad you did.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000087Y', '2018-05-19 12:10:08', 'The atmosphere...beautiful, romantic (if you like sharing intimate moments with strangers) but it was pleasantly dark with candles and Christmas lights through out. They had an electric fireplace when we first sat down we observed and enjoyed the heat coming from it, since as you know we dress up, not dress warm when going out to dinner. The place lost half of its power 5 minutes after sitting down. The manager  chose to turn the fireplace off, even though it stayed lit and running during the power outage.  By the time I left, my toes were frozen.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000159H', '2019-01-14 09:59:45', 'Battista"s Hole In the Wall is awesome! Went here for the first time when I was in Vegas for my kickball tourney (WAKApalooza) early October. My teammate is a huge fan and suggested this place to the rest of the team for a big team dinner Saturday night.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000087Y', '2018-03-26 11:58:47', '1. Reserved table is always ready');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000292K', '2018-08-08 20:55:22', 'My friend lost the key in the car and we were locked out of the car.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000089C', '2019-07-26 05:06:03', 'Service:  Service was slow, although it was Opening Night.  They also screwed up my friend"s appetizer, serving him the wrong kind of wing sauce.  However, the people could not have been nicer.  The owner apologized and bought us desserts.  (Chocolate Decadence Cake was delicious, although a little rich for my taste.)  Then, the chef came out , shook our hands, and bought us drinks.  I felt like I was in a place where people would remember my name, even though they surely won"t.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000206Z', '2018-07-23 22:19:13', 'As a professional traveler, I like to travel light, and if I take something with me on a trip..........I"ll be sure to use it!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000263B', '2019-09-30 12:48:25', 'At our table we had a chicken sandwich, a sausage and pepper hoagie, and a pork chop. The chicken was reported as good (wasn"t mine), the pork was Ok but not out of this world, and the sausage was messy but good - had marinara sauce on it which was unexpected. The mac and cheese was a little greasy but pretty good.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000139U', '2018-01-22 08:12:08', 'Yeah, service continues to go downhill. Take your money elsewhere.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000230T', '2019-10-31 03:12:55', 'My only complaint is sometimes, especially towards the end of the year, appointments are hard to book - but that"s kind of how it goes most places.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000028T', '2019-01-11 14:49:03', 'I"m not sure how I rate this restaurant because I walked in to get some soup. It was around 4pm and I was in destroyed need of something that would clear my sinuses. Hot and sour soap always does the trick. I was told that I couldn"t order a cup because it was supper time. That"s okay, so I ordered a bowl of soup to take home... it was 11.00, and that okay too. My only thing is that it looked like a cup and the soup was not too fresh. It was good though. I"m not too sure if I would go back because the prices seemed too high and for a bowl of soup being 11.00, it wasn"t great and there was much, but broth.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000140O', '2018-08-08 16:48:48', 'I have purchased potted herbs here before and have been less than impressed- gnats/root rot are commonly seen upon close inspection and I have to dig around to find a few to take home.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2019-02-17 10:28:38', 'A0000230T', '2018-08-10 00:02:42', 'I really want to warn you do not go here!!!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000051B', '2018-02-21 20:04:07', 'Visited this restaurant after a 3 hour drive to get to it.  We, my boyfriend and I,  saw their ad on their website for an $$85 per couple Valentine"s Day Dinner.  We had reservations for 6p.m. this reservation was made on Friday, we dined on Saturday. When we arrived right at 6p.m. there were plenty of OPEN tables in the restaurant.  When the hostess looked for our name on the reservation list it showed we were to be sat at table 14.  The list said in large print at the top..DO NOT CHANGE TABLES.  The hostess walked us past 8 - 10 2 person tables to sit us at a 2 person table literally 6inches from the neighboring table!  Could we have asked to sit elsewhere? Apparently not as the hostess was under direct orders not to change tables.  Could we have dined elsewhere...probably not considering it is Valentines Weekend and we drove 3 hours to get there and have no reservations any where else, and no idea at 6p.m. where to go.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000285W', '2019-09-15 17:36:22', 'Snow and Kind crab, caviar, steak tartare, all types of meat and cuts, sushi, soups, Asian cuisine, pastas and pizzas. Literally all you can think about.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000051B', '2019-07-16 02:04:36', 'Reservation = walk in.  Pointless to make reservations.  We made a reservation the day before for 11:00am the next day morning. When we arrived we are not being served but was asked to wait.  This is  pointless for reservation, as at the same time they still take walk in and people who has reservation is under the same queue with the walk in.  After 30min, we asked how much longer will be the wait? The lady answered "no idea, I don"t know". Avoid this restaurant.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000051B', '2019-10-26 20:42:10', 'The O"Donnells');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000197C', '2018-07-14 14:36:36', 'No matter what happened in the process, he did not let us down. He always had our backs, made sure that we understood all routes and options, and made the process fun and exciting.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000215E', '2019-09-11 09:34:59', 'We dropped by in hopes of finding Atkinson"s Peanut Butter Bars(we first tried them From Honey Salt"s candy bowl ) and after searching a few minutes, we found it.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000259X', '2018-04-11 06:41:36', 'I had THE BEST VEGAN Gardein chicken plate with broccolini. I was blown away!!! The decor is cute! Nicely dimly lit, It was romantic and very chic. I recommend coming if you"re a vegan looking for a good dinner!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000190B', '2019-05-13 03:52:47', 'Had a nice date here with the bae on Friday night.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000019J', '2018-03-21 05:46:53', 'Ah- Thrift-gasm. Thank you Savers. I"ll see you next week.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000228K', '2018-02-11 04:04:49', 'Great place for a smaller breakfast, and pretty great coffee as well.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000215E', '2018-10-26 01:34:24', 'Five stars! I highly recommend this place if you"re in the mood for authentic Latin American cuisine. Coming from someone raised in Latin America, I"m usually skeptical of restaurants that claim to have Latin American food because although the dishes try to imitate Latin American styles, they usually come up short and completely miss the subtle flavors that make these dishes what they"re supposed to be. However, Chica completely nailed it. The whole chicken with chimichurri is a must-have (we shared it among four people) and the small dishes were delicious as well. The mini arepas that came with the guacamole were a really nice surprise and the empanadas were simply amazing and tasted just like the ones back home. Besides that, the latin music was on point and the cocktails were great too!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000228K', '2019-02-19 09:09:58', 'I am speechless. I am without words to properly describe this place. Everything about this place is amazing. The staff, the food, everything. I ate one meal today and I made it count by getting the 2-meat plate with brisket and ribs with grits and beans as the sides. The ribs had to be my favorite, but my mind was blown by the jalapeño cheddar grits, and then lord the brisket and beans. Oh hell, who am I kidding I can"t put these in any order. Eat everything here. I don"t know who Bekke is, but she"s got one hell of a pecan pie named after her.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000228K', '2018-08-21 14:42:28', 'Yum! I could eat it every day. My favorite is the "special" burro.  My second would have to be the two tacos. Beef or chicken, both delicious. Affordable, quick, and take some tortillas home for later.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000283C', '2019-10-02 15:17:13', 'Anywho, there are a ton of great shops out there. And I"m sure these guys are good too. But I can"t justify paying double.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000035K', '2019-10-02 02:11:15', 'We got the Fajitas for 2 with Steak and Chicken, add cheese...so good, lots of flavor. Loved the fideo soup and chips with the onions and peppers, the salsa and bean dip were good although not my favorite.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000159H', '2019-06-10 07:51:23', 'I honestly love this location! Blanca is always so welcoming and friendly. Her personality definitely makes it a fun experience! Every time I come in my food is fresh or if I ask for it to be made fresh they will make it. We ordered the orange chicken and Kung pow chicken tonight and it was soooo yummy. I love coming back here because the staff makes me feel like I live in a small town where people know each other and say hi with a smile.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000087Y', '2018-04-15 20:42:01', 'OVERALL RATINGS:');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000087Y', '2018-10-12 23:17:54', 'Anywho, the ice cream is always yummy and the experience of the kids being able to run back and forth AND BACK AND FORTH trying new flavors or deciding which one to pick It"s always fun!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000159H', '2019-08-04 07:55:30', 'I took my daughter to see Dr Lederman in the Glendale office as she was needing a shoulder replacement. I was told he is the best. My daughter has multiple disabilities from a TBI. She only has the use of that one arm/shoulder. Of course the doctor knew her condition at the first appointment. He said she was too young for a replacement as they only last so long and wanted to put off the surgery. He suggested a series of  shots in the shoulder which did not relieve the pain. Then the next appointment with Dr Lederman a couple years later due to increasing pain, my daughter was sent to a pain clinic again saying she was too young for the surgery and rehab would be hard. Shots in the shoulder and neck did not relieve the pain. Then she was prescribed with pain meds. This went on another few years. She was crying in pain everyday and in the night too. I massaged her up to ten times a day and bought every pain topical solution I could find besides taking the pain meds. She cried and  "begged" me to cut off her arm several times. We finally went back to Lederman again. This time my daughter refused to take no for an answer...she wanted the surgery. Dr Lederman left the room and came back in saying "I"m not the man for job. Myself or my staff is not accustomed to working with someone with a TBI." Then he walked out. Like he did not already know her condition from day one. My daughter suffered terribly for these years of delaying the surgery then refusing to do it. He did refer us to another doctor who turned out to be a blessing with a very caring heart. Dr Dana Seltzer. The surgery WAS difficult and the rehab WAS difficult, but we got through it as a team and she is now pain free with most of her shoulder movement intact.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000089C', '2019-02-14 07:45:55', 'Interior is super cool and chill & the place has numerous decorative pieces if you look carefully.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000292K', '2018-09-29 09:53:26', 'Some call it cozy but for me the table layout in the main dining room is claustrophobically cramped.  If you want a seat on the patio on Friday or Saturday in the summer, make sure to reserve several days in advance.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000292K', '2018-08-30 12:51:02', 'We came here on Super Bowl Sunday because we were visiting a friend who lived not far from this place.  When deciding on a place to watch the game, a couple of friends suggested this casino because they had a big sports booking place, and also because it wouldn"t be as packed and crazy as the casinos on the strip.  This casino is about a 15-20 minute drive from the strip.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000089C', '2018-07-06 03:58:30', 'This review is difficult to write because it is so mixed.  The floral department is one of the best.  Greg in the meat department is extremely helpful, the management there is horrible.  The store certainly does not represent what Safeway should stand for.  I live in Goodyear part of the year and in San Ramon, California part of the year, they have a state-of-the-art store in San Ramon, one which would rival any speciality grocery store, so I know they can do it, the one in Goodyear is just horrible by conparison.  Often the food is even old.  The people are generally nice, but the management of Safeway needs to do a major update here and fix this store.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000163Z', '2019-04-30 18:56:02', 'The Braised Veal Meatball was so light and tender I wanted to order another as my entree rather than the Gnocchi con Bolognese . The problem with the gnocchi was the gnocchi themselves. Kind of like eating raw biscuit dough, but the lamb bolognese was simple and delicious.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000083Q', '2018-07-13 08:35:38', 'The Montblanc store in Hong Kong is located in Pacific Mall. Jane has since been promoted and transferred to their flagship store on Kowloon Side on Canton Road. I"m not surprised of her promotion given the service she provided me.  I will be forever be loyal to the Hong Kong location. Thanks Jane!  I"m giving 2 stars to the Toronto location, the Hong Kong location would easily have 5 stars.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000010N', '2019-06-02 13:37:22', 'So there you have it.  A locally owned business filling a need in an emerging neighborhood.  Nothing pretentious.  Just a good, straight forward, progressive independent convenience store.  Even if you don"t live in this quiet corner of Downtown, its worth a look.  Or a sip and bite and it was in my case.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000055R', '2018-02-03 03:09:07', 'I can honestly say you get so much more for your money at Subway for much less and you can make the sub the way you want and you get very full and sometimes even have leftovers!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000122F', '2019-04-12 22:26:36', 'Drink - 4 stars for the cucumber cocktail & bottle of Santa Margaritta Pino Grigio');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000161B', '2019-09-06 22:24:35', 'Pizza was fine, but barely had enough cheese on it to cover it. Fair for the price.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000263B', '2019-09-14 02:06:07', 'I love this nail salon. They are very friendly and attentive. They make the experience fun. My nails turned out Greeeeeeat. I"m moving across town but this will still be my nail salon. You travel for good service.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000028T', '2018-03-03 18:15:53', 'I love this place... it"s great to have a neighborhood center with good food and great coffee!!  The patio is great all year long.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000169M', '2018-01-19 08:37:58', 'The gang at Sun Valley Stereo is definitely top notch. Ryan gets right to the point and saw what I was interested in, and we worked together to verify that all the parts were in to upgrade my 2004 RX-8 with a Pioneer 4000NEX touchscreen and back-up camera before I drove 90 minutes for the work. When I first left there was some adjustments needed. They took me back in without hesitation and made everything right. The installer was committed to treating my car like it was his own. He took the extra steps to make it all right, and even fixed the hatch door to my 12-volt socket. Now that"s going the extra mile! 6-stars!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000169M', '2019-06-17 16:05:46', 'After my second, alcohol only, visit, I was excited to taste what vegetarian options they had.  I had the grilled cheese with spicy asparagus and portobello.  Let me tell you...grilled cheese is amazing, add a few interesting touches, it becomes addicting.  I was very happy with my sandwich.  Also, they have a very tasty appetizer of Goat Cheese Fritters with a red wine sauce.  Goat Cheese is one of my favorites and frying anything makes it better. I was in love.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 1, 'P0000005R', '2018-03-02 16:43:17', 'A0000161B', '2018-07-31 13:34:39', 'Each visit is carefully tailored to your current state of being and needs.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000237J', '2019-09-06 09:41:49', 'This place epitomizes the rumored transformation that is in the process of taking place in Pittsburgh. Great food, drinks, and service, but the atmosphere is second to none. Definitely a must visit for locals and visitors alike! You will not feel like you"re in "Pittsburgh".');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000145F', '2019-09-26 23:56:34', 'Service here was great - Brian took good care of us. They seem to be doing well since they opened. Decent crowd at lunch, but not too packed. I like the layout inside - and the fact that they have a bar means I will definitely be visiting Chao in the near future for happy hour.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000237J', '2019-09-22 14:01:03', 'I really don"t know how to rate this place. I came for brunch on a Sunday at 12:30 with a reservation. Side note: AWESOME that this place takes brunch reservations. More places should start doing that. But back to my review...so I came at 12:30 with my boyfriend and we promptly ordered a caesar, a bellini, an order of donuts, the duck scramble, and the two egg breakfast. Yes, we"re fatsos at heart.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000146C', '2019-09-11 16:09:42', 'Even though a few flavours have been hit or miss for me here (maple was meh and there was a weird aftertaste to mint chocolate chip) I still look forward to trying flavours out from here because when the flavour is right on, it"s amazing.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000212I', '2019-08-02 00:46:20', 'We were a group of 6 people and whatever we ordered was worse than another one!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000212I', '2019-09-25 05:13:27', 'Lets hope for more consistency and the locals will fill the room.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000196F', '2018-08-22 04:48:21', 'I had bagel lox and cream cheese, and let me tell you it ranks up top with the best of them.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000223L', '2019-03-10 03:59:39', 'Pho (soup) and their Banh Minhs (sandwiches) are to die for!!! Not to mention their Chinese Food choices!!!! This place is a hole in the wall but their food choices are awesome!!!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000146C', '2018-08-17 21:07:52', 'Impressed. The groomers work and etiquette was lovely. I usually need the works when it comes to my little schweenie mix. ;) I"m glad I went to her and will most definitely be back!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000223L', '2019-09-27 10:19:29', 'The lady who was assisting me on the kiosk phone was pretty friendly, but she was doing a lot of up-sell so it was kind of bothersome.  I didn"t need a bigger car than an economy size since there was only 2 of us.  I understand that they probably work off of commission, but sometimes it"s unnecessary to try and convince you to get something that you don"t need.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000033P', '2019-04-21 06:28:21', 'Good place always willing to stop by n shop. Hate that they dnt have what they are kniwn for but some of the buttenders help out !');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000223L', '2019-05-05 01:24:34', 'My only complaint is sometimes, especially towards the end of the year, appointments are hard to book - but that"s kind of how it goes most places.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000126F', '2018-10-11 21:09:40', 'If you can avoid this company, I recommend you do so. They are in the midst of overcharging me $100 for nothing, and insist I have to prove I don"t owe it by going to their inconveniently located offices. They won"t take a letter or FAX. Rude on the phone to me.  You have to watch them every month, as we have had other bills that were inaccurate (overbilling us) before, too. NO, I do not recommend.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000103Z', '2018-04-17 03:32:10', 'Hands down, best jerky!  I bought the Sweet Heat for myself, which was the perfect amount of heat, I ate the entire bag in one sitting!  My son loves the Teriyaki Beef and I couldn"t forget my "fur-kids", I bought them a bag of the beef and a bag of the turkey Top Ten dog treats, they went CRAZY for the stuff!  Customer service was awesome too, really cool guys working the shop.  Love this place!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000103Z', '2018-11-06 15:59:39', 'I have to say that this office really has it together, they are so organized and friendly!  Dr. J. Phillipp is a great dentist, very friendly and professional.  The dental assistants that helped in my procedure were amazing, Jewel and Bailey helped me to feel comfortable!  I don"t have dental insurance, but they have this insurance through their office you can purchase for $80 something a year and this gave me 25% off all of my dental work, plus they helped me get signed up for care credit which I knew nothing about before this visit!  I highly recommend this office for the nice synergy the whole office has!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000233C', '2019-06-05 23:11:37', 'Excellent for Take-out or Delivery.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000007E', '2019-09-12 00:02:27', 'The meal - Veal with shrimp and gnocchi..Quite pleasing to the palette.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000118M', '2019-09-05 09:47:37', 'So I chose this place because they were open at the time I wanted to go pick up dinner at 4pm.  Ordered a Papaya salad and Pad Thai. They asked how I wanted it Mild Medium or Hot.  I stayed safe and said mild for both.  Well, when I got home and opened up the containers--of which they stupidly put them in one bag-dumb because papaya salad is always cold- I had to remove it in the car before heading home.  The Papaya salad was not evenly cut...their shredder is not working and it is supposed to be picked up like speghetti...this was clumps of papaya shredded half way. ALL I COULD TASTE WAS ONION. ONION...like eating a clumpy mouthful of ONION.  Horrid.  The Pad Thai had dry pieces of chicken and ZERO seasoning.  AWFUL. CRAP.  Waste of $17. NEVER BE BACK. They cannot produce Thai food that is worthy.  Instead of driving back to the place to return this...I"m writing this review. STAY AWAY.  Should have gone to Thai Plates or tried another place..these guys were the only ones open at the time I wanted food.  BAD DECISION. STAY AWAY. Headed to the fridge to eat crackers and cheese. TICKED.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000136L', '2018-08-05 16:22:05', 'As for the tenants who are complaining, I am hard-pressed to believe that Rich and the entire Active Renter crew have treated anyone poorly or have not serviced rentals in a timely manner. There are also people who tear up property (not their property!!) and then complain when they get billed for all the damages.  These are probably the same tenants who punch holes in dry wall, steal furnaces (who DOES that!?!?!?!), damage landscaping, tear up concrete driveways, etc.  - and then later complain when they are held accountable for the damages they created.  It"s said that people who have negative comments are much more likely to post a review than people with positive comments - on a 9 to 1 basis!  So for every complaint, remember there are dozens, hundreds, perhaps even thousands of individuals who have wonderfully positive things to say about Active Renter, but just don"t take the time to post a review.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000233C', '2019-09-14 22:21:32', 'I"ve had 3 other laser tattoo removals before I came here so I know what I should be getting. Honestly she didn"t even go over it all the way with the laser. There"s quite a bit of the tattoo that"s untouched. I"ll be going somewhere else for the remainder. It"s not worth the pain if it"s not even going to make a difference.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000173C', '2018-05-31 03:54:39', 'The young lady was cleaning dirty tables with a rag  and spray. Not a problem except when she was done she put the spray bottle up and didn"t bother washing her hands either and went immediately to handling food items in the back.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000271T', '2018-09-21 20:42:57', 'Travis, I will see you every single time I"m out in Vegas.  You make me feel beauuuutiful!');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000233C', '2018-02-12 15:35:29', 'I was near empty, and just got a fill up here where 20.5 gallons were poured. Generally near empty, the max I"ve ever seen is 18 - 18.2, because there"s reserves.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000271T', '2018-09-11 17:31:36', 'Pizza Hut quoted me an hour-ish wait time (which is fine when I know about it, not when i"m promised 30-40 minutes and it ends up being over an hour like PJ"s was)...and they were there at my house with my piping hot, delicous pizza in about 25 minutes.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000118M', '2019-08-09 11:27:21', 'Services are reasonable priced and they are HONEST. They did not try to sell us unnecessary parts or services and they back up their work as well.');
INSERT INTO ForumEntries VALUES('CS2102', 2018, 2, 'P0000007K', '2019-04-25 09:07:34', 'A0000080C', '2018-02-02 13:33:43', 'The salad and soup and breadsticks are always wonderful. We also got the bruschetta which was really perfect - not specialty, not gourmet, just perfectly normal, fresh tasting tomato, basil and olive oil yumminess.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000062J', '2018-04-13 15:02:34', 'I am so blown away by this sophisticated & beautiful hotel. One of the best in Las Vegas. The decor is breathe taking, and this place always smell like a magical garden. With so many top notch restaurants, spa services, shows, and clubs to choose from. It"s vegas luxury! The last time I stayed here, July 2011, it was such a BIG disappointment. There was a total of 8 of us. One of the bed broke and fell flat to the floor (no, there were no foul play)! 6 out 8 of us left with some kind of bug bite that looks like a terrible case of eczema/rash! The mechanic curtain didn"t work. The main T.V. didn"t work. Actually, disappointed is an understatement, WE WERE DISGUSTED! How can this 5star resort & hotel failed us so miserably!!!!!?');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000198B', '2018-11-11 05:54:57', 'In most cases, I find kabob houses to be boring and that isn"t because I don"t love the almighty Kabob, it"s because I have come to expect that Kabob places outside of the Middle East, Detroit, and even Western Europe just can never get it right - every time there is hope, it normally ends in disappointment for me - I should have never made that trip to Iran in 2007 where I was in kabob paradise.  However, Chateau Kabob located in the Frankophilic metropolis of Montreal did me rare pleasure of maintaining that hope.  Here in Washington, DC we need to cling to places like Shamshiri and Alboorz to get our kabob fix but even that gets repetitive after a while - especially when there isn"t a single Kabob house in the region that can even hold a candle to those two places and therefor isn"t particularly incumbent of them to reach for the stars.  Chateau Kabob does it right and is about as close as you can get to some of the legendary places you can find in Iraq and Iran - the latter of which reigns supreme in the world of Kabobs.  At Chateau the spices are right, the juiciness is on par, and the meat is superb - all in all a very excellent Kabob.  And perhaps one of the most underappreciate techniques that Chateau also got right is the rice!  It is superb here - fluffy, velvety, and aromatic.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000062J', '2018-10-18 06:37:19', 'Worst experience ever.... I guess it"s my first time left negative comments but definitely for me won"t go back anymore. I have made reservation for the day and when I arrive they told me they don"t remember they have confirmed my appointment n already other guests waiting there but they re closing in a hour. Still the lady told me it"s ok they could do it. So I sit down n soak my feet into cold water... n after 20 mins, the lady told me n another girl that actually they could not help us today as they re closing soon n one of the staff actually have to leave soon... so I don"t know how good they re as I guess I ll never know:(');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000198B', '2019-10-22 03:21:24', 'I"d like to try noodles with beef soup next time.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000062J', '2018-11-27 05:15:46', 'Now I have to call LG, file a complaint, and find a *real* solution provider. This is a real *hassle* I don"t need right now.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000184I', '2018-03-22 08:15:49', 'If you haven"t been to Chino"s - it"s time - make a run for the border/great wall/beach!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000101O', '2018-10-22 00:58:44', 'My wife and I flew out to Vegas for the 3-Day President"s Day weekend and my 50th birthday.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000034A', '2019-01-08 07:32:37', 'This was my first time here. I tried the salmon enchiladas with brown rice and Cajun beans.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000247B', '2019-03-27 03:26:06', 'The place is usually pretty packed but on a week night you can usually get a seat without having to wait.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000034A', '2019-09-29 01:42:46', 'They don"t deserve any stars!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000253B', '2019-09-11 12:04:25', 'Just okay. Was expecting more based on a friends  referral but the food was average and the service was slow and left me disappointed. $38 for a steak so I expected much more. The Brussel sprouts small plate was on point but overall would not return to this spot.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000011K', '2018-05-15 07:05:40', 'Egg white omelet with veggies(Goid)');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000160N', '2019-09-31 12:00:45', 'Overall I"m very happy with our experience and the friendly service.  We struck up some good conversation with the server and found everyone but the cashier to be friendly.  I will definitely be back soon!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000011K', '2018-01-19 00:21:18', 'Oh man this is going to be a long review so if you want the gist, god awful, do not go. I was so dissapointed with everything that once I got home I had to write a review.  First of All I am Vietnamese and Pho is such a soulful dish, the pho I had today was the worst thing ever.  My parents came to visit with my sister and a friend, and after a long day we wanted to finish with a hot bowl of pho.  I have seen this place, I have even walked by it when I ate at Sura.  There was a smell so tantalizing that I had to go and try it. I thought it would be a good idea to try Jenni Pho Grill tonight.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000296W', '2019-02-24 02:37:46', 'Everything is great really.  Even their level of spice, is always bang on for me.  You can request that they withhold certain things like hot sauce or jalopenos, but trust me, it"s not that bad.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000296W', '2018-10-26 03:37:04', 'People go to spine specialists because THEY"RE  IN PAIN. Making patients wait for extended periods of time in terribly uncomfortable chairs is painfully ironic.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000253B', '2019-06-01 05:52:03', 'Service was great, unlike some other posters, but that did not make up for the food.  Maybe I ordered the wrong thing?');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000034A', '2019-02-27 19:04:08', 'When they arrive for the pick-up - 2 days late 6 hours after they were supposed to be there - they didn"t come prepared for a piano. My dad and uncle had to find 2x4"s to use as a ramp and help the movers hold it and roll it off the porch. This is a stage piano, the wheels aren"t really meant for rolling around cement! After loading everything and telling my parents they were headed my way (Virginia), my stuff is taken from Wyoming to Seattle, then back to Vegas where it was put in storage without my knowledge or permission. I only found out because I kept calling to see the whereabouts of the truck so I could plan accordingly. After repeated phone calls, and finally the threat of legal action, my items were put back on a truck and started the journey East.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000101O', '2018-09-22 12:22:20', 'Frankly disappointed. Guy is one of my favorite chefs i know, he"s so cool and i love his since of humor. but his menu is lacking to me. its so concentrated which can be good... if the quality can hold up to it. i got the bacon cheese burger and i could have gotten the same thing at half the price 3 blocks down the strip. seasonings were bland and LOTS of grease. the reason your getting 3 starts Guy is because I"m more the sure this restaurant doesn"t represent you very well.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000296W', '2019-08-30 12:08:46', 'Last time I was in this area at lunch time, Chao was still being built. Now it"s open and today was my first official visit to check things out. I"ve only tried one entree from the menu, but if the other choices are anything like what I ate today I will definitely be a regular here.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000034A', '2019-09-24 22:15:22', 'The pros:');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000107C', '2018-11-20 00:20:09', 'So with that being said we had a great time at Marcella"s, yes folks a chain, but a decent chain with only a few locations in Ohio. The straight forward menu makes for easy navigation and the helpful suggestive service was more than enough to make decisions easy.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000210S', '2018-11-20 21:13:42', 'After getting into an arguement at another Az casino with a fellow BJ player, I"ve decided that table poker is the game for me.  3 Card Poker specifically!!!   Love going to the Wild Horse Pass casino.  All the table dealers I"ve dealt with there are very friendly, both when you"re winning and losing.  Trust me, I"ve seen my fair share of "coolers" who have been asshats in other casinos.  The dealer I had this past Friday night was especially helpful to a friend of mine, a newbie to 3 card, and taught her the basics.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000121F', '2018-08-09 11:53:15', 'When they arrive for the pick-up - 2 days late 6 hours after they were supposed to be there - they didn"t come prepared for a piano. My dad and uncle had to find 2x4"s to use as a ramp and help the movers hold it and roll it off the porch. This is a stage piano, the wheels aren"t really meant for rolling around cement! After loading everything and telling my parents they were headed my way (Virginia), my stuff is taken from Wyoming to Seattle, then back to Vegas where it was put in storage without my knowledge or permission. I only found out because I kept calling to see the whereabouts of the truck so I could plan accordingly. After repeated phone calls, and finally the threat of legal action, my items were put back on a truck and started the journey East.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000107C', '2019-02-17 11:54:26', 'As the others mentioned these are the big wing versions.....so you get a lot of meat.  I personally prefer the small crispy kind...');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000155H', '2019-09-15 06:23:12', 'The staff is very nice and helpful but there pricing sucks!!!!! Very over priced. I went with my wife and my sister and brother in law, we all wanted to get tattoos. I have 6 so I am fairly familiar with tattoo pricing. Long story short why wife wanted a small piece that should be around $75 to Vegas price maybe $150. They wanted $350 bucks! They must be joking right my piece that should be maybe $150-200 they wanted $750. The point is that they apparently think that the ink is liquid gold or something.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000107C', '2018-02-11 01:01:01', 'Très grand café, mais aussi calme et reposant, je m"y suis arrêté alors que j"étais dans le coin.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000229S', '2018-10-21 23:50:35', 'Hy Steakhouse is a contemporary and elegant  traditional steak house, with lots of open space and an intimate dinning experience.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000088F', '2019-03-12 22:38:20', 'My girlfriend and I will definitely be returning to pickle bills, we had a fantastic evening. Last thing to note, the service was great even though the place was packed!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000221B', '2019-04-06 16:48:10', 'The service was exceptional and we rarely waited for anything we needed. Our server asked my boyfriend if he wanted another diet coke, she cleared our cutlery from the greek salad and replaced it when our platter came.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000274S', '2019-10-23 09:56:34', 'The second line, is to "check in" - by which they scan your new membership card and ask whether you want a bay on a specific floor.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000088F', '2019-09-07 05:06:06', 'Couldn"t have made my bachelor party better.  I will be using them again and again for as long as I live when I come to Vegas.  All their staff is great with email or phone correspondence, thank you Annie!!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000155H', '2019-02-13 09:53:47', 'Planning ahead is the way to go when it comes to Vegas, and while I don"t think you HAVE to use an outside VIP company to plan, I don"t really see a disadvantage to doing so.  I would definitely call Red Carpet VIP again.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000107C', '2018-03-24 03:44:13', 'Time to start shopping around for a new rental car company.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000274S', '2019-08-27 20:17:18', 'So there you have it.  A locally owned business filling a need in an emerging neighborhood.  Nothing pretentious.  Just a good, straight forward, progressive independent convenience store.  Even if you don"t live in this quiet corner of Downtown, its worth a look.  Or a sip and bite and it was in my case.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000178S', '2019-09-05 04:05:41', 'One thing that concerned me was the gal cooking the burgers had long hair that was not tied back.  Just an FYI in case you"re squeamish about plucking hair out of your food.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000209N', '2018-12-06 07:54:40', 'Friends got Chili (homemade by Buldogis) Dog, Bulgogi Bowl, Fries, and again the Euro Fries with kimchee added and they LOVED it too!   My 2 friends who had the Chili Dog said the chili was very good! One of them is not even a hotdog fan and loved it :)');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000054Q', '2019-04-03 12:51:46', 'While the prices are a bit high for a make-your-own pizza, the taste makes up for it. I love going to Seventh Street market, sitting Not Just Coffee and having a drink while waiting for delicious fresh made pizza from Pure.  I"ve taken this to go as well as eaten inside the market, and I can say that the pizza doesn"t do well reheated. So try to eat it fresh while there if possible.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000014L', '2018-12-10 16:57:46', 'Sexy, swanky Art Deco/Craftsman interiors with nightly piano.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000014L', '2018-09-13 14:03:55', 'Q absolutely astonishing my Windows became corrupted I had a lot of problems with the computer came to my house and fix all the problems my computer is like it should be really fast. He"s extremely knowledgeable . And honest I will absolutely be using him again and again');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000227F', '2018-10-11 13:50:45', 'So the food is pretty good but overpriced. The thing that irks me is there was basically no alcohol in the Caesars I ordered. I am small, I had two, and I wasn"t even tipsy. No taste of alcohol, no feel of it. Super lame. Also, no happy hour.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000216S', '2019-08-26 14:51:34', 'I would like to see a greater use of food trucks.  We saw pizza, Mexican, Filipino, hot dogs, cupcakes, and snowcones. Come on Las Vegas Valley food culture, come out and show us what you offer.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000014L', '2019-02-13 10:03:45', 'Had a fantastic experience dining at Olive & Ivy! Believe it or not, we even thoroughly enjoyed dining outside in the August Scottsdale swelter- their misting system works amazingly well.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000227F', '2018-03-02 21:48:41', 'Unlimited alcohol, wines and beer. They have a bar area with one bartender working and a bunch of tv"s to watch or get updates on games.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000216S', '2019-09-20 07:47:31', 'The O"Donnells');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000054Q', '2019-05-10 15:43:12', 'So, this is actually not my first time here... came here a few times already and food is pretty good.  No complaints at all.  You come here for the curries and their rotis.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000178S', '2018-02-23 03:33:15', 'Worst experience ever.... I guess it"s my first time left negative comments but definitely for me won"t go back anymore. I have made reservation for the day and when I arrive they told me they don"t remember they have confirmed my appointment n already other guests waiting there but they re closing in a hour. Still the lady told me it"s ok they could do it. So I sit down n soak my feet into cold water... n after 20 mins, the lady told me n another girl that actually they could not help us today as they re closing soon n one of the staff actually have to leave soon... so I don"t know how good they re as I guess I ll never know:(');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000044J', '2018-01-27 17:12:08', 'First time here and everything was amazing. What a wonderful little gem we found in this place. Looks like not much out front but it"s very charming and original in back. Beautiful patio and food was fabulous. Lunch today but we will be back to try more.  Breakfast looks incredible. Plus, they are Detroit Tiger fans!  Added bonus!!!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000130G', '2019-09-25 15:29:57', 'Clean and comfortable. Nice hot breakfast available - eggs, bacon, oatmeal, fruit, pancakes, cinnamon rolls, yogurt, biscuits and gravy. Also has a small (somewhat dated) exercise facility and outdoor pool.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000130G', '2019-09-26 16:06:54', 'Will also be posting my experience on your Facebook in hopes that you get better trained and caring staff.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000014L', '2018-03-13 17:58:01', 'On the bright side though, we all got salads and really enjoyed them. I had the small blue wedge salad. It was a large portion with fresh cooked crispy bacon on top. Really good!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-03-30 03:29:36', 'A0000054Q', '2019-05-12 21:28:46', 'I"m a big fan of the Comedy Zone. They are having a killer year with shows. Kudos to the crew there for bringing in such great talent and big names in 2013.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000216S', '2019-08-27 22:35:06', 'Came in for some Chinese dessert, and I must say their selection has increased tremendously over the years. I might as well add that the price has also increased tremendously as well. The waitress gave us tea, which I could taste had red date in it. Fancy!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000014L', '2018-04-05 23:43:40', 'I adore Ikea! There is nothing better to me than seeing a piece in it"s functionality and how it will work in a room, hence, the showroom.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000294V', '2018-09-19 08:42:43', 'The repair worked for a short time.  They were to fix the spring.  They repaired the spring seemingly, but within the year, the arm that pulls the door up broke from the door and I had to pay another charge.  Within the year, the door would not respond to detaching the arm with the power was out.  Now we are over to the next year.  My door tore up!!!  The arm detached, a panel was split, and the metal folded.  I called the company back and I got the ...you must pay us once again to come out and improperly fix your door.  I called the Original Overhead Door Company.  They were more expensive, but you get what you pay for.  They repaired the door by reinforcing what the arm was attached to.  What did they say....the arm was improperly attached, that the door and the iron should have never folded like it did.  Thankfully my door is still good but needs new panels as they were split and new iron across the bar as it was bent.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000054Q', '2018-12-02 09:19:19', 'What an awesome pool party!!! I wish there was a tad more interactive aspects. I want hot girls and guys spraying champagne all over us or dancing with us.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000178S', '2019-06-09 07:36:51', 'I"ve had the opportuniti to dine in, get carri out, and order deliveri (I"ll stop this now) from Lucki on many occasions in the last few months, so I can tell you that no matter which method you decide to go with for your thai food fix there you won"t be disappointed.  The first time I had Lucki I dined in and had the Tom Yum soup with Shrimp and their Crab Fried rice.  The Tom Yum Soup is consistently good, and I"d know since it"s been a staple of every single order I"ve made with Lucki since.  It"s always hot, with the perfect combination of sour and spicy, and loaded with mushrooms and an ample amount of shrimp.  The large order feeds 2 perfectly.  The crab fried rice is not something I tend to order, but Lucki"s version definitely packed a lot of crab flavor.   They also weren"t shy with the egg on the rice, and being an egg slut like Anthony Bourdain, that pleased me.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000054Q', '2018-09-10 16:21:17', 'Bruh, I"m a stickler for good wings.  Like to the point I can only eat them from about 4 places and I find those places to usually be inferior to the ones I make with my brother.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000054Q', '2018-04-09 03:05:31', 'Certainly a fun place to shop. The sales people are very nice they just really don"t have a clue about anything and the parking is always a mess. I bought a jacket today, and it had an unusual rear pocket and I asked what was the purpose and they really didn"t know so there best guess was that it could be for carrying your skies or poles lol.  I don"t shop here often but it is the first place I will come when looking for sporting equipment/clothes. I don"t rely on the staff, I do my research before I arrive. I have bought many items here including skies, inline skates, ice skates, and other odds and ends. Good selection and pleasant staff, just not that bright. Bring your own light bulb! lol. Watch out for the parking on side streets. I got towed once, that is never fun.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000014L', '2019-09-07 11:04:08', 'Unfortunately, I must recommend not to conduct any business with Fast Fix Jewelry and Watch Repairs.  The staff is completely unprofessional and I have never been treated so rudely in my life.  I was actually shocked and walked away thinking "wow, how do those people even have a job?"');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000296W', '2019-06-26 16:30:02', 'Not happy.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000101O', '2018-11-16 15:30:22', 'The challah French toast paired with turkey bacon was a pretty awesome breakfast and I thoroughly enjoyed it; however, I felt the staff was lacking in service. They were very nice, just not very prompt and would disappear for quite some time.  I don"t know if it was because a few people called out and they were short-staffed or if one should plan to stay awhile.  The food is very good, though.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000172O', '2018-06-25 20:07:36', '* Large TVs (we watched football during one of our visits)');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000172O', '2018-07-30 21:48:14', 'So I"ve been coming here for years and have never had any issues until today. I ordered what I"ve always ordered. A bean burrito, a taco and a drink. It cost over $9 dollars!! The lady didn"t tell me a price in the drive through which is annoying because they don"t have a screen that tells you. She asked if I wanted a bean and cheese burrito. Well obviously I said yes I want cheese in it. The price on the menu said it was like $2.50. There was no mention of cheese in my burrito costing more. So I pull up to the window and she tells me it will be $9.40 or whatever. I said, I"m sorry how much?? So I"m sitting there doing my own math and it still didn"t add up. $2.09 for a drink, $2 something for the taco and $2 something for the burrito. Even with tax there was absolutely no way that it would have added up to that much. So I get the receipt and they charged me $4.58 for a burrito!! There sign said $2 something. I pulled around and went in and their price inside said $3 something for the burrito. I went up and asked why I was overcharged $4.58 for a burrito. He said because I got cheese in it. I said, your burritos don"t come with cheese in them??? They always have and I"ve never been charged extra for it!! What place doesn"t put cheese in a burrito?? Also, for the first time their taco was bad. I opened the box and the taco shell was wet and soggy!! Usually it"s nice and crispy/crunchy and this time was not. I told them their signs are wrong. Also that it"s ridiculous you charge that much for a burrito with cheese!! Told them I will never be back!! I can get better food at Taco Bell and more food for the same price!! They don"t false advertise there either! Furious!  Their food and prices have gone downhill fast! They lost mine and my family"s business for good!!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000172O', '2018-03-13 09:40:48', '- 4 different Sushi Rolls were brought out last (3.5 stars).  All 4 were decent, nothing really to rave much about unfortunately. :(  I"m a big big sushi lover and have had some off the chart rolls so I can"t pretend these were anything to die for.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000127E', '2019-02-11 16:54:01', '***The first time I came my friend ordered for the table and I definitely think that made a difference.  They have some REALLY scrumptious dishes that I wish I could"ve ordered for my friends to try!! Perhaps next time!! I"ll be more prepared lol');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000160N', '2018-04-03 03:36:03', 'I"ve waited 16 years to get this crazy rachet home tattoo covered up I"m celebrating 10!yrs of marriage and had to get this handled. It had scarring it was bad!! Josh came through like a champ his superrrr cool it was a longgg session but I took it like a G and now I"ll be in the Domican Republic celebrating without having to worry about my back.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000296W', '2019-06-29 15:26:49', 'Tried hamburger steak and it was so delicious. Gravy/sauce they put on the hamburger steak was perfect! Also came with onion rings on top which I love. Chicken katsu was amazing! Chicken katsu here is crunchy and surprisingly has a flavor by itself that you really don"t need a sauce for it. Best chicken katsu I had.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000172O', '2018-01-06 08:01:49', 'Service was great, unlike some other posters, but that did not make up for the food.  Maybe I ordered the wrong thing?');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000253B', '2019-04-27 16:57:37', 'It is BYOB, but when I eat Mexican I want an ice cold margarita.  They also charge for sharing plates ($2.50) and ask that you split your check prior to ordering.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000247B', '2019-03-20 09:26:02', 'Although the vibe and terrace are nice and trendy, that"s about all this place has to offer.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000247B', '2019-07-12 13:41:28', 'We all started with cocktails - Margaritas and Mojitos.  The Margarita was made with bourbon and rimed with crushed bacon and salt (yes I said bacon).  The Mojitos were fresh and minty.  The one thing I we all really like about the drinks was that they were not too sweet.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000034A', '2019-03-16 18:13:31', 'The waitress was very friendly and attentive.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000034A', '2019-01-30 10:35:36', 'The search for Pasta Carbonara continues... maybe a trip to NYC or even Rome!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000253B', '2018-12-09 05:30:00', 'The service was perfectly paced, with our server prepping our next course and pouring wine, and another server serving and explaining each dish.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000034A', '2018-10-31 06:34:06', 'Naked BBQ was fun, fast, and tasty. The staff was ridiculously nice and fun. As for the food, the sides are bit lackluster and need a bit more of a spicy punch or additional creamy, fatty goodness.  But, that is totally okay as the meat is the real star here. We tried four options, and we agreed that we both liked the brisket the most. Pulled pork and chicken were tasty as well. Overall, it was a fun, casual lunch with the before mentioned meat on a tray. I would totally stop by here for lunch or a brisket pick-up adventure again.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000253B', '2018-07-09 17:28:28', 'I"ve been to Sakana twice for lunch and both times have been happy with the sushi and service. Instead of creating longer rolls with more pieces of sushi they create shorter, fatter rolls. Makes for a bigger piece of sushi which I"m ok with.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2019-07-13 10:55:56', 'A0000101O', '2019-09-19 04:00:32', 'Overall, food was pretty good (chimichanga al pastor, flag enchilladas, and guacamole and chips) - though it was really slow coming out (despite not being busy), and the enchiladas were not as hot as my missus expected they would be. That said, drinks (including really good micheladas) were good, the guac was excellent, and overall, we left pretty happy (they Yelp special churros were a nice touch) - not an area I"m in a lot, but definitely impressed me with the authenticity - it was just the lag and the temperature of the food that was a little off.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000155H', '2018-09-29 07:39:27', 'Back to the Eggs Benedict. Everything on the Benny was cheap. The English muffin WASN"T TOASTED! Never seen that before. The hash browns were WAY too crispy.. Like eating unflavored Pop Rocks.. The Hollandaise sauce was just ok..');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000088F', '2019-10-16 15:03:49', 'My family and I have been visiting this location since it opened. Can"t really remember the year now.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000107C', '2018-10-19 01:21:07', 'The young man at the register "Chris" was very helpful with ordering and extremely pleasant. I will definitely be coming back to check out the $1.50 tacos on Tuesday.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000107C', '2018-09-25 03:38:47', 'I"m gonna admit, this place looks kinda dirty. I don"t think Arizona uses those health department letter grade system like California does, but if I were to just judge by how it looked inside, i"d give it a "C" grade lol. We waited for about 15 minutes or so and finally got our food. We took it to go and ate at our hotel room.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000107C', '2018-03-18 10:21:27', 'I"ll never return!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000274S', '2019-04-04 05:29:03', '-Reasonable prices. It"s not as cheap as fast food, no. But if you"re gonna spend your money somewhere why not make it your health.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000155H', '2019-05-31 02:36:18', 'Staff was eh.. I mean the place is busy. No time to be too friendly to all the damn tourist. Can"t say that I blame them.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000088F', '2018-04-22 16:07:52', 'After a while we decided to walk around to check out the rest of the park. We see ducks everywhere especially in the pond that has the nice waterfall going into it. Unfortunately, this is where the "nice stuff" ends. Everywhere on the paths we were walking on were green duck crap. Which brings the question, "Is there some kind of spray or force field they have on the playground?" Because there were no ducks or green duck crap anywhere in the playground. Im also curious as to how many people would actually spread out a blanket and have a picnic on the grass for the crap was all over that as well. Just doing this review im starting to get grossed out thinking about that day.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000088F', '2019-06-06 09:22:11', 'Here, I tried three flavors - chocolate, pumpkin, and caramel sea salt.  Added toppings of brownie bits, chocolate caramel turtles, and mochi.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000216S', '2019-01-09 21:48:36', 'They gave me a list of recommended repairs. Not once, did they push ...');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000216S', '2018-01-18 21:58:12', 'As a Mexican born and raised in California I"m sorry this place was horrible!! The chili had a strange taste !! We just threw it away! And bought hamburgers from B K and that says a lot!! Don"t waste your time!!!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000044J', '2019-09-13 05:11:33', 'Unfortunately we had no room for dessert but the meal was definitely above out expectations.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000044J', '2018-08-15 23:18:44', 'This is definitely a go to place if you"re anything like me and don"t know how to buy jeans. My last visit at the store, Jannette spent a great deal of time educating my friend and I on how to dress. We left the store uncharacteristically self aware of ourselves, but really, we learnt a great deal in the process.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000054Q', '2018-03-10 20:31:18', 'I dined at P.J."s last weekend.  I had heard many great things about their food and service, so I had to check it out.  I like the atmosphere of the restaurant and that they have a little pseudo patio as well.  It was nice sitting out there and people watching all of the crazy people who come through the Forum Shops.  Our server was very friendly, but did seem a little awkward and didn"t make a lot of eye contact.  His recommendations were spot on and we enjoyed all of our food.  I over heard other servers asking tables where they were from, and it was a little overboard.  EVERY person who came to a table asked that question.  The poor table next to us must"ve answered 15 times.  Here is a little tip: if the hostess asks, she should then communicate it to the server. So when the server approaches the table he/she can say "hey, I heard you are visiting from ____, welcome!" Much more personal.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000211O', '2019-10-03 11:14:25', 'Now the Bad: 7700 S Autoplex');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000027M', '2019-03-16 06:24:54', 'I have never had a problem with stocking here, which is good. Items are always stocked well, regardless of when in the week you come. I am not the biggest fan of their produce however. About 20% of the time, I bring how green beans or asparagus, and two days later they are covered in mold (and no, it is not my refrigerator). So I no longer purchase produce here except for when I am in a bind. Store is also always clean, I have never once seen a spill or poorly arranged merchandise, which is a testament to the hard working staff.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000056Z', '2018-10-29 15:37:25', 'Pretty bad. Was this place good at one time? For the price I paid, I expected something much better.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000211O', '2019-01-17 07:52:57', 'In my case...........I shipped my box out on Sunday, and used the kiosk! No problemo gang! Easy bruddah! Winning!!!!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-03-08 23:05:30', 'A0000198B', '2018-03-15 00:25:07', 'Our lane broke down repeatedly, it even gave up and powered itself off one time.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000034A', '2018-11-29 07:33:20', 'Dr.K. & Dr.B. will holistically bring your health & well being back into balance, not just treat individual injuries.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000296W', '2019-09-19 11:59:16', 'The service was friendly. I thought it was weird that drinks come in massive beer steins, which do not exactly mesh with the contemporary Asian fusion decor, which is classy and understated.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000034A', '2019-03-20 15:20:19', '* Friendly & efficient service when you order at the counter');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000034A', '2018-09-22 00:19:28', 'Today my friend and I came in for a body massage.  Let me tell you! The staff was very consistent, they ask you if you"re okay while giving you massage in troubled areas. Very relaxing and clean. I didn"t get my misuses name but she did a fantastic job.  And I came home feeling so relaxed with no more tight pressure in my back. I am so happy my friend and I chose this place.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000253B', '2019-09-12 18:43:08', 'She could have found a nicer approach instead of yelling at me. I got to the window to pay for what I was able to order and she told me that if I wanted my food I would need to come inside and leave my dog in the car because it was unsanitary for me to have my 3 lbs yorkie in my lap while she was handling food.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000052Z', '2018-10-09 11:16:33', 'I gave this place 4 stars mainly because I had a great time that night, and the company I kept definitely played a big part in that.  The food IS goood, just a bit $$$$.  Its definitely a GREAT place to go with a group thats just looking for some good eats, good drinks, and a great time :O) BOTTOM LINE: I"d DEFINITELY GO BACK AGAIN!!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000160N', '2018-06-18 06:48:38', 'Impressive and given the people cycling through this practice it was clear that the facility and all the therapists were doing something special.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000296W', '2018-07-03 11:23:13', 'We are so sad to see Sabrina leave Orange County!!!  We have depended on her for the past 4 years petsitting our huge English Mastiff.  Sabrina has made our lives so much easier to travel with peace of mind knowing that Kali would be well taken care of and even giving up updates and pictures while we were gone.  Do not hesitate to use Sabrina - she is really as fabulous as everyone on this site says.  NO KIDDING!!!  And if she ever comes back to O.C. we will welcome her back with OPEN PAWS!!!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000296W', '2019-03-31 12:31:05', 'The Braised Veal Meatball was so light and tender I wanted to order another as my entree rather than the Gnocchi con Bolognese . The problem with the gnocchi was the gnocchi themselves. Kind of like eating raw biscuit dough, but the lamb bolognese was simple and delicious.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000101O', '2019-03-22 11:21:28', 'Food (for the first time I came) - 4.25 stars!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000127E', '2018-08-20 15:51:17', 'There was hair in our food and drinks - multiple times!  We had to send out food and drinks back 3 different times.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000296W', '2018-01-22 09:17:22', 'My only complaint is the hostess staff. They treat you like crap - you"re just a number to them. They have no personality and make no effort to get you excited about the meal - give me you cell number and we"ll text you. NEXT! When I asked about the wait after 45 minutes, she told me that she texted me 6 minutes earlier. I showed her my phone - no text. Well, that also meant no apology from her either. She gave me a look like, do you still want in or not, I have other people to be rude to.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000056Z', '2019-09-18 15:02:20', 'Came here while in town for a country concert.  What better way to start our day.  Everything was great.  The service was amazing from the time we walked in the door.  We were sat at a table and to our surprise there is a beer and whiskey tap at the table.  You pay by the ounce and there is a screen to show you what you"ve drank.  The food we had was great.  The whiskey burger was my favorite.  For you country fans this is a must when in Scottsdale!');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000198B', '2019-05-10 05:13:28', 'My hubby got the crab tortellini and also loved his. I heard "mmmm this is so good" from all around the table. Our waiter was super nice and even gave us free desserts because we were some of the last people in the restaurant. Service was very slow and the place was PACKED but we had our jugs of wine and a large group with good conversation so it didn"t seem to bother anyone.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000013R', '2019-01-10 23:01:13', 'Upon leaving the hostess who was so sweet and friendly upon arrival was short and sarcastic in her good bye and have a nice evening.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000147I', '2018-03-22 02:01:29', 'We had breakfast there today for about $25 each with tax and fees included but 2 of our party of 4 were covered by the bed and breakfast deal from JW Marriott and they didn"t charge for the kid. Food was ok but plentiful and what makes it a 5-star for me is the ambience and the patio with the beautiful koi pond and cascades, refreshing in a summer morning. Staff was attentive amd we were there at 10 and breakfast ends at 11 but didn"t fell pressured at all and nobody gave us looks for taking some fruit with us on our way out ;-)');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000147I', '2019-08-13 02:53:38', 'The plumber was friendly and got right to work.  He was able to take care of one problem, but needed a part for the second one.  It turned out that he could not order the part (??) and we had to do it ourselves.  Once the part arrived about a week and a half later, the plumber came back out to finish the work.');
INSERT INTO ForumEntries VALUES('CS2102', 2019, 2, 'P0000008G', '2018-08-29 18:56:09', 'A0000062J', '2019-08-16 14:35:29', 'My experience with Dr. Malek has been nothing short of fantastic. His staff is professional and kind, and they"re great at answering questions without being pushy or sales-like. Dr. Malek was kind while retaining a very professional demeanor. (Honestly, the first time I met with him, I had almost wished that he had been a bit more "friendly" vs. doctor-patient, but he was obviously experienced and competent. On the day of the surgery, I appreciated that bit of professional distance that he kept and felt comfortable in his hands and under his care.)  He and his staff were great about working with my crazy schedule and finding times that would work for me. Everything was very upfront. There were zero hidden charges or unexpected costs. Dr. Malek customized the procedure to obtain the best results for my particular situation and explained to me in detail what he suggested and why he felt it was the best approach. The results are incrdible. (I"ve used the word magician quite a few times when speaking about Dr. Malek"s skill.) Pain or discomfort was exremely minimal and I can"t begin to describe how thrilled I am that I chose to have the procedure done and to have Dr. Malek do it.');